(72784, 'deDE', 'Untersttzung fr den Kobaltkonvent', 'Sprecht mit Venthi im Kobaltkonvent.', 'Genau zur rechten Zeit, $n.\n\nHab Ihr schon mal vom Kobaltkonvent gehrt? Das war einst ein wundersamer Ort, an dem die meisten meiner Art gelebt haben.\n\nDie Splitterflammen haben uns vertrieben und sich dort niedergelassen.\n\nWir hatten die Hoffnung, unser Zuhause wieder zurckzuerobern, doch neuesten Informationen zufolge kmpfen wir eine verlorene Schlacht.\n\nKnnt Ihr uns Eure Untersttzung leihen? Trefft Euch mit Venthi im Kobaltkonvent, wenn Ihr knnt.', '', '', '', '', '', 'Sprecht mit Venthi im Kobaltkonvent.', 47187),
(72783, 'deDE', 'Handwerksauftrge', 'Sprecht mit Brovorsteherin Mimzy Funkelstein und erfahrt mehr ber das Erfllen von Handwerksauftrgen.', 'Das ist ein schickes Ding, das Ihr da von dem Titanengert bekommen habt. Her damit!\n\nKleiner Spa! Ich wsste nicht einmal, was ich damit machen soll. Ihr etwa?\n\nSprecht mit Mimzy Funkelstein. Ihr ganzes Ding ist es, Leute zu finden, die sogenannte \"Handwerksauftrge\" erledigen.\n\nIhr bringt ihnen Sachen, jemand nimmt sie und stellt daraus was fr Euch her.\n\nEinfach, stimmt\'s? Redet mimt Mimzy und probiert es aus! Und sagt ihr nicht, dass ich Euch geschickt habe.', '', '', '', '', '', '', 47187),
(72773, 'deDE', 'Genialitt erlernen', 'Trefft Greyzik Flickfinger innerhalb von Valdrakken.', 'Es gibt einige Goblilns in Valdrakken, die ein herrenloses Titanengert untersuchen.\n\nUm ehrlich zu sein sorgen sie fr ganz schn Aufsehen. Einige sind besorgt, Ihre Forschung knnte mehr Schaden als Gutes anrichten.\n\nDie Einwohner von Valdrakken wrden es begren, wenn Ihr diesen Goblins einen Besuch abstattet und versucht, eine Lsung fr Ihre Untersuchung zu finden.\n\nOhne Teile unserer Stadt zu zerstren.', '', '', '', '', '', 'Trefft Greyzik Flickfinger innerhalb von Valdrakken.', 47187),
