(72729, 'deDE', 'Der Groe Flunk', 'Bringt die rostige Mnze der Inseln zum Groen Flunk auf den Ebenen von Ohn\'ahra.', 'Eine ungewhnliche Mnze, die auf den Dracheninseln aus dem Wasser gefischt wurde.\n\nAndere Fischer haben Euch Gerchte erzhlt, dass auf den Ebenen von Ohn\'ahra eine Kreatur leben soll, die solche Dinge sammelt.', '', '', '', '', '', '', 47187),
(72728, 'deDE', 'Die Welt wartet', 'Schliet 10 Weltquests auf den Dracheninseln ab.', 'Wisst Ihr, was ein klares Zeichen von Hrte ist? Der Gemeinschaft der Dracheninseln zu helfen!\n\nHier gibt es haufenweise Probleme, die es zu lsen gilt. Zeigt mir, wie hart Ihr seid, indem Ihr aushelft!', '', '', '', '', '', '', 47187),
(72709, 'deDE', 'Die Finanzierung einer Schatzsuche', 'Kauft die Artefaktaufzeichnungen des Archologen von Katalogisiererin Jakes.', '<Katalogisiererin Jakes whlt schnell durch ihre eigene Vorratstasche und holt eine frisch gezeichnete Karte hervor.>\n\nEiner unserer Archologen hat soeben neue Ergebnisse bezglich eines verlorenen Artefakts gemeldet, das sich in diesem Gebiet befinden soll.\n\nWenn Ihr die Vorrte spendet, um die nchste archologische Expedition zu finanzieren, knnt Ihr diese Karte haben. Sie wird Euch zu einem Schatz fhren, der sich in der Nhe befindet.', '', '', '', '', '', '', 47187),
(72708, 'deDE', 'Vorrte der Dracheninseln', 'Liefert die Vorratstasche der Dracheninseln an Katalogisiererin Jakes in der Botschaft von Schwingenrast.', '<Dieser Protodrache muss sich die Tasche mit Vorrten von einem unglcklichen Mitglied der Drachenschuppenexpedition geschnappt haben.\n\nKatalogisiererin Jakes in der Botschaft von Schwingenrast sollte wissen, was damit zu tun ist.>', '', '', '', '', '', 'Liefert die Vorratstasche der Dracheninseln an Katalogisiererin Jakes in der Botschaft von Schwingenrast.', 47187),
