(72686, 'deDE', 'Sturmwoge', 'Besiegt elementerfllte Kreaturen und sammelt Elementarberfluss, whrend Ihr Euch in einem Elementarsturm befindet.', 'Die Primalisten haben wtende Elementarstrme berall auf den Dracheninseln beschworen, $n.\n\nWenn Ihr einen aktiven Sturm findet, geht hin und erschlagt die elementerfllten Kreaturen dort.\n\nDann sammelt den Elementarberfluss von den erschlagenen Feinden. Denkt daran, dass Ihr mehr Elementarberfluss von strkeren Feinden sammeln knnt.\n\nWir knnen nicht zulassen, dass die elementare Verderbnis der Primalisten ungehindert fortschreitet.', '', '', '', '', '', '', 47187),
