(72648, 'deDE', 'Funken des Lebens: Azurblaues Gebirge', 'Sammelt $1oa Funken des Lebens im Azurblauen Gebirge, whrend Ihr im Kriegsmodus seid.', 'Die Gezeiten sind gekommen und haben ein Geschenk des Lebens mit sich ins Azurblaue Gebirge gebracht.\n\nEs ist Zeit fr Freunde, Familie, gutes Essen und das Schmieden neuer Geschichten.', '', '', '', '', '', 'Sprecht mit Feldmeister Glutrath in Valdrakken.', 47187),
