(72585, 'deDE', 'Freie Orientierung', 'Schliet die Orientierungsquests in jedem greren Fraktionshauptquartier ab: Drachenschuppenbasislager, Maruukai, Iskaara und Valdrakken.', 'Ihr habt viel fr die Dracheninseln getan, $gHeld:Heldin;.\n\nViele sind Euch dankbar fr Euren Beitrag und wollen Euch vollstndig in ihrer Gemeinschaft willkommen heien. Geht zu ihnen und lernt jede Gruppe und deren Spezialitten kennen.\n\nGanz wie Ihr den Dracheninseln vieles zu bieten habt, haben viele von uns so einiges, was sie Euch gerne als Gegenleistung anbieten mchten.', '', '', '', '', '', '', 47187),
(72584, 'deDE', 'Das eigene Netz auswerfen', 'Werft Euer Fischernetz am Angelloch der Flussmndung aus.', 'Wollt Ihr Euer Netz ausprobieren? Geht an die Flussmndung sdlich der Kste des Erwachens und sucht einen Ort, an dem es viele Fische gibt. Das sollte ein guter Ort sein, um das Netz auszuwerfen.', '', '', '', '', '', '', 47187),
