(72525, 'deDE', 'Basiskatalogisierungsausrstung', 'Nutzt das Expeditionsversorgungspaket, um Katalogisierungsausrstung zu erforschen.', 'Jeder Katalogisierer der Expedition braucht eine eigene Kamera!\n\nIhr msst Eurer keinen besonderen Namen geben, aber ich wrde es Euch dennoch raten. So macht es viel mehr Spa!\n\nPfadfinder Jeb sollte Euch mit allem versorgen knnen, was Ihr braucht.\n\nIch habe noch nie etwas gebraucht, was er nicht bei sich hatte. Er ist unglaublich!', '', '', '', '', '', '', 47187),
(72524, 'deDE', 'Basiskletterausrstung', 'Nutzt das Expeditionsversorgungspaket, um Kletterausrstung zu erforschen.', '<Pfadfinder Jeb deutet auf den Versorgungspaket neben sich.>\n\nIhr werdet Vorrte brauchen, um hier drauen zu berleben.\n\nBesorgen wir Euch, was Ihr zum Klettern braucht.', '', '', '', '', '', '', 47187),
(72519, 'deDE', 'Temporale Zweistimmung', 'Wendet den Chronokristall auf Eternus und Chromie in Azmerloth an, um zu verhindern, dass sie weiter durch die Zeit fallen.', 'Ich verstehe... Sie fallen durch Mglichkeiten und die Zeit selbst.\n\nBeeilt Euch, ich habe einen weiteren Punkt in der Zeitlinie entdeckt, an dem wir sie auffangen knnten. Er ist... ungewhnlich, aber lasst Euch nicht von der Fremdartigkeit dieser Welt ablenken. Chronormus Schicksal liegt in Euren Hnden.', '', '', '', '', '', 'Kehrt zu Nozdormu in die Gegenwart zurck.', 47187),
(72512, 'deDE', 'Eine flsternde Brise', 'Nhert Euch Ohn\'ahra in Ohn\'ahras Horst.', '<Godoloto legt den Kopf schrg, nickt Euch zu und sieht Euch schlielich in die Augen. Nach einem langen Moment hebt sie den Blick zum Himmel... und dem Berg neben Maruukai. Ihr sprt, dass sie Euch bittet, zu Ohn\'ahras Horst hinaufzureisen.', '', '', '', '', '', 'Nhert Euch Ohn\'ahra in Ohn\'ahras Horst.', 47187),
(72488, 'deDE', 'Fortgeschrittene Tour in Thaldraszus', 'Fliegt jedes fortgeschrittene Rennen in Thaldraszus.', 'Einmal mehr auf nach Thaldraszus mit seinen Gipfeln und Tlern und Rennstrecken, die nur auf Euch warten!\n\nSuch meine bronzenen Kollegen auf, um die fortgeschrittenen Rennen zu fliegen und Eure Tour auf den Dracheninseln zu beenden!', '', '', '', '', '', '', 47187),
(72487, 'deDE', 'Tour in Thaldraszus', 'Fliegt einmal auf jeder Rennstrecke in Thaldraszus.', 'Thaldraszus. Es ist die Heimat des Sitzes der Aspekte und eines Groteils der Geschichte der Drachenheit. \n\nEs ist auerdem die Heimat schwindelerregender Gipfel und steile, tiefe Schluchten, die geradezu zu einem berflug einladen!\n\nMeine Bronzekollegen haben wie immer Rennstrecken in Thaldraszus aufgebaut, die Ihr fliegen knnt, whrend Ihr das Land erforscht. \n\nWarum seht Ihr sie Euch nicht an und schliet Eure Tour der Dracheninseln ab?', '', '', '', '', '', '', 47187),
(72486, 'deDE', 'Fortgeschrittene Tour im Azurblauen Gebirge', 'Fliegt jedes fortgeschrittene Rennen im Azurblauen Gebirge.', 'Die fortgeschrittenen Strecken im Azurblauen Gebirge sind darauf ausgelegt, Euren Fertigkeiten im Drachenreiten zu neuen Hhen zu verhelfen! \n\nAber... fallt bitte blo nicht aus eben jenen Hhen!\n\nWenn Ihr bereit seid, sucht meine bronzenen Kollegen auf und fliegt ihre Strecken!', '', '', '', '', '', '', 47187),
(72485, 'deDE', 'Tour im Azurblauen Gebirge', 'Fliegt einmal auf jeder Rennstrecke im Azurblauen Gebirge.', 'Rennstrecken im Azurblauen Gebirge sind eine einzigartige Erfahrung. Die hohen Gipfel, das schneebedeckte Terrain und die dichten Wlder bieten zahlreiche interessante Hindernisse... und Herausforderungen!\n\nSucht nach meinen bronzenen Kollegen, wenn Ihr dort seid, und probiert Euch an ihren Strecken!', '', '', '', '', '', '', 47187),
(72484, 'deDE', 'Fortgeschrittene Tour auf den Ebenen von Ohn\'ahra', 'Fliegt jedes fortgeschrittene Rennen auf den Ebenen von Ohn\'ahra.', 'Die fortgeschrittenen Strecken sollten etwas herausfordernder sein, aber ich bin mir sicher, dass Ihr auch damit zurechtkommen solltet!\n\nMeine bronzenen Kollegen haben auf den Ebenen von Ohn\'ahra fortgeschrittene Strecken mit ein paar Hindernissen und berraschungen fr Euch vorbereitet. Ihr knnt dort auch gegen Eure eigenen Bestzeiten antreten!\n\nViel Glck!', '', '', '', '', '', '', 47187),
(72483, 'deDE', 'Tour auf den Ebenen von Ohn\'ahra', 'Fliegt einmal auf jeder Rennstrecke der Ebenen von Ohn\'ahra.', 'Ah, die Ebenen von Ohn\'ahra. Ausgedehnte, freie Flchen, Windben, ungetrbte Aussicht... Und noch mehr Rennstrecken!\n\nWie auch schon an der Kste des Erwachens gilt, wenn Ihr jemanden meiner bronzenen Kollegen trefft, dann sprecht ihn doch auf die Rennstrecke an.', '', '', '', '', '', '', 47187),
(72482, 'deDE', 'Fortgeschrittene Tour an der Kste des Erwachens', 'Fliegt jedes Rennen an der Kste des Erwachens.', 'Nun, da Ihr die Basisrennen auf den ganzen Dracheninseln geflogen seid und Euer Knnen unter Beweis gestellt habt, wie wre es mit einer neuen Herausforderung?\n\nDie fortgeschrittenen Rennkurse hneln den Standardkursen, die Ihr bereits kennt, aber viele haben angepasste Flugstrecken oder zustzliche Hindernisse, die Eure Fhigkeiten auf die Probe stellen.\n\nFangen wir doch mit den Strecken an der Kste des Erwachens an!', '', '', '', '', '', '', 47187),
(72481, 'deDE', 'Tour an der Kste des Erwachens', 'Fliegt einmal auf jeder Rennstrecke der Kste des Erwachens.', 'Und was macht am meisten Spa, wenn es ums Drachenreiten geht? Rennen!\n\nMeine bronzenen Kollegen haben berall auf den Dracheninseln Rennstrecken entworfen. Die Landschaften sind einfach so vielseitig und dynamisch, dass sie fast schon darum betteln, bei Hchstgeschwindigkeiten erkundet zu werden.\n\nWarum probiert Ihr es nicht aus, wenn Ihr mal in der Nhe einer unserer Rennstrecken an der Kste des Erwachens seid?', '', '', '', '', '', '', 47187),
(72456, 'deDE', 'Folianten des Vertrauens', 'Findet Bnde der Obsidiangenealogie und bringt sie zu Furorions und Sabellians Rstmeistern.', 'Obwohl wir die oberen Ebenen der Obsidianzitadelle sichern konnten, plndern die Streitkrfte der Djaradin weiterhin den Innenhof. Doch dort lagern lauter unbezahlbare historische Aufzeichnungen! Wir mssen schnell handeln, um alles zu retten, das die Abstammung des schwarzen Drachenschwarms dokumentiert.\n\nFurorion und Sabellian brauchen diese Informationen, Ihr knntet Euch also gut bei ihnen einschmeicheln, wenn Ihr jedem einen Folianten mitbringt.\n\nGeht zum eingestrzten Turm der Zitadelle, dort solltet Ihr etwas Wertvolles finden knnen.', '', '', '', '', '', '', 47187),
(72448, 'deDE', 'Das Vermchtnis sichern', 'Eliminiert zwei seltene Gegner in der Obsidianzitadelle oder dem Schlackensumpf.', 'Ich habe nicht so hart gearbeitet und bin so weit gekommen, um die Zitadelle jetzt zu verlieren!\n\nLeider sind neue Bedrohungen aufgetaucht. Kann ich mich auf Eure Untersttzung bei deren Beseitigung verlassen?\n\nHelft, die Gegend zu sichern. Findet zwei unserer mchtigsten Gegner und lscht sie aus.', '', '', '', '', '', '', 47187),
(72447, 'deDE', 'Die grte Bedrohung', 'Eliminiert zwei seltene Gegner in der Obsidianzitadelle oder dem Schlackensumpf.', 'Mchtige Djaradin und andere Kreaturen bedrohen die Obsidianzitadelle und die Sicherheit meines Schwarms.\n\nDas knnen wir nicht zulassen.\n\nHelft uns, das Gebiet zu sichern. Findet und eliminiert zwei unserer strksten Feinde.', '', '', '', '', '', '', 47187),
(72435, 'deDE', 'Ausrichtung: Iskaara', 'Lernt einige Hndler mit wertvollen Waren kennen.', 'Willkommen in Iskaara.\n\nGeschichten ber Eure Taten in Brackenfell haben bereits unser Volk erreicht. Ihr habt schon viele von uns getroffen und es gibt noch viele andere, die gerne Wissen und Waren mit Euch austauschen wrden.\n\nBitte, nehmt Euch einen Moment, um einige der freundlichen Gesichter in Iskaara kennenzulernen. In unserer Gemeinschaft hilft man sich gegenseitig, so viel Ihr uns also zu bieten habt, so viel haben unsere Leute Euch im Gegenzug anzubieten.', '', '', '', '', '', '', 47187),
(72434, 'deDE', 'Rubinlebensschrein-Schleife', 'Schliet die Rubinlebensschrein-Schleife ab.', 'Sie sagen, ich bin noch nicht gro genug, um einige dieser Strecken zu fliegen.\n\nAber ich kann anderen dabei zusehen. Ihr solltet das Rennen fliegen! Dann kann ich Euch zusehen!', '', '', '', '', '', 'Schliet die Rubinlebensschrein-Schleife ab.', 47187),
(72429, 'deDE', 'Ausrichtung: Maruukai', 'Trefft die Hterin des Ruhms und den ruhmreichen Rstmeister in Maruukai.', '<Als Sansok Khan seufzt, spricht Okir fr sie.>\n\nDas Volk der Maruuk hat sich nicht gegen Auenseiter verschworen, aber alle mglichen Verbndeten mssen sich uns gegenber dennoch beweisen. Whrend Ihr die Klans trefft und untersttzt, werden sich Geschichten ber Eure Taten bald herumsprechen.\n\nAuf der unteren Ebene des Krutals auf dem Hgel knnt Ihr eine der Tchter der Khanam Matra finden. Sie kann Euch sagen, wie es um Euren Ruf bei unserem Volk steht. Vergesst nicht, Euch bei ihr vorzustellen.', '', '', '', '', '', '', 47187),
(72428, 'deDE', 'Flunkerbunker', 'Sammelt 20 stinkende Edelsteine von den Flunkern auf den Dracheninseln fr Gnoklin Quirkspule bei der Drachenschuppenexpedition.', 'Es ist kein Geheimnis, dass die Flunker dieses Landes eine Faszination fr Edelsteine, Juwelen und alles, was glitzert, aufweisen. Erst vor Kurzem fand ich einen sehr wertvollen Edelstein in Flunkerkot!\n\nEs ist vielleicht nicht die angenehmste Arbeit, aber anscheinend sammeln die Flunker Wertgegenstnde nicht nur, sie fressen sie auch.', '', '', '', '', '', '', 47187),
(72427, 'deDE', 'Belebte Infusion', 'Sammelt 13 stachelige Bltter von den Peitschern der Dracheninseln fr Dhurrel von den Zentauren der Maruuk.', 'Ich habe heute eine einfache Bitte an Euch.\n\nDen Alchemisten geht eine Zutat aus, die sie fr ein besonders heikles Gebru brauchen. Das Kraut ist aber leicht zu finden. Ihr msst nur einige aggressive Pflanzen finden, denen Ihr Proben entnehmen knnt. Fhlt Ihr Euch dem gewachsen?', '', '', '', '', '', '', 47187),
(72423, 'deDE', 'Den Sturm berstehen', 'Sammelt 12 Sturmwaffen von den Zentauren der Nokhud auf den Dracheninseln fr Temnaayu von den Tuskarr von Iskaara.', 'Ah, Ihr kommt genau rechtzeitig! Wir haben gehrt, dass die Zentauren der Nokhud mchtige, gefhrliche Waffen mit Sturmverzauberungen haben. Wir wrden unseren Verzauberern gerne einige Exemplare bringen, damit sie sie studieren knnen.\n\nIm schlimmsten Fall knnen wir die Waffen immer noch entladen und fr gute Zwecke einsetzen.', '', '', '', '', '', '', 47187),
(72410, 'deDE', 'Viele Zangen, spitze Nadeln', 'Sammelt 10 spitze Zangen von den Scythiden der Dracheninseln fr Gnoklin Quirkspule von der Drachenschuppenexpedition.', 'Uns gehen bald die Nhnadeln aus. Diese verflixten Dinger brechen stndig ab!\n\nEinige spitze Teile der Scythiden in der Gegend knnten gut als Ersatz herhalten.', '', '', '', '', '', '', 47187),
(72406, 'deDE', 'Ausrichtung: Valdrakken', 'Trefft die wichtigen Versorger des Abkommens in Valdrakken.', 'Willkommen in Valdrakken, $p. Ich bin Unatos, Hter des Ruhms fr das Valdrakkenabkommen.\n\nAls Anerkennung fr Eure Untersttzung fr die Drachenschwrme wurden einige Zulieferer in der Stadt autorisiert, Euch mit einigen unserer besten Waren zu versorgen.\n\nWarum nehmt Ihr Euch nicht die Zeit, ihre Standorte und Waren kennenzulernen?', '', '', '', '', '', '', 47187),
(72399, 'deDE', 'Der Einsiedlergarten', 'Sprecht mit Szareth an der Schattenklippe.', 'Unsere Eltern sagen immer, wir sollen die Grten ber Gelikyr nicht besuchen. Sie glauben, der Grtner ist bse und gefhrlich.\n\nAber das stimmt nicht. Er ist ein bisschen grummelig, aber wirklich nett! \n\nKeiner von uns war da oben, seit die Primalisten aufgetaucht sind. Jetzt ist es wirklich zu gefhrlich. Aber ich hoffe, dem Grtner geht es gut. Wrdet Ihr bitte nach ihm sehen, wir knnen ihn ja nicht mehr besuchen.', '', '', '', '', '', '', 47187),
(72397, 'deDE', 'Ausrichtung: Drachenschuppenbasislager', 'Trefft die wichtigen Versorger im Drachenschuppenbasislager.', 'Willkommen im Basislager, $p.\n\nToddy und ich haben eine Weile gebraucht, um den perfekten Platz fr ein Lager zu finden, aber unsere Wahl knnte mich nicht glcklicher machen.\n\nLeichter Zugang zu Ruinen, Brutpltze der Protodrachen und natrlich die Drachenschwrme.\n\nWarum nehmt Ihr Euch nicht ein paar Minuten, um Euch das Lager anzusehen und einige der Versorger kennenzulernen, die die Expedition am Laufen halten?', '', '', '', '', '', 'Trefft Toddy Schnurrbart im Zelt des Drachenschuppenbasislagers.', 47187),
