(72380, 'deDE', 'Zusammen sind wir nicht aufzuhalten', 'Kehrt zum Sitz der Aspekte zurck und informiert Alexstrasza darber, was nach dem Sieg ber Raszageth im Gewlbe der Inkarnationen geschehen ist.', '$n, Ihr msst Alexstrasza und Nozdormu erzhlen, was hier passiert ist.\n\nKhadgar und ich werden Euch in Krze am Sitz der Aspekte treffen.', '', '', '', '', '', 'Kehrt zu Alexstrasza der Lebensbinderin am Sitz der Aspekte in Valdrakken zurck.', 47187),
(72374, 'deDE', 'Helft dem Abkommen: Drachenfluchfestung', 'Reist an die Kste des Erwachens und belagert die Drachenfluchfestung. Fhrt Eure Bemhungen fort, dem Valdrakkenabkommen und seinen Verbndeten auf den ganzen Dracheninseln zu helfen.', 'Unsere Verbndeten brauchen einmal mehr Eure Untersttzung bei ihren Vorhaben auf den Inseln. In Valdrakken gehen Worte des Trostes um, die davon sprechen, wie Ihr geholfen habt, unsere Zukunft zu formen.\n\nZurck zum Geschft.\n\nEine lauernde Bedrohung der Djaradin bewegt sich tief im Inneren des schwelenden Infernos der Drachenfluchfestung auf die Kste des Erwachens zu. Wir mssen diesen Vorsto aufhalten.\n\nWir erwarten Eure Rckkehr, $n.', '', '', '', '', '', '', 47187),
(72373, 'deDE', 'Helft dem Abkommen: Die Jagd ist erffnet', 'Helft den Maruuk bei einer Jagd auf den Dracheninseln. Fhrt Eure Bemhungen fort, dem Valdrakkenabkommen und seinen Verbndeten auf den ganzen Dracheninseln zu helfen.', 'Unsere Verbndeten auf den Ebenen von Ohn\'ahra haben nach allen und jedem geschickt, die in diesen Landen jagen, um sie zu bitten, ihre Sache zu untersttzen.\n\nWhrend Ihr Euren Bemhungen auf den Inseln nachgeht, stattet doch unseren Verbndeten in ihren Jagdlagern einen Besuch ab und helft Ihnen ein wenig aus.\n\nEs gibt viel zu tun. Trdelt nicht.', '', '', '', '', '', '', 47187),
