(72354, 'deDE', 'Die Groe Schatzkammer', 'Holt Euch eine Belohnung aus der Groen Schatzkammer.', 'ber die Jahre hinweg haben die Aspekte und ihr Volk viele bemerkenswerte Artefakte und Waffen angesammelt. Die Aspekte haben die Konstruktion einer verzauberten Schatzkammer in Auftrag gegeben, um sie zu lagern, bis eine wrdige Seele auf der Suche nach ihrem Inhalt eintrifft.\n\nIhr findet diese Schatzkammer innerhalb der Mauern der Bank. Vielleicht wird sie Euch einen Teil des uralten Schatzes der Aspekte gewhren, wenn Ihr Euren Eifer beweist.', '', '', '', '', '', '', 47187),
