(72293, 'deDE', 'Abenteuer auf den Dracheninseln', 'Betrachtet die Spherkarte, um eine Gegend auf den Dracheninseln auszusuchen, die Ihr untersttzen wollt.', 'Oh, ich wei, was ich tun kann!\n\nDie Drachenschuppenexpedition hat eine schne Karte der Dracheninseln in der Nhe aufgehngt.\n\nIhre Zeichnungen sind sehr genau und detailliert, wie ich finde. Verzeiht, Ihr wollt keine Kunstanalyse hren.\n\nIhr solltet Euch die Karte ansehen, um herauszufinden, welche Gegenden auf den Dracheninseln Eure Hilfe brauchen knnen!', '', '', '', '', '', '', 47187),
(72292, 'deDE', 'Geschichte eines spektakulren Sieges', 'Erzhlt der ltesten Poa in Iskaara von Eurem Sieg.', 'Das war ein majesttischer Kampf!\n\nlteste Poa in Iskaara wird an der Geschichte dieses beeindruckenden Sieges interessiert sein.', '', '', '', '', '', '', 47187),
(72291, 'deDE', 'Geschichte eines denkwrdigen Sieges', 'Erzhlt der ltesten Poa in Iskaara von Eurem Sieg.', 'Das war ein guter Kampf! \n\nlteste Poa in Iskaara wird an der Geschichte dieses Sieges interessiert sein.', '', '', '', '', '', '', 47187),
