(72269, 'deDE', 'Thaldraszus', 'Reist nach Valdrakken und trefft Euch mit Alexstrasza der Lebensbinderin.', 'Alexstrasza die Lebensbinderin plant ein Treffen am Sitz der Aspekte, um ber die Bedrohung durch die Primalisten zu sprechen.\n\nSie hat alle hilfsbereiten Abenteurer eingeladen.', '', '', '', '', '', 'Reist nach Valdrakken und trefft Euch mit Alexstrasza der Lebensbinderin.', 47187),
(72268, 'deDE', 'Azurblaues Gebirge', 'Sprecht mit Masud dem Weisen auf den Ebenen von Ohn\'ahra.', 'Die Kirin Tor brauchen alle Hilfe, die sie bekommen knnen, wenn es darum geht, den Schwurstein der blauen Drachen aufzuspren.\n\nEinige ihrer Magier wurden hilfesuchend auf den Ebenen von Ohn\'ahra gesehen.', '', '', '', '', '', '', 47187),
(72267, 'deDE', 'Ebenen von Ohn\'ahra', 'Trefft Botschafter Taurasza im Auenposten der Rubinschuppen.', 'Der grne Drachenschwarm braucht die Hilfe von Abenteurern. Doch Ihr msst Euch erst mit den Zentauren der Ebenen verbnden.\n\nBotschafter Taurasza kann Euch helfen.', '', '', '', '', '', '', 47187),
(72266, 'deDE', 'Kste des Erwachens', 'Trefft Sendrax an der Kste des Erwachens.', 'Die Drakonide Sendrax sucht Hilfe fr die Untersttzung der Neuankmmlinge an der Kste des Erwachens.', '', '', '', '', '', '', 47187),
(72263, 'deDE', 'Kavallerie vor', 'Lernt, Euer persnliches Vorquinreittier zu reiten.', '$gRufer:Ruferin;! Hier gibt es noch immer Vorquinherden!\n\nIch habe ein paar der Tiere zusammengetrieben, die als Reittiere dienen knnten, wenn Eure Schwingen mde werden. Wisst Ihr noch, wie man reitet?\n\nDieses Exemplar wird Euch zugeteilt, schlielich scheuchen Euch die Schuppenkommandanten ziemlich viel herum. Bitte kmmert Euch gut darum.', '', '', '', '', '', '', 47187),
(72261, 'deDE', 'Mehr als ein Gefngnis?', 'Bringt das uralte Gewlbeartefakt zu Lillian Mondenschein.', '<Das uralte Artefakt sieht elementar aus. Lillian Mondenschein in Valdrakken kann Euch vielleicht mehr sagen.>', '', '', '', '', '', '', 47187),
(72260, 'deDE', 'Gewlbeartefakte', '', '', '', '', '', '', '', '', 47187),
(72259, 'deDE', 'Gewlbeartefakte', '', '', '', '', '', '', '', '', 47187),
(72256, 'deDE', 'Die Dunkelkrallen', 'berbringt die Befehle der Schuppenkommandantin an Kodethi und die Dunkelkrallen.', 'Naleidea scheint voller Begeisterung, aber sie ist Historikerin, keine Soldatin. Sie hat keine Ahnung von den Gefahren, denen wir uns auf den Dracheninseln gegenbersehen werden.\n\nNicht, dass irgendjemand sich Sorgen machen msste. Schlielich werden die Dunkelkrallen die Expedition schtzen.\n\nIch werde mit Ebyssian und den Anfhrern Eurer Horde die Missionslogistik besprechen.\n\nMein Leutnant Kodethi erkundet mit den anderen Dracthyr die Stadt. Seid so gut und gebt ihm Bescheid, dass wir uns am Zeppelinturm versammeln. Er wird meine Befehle an die anderen weitergeben.', '', '', '', '', '', 'Trefft Naleidea am Zeppelinturm auerhalb von Orgrimmar.', 47187),
