(72246, 'deDE', 'Ruhige Trume', 'Sprecht mit dem Badmanager.', 'Willkommen im Bad der Ruhigen Trume!\n\nIch muss mich entschuldigen, wir knnen wegen gewisser Umstnde, die auerhalb unserer Kontrolle liegen, keine neuen Gste aufnehmen!\n\nLasst mich Euch an Xijan Dornenpranke, den Badmanager, verweisen. Er ist qualifiziert, Euch alle Fragen zu beantworten.', '', '', '', '', '', '', 47187),
(72245, 'deDE', 'Alchemie der Dracheninseln', '', '', '', '', '', '', '', '', 47187),
(72244, 'deDE', 'Inschriftenkunde der Dracheninseln', '', '', '', '', '', '', '', 'Sprecht mit Jessamine Spitz in der Botschaft von Schwingenrast.', 47187),
(72243, 'deDE', 'Kruterkunde der Dracheninseln', '', '', '', '', '', '', '', '', 47187),
(72242, 'deDE', 'Ingenieurskunst der Dracheninseln', '', '', '', '', '', '', '', '', 47187),
(72241, 'deDE', 'Lektionen der Vergangenheit', 'Sprecht mit Schuppenkommandantin Glutthal.', 'Ich bin Glutthal, eine Schuppenkommandantin der Dracthyr. Furorion half uns, nachdem wir aus unserer langen Stasis erwacht waren, und nun ist es an mir, ihm zu helfen.\n\nIhr habt zweifellos viele Fragen ber mein Volk und unsere Geschichte. Bis vor Kurzem hatte ich das auch.\n\nAber Nozdormu der Zeitlose hat viele verlorene Wahrheiten ber die Dracthyr aufgedeckt. Er hat mir eine Vision unserer Herkunft gezeigt... und warum wir weggesperrt wurden. \n\nLasst mich Euch von den Dingen erzhlen, die ich gesehen habe.', '', '', '', '', '', '', 47187),
(72240, 'deDE', 'Die Obsidianwchter', 'berbringt die Befehle des Schuppenkommandanten an Derwischian und die Obsidianwchter.', 'Die Begeisterung dieser Toddy ist bewundernswert. Ich hoffe nur, dass sie vor lauter Enthusiasmus nicht die Gefahren ignoriert, die uns auf den Dracheninseln erwarten.\n\nDennoch, die Obsidianwchter sind zum Schutze der Expedition verpflichtet.\n\nIch muss mit Furorion und dem Lordkommandanten ber die Mission sprechen.\n\nDie anderen Dracthyr erkunden die Stadt. Sucht meinen treuen Leutnant Derwischian und gebt ihr Bescheid, dass wir uns an den Docks versammeln. Sie wird meine Befehle an den Rest der Truppe weitergeben.', '', '', '', '', '', 'berbringt die Nachricht von Eurem Erfolg Toddy Schnurrbart am Hafen von Sturmwind.', 47187),
(72193, 'deDE', 'Die Akademie von Algeth\'ar', 'Lasst Euch durch das Gelnde der Akademie von Algeth\'ar fhren.', 'Mir ist zu Ohren gekommen, dass die Akademie von Algeth\'ar sich wieder dem Rest der Welt geffnet hat.\n\nVor langer Zeit waren ihre geheiligten Hallen nur fr Drachen geffnet, doch in den vergangenen Jahren wurde die Direktorin von der Weisheit ereilt, jeden willkommen zu heien, der lernbegierig ist. Sie bat mich um Empfehlungen zu vielversprechenden Studenten.\n\nEs wre mir eine Ehre, Euch, als $ggroartigen Verbndeten:groartige Verbndete; der Drachenheit, an unserer ebenso groartigen Akademie zu wissen. Es obliegt ganz allein Euch, dieses Angebot anzunehmen oder nicht, aber ich bin mir sicher, dass Doragosa Euch gerne wenigstens eine Fhrung ber das Akademiegelnde geben wrde.', '', '', '', '', '', '', 47187),
(72192, 'deDE', 'Hallen der Infusion: Entropie zu Ordnung', 'Betretet die Hallen der Infusion und besiegt den urtmlichen Tsunami.', 'Die Primalisten wollen das elementare Chaos in die Welt zurckbringen und machen vor nichts Halt, wenn es darum geht, ihr Ziel zu erreichen.\n\nIch habe ble Neuigkeiten erhalten, dass sie in die Hallen der Infusion unter Tyrhold eingedrungen sind. Sie versuchen, die Werke von Hter Tyr fr ihre eigenen niedertrchtigen Zwecke zu missbrauchen.\n\nBitte, Ihr msst die Bedrohung der Primalisten aus diesen heiligen Hallen vertreiben, $n.', '', '', '', '', '', '', 47187),
(72191, 'deDE', 'Belohnungen sind knapp', '', '', '', '', '', '', '', '', 47187),
(72190, 'deDE', 'Reservoirreservierungen', 'Findet Zuttiki.', '$C! Ich kenne da jemanden, der dringend Eure Fhigkeiten bentigt.\n\nDas Tyrholdreservoir wurde von den Primalisten angegriffen. Ich konnte gerade noch entkommen, aber andere hatten weniger Glck.\n\nEs ist gleich nrdlich von hier. Findet Zuttiki, sie kann Euch weitere Details nennen.\n\nDas heit... wenn sie noch lebt.', '', '', '', '', '', '', 47187),
(72189, 'deDE', 'Gartenvielfalt', 'Sprecht mit Gryrmpech.', 'Gefllt Euch der Schmetterlingsgarten?\n\nWisst Ihr, sdlich von hier gibt es einen noch viel greren Garten. Ein alter Drakonid namens Gryrmpech kmmert sich darum.\n\nEr kann immer ein Paar helfende Hnde brauchen. Er hat einen \"Assistenten\", aber ich habe ihn noch nie gesehen. Ich glaube nicht, dass er eine groe Hilfe ist.\n\nWenn Ihr vorbeikommt, sagt ihm, dass Xina Euch geschickt hat.', '', '', '', '', '', '', 47187),
