(72181, 'deDE', 'LFGDungeons - DF - Normal Random - 1st', '', '', '', '', '', '', '', '', 47187),
(72175, 'deDE', 'Eine szeptakulre Zeit', 'Stellt $1oa Szepter des Spektakels: Feuer und $2oa Szepter des Spektakels: Luft fr Soragosa in Valdrakken her.', 'Diese Woche sind einige aufregende Bestellungen reingekommen! Die Studenten der Akademie von Algeth\'ar werden sich Kopf ber Horn auf diese Szepter strzen.\n\nWarum helft Ihr uns nicht mit der Herstellung einiger Szepter?', '', '', '', '', '', '', 47187),
(72172, 'deDE', 'Essenz, Splitter, und chromatischer Staub', 'Stellt $1oa chromatischen Staub fr Soragosa in Valdrakken her.', 'Die Basiskomponenten scheinen bei uns immer knapp zu sein. Essenzen, Splitter... und unser Vorrat an chromatischem Staub ist beinahe aufgebraucht.\n\nWenn es Euch nichts ausmacht, uns mit dem Aufstocken zu helfen, halten wir vielleicht mehr als einen Tag durch, ohne die Vorrte auffllen zu mssen.', '', '', '', '', '', '', 47187),
(72171, 'deDE', 'Im Einzel beweisen', 'Schliet 12 Runden im gemischten Einzel ab.', 'Euer Eifer, selbst den Konflikt zu suchen, gefllt mir. Wenn Ihr so sehr auf Eure Fhigkeiten vertraut, dann werde ich hierbleiben und zusehen. Zur Belustigung.\n\nBeweist Euch, dann kehrt zu mir zurck.', '', '', '', '', '', '', 47187),
(72168, 'deDE', 'In Geplnkeln beweisen', 'Verdient Ehre in Arenageplnkeln.', 'Ihr habt Vertrauen in Eure taktischen Fhigkeiten, wie? Mir ist zu Ohren gekommen, dass es oft kleinere Geplnkel unter Euch Sterblichen gibt. Sucht Euch einige Gegner, gegen die Ihr antreten knnt.\n\nBeweist Euch, dann kehrt zu mir zurck.', '', '', '', '', '', '', 47187),
(72167, 'deDE', 'Im Krieg beweisen', 'Verdient Ehre auf epischen Schlachtfeldern.', 'Ihr wollt also eine \"echte Herausforderung\"? So sei es. Ich kenne einige groe Konflikte, die sogar fr mich eine Herausforderung darstellen knnten.\n\nIch bin neugierig, wie schnell Ihr scheitert... ich meine gewinnt. Wollen wir sehen, ob Ihr Euch mir gegenber beweisen knnt.', '', '', '', '', '', '', 47187),
(72166, 'deDE', 'In der Schlacht beweisen', 'Verdient Ehre auf zuflligen Schlachtfeldern.', 'Wenn Ihr Sterblichen es so sehr liebt, um jedes Land zu streiten, das Ihr findet, dann bitte.\n\nWenigstens wird es amsant. Fr mich zumindest. Dann lasst uns doch einmal sehen, wie gut Ihr Euch \"beweisen\" knnt.', '', '', '', '', '', '', 47187),
(72159, 'deDE', 'Wie Schuppen fr die Augen', 'Sammelt $1oa schimmernde Schuppenblge fr Ralathor den Zerfurchten in Valdrakken.', 'Schuppen haben vielerlei Verwendungszwecke. Sie bieten Schutz, in einigen Fllen aber auch eine glatte, reflektierende Oberflche. Viele unserer besten Spiegel sind eigentlich Schuppen.\n\nGenau diese Spiegel werden zuflligerweise auch stark nachgefragt. Besorgt mir einige schimmernde Schuppenblge, dann teile ich ein paar Geheimnisse meiner Kunst mit Euch.', '', '', '', '', '', '', 47187),
(72154, 'deDE', 'Skag der Werfer', '', '', '', '', '', '', '', '', 47187),
(72137, 'deDE', 'Kkenplne', '', '', '', '', '', '', '', '', 47187),
(72135, 'deDE', 'Neltharus: Verborgenes Wissen', 'Findet $1oa von Neltharions Notizen, $2oa Obsidiantagebcher und einen Forschungsfolianten in Neltharus.', 'Wir haben ein Problem, $gReisender:Reisende;. Zuerst erschienen die Djaradin innerhalb von Neltharus, also werden sie dessen Hallen plndern!\n\nNeltharus enthlt viele Schtze, aber vor allem viel Wissen. Die Geschichte unseres Schwarms, dessen Fall... Sabellian und Furorion suchen nach Informationen ber Neltharions Leben und seine Bestrebungen.\n\nVersucht, mglichst viel davon zu finden, bevor die Djaradin alles mitnehmen!', '', '', '', '', '', '', 47187),
(72134, 'deDE', 'Abenteuerassistenz', 'Verwendet die Spherkarte, um Eure erste Zone auszuwhlen.', 'Wir haben herausgefunden, dass es auf den Verheerten Inseln, das Land, ber dem wir schweben, viele Probleme gibt. \n\nWir werden von hier aus tun, was wir knnen. Ich mchte Euch bitten, auf der nahegelegenen Karte nachzusehen, wem Ihr als erstes helfen knnt.', '', '', '', '', '', '', 47187),
