(72122, 'deDE', 'Ehemalige kologen', 'Sucht nach den verschollenen kologen.', 'Die Verwundeten sind stabilisiert, aber meine Sorgen sind noch nicht vorber, $n.\n\nZwei Drachenbrutkologen sind zum Auenposten gekommen, um das Sumpfland zu untersuchen. Seit dem Angriff hab ich keine einzige Schuppe von ihnen erblickt und das bereitet mir Sorgen.\n\nKnntet Ihr Euch nach ihnen umsehen und ihnen helfen, wenn Ihr hinauszieht?\n\nUnd passt dabei auf. Angeblich lauern im Sumpf Gorlocs.', '', '', '', '', '', '', 47187),
