(72083, 'deDE', 'Mein Glckskder', 'Findet Kapitn Haabs Glckskder.', 'Ihr sucht mich in einer schweren Zeit auf, $R, und nicht, weil ich tot bin.\n\nIch bin auf der Jagd gestorben, um sicherzugehen, dass die Bestie, die meine Mannschaft gettet hat, nie wieder tten kann.\n\nNein, das Problem ist, dass der Kampf unentschieden ausging!\n\nDer Geist der Bestie ist immer noch da drauen, so sicher ich hier vor Euch stehe. Aber als Geist kann ich nicht einmal meinen Glckskder von den Aasfressern zurckholen, die meine Knochen abgenagt haben, um es nochmal zu versuchen!\n\nWrdet Ihr mir helfen?', '', '', '', '', '', '', 47187),
(72079, 'deDE', 'Gemeinschaftliches Festmahl', '', '', '', '', '', '', '', '', 47187),
(72075, 'deDE', 'Heies Lager', 'Sammelt Fische, um das Angelloch zu bestcken, und besteigt Euren Drachen, um sie von oben abzuwerfen.', 'Die Fische knnten etwas besser beien, meint Ihr nicht?\n\nDa kommt mir eine Idee. Der Legende nach sind diese Lavaseen nicht immer voller hitzeliebender Fische. Angeblich wurden diese Becken mit Fischen bestckt, als die Drachen darber segelten und sie fallen lieen! Knnt Ihr das glauben?\n\nVielleicht knntet Ihr es mit Eurem Drachen mal versuchen?', '', '', '', '', '', '', 47187),
(72072, 'deDE', 'Drachenquellensturz', 'Sammelt Fische, um das Angelloch zu bestcken, und besteigt Euren Drachen, um sie von oben abzuwerfen.', 'Die Fische knnten etwas besser beien, meint Ihr nicht?\n\nDa kommt mir eine Idee. Der Legende nach waren diese Seen und Flsse nicht immer voller Fische. Angeblich wurden diese Wasserlcher mit Fischen bestckt, als die Drachen darber segelten und sie fallen lieen! Knnt Ihr das glauben?\n\nVielleicht knntet Ihr es mit Eurem Drachen mal versuchen?', '', '', '', '', '', '', 47187),
(72071, 'deDE', 'Runde zwei, angelt!', 'Ttet Mochoby.', 'Was haltet Ihr von ein wenig Angeln, $n?\n\nGleich vor der Kste gibt es einen Schwarm Kderfische, der immer von dieser dummen Bestie angegriffen wird, sobald sie sich versammeln... Sie vergisst einfach, dass sie lngst tot ist.\n\nSchwimmt raus und wedelt mit dem Kder, tut vielleicht, als wrt ihr eine verwundete Robbe, dann kann die Bestie nicht widerstehen.', '', 'Ein Schrecken der Tiefe.\n\nKapitn Haabs Jagd bedeutete das Ende fr beide, aber nicht einmal der Tod konnte seine Rachsucht beenden.', 'Mochoby', '', '', '', 47187),
(72068, 'deDE', 'Untersttzung fr das Abkommen: Ein Festmahl fr alle', 'Reist nach Iskaara im Azurblauen Gebirge und nehmt an einem gemeinschaftlichen Festmahl teil. Fhrt Eure Bemhungen, dem Valdrakkenabkommen und seinen Verbndeten auf den ganzen Dracheninseln zu helfen, fort.', 'Unsere Verbndeten bentigen Hilfe, $n!\n\nEure Bemhungen auf den Inseln sind nicht unbemerkt geblieben. Unsere Vertrauten im Sden, die Tuskarr von Iskaara, mchten Eure Errungenschaften mit einem unbertroffenen Festmahl feiern!\n\nReist in das Land von Iskaara, whrend Ihr Eure Arbeit an der Seite der Mitglieder des Abkommens fortfhrt. Wenn Ihr die schimmernden Gewsser der Sdlande erreicht, zgert nicht, Euch den Festlichkeiten anzuschlieen!', '', '', '', '', '', '', 47187),
(72067, 'deDE', 'Zeit fr Entspannung!', 'Geht zum Bad der Ruhigen Trume.', 'Ihr da!\n\nIhr seht erschpft aus. Verbraucht. Als bruchtet Ihr dringend etwas Ruhe und Erholung. Da habe ich genau das Richtige! Das Bad der Ruhigen Trume ist der Ort, den Ihr sucht!\n\nGeniet unsere neuen Yougakurse, die sind GROSSARTIG. Oder vielleicht habt Ihr eher Lust auf eine Schlammmaske als Gesichtsbehandlung? Ich empfehle beides.\n\nDas Bad liegt gleich nrdlich der Stadt!', '', '', '', '', '', '', 47187),
(72063, 'deDE', 'Gebt Yennus Spielzeugboot zurck', 'Bringt das Spielzeugboot zu Yennu in der Nhe zurck.', 'Das ist Yennus Spielzeugboot. Er wird froh sein, es wiederzubekommen.', '', '', '', '', '', '', 47187),
