(72060, 'deDE', 'Sonderbehandlung', 'Bringt die Sonnenbrille zu Zeldis zurck. Noch einmal.', '<Die Schlammmaske scheint gespannt hinsichtlich Eurer Plne, ist aber auf diesem Ast in die Enge getrieben.>', '', '', '', '', '', '', 47187),
