(71242, 'deDE', 'Untersttzung fr die Sturmforscher', 'Bringt das Bndel an Elementarberfluss zu einem Forscher in Valdrakken.', 'Das sieht aus wie ein Bndel berschwellender Kraft von Kreaturen im Sturm der Primalisten.\n\nIn Valdrakken gibt es sicher einen Forscher, der sich dafr interessiert.', '', '', '', '', '', '', 47187),
(71241, 'deDE', 'Mit Enten auf Jagd', 'Stellt die Fallen des Klans Aylaag im Urzeitlichen Tal neu.', 'Das Urzeitliche Tal ist erfllt von der Magie der alten Drachen. Eine dort lebende Slyvernart wird bei meinem Volk fr ihr Fell geschtzt, aber sie ist scheu und schwer zu finden.\n\nAnstatt zu versuchen, sie aufzuspren, knnt Ihr nach unseren Jagdfallen in der Gegend suchen. Nehmt Fleisch der hiesigen Wasservgel, um sie neu zu stellen. Ich werde dann einige Klanmitglieder aussenden, um den Fang einzusammeln.', '', '', '', '', '', '', 47187),
(71239, 'deDE', 'Im Himmel verloren', 'Findet Harleen Hohnzirper an den Blaufederklippen.', 'Ich brauche einen Gefallen, und Ihr seht aus wie jemand, der gerne Gefallen erledigt.\n\nEine alte Freundin von mir, Harleen Hohnzirper, sollte mich vor ein paar Tagen in der Stadt treffen. Wir wollten uns durch das Rubinfestmahl probieren, zum Frisr gehen und dann dieses schicke Auktionshaus besuchen, das es dort gibt.\n\nAber sie ist nicht gekommen. Sie verliert sich oft in ihrer Arbeit, aber ich wrde mich besser fhlen, wenn ich wsste, wo sie ist.\n\nVersucht es in den Bergen sdlich von hier. Sie hat erwhnt, dass sie einen Abstecher dorthin machen will.', '', '', '', '', '', '', 47187),
(71238, 'deDE', 'Das Rubinfestmahl!', 'Sprecht mit den Kchen Rumiastrasza und Schnabuli beim Rubinfestmahl.', 'An alle aufstrebenden Kulinariker!\n\nStrebt Euer Herz nach den ultimativen Genssen dieser Welt? Sucht Ihr nach Mglichkeiten fr groartige Forschungen? Seid Ihr gewillt, Leib und Leben fr vollkommen Fremde zu riskieren?\n\nDann sprecht mit dem unbertroffenen, angesehenen, weltberhmten Kochduo Rumiastrasza und Schnabuli! Zurzeit veranstalten sie das Rubinfestmahl in Valdrakken!', '', '', '', '', '', '', 47187),
(71235, 'deDE', 'Feldmagier', 'Seht nach den Magiern der Kirin Tor in der Nhe von Slyvernsturz im Azurblauen Gebirge.', 'Lok\'tar, $R.\n\nWenn Ihr Zeit habt, gibt es zwei Magier in der Nhe, die sicher Hilfe bei der Feldarbeit brauchen knnten.\n\nDieses Land ist in seinen besten Zeiten sehr gefhrlich.\n\nUnd es sind nicht gerade die besten Zeiten.', '', '', '', '', '', '', 47187),
(71234, 'deDE', 'Neuigkeiten in jedem Winkel', 'Besucht den Walfngerwinkel im Azurblauen Gebirge.', 'Ihr da, $R.\n\nIhr seht weit gereist aus.\n\nMein Cousin Wayun hat einen Fang vom Walfngerwinkel mitgebracht und... merkwrdige Zeitgenossen erwhnt, die da ihr Lager aufgeschlagen haben.\n\nSie scheinen sich zu benehmen, aber wrdet ihr nach Wayun sehen?\n\nEr ist schnell eingeschnappt.', '', '', '', '', '', '', 47187),
(71233, 'deDE', 'Fallendes Wasser', 'Sprecht mit Willa am Dreifllerundblick im Azurblauen Gebirge.', 'Ich liebe Wasserflle.\n\nWollt Ihr wissen, was besser ist als ein Wasserfall?\n\nZwei Wasserflle!\n\nUnd das Einzige, was noch besser ist, als das... seht Euch Dreiflle im Westen an, dann erfahrt Ihr es!\n\nDie Gastwirtin dort ist ganz nett.', '', '', '', '', '', '', 47187),
(71232, 'deDE', 'Ruhm der Dracheninseln', 'Sprecht mit Therazal innerhalb von Valdrakken.', 'Es gibt nach wie vor vieles, das getan werden muss, um den Dracheninseln zu helfen.\n\nIch wrde Euch darum bitten, mit Therazal zu sprechen. Er hat viele Informationen dazu, wer in diesen Landen Hilfe braucht.', '', '', '', '', '', 'Sprecht mit Therazal innerhalb von Valdrakken.', 47187),
(71231, 'deDE', 'Ruf der Jagd', 'Sprecht mit Trainer Frodrum auf den Ebenen von Ohn\'ahra.', '<Roki drckt Euch eine Nachricht in die Hand.>\n\n$n, Klan Shikaar ldt Euch zur groen Jagd ein. Trefft Trainer Frodrum auf den Ebenen von Ohn\'ahra.', '', '', '', '', '', '', 47187),
(71230, 'deDE', 'Angelausrstung der Tuskarr', 'Sprecht mit Tavio bei Iskaara im Azurblauen Gebirge.', 'Hallo noch mal, $n.\n\n<Rowie sieht sich um und summt ein Lied.>\n\nOh, stimmt! Tavio hat mir ein neues Netz gemacht und gesagt, sie knnte Euch auch eines machen. Sie kann auch andere Angelausrstung machen, wenn Ihr das ganze Zeug zu ihr bringt.\n\nIhr solltet mit ihr reden.', '', '', '', '', '', '', 47187),
(71229, 'deDE', 'Ruf der Ebenen', 'Sprecht mit Hadari Khan auf den Ebenen von Ohn\'ahra.', '<Roki drckt Euch eine Nachricht in die Hand.>\n\n$n, Klan Aylaag hat Geschichten von Euren groen Taten gehrt. Wir laden Euch ein, unseren Klan zu treffen und unsere Wege zu erfahren.\n\nHadari Khan', '', '', '', '', '', '', 47187),
(71227, 'deDE', 'Luftige Herausforderungen', 'Sprecht mit einem Bronzezeithter, um mehr ber die luftigen Herausforderungen zu erfahren.', '<Flatter flattert aufgeregt mit den Flgeln und lsst eine Nachricht und ein angesengtes Nagetier vor Eure Fe fallen.>\n\n$gDrachenreiter:Drachenreiterin;! Euer Heldenmut ist weithin bekannt. Beweist Euch in luftigen Herausforderungen berall auf den Dracheninseln.\n\nSprecht mit einem Bronzezeithter, um anzufangen.', '', '', '', '', '', '', 47187),
(71226, 'deDE', 'Ttet Steinschnecken', 'Ttet $1oa Hasen der Verdammnis auf dem bungsplatz.', 'Hilfe! Diese Hasen verschlingen mein Fleisch! Bitte, ttet sie, bevor sie uns alle tten!', '', '', '', '', '', '', 47187),
(71219, 'deDE', 'Wegbehter auf Abwegen', 'Findet Wegbehterin Alvi.', 'Scheinbar haben einige der jngeren Wegbehter in letzter Zeit ihre Pflicht vernachlssigt. \n\nWegbehterin Nori hat mich gebeten, nach ihrer jngeren Schwester Alvi zu sehen, die an der Mndung des Zeitenflusses stationiert ist. Ihre Leistung war in letzter Zeit wohl ungengend.\n\nWenn Ihr nach Osten reist und zufllig auf Wegbehterin Alvi trefft, erinnert sie bitte daran, wie wichtig ihre Position ist und dass ihre Schwester sich Sorgen um sie macht.', '', '', '', '', '', '', 47187),
(71212, 'deDE', 'Angriff auf die Brackenfelle', '', '', '', '', '', '', '', '', 47187),
(71210, 'deDE', 'Zur Drachenfluchfestung!', 'Reist an die Kste des Erwachens und schliet Euch den Obsidianausgestoenen bei der Belagerung der Drachenfluchfestung an.', '<Flatter lsst eine leicht angesengte Notiz in Eure Hand fallen.>\n\n$n, die Obsidianausgestoenen haben Geschichten ber Euren Mut gehrt. Unsere frhere Heimat, die Drachenfluchfestung, ist in die Hnde der Djaradin gefallen. Wir knnen das nicht auf uns sitzen lassen. Helft uns, unser Land zurckzuerobern.\n\nBoss', '', '', '', '', '', '', 47187),
(71209, 'deDE', 'Wildtier der Ebenen', 'Nehmt Lizis Zgel an.', 'Ich glaube, Lizi ist bereit, wieder zu einem Wildtier der Ebenen zu werden. Sie ist Euch und mir gegenber so zahm geworden, aber ich kann ihr ansehen, dass sie zurck in die Wildnis will.\n\nEines Tages, wenn ich eine Windweise bin, werde ich die ganze Welt jenseits dieser Quellen erkunden. Aber erst stehen meine Halbjahresprfungen fr Initianden an! Wie die Zeit vergeht.\n\nIch habe Sattel und Zaumzeug aus der Wolle hergestellt, die Ihr gesammelt habt. Lizi kommt sicher gern, wann immer Ihr sie ruft.\n\nBitte nehmt sie auf vielen Abenteuern mit, $p.', '', '', '', '', '', '', 47187),
(71205, 'deDE', 'Wassertuskarr', '', '', '', '', '', '', '', '', 47187),
(71202, 'deDE', 'Winziger Manageistnahkmpfer', 'Besiegt Arkantus in einem Haustierkampf.', '', '', '', '', '', '', '', 47187),
(71199, 'deDE', 'Donnerrckgrat zhmen leicht gemacht', '', '', '', '', '', '', '', '', 47187),
(71198, 'deDE', 'Donnerrckgrat zhmen leicht gemacht', '', '', '', '', '', '', '', '', 47187),
(71197, 'deDE', 'Donnerrckgrat zhmen leicht gemacht', '', '', '', '', '', '', '', '', 47187),
(71196, 'deDE', 'Donnerrckgrat zhmen leicht gemacht', 'Sammelt $1oa Portionen fluoreszierende Flssigkeit von Insekten auf den Dracheninseln sowie $2oa Vorrte der Dracheninseln.', 'Ich bin so froh, dass Lizi bei uns in Sicherheit ist.\n\nLeider heilen ihre Wunden aber langsamer als gedacht. Ich hoffe nur, die Magie, der sie ausgesetzt war, hat keine bleibenden Schden hinterlassen.\n\nKnntet Ihr mir wohl helfen, Insektensekret zu sammeln? Ich wei, es klingt unappetitlich, aber es ist die Basis von vielen Heilsalben.', '', '', '', '', '', '', 47187),
(71195, 'deDE', 'Donnerrckgrat zhmen leicht gemacht', 'Holt Meluuns grnes Curry in den Quellen von Ohn\'iri und $2oa Vorrte der Dracheninseln.', 'Ich schtze, das hier ist Lizis neuer Lieblingsplatz. Sie wollte nicht wirklich wieder heimkommen. Immerhin ist sie ein wildes Tier.\n\nIch muss zugeben... ich habe nicht mehr mit Meluun gesprochen, seit wir Lizi gerettet haben. Ich sehe ja ein, dass sie recht hatte, aber ich wei nicht, wie ich mit ihr sprechen soll. Ich kann es ihr einfach nicht recht machen. Ich wei, dass ich mich mehr um meine Ausbildung kmmern muss.\n\nMeluun macht ein Curry zum Dahinschmelzen, das Lizi bestimmt lieben wrde. Knntet Ihr sie wohl danach fragen? Sie arbeitet normalerweise in ihrem Haus westlich der Quellen.', '', '', '', '', '', '', 47187),
(71194, 'deDE', 'Frsche des Feuers', 'Bringt ein paar Hornstacheln bei, Eiszapfengebru zu vermeiden.', 'Ich habe den perfekten Ort gefunden fr ein Fischernetz. Ein Problem bekmmert mich jedoch... diese Hornstachel. Ich bin mir ziemlich sicher, dass sie die Netze zerreien werden, sobald sie ungestrt sind. Was sollen wir tun?\n\nIch habe eine Idee. Wir behandeln unsere Lavafischnetze mit Eiszapfengebru, um sie hitzeresistent zu machen. Wir mssen den Hornstacheln nur zu verstehen geben, sich von dem Geruch fernzuhalten.\n\nWerft ein Flschchen Eiszapfengebru auf einen Hornstachel und fgt ihm dann Schaden zu. Stellt nur sicher, dass Ihr sie nicht ttet. Sie knnen nicht lernen, wenn sie tot sind, oder?', '', '', '', '', '', '', 47187),
(71193, 'deDE', 'Unterwasserbedrohung', 'Verwendet 5 ominse Muscheln am Angelloch von Tyrhold, um eine riesige Unterwasserbestie anzulocken, und nehmt einen Beweis ihres Ablebens mit.', 'Habt Ihr das gesehen? Unter Wasser! Ein riesiges, gepanzertes, hungriges Ungeheuer! Auf keinen Fall gehe ich mit meinem Netz an das Wasser, whrend so eine Monstrositt da lauert. Wenn Ihr wollt, knnt Ihr sie mit einer Handvoll ominser Muscheln hervorlocken, die sollten nicht zu schwer zu fangen sein.', '', '', '', '', '', '', 47187),
(71192, 'deDE', 'Raubtierkontrolle', 'Stellt die furchteinflenden Bildnisse auf.', 'Seid gegrt.\n\nIch habe nach einem geeigneten Platz gesucht, um ein paar Fischernetze auszulegen, aber die Watschlerbevlkerung in dieser Gegend ist zu dicht... sie fressen die meisten kleinen Fische auf, bevor sie berhaupt erst dazu kommen, heranzuwachsen.\n\nIch habe ein paar Bildnisse gemacht, um zumindest ein paar dieser gefrigen Vgel zu verscheuchen. Das wird uns dabei helfen, die ppigen Fischgrnde der Drachenquellen zu erhalten.\n\nKnnt Ihr mir dabei helfen, sie aufzustellen?', '', '', '', '', '', '', 47187),
(71191, 'deDE', 'Gut vernetzt', 'Findet das Netz des brbeiigen Fischers in den Eislchern im Azurblauen Gebirge.', 'Oh je, mein Fischernetz wurde von der Strmung davongetragen. <Seufz> Ich nutze nicht gerne Angelruten, wie meine Freunde...\nWenn Ihr zufllig mein Fischernetz irgendwo findet, bringt es doch bitte zurck.', '', '', '', '', '', '', 47187),
(71182, 'deDE', 'Archivare auf Abwegen', 'Trefft Sindragosa im oberen Archiv der Azurarchive.', 'Ihr da, Dracthyr.\n\nZwei von Eurer Art haben die Archive sdlich von hier durchsucht. Ich habe mich ihnen noch nicht vorgestellt und wsste Eure Gesellschaft zu schtzen.\n\nFalls Ihr Zeit habt, knnen wir uns im oberen Archiv treffen.', '', '', '', '', '', '', 47187),
(71179, 'deDE', 'Blick zum Rundblick', 'Sprecht mit Kommandant Thadezus am Rundblick der Gelikyr.', '$n, ich habe eine neue Aufgabe fr Euch.\n\nEs gibt Berichte von Primalistenaktivitten in der Nhe des Postens der Gelikyr, die unsere Kontrolle ber Tyrhold gefhrden.\n\nSprecht mit Kommandant Thadezus und seht zu, wie Ihr helfen knnt.', '', '', '', '', '', 'Sprecht mit Kommandant Thadezus am Rundblick der Gelikyr.', 47187),
(71178, 'deDE', 'Portal: Schattenzuflucht', 'Findet das inaktive Portal bei der Schattenzuflucht auf den Ebenen von Ohn\'ahra.', 'Unsere Expedition berichtet von einem inaktiven Stein bei den ppigen Hngen im Sdwesten. Es ist ein gutes Stck entfernt, aber es lohnt sich, jemanden mit Eurer Kenntnis fr die Untersuchung dort hinzuschicken.', '', '', '', '', '', '', 47187),
(71166, 'deDE', 'Die lteste Libelle', 'Besiegt Flunk in einem Haustierkampf.', '', '', '', '', '', '', '', 47187),
(71165, 'deDE', 'Portal: Grenze des ons', 'Findet das inaktive Portal an der Grenze des ons in Thaldraszus.', 'In weiter Ferne, in den Bergregionen von Thaldraszus gibt es ein kleines Gasthaus, das dort am Berghang steht. Gleich hinter dem Eingang liegt ein lngst vergessener, inaktiver Stein.\n\nWas meint Ihr? Lust auf ein neues Abenteuer, $n?', '', '', '', '', '', '', 47187),
(71162, 'deDE', 'Portal: Algeth\'era', 'Findet das inaktive Portal auf dem Turm in Algeth\'era in Thaldraszus.', 'Neuer Stein, neuer Turm.\n\nAm besten macht Ihr Euch auf den Weg. Das wird eine ordentliche Wanderung und gefhrlich noch dazu! Zumindest, wenn man ihren Entdeckern glauben kann.\n\nSeid Ihr bereit?', '', '', '', '', '', '', 47187),
(71161, 'deDE', 'Portal: Vakthros', 'Findet das inaktive Portal auf dem Turm in Vakthros im Azurblauen Gebirge.', 'Wir haben einen Bericht von einem weiteren der inaktiven Steine in der winterlichen Region im Sdosten erhalten.\n\nBevor Ihr jetzt ganz aufgeregt werdet, solltet Ihr wissen, dass nicht viele freiwillig da hingehen wrden, aber wenn Ihr Lust auf ein mglicherweise tdliches Abenteuer habt, ist es genau das Richtige!\n\nSeid Ihr schon berzeugt? Gut!\n\nWerft Euch in Eure wrmsten Klamotten. Geht anschlieend nach Osten, bis der kalte Wind Euch an der Nase kitzelt, und geht dann immer weiter. Ihr werdet wissen, dass Ihr in der Nhe seid, wenn Euer Atem steif und Eure Knochen kalt werden.', '', '', '', '', '', '', 47187),
(71157, 'deDE', 'Portal: Himmelhochobservatorium', 'Findet das inaktive Portal am Himmelhochobservatorium an der Kste des Erwachens.', 'Einige unserer Entdecker aus dem Norden berichten, dass sich ein weiterer dieser Steine hoch oben auf dem Turm im Nordosten befindet.\n\nIch hab gehrt, dass es ziemlich schwierig ist, da oben ranzukommen, aber ich wette, dass Ihr einen Weg findet!', '', '', '', '', '', '', 47187),
(71155, 'deDE', 'Das Azurblaue Gewlbe', 'Haltet die Splitterflammen im Azurblauen Gewlbe auf.', 'Wir haben ein Problem, $n.\n\nUnter den Azurarchiven ruht das Azurblaue Gewlbe. Ich habe im Laufe meines Lebens so manche wichtige und gefhrliche magische Kuriositt darin eingelagert.\n\nJetzt ist eine groe Gruppe von Splitterflammen ins Gewlbe eingebrochen, in der festen berzeugung, dass es wertvolle Geheimnisse birgt.\n\nBitte, Ihr msst hineingehen und diesen trichten berfall aufhalten, sonst entfesseln sie Gefahren, die sie nicht begreifen knnen.\n\nDiese Diebe ahnen nicht, was im Gewlbe lauert.', '', '', '', '', '', '', 47187),
(71153, 'deDE', 'Weltquests, Bonusziele und Szenarien, oje', 'Schliet 3 Weltquests der Tortollaner ab.', 'Untersttzt die Tortollaner, indem Ihr 3 Weltquests abschliet.', '', '', '', '', '', 'Kehrt zu Sammler Kojo zurck.', 47187),
(71152, 'deDE', 'Zurck zur Haupthalle', 'Trefft Euch mit Toddy in der Haupthalle.', 'Nun, da wir auf die berbrckungskonsolen zugegriffen haben, sollten wir an dieser Barriere vorbeikommen.\n\nTrefft mich in der Haupthalle, dann erledigen wir das!', '', '', '', '', '', '', 47187),
(71151, 'deDE', 'Fortgesetzte Portalerkundung', 'Trefft Thaelin Schwarzamboss im Auenposten der Rubinschuppen an der Kste des Erwachens.', '<Der Brief ist sauber, unzerknittert und trgt das Siegel der Drachenschuppenexpedition.\n\nThaelin Schwarzamboss verlangt Eure Anwesenheit.>', '', '', '', '', '', '', 47187),
(71150, 'deDE', 'Fortgesetzte Portalerkundung', 'Trefft Thaelin Schwarzamboss im Auenposten der Rubinschuppen an der Kste des Erwachens.', '<Das Pergament verstrmt einen unangenehmen, schimmligen Geruch. Nachdem Ihr Euch gesammelt habt wird Euch klar, dass Thaelin Eure Untersttzung auf der Suche nach Antworten zu seinen jngsten Funden braucht.\n\nIhr fragt Euch nur, was Ihr nun mit dem unertrglich stinkenden Pergament machen sollt.>', '', '', '', '', '', '', 47187),
(71149, 'deDE', 'Fortgesetzte Portalerkundung', 'Trefft Thaelin Schwarzamboss im Auenposten der Rubinschuppen an der Kste des Erwachens.', '<beraschenderweise hat der Bote Euch diesmal weder ein Sckchen noch eine Notiz gebracht, sondern einen Gegenstand aus Thaelins persnlicher Sammlung.\n\nBei genauerer Betrachtung findet Ihr dennoch eine Nachricht von Thaelin, der einmal mehr um Eure Untersttzung bittet.>', '', '', '', '', '', '', 47187),
(71148, 'deDE', 'Fortgesetzte Portalerkundung', 'Trefft Thaelin Schwarzamboss im Auenposten der Rubinschuppen an der Kste des Erwachens.', '<Das merkwrdige Tierchen vor Euch hlt Euch eine Notiz entgegen, gezeichnet und gesiegelt von der Drachenschuppenexpedition.\n\nVielleicht ein Hilferuf von einem berhmten Forscher.>', '', '', '', '', '', '', 47187),
(71146, 'deDE', 'Fortgesetzte Portalerkundung', 'Trefft Thaelin Schwarzamboss im Auenposten der Rubinschuppen an der Kste des Erwachens.', '<Der Forscher-in-Ausbildung gibt Euch eine zusammengerollte Notiz. Sie scheint von einem alten Freund zu stammen, Thaelin Schwarzamboss, der Euch um Hilfe bittet.\n\nBevor es davonhuscht, streckt das kleine Tier Euch eine Hand entgegen, als wrde es um eine Belohnung bitten. Kurz darauf ertnt ein schriller Schrei, als die seltsame Kreatur mit leeren Hnden davonprescht.>', '', '', '', '', '', '', 47187),
(71145, 'deDE', 'Der Gromeister', 'Besiegt Flicki in einem Haustierkampf', '', '', '', '', '', '', '', 47187),
(71144, 'deDE', 'Allianzschlchter', 'Whrend ein Kopfgeld auf Euch ausgesetzt ist, ttet 10 Mitglieder der Allianz, ohne zu sterben.', 'Ja! Weiter so, ttet diese Allianztlen!\n\nWenn Ihr noch ein paar Allianzler ttet, knntet Ihr einen neuen Rekord aufstellen, $C.\n\nAber das wird nicht leicht, denn die Allianz hat einen Preis auf Euren Kopf ausgesetzt! Passt auf Euch auf!\n\nFr die Horde!', '', '', '', '', '', '', 47187),
(71143, 'deDE', 'Hordenschlchter', 'Whrend Ihr von der Horde gejagt werdet, ttet 10 ihrer Mitglieder, ohne zu sterben.', 'Toll! Immer weiter so, $gSoldat:Soldatin;!\n\nTtet ein paar mehr von der Horde, dann werdet Ihr in die Geschichtsbcher der Allianz eingehen.\n\nAber das wird nicht ganz leicht. Die Horde hat ein Kopfgeld auf Euch ausgesetzt, also seid vorsichtig!\n\nFr die Allianz!', '', '', '', '', '', '', 47187),
(71141, 'deDE', 'Krasse Kiemen', 'Ttet Gurblbrblr den Eindringling am Klippensturzlager.', 'Kad\'irsza ist leichtsinnig, aber sie kennt ihre Krabben. Die Gorlocs sind zu weit gegangen!\n\nIch habe bemerkt, dass die Gorlocs fr alles zu Gurblbrblr gehen. Vor allem erklrt er ihnen, wie man Krabben fngt. Das darf nicht so weitergehen, weder fr das Gleichgewicht des Lebens noch fr die Sicherheit derjenigen, die es pflegen.\n\nBesiegt Gurblbrblr. Nehmt ihnen die Mglichkeit, sich jenseits dies Flusses auszubreiten!', '', 'Gorlocs von bengstigender Gre? Dieser hier ist zumindest real.', 'Gurblbrblr der Eindringling', '', '', '', 47187),
(71140, 'deDE', 'Zwei und zwei zusammen', 'Besiegt Bakhushek in einem Haustierkampf.', '', '', '', '', '', '', '', 47187),
(71139, 'deDE', 'Leuchtendes arkanes Juwel', 'Bringt das leuchtende arkane Juwel zu Noriko der Allererinnernden im Lager Antonidas.', '<Dieses Juwel scheint sehr mchtig zu sein. Es verstrmt ein unheimliches Licht.\n\nVielleicht wre es das Beste, es den Kirin Tor zu bringen, damit es sicher verwahrt werden kann.>', '', '', '', '', '', 'Bringt das leuchtende arkane Juwel zu Noriko der Allererinnernden im Lager Antonidas.', 47187),
(71138, 'deDE', 'Portal: Rusza\'thar-Vorsto', 'Findet das inaktive Portal beim Rusza\'thar-Vorsto auf den Ebenen von Ohn\'ahra.', 'Ein Expeditionsmitglied hat berichtet, dass auf einem Ausguck auf den Ebenen von Ohn\'ahra ein inaktiver Stein gesichtet wurde.\n\nBereit fr ein Abenteuer?', '', '', '', '', '', '', 47187),
(71135, 'deDE', 'Ungeklrte Angelegenheiten', 'Stellt Frostbiss am Schneebalglager im Azurblauen Gebirge.', 'Wenn ich eines von meiner Zeit in der Wildnis gelernt habe, dann dies: Wenn man sich nicht um das Bse kmmert, wenn man es findet, und wenn man nicht seine Knochen bricht und seine Wurzeln ausreit, dann wchst es nur weiter. Und dann wird es nur schwerer zu tten.\n\nDiese Berge leiden schon unter Frostbiss\' Existenz, seit ich ein kleiner Welpe war wie Ihr. Und es wird nur schlimmer werden, wenn er die volle Kontrolle ber den Schneebalgstamm erringt.\n\nIch htte vor langer Zeit etwas gegen ihn unternehmen mssen, und nun sind wir die Einzigen, die diesen Fehler wiedergutmachen knnen.', '', 'Setzen wir Frostbiss\' grausamer Herrschaft ein Ende.', 'Frostbiss', '', '', '', 47187),
(71097, 'deDE', 'Eine helfende Klaue', 'Aktiviert das Artefakt im Turm ber dem Kobaltkonvent und beobachtet Venderthvans Handlungen.', 'Also gut, Ihr habt das Artefakt aufgeladen. Dann aktiviert es...\n\n...und hrt auf, mich so anzusehen. Tut nicht so, als wrt Ihr nicht neugierig, ob es funktioniert.\n\nSchttelt es noch einmal, entfernt Euch langsam und lasst es mich zu Ende bringen.', '', '', '', '', '', '', 47187),
(71096, 'deDE', 'Eine Klaue zweifellos', 'Versucht, das Artefakt zu aktivieren.', '<Venderthvan reibt sich die Augen und sthnt vor Schmerzen.>\n\nNa gut. Wenn Ihr es mit nicht gebt, knnt Ihr selbst herausfinden, wie es funktioniert.\n\nIch werde es Euch abnehmen, wenn Ihr fertig seid. Mit Gewalt, wenn es sein muss.\n\nAlso nur zu. Schttelt es oder so.', '', '', '', '', '', '', 47187),
(71095, 'deDE', 'Eine Klaue in Not', 'Fragt Venderthvan, wie Ihr ihm helfen knnt, und tut, was er sagt.', 'Mal sehen, wie wir diesem Kerl helfen knnen!\n\n<Heleth lehnt sich zu Euch vor und flstert.>\n\nKeine Sorge, wir werden ihn nichts klauen lassen oder so. Lasst uns nur etwas Spa haben!\n\nEs ist ewig her, dass jemand hergekommen ist, um nach uns zu sehen. Uns ist SO langweilig!\n\n<Heleth zwinkert Euch zu.>\n\nWarum fragt Ihr ihn nicht, was er will?', '', '', '', '', '', '', 47187),
(71094, 'deDE', 'Helfen ist unser Weg!', 'Findet Verbnde im Turm ber dem Kobaltkonvent, um Venderthvan zu heilen.', 'Hallchen!\n\nSeid Ihr auch hier, um zu helfen? Ihr seht sehr hilfreich aus!\n\n<Heleth deutet auf den verletzten Dracthyr.>\n\nDer da drben hat sich beim Versuch, hier hochzufliegen den Flgel verletzt! Er sieht aus wie einer von den Bsen von da unten, aber ich habe keine Angst vor ihm! Ich werde ihm so oder so helfen, weil wir das nun mal so machen!\n\n<Heleth strafft die Schultern.>\n\nIch werde auf ihn aufpassen, whrend Ihr ein paar Verbnde sucht!', '', '', '', '', '', '', 47187),
(71093, 'deDE', 'Vermchtnis von Tyr: Geheimnisse der Vergangenheit', 'Geht nach Uldaman: Vermchtnis von Tyr im dland und bergt die Scheibe.', 'Damit Raszageth die anderen Inkarnationen nicht befreien kann, mssen wir die Macht der Aspekte wiederherstellen.\n\nUnglcklicherweise sind die Titanen mit anderen Dingen beschftigt und Hter Tyr ist schon lange tot.\n\nKnigin Alexstrasza hat jedoch einen Plan vorgebracht. In den Tiefen des dlands liegt eine Titanenanlage namens Uldaman. Anscheinend haben Verbndete Tyrs dort eine Scheibe mit seinen Erinnerungen versteckt.\n\nJedoch wurde diese Anlage angeblich von Troggs berrannt. Sammelt Eure Verbndeten und begebt Euch nach Uldaman. Beschlagnahmt die Scheibe im Namen der Drachenknigin!', '', '', '', '', '', '', 47187),
