(71029, 'deDE', 'Jagdtaktiken: Begleiterausbildung', 'Whlt eine zustzliche Begleiterfhigkeit fr die groe Jagd.', 'Euer Ruhm unter den Maruuk wchst weiter. Fr Eure Mhen werde ich Euch beibringen, wie Ihr Euren Jagdbegleiter im Kampf effektiver einsetzen knnt.', '', '', '', '', '', '', 47187),
(71028, 'deDE', 'Jagdtaktiken: Segen von Ohn\'ahra', 'Whlt einen Segen von Ohn\'ahra fr die groe Jagd.', 'Euer Ruhm unter den Maruuk wchst. Hrt gut zu, dann bringe ich Euch bei, wie Ihr einen Segen von Ohn\'ahra herbeiruft, um Euch und Eure Verbndeten zu schtzen.', '', '', '', '', '', '', 47187),
(71027, 'deDE', 'GESUCHT: Mara\'nar der Donnernde', 'Ttet Mara\'nar den Donnernden im Urzeitlichen Tal und erbeutet eine seiner Panzerplatten.', 'Ich bin auf der Suche nach einem mchtigen Jger, um eine wtende Bestie zur Strecke zu bringen!\n\nEine Donnerechse namens Mara\'nar der Donnernde hat sich ihren Weg vom Donnerrckgratdickicht bis zum Urzeitlichen Tal gebahnt und strt die rtliche Tierwelt. Sie hat Wasser elektrisiert, Bume niedergerissen und Entennester zerstrt.\n\nDiese Geiel muss aufgehalten werden. Erledigt sie und bringt eine ihrer Panzerplatten zu Khanswache Jebotai als Beweis.\n\nMge Ohn\'ahra Euch leiten.', '', 'Diese Bestie bringt die rtliche Tierwelt im Urzeitlichen Tal durcheinander, aber bald hat sie ihr letztes Entennest zerstrt.', 'Mara\'nar der Donnernde', '', '', '', 47187),
(71026, 'deDE', 'Entgegen aller Wahrscheinlichkeit', 'Ttet 25 Hordemitglieder der Stufe 70 auf den Dracheninseln.', 'Obwohl Ihr mickrigen Sterblichen einen Waffenstillstand geschlossen habt, habe ich Gerchte gehrt, dass einige von Euch sehr nachtragen sind.\n\nWenn Ihr ein paar Freunde versammelt, kann ich Euch einen Ort zeigen, an dem Ihr der anderen Seite beweisen knnt, wer wirklich berlegen ist.\n\nUnd um es spannender zu machen, habe ich einen Preis fr Euch, solltet Ihr gewinnen.', '', '', '', '', '', '', 47187),
(71024, 'deDE', 'Chaos und Aufruhr', 'Helft Erima, den Zwischenfall im unteren Stockwerk des Sitzes der Aspekte zu untersuchen.', '$n! Habt Ihr das gehrt? Da ist etwas im unteren Stockwerk passiert.\n\nEiner meiner vertrauten Ermittler, Erima, war als erstes dort. Er braucht Eure Hilfe beim Sammeln der Beweise, whrend er versucht, die Schaulustigen zu befragen.', '', '', '', '', '', '', 47187),
(71023, 'deDE', 'Angesehen beim Valdrakkenabkommen', 'Sprecht mit Unatos in Valdrakken.', 'Eure Taten entsprechen Eurem sagenhaften Ruf, den Ihr vor Eurer Ankunft auf den Dracheninseln erlangt habt.\n\nIch mchte Euch untersttzen, indem ich Euch mit weiteren Vorrten versorge. Sucht mich in Valdrakken auf.', '', '', '', '', '', '', 47187),
(71022, 'deDE', 'Wider den Widder', 'Befehlt Taivan, sich dem strrischen Widder der Herde zu stellen.', 'Die Riesenwildschafe scheinen schon mal wenig Respekt vor Taivan zu haben. Wir sollten als Nchstes probieren, ob er mit dem Widder der Herde zurechtkommt.\n\nDer Widder ist Chef aller Riesenwildschafe hier und ein ziemlich sturer Kerl. Wenn Taivan seine Dominanz ber den Widder behaupten kann, wird die Herde ihm gehorchen.\n\nIhr findet ihn dort auf dem Hgel. Viel Glck, Taivan. Ich frchte, wenn auch das nicht klappt, bleibt wenig Hoffnung, dass Taivan es noch zum Hirtenbakar schafft.', '', '', '', '', '', '', 47187),
(71020, 'deDE', 'Gewlbe der Inkarnationen: Knackt ein paar Eier', 'Sammelt 3 Splitter des Grostabs von Bruthterin Diurna im Gewlbe der Inkarnationen auf mythischem Schwierigkeitsgrad.', 'Bruthterin Diurna ist irgendwo in dieser Festung, wo sie von ihrer Kammer aus zweifellos das Gewlbe berwacht. Wenn Ihr Teile ihres Grostabes erbeuten knnt, sollten wir ihren Bau damit direkt angreifen knnen.\n\nDrei sollten reichen. Vier knnten zu viel sein.', '', '', '', '', '', '', 47187),
(71019, 'deDE', 'Gewlbe der Inkarnationen: Knackt ein paar Eier', 'Sammelt 3 Splitter des Grostabs von Bruthterin Diurna im Gewlbe der Inkarnationen auf heroischem Schwierigkeitsgrad.', 'Bruthterin Diurna ist irgendwo in dieser Festung, wo sie von ihrer Kammer aus zweifellos das Gewlbe berwacht. Wenn Ihr Teile ihres Grostabes erbeuten knnt, sollten wir ihren Bau damit direkt angreifen knnen.\n\nDrei sollten reichen. Vier knnten zu viel sein.', '', '', '', '', '', '', 47187),
(71018, 'deDE', 'Gewlbe der Inkarnationen: Knackt ein paar Eier', 'Sammelt 3 Splitter des Grostabs von Bruthterin Diurna im Gewlbe der Inkarnationen auf normalem Schwierigkeitsgrad.', 'Bruthterin Diurna ist irgendwo in dieser Festung, wo sie von ihrer Kammer aus zweifellos das Gewlbe berwacht. Wenn Ihr Teile ihres Grostabes erbeuten knnt, sollten wir ihren Bau damit direkt angreifen knnen.\n\nDrei sollten reichen. Vier knnten zu viel sein.', '', '', '', '', '', '', 47187),
(71017, 'deDE', 'Nalukis Brief', 'Bringt Nalukis Fischkopf zum alten Grimmhauer.', 'Lasst mich raten: Grimm hat Euch verboten, den Brief zu ffnen?\n\nAnscheinend habt Ihr Euch daran gehalten. Kein Wunder, dass er Euch so sehr vertraut!\n\nGebt ihm diesen Fischkopf von mir. Er wei, was das bedeutet.', '', '', '', '', '', 'Bringt Nalukis Fischkopf zu Grimmhauer.', 47187),
(71016, 'deDE', 'Grimmhauers Schwester', 'berbringt Grimmhauers Brief seiner Schwester Naluki in Iskaara.', 'Zuletzt kommt meine Schwester Naluki. Sie hilft im Gasthaus in Iskaara aus.\n\nGebt ihr einfach diesen Brief.\n\nffnet ihn nicht.', '', '', '', '', '', 'berbringt Grimmhauers Brief seiner Schwester Naluki in Iskaara.', 47187),
(71015, 'deDE', 'Nur Muskeln, kein Gehirn', 'Find Varsek im Uralten Aussichtspunkt.', 'Varsek ist einer der zhesten Drakoniden, die Ihr je gesehen habt. Aber auch einer der dmmsten, auch wenn er das nie zugeben wrde.\n\nDie Sache mit Frostbiss hat ihn erschreckt und er hat sein Leben berdacht... oder so. Er sagte, er wre nie dazu gekommen, die Ruinen seiner Vorfahren zu studieren. Ist davongelaufen, um ein \"Gelehrter\" zu werden.\n\nHolt Varsek zurck. Er gehrt da sowieso nicht hin!', '', '', '', '', '', 'Find Varsek im Uralten Aussichtspunkt.', 47187),
(71014, 'deDE', 'Ein entfernter Furbolgfreund', 'Findet Barst auf der Langklaueninsel.', 'Barst war einer der hrtesten Furbolgs, die ich je kannte. Es sagt viel ber Frostbiss aus, dass seine Meute ihn im Kampf besiegt hat.\n\nAls ich zuletzt von Barst gehrt habe, war er auf dem Weg zu einer Insel vor der Kste von Iskaara. Er hat etwas von \"Ruhestand\" und lauter so Unsinn gefaselt.\n\nSagt Barst, dass es an der Zeit ist, sich wieder an die Arbeit zu machen.\n\nOh, und lasst Euch nicht von seiner Sprechweise irritieren. Er reit Euch entzwei, wenn Ihr ihn nur komisch anseht.', '', '', '', '', '', 'Findet Barst auf der Langklaueninsel.', 47187),
(71013, 'deDE', 'Keine Rache auf leeren Magen', 'Angelt $2oa gefrorene Schwanzflitzer in Grimmhauers Unterschlupf.', 'Da wir wieder beim Thema sind, mssen wir Stozahn zu Stozahn reden. Dieser Gnoll, Frostbiss? Mit dem Ihr geredet habt?\n\nWir haben eine Vorgeschichte mit ihm.\n\nEs knnte eine Weile dauern, es zu erklren. Geht und holt etwas Fisch, whrend ich es Euch erzhle, Kind. Wir brauchen Essen fr alle. Sie mssen gestrkt sein fr das, was kommt.', '', '', '', '', '', '', 47187),
(71012, 'deDE', 'Varsek rekrutiert', 'Berichtet Grimmhauer, dass Ihr Varsek rekrutiert habt.', 'Ich schtze, ich werde die Rtsel dieses Ortes in Zukunft problemlos lsen knnen.\n\nLasst uns einfach nicht mit dem alten Grimmhauer hierber sprechen, in Ordnung?\n\nIch werde mich auf den Weg zum Unterschlupf machen. Ich glaube, ich kann es jetzt vertragen, etwas angestauten Frust an Frostbiss auszulassen.', '', '', '', '', '', 'Kehrt zu Grimmhauer zurck.', 47187),
(71011, 'deDE', 'Gesucht: Reiende Lilie', 'Findet die reiende Lilie.', '<Die angebrachte Notiz ist mit schner Kalligrafie verziert.>\n\nDie Archivare bitten demtig alle Expeditionsteilnehmer, nach der reienden Lilie fr unser Artefaktarchiv zu suchen.\n\nIm Falle des Funds bitte bei Katalogisiererin Jakes zur Bearbeitung und Vergtung abgeben.\n\nEinige Expeditionsmitglieder haben berichtet, dass sie beim Rundblick der Gelikyr in Thaldraszus eine mchtige Primalistin gesehen haben, die eine Blume an ihrem Kragen trgt. Es ist nicht bekannt, ob es sich dabei um die legendre reiende Lilie handelt, aber es ist ein guter Ort, um mit der Suche zu beginnen.', '', 'Eine mchtige Wasserprimalistin in Thaldraszus trgt die reiende Lilie an ihre Kapuze gesteckt.', 'Alora Nebelhauch', '', '', 'Kehrt zu Katalogisiererin Jakes im Drachenschuppenbasislager zurck.', 47187),
(71010, 'deDE', 'Gesucht: Zeitfernrohr', 'Findet das Zeitfernrohr.', '<Die angebrachte Notiz ist mit schner Kalligrafie verziert.>\n\nDie Archivare bitten demtig alle Expeditionsteilnehmer, nach dem Zeitfernrohr fr unser Artefaktarchiv zu suchen.\n\nIm Falle des Funds bitte bei Katalogisiererin Jakes zur Bearbeitung und Vergtung abgeben.\n\nEinige Expeditionsmitglieder haben berichtet, dass sie mitgehrt haben, wie ein Zwerg in den Gasthusern von Sdthaldraszus mit seinem magischen Fernrohr angibt. Wir schlagen vor, die Suche auf diese Region zu konzentrieren.', '', 'Ein Ausguck der Primalisten in Thaldraszus nutzt das Zeitfernrohr, um seinen nchsten Angriff zu planen.', 'Ausguck Mordren', '', '', 'Kehrt zu Katalogisiererin Jakes im Drachenschuppenbasislager zurck.', 47187),
(71009, 'deDE', 'Das ist elementar, mein lieber Drakonid', 'Helft Varsek, das Mysterium des Uralten Aussichtspunkts zu lsen.', 'Grimmhauer will sich die Zhne an Frostbiss ausbeien, was? Ich will ihn ungern enttuschen, aber ich habe dieses Leben hinter mir gelassen, um ein Gelehrter zu werden.\n\nIch versuche, die Geschichte aufzudecken... und selbst Geschichte zu schreiben! Aber ich hnge an diesem esoterischen Rtsel dieser uralten Ruinen fest.\n\nDas Rtsel ist Folgendes: Wenn Ihr einen Kristall in der Nhe berhrt, sagt er \"Folgt dem Muster\". Aber ich habe nicht die leiseste Ahnung, was das bedeutet!\n\nIch sage Euch was: Wenn Ihr mir helfen knnt, dieses Rtsel zu lsen, werde ich Grimmhauer helfen, Frostbiss ein fr alle Mal den Garaus zu machen.', '', '', '', '', '', '', 47187),
(71008, 'deDE', 'Gesucht: Steinherz\' steinernes Herz', 'Findet Steinherz\' steinernes Herz.', '<Die angebrachte Notiz ist mit schner Kalligrafie verziert.>\n\nDie Archivare bitten demtig alle Expeditionsteilnehmer, nach Steinherz\' steinernem Herz fr unser Artefaktarchiv zu suchen.\n\nIm Falle des Funds bitte bei Katalogisiererin Jakes zur Bearbeitung und Vergtung abgeben.\n\nEinige Expeditionsmitglieder haben berichtet, dass sie Steinherz in einer Hhle im Zentrum des Azurblauen Gebirges gesehen haben.', '', 'Steinherz bewahrt sein steinernes Herz in... na ja, da kommt Ihr bestimmt selbst drauf.', 'Steinherz', '', '', 'Kehrt zu Katalogisiererin Jakes im Drachenschuppenbasislager zurck.', 47187),
(71004, 'deDE', 'Gesucht: Massenbindungstotem fr Ohuna', 'Findet das Massenbindungstotem fr Ohuna.', '<Die angebrachte Notiz ist mit schner Kalligrafie verziert.>\n\nDie Archivare bitten demtig alle Expeditionsteilnehmer, nach dem Massenbindungstotem fr Ohuna fr unser Artefaktarchiv zu suchen.\n\nIm Falle des Funds bitte bei Katalogisiererin Jakes zur Bearbeitung und Vergtung abgeben.\n\nEinige Expeditionsmitglieder haben berichtet, dass sie auf der Windspielanhhe auf den Ebenen von Ohn\'ahra einen besonders fhigen Primalisten gesehen haben, der die Macht dieses Totems beherrschen soll.', '', 'Eine mchtige Luftprimalistin auf den Ebenen von Ohn\'ahra, die das Massenbindungstotem fr Ohuna fhrt.', 'Prozela Windschuss', '', '', 'Kehrt zu Katalogisiererin Jakes im Drachenschuppenbasislager zurck.', 47187),
(71002, 'deDE', 'Bester Zauber aller Zeiten', 'Lest \"Manastrmen fr Anfnger\" und entdeckt Millhaus\' geheimen Zauber.', '<Dieses sacht schwebende und Arkanmagie verstrmende verzauberte Buch enthlt zahllose Zauber und Verzauberungen, die dem chaotischen und doch wunderschnen Verstand von Millhaus Manasturm entsprungen sind.>', '', '', '', '', '', '', 47187),
(71001, 'deDE', 'Gesucht: Erdgebundener urzeitlicher Kern', 'Findet den erdgebundenen urzeitlichen Kern in Neltharus.', '<Die angebrachte Notiz ist mit schner Kalligrafie verziert.>\n\nDie Archivare bitten demtig alle Expeditionsteilnehmer, nach dem erdgebundenen urzeitlichen Kern fr unser Artefaktarchiv zu suchen.\n\nIm Falle des Funds bitte bei Katalogisiererin Jakes zur Bearbeitung und Vergtung abgeben.\n\nJngste Erkenntnisse und Berichte aus der Obsidianzitadelle deuten darauf hin, dass er einst im Drachenhort von Neltharus gelagert wurde. Seine aktuelle Position ist jedoch unbekannt.', '', 'Es heit, der Kern wre im Drachenhort von Neltharus verschollen.', 'Erdgebundener urzeitlicher Kern', '', '', 'Kehrt zu Katalogisiererin Jakes im Drachenschuppenbasislager zurck.', 47187),
(71000, 'deDE', 'Barst rekrutiert', 'Berichtet Grimmhauer, dass Ihr Barst rekrutiert habt.', 'Abgemacht ist abgemacht. Wenn Grimmhauer Hilfe braucht, um Frostbiss endgltig zu tten, dann bin ich dabei.\n\nDen Hass, den ich noch in mir trage, hebe ich mir fr Frostbiss auf. Hat Grimmhauer Euch gesagt, was passiert ist?\n\nWir alle, die mit Grimmhauer auf die Jagd gingen, dachten, wir wren unaufhaltsam. Bis wir Frostbiss trafen.\n\nFrostbiss hat uns nicht nur besiegt. Er hat uns vor allen anderen im Unterschlupf gedemtigt.\n\nWir wurden blutig und geschlagen im Unterschlupf zurckgelassen. Frostbiss hat ein Exempel an uns statuiert.\n\nJetzt ist es an der Zeit fr Rache.', '', '', '', '', '', 'Kehrt zum Alten Grimmhauer zurck.', 47187),
(70996, 'deDE', 'Tang-o am Strand', 'Besiegt den wilden Tangelementar auf der Langklaueninsel.', 'Oje, das klingt, als wre Grimmhauer in Schwierigkeiten. Ich wrde sagen, ich habe genug von den Konflikten des Festlands, aber...\n\nFrostbiss und ich haben eine Vorgeschichte. Und eine Rechnung zu begleichen.\n\nAch, Schande! Ich kann die anderen hier aber nicht ohne Verteidigung lassen... Wir hatten Probleme mit einem Elementar, der am Strand fr rger gesorgt hat. Ich bin der Einzige, der es mit ihm aufnehmen kann. Das ist ein schlpfriger Geselle... buchstblich\n\nIch sage Euch was: Wenn Ihr Euch fr mich um den Elementar kmmert, latsche ich mal rber zu Grimmhauers Lager.\n\nWie sieht\'s aus, Champ?', '', 'Ab mit Euch!', 'Tangelementar', '', '', '', 47187),
(70995, 'deDE', 'Gesucht: Fenistraszas Schdel', 'Findet Fenistraszas Schdel.', '<Die angebrachte Notiz ist mit schner Kalligrafie verziert.>\n\nDie Archivare bitten alle Expeditionsteilnehmer, nach Fenistraszas Schdel fr unser Artefaktarchiv zu suchen.\n\nIm Falle des Funds bitte bei Katalogisiererin Jakes zur Bearbeitung und Vergtung abgeben.\n\nEinige Expeditionsmitglieder haben berichtet, dass er im Besitz eines verstoenen Djaradin in den westlichen Bergen sein soll. Aber es konnte ihn niemand davon berzeugen, ihn herauszurcken.', '', 'Ein zurckgezogener Djaradin stellt den verzauberten Schdel in seinem Alkoven aus.', 'Tarjin der Blinde', '', '', 'Kehrt zu Katalogisiererin Jakes im Drachenschuppenbasislager zurck.', 47187),
(70994, 'deDE', 'Absauglsungen', 'Saugt $1oa glitzernde Strme in der Hhle stlich der Ruinen des Lebensgewlbes auf.', 'Wollt Ihr die Ehre haben, der weltberhmten Chefgeologin der Drachenschuppenexpedition zu assistieren? Ja, das ist richtig. Ich bin genau die, fr die Ihr mich haltet. Und ich stecke in der Klemme!\n\nIch habe diesen Fluss nach neuen Sedimentproben abgesucht, aber dann begann das Wasser, die interessantesten Schlickanteile mitzureien!\n\nIch habe hier meine patentierte Wasserfangvorrichtung, aber es braucht dringend jemanden, der herumluft und die Elementare in sie hineinzieht.\n\nMeint Ihr, Ihr bekommt das hin?', '', '', '', '', '', '', 47187),
(70992, 'deDE', 'Gesucht: Verlorener Tuskarrdrachen', 'Findet den verlorenen Tuskarrdrachen.', '<Die angebrachte Notiz ist mit schner Kalligrafie verziert.>\n\nDie Archivare bitten alle Expeditionsteilnehmer, nach dem verlorenen Tuskarrdrachen fr unser Artefaktarchiv zu suchen.\n\nIm Falle des Funds bitte bei Katalogisiererin Jakes zur Bearbeitung und Vergtung abgeben.\n\nEinige Expeditionsmitglieder haben berichtet, dass sie einen solchen Drachen an einem Tuskarrtransporter befestigt an der Westkste gesehen haben. Aber niemand konnte ihn erreichen, da der Transporter ihn in der Luft und damit auer Reichweite hlt, wenn er in Bewegung ist.', '', 'Der Drachen segelt stolz hinter dem verlorenen Arvillo, whrend er sich fortbewegt...', 'Verlorener Tuskarrdrachen', '', '', 'Kehrt zu Katalogisiererin Jakes im Drachenschuppenbasislager zurck.', 47187),
(70990, 'deDE', 'Wo die Wolle ist, ist auch ein Weg', 'Schert die Wolle von Klippenhufschafen.', 'Obwohl fast unsere gesamte Wolle von unseren eigenen Riesenwildschafen stammt, mssen wir doch mitunter das Land nutzen, wenn die Herde schrumpft.\n\nAuf den nahen Ebenen leben wilde Riesenwildschafe. Sie sind meist temperamentvoller als die unseres Klans. Wenn Ihr diese Klinge nehmen und ihre Wolle scheren knntet, wre das ein groer Dienst fr Aylaag.', '', '', '', '', '', '', 47187),
(70989, 'deDE', 'Mitglied der Meute', 'Jagt den gefrigen Drachen mit Taivan und dem Rudel Jagdbakar.', 'Vielleicht muss sich Eurer Bakar von Artgenossen abschauen, wie man ordentlich jagt.\n\nIhr knnt Euch einige von unseren trainierten Bakar ausleihen. Nehmt sie und holt den kreisenden Protodrachen vom Himmel.\n\nSchauen wir doch mal, wie Taivan sich in einem Rudel mit seinesgleichen verhlt.', '', '', '', '', '', '', 47187),
(70987, 'deDE', 'Strke des Herzens', 'Sprecht mit Meliane Enorath in den Ruinen des Lebensgewlbes an der Kste des Erwachens.', 'Was knnte besser sein als ein Essen, das Ihr auf Erkundungsreisen mitnehmen knnt?\n\nStraenimbisse sind aus den belebten Stdten dieser Welt nicht mehr wegzudenken. Aber nicht jedes Gericht lsst sich gut transportieren. Die Basis groartiger Gerichte zum Mitnehmen ist die Strke, die unterwegs alles zusammenhlt. Brot, Kartoffeln, Reis und was Euch sonst noch einfllt sind das Herz der bestecklosen Kche.\n\nIch wrde meinem Pandarenkollegen gerne ein kstliches Exemplar servieren, das als Springmais bekannt ist. Schnabuli hat ihn mir gezeigt, als wir uns in der Nhe einer Ruine der Titanen an der Kste des Erwachens kennenlernten.', '', '', '', '', '', '', 47187),
(70986, 'deDE', 'Gefreite Shikzar', '', '', '', '', '', '', '', '', 47187),
(70985, 'deDE', 'Die einsame Spherin', 'Sprecht mit Dryaden in der Schattenzuflucht.', 'Ich wei, ich wei, es ist albern. Eine Zentaurin und eine Dryade. Wir knnten kaum unterschiedlicher sein.\n\nAber seit ich die Smaragdgrten zum ersten Mal erblickt habe, wollte ich eine Dryade besser kennenlernen. Aber es will mir einfach nicht gelingen, das Richtige zu sagen oder zu tun, damit sie an mir Interesse htten.\n\nWie ich hre, mgen sie... Pflanzen. Und niedliche Tierbabys. Und womglich machen sie gern Jagd auf Wilderer? Ach, ich wei nicht, wo ich anfangen soll.\n\nKnntet Ihr vielleicht mit ihnen reden? Fragt einfach ein bisschen herum, was sie gern mgen. Vielleicht habe ich dann eine Chance.', '', '', '', '', '', 'Kehrt zu Spherin Santuun zurck.', 47187),
(70984, 'deDE', 'Wogenbrecher', '', '', '', '', '', '', '', '', 47187),
(70983, 'deDE', 'O\'nank Strandsieb', '', '', '', '', '', '', '', '', 47187),
(70981, 'deDE', 'Vollmundige See', 'Sprecht mit Wayun im Walfngerwinkel im Azurblauen Gebirge.', 'Der Duft der See! Knnt Ihr das riechen, $n? Riecht Ihr die Vielzahl von Mineralien und das Meersalz? Sagt schon!\n\nWas den heutigen Genssen noch fehlt, ist eine seltene Fischart, die ich einst in der Nhe von Iskaara im Azurblauen Gebirge gekostet habe. Zwei Tuskarr haben einfach einen ber einem Feuer gegrillt und das hat die eisige Tundra mit dem kstlichsten Duft erfllt.\n\nVersucht doch, einen fr uns zu finden. Ich bin sicher, unsere Gste werden ebenso bezaubert von dem Geruch der See sein, wie ich an diesem Tag.', '', '', '', '', '', '', 47187),
(70979, 'deDE', 'Magmaton', '', '', '', '', '', '', '', '', 47187),
(70978, 'deDE', 'Sagen der Champions der Dracheninseln', '', '', '', '', '', '', '', '', 47187),
(70977, 'deDE', 'Ruckscaps', '', '', '', '', '', '', '', '', 47187),
(70976, 'deDE', 'Schwnzen und Schlittenfahren', 'Sucht Kiopo auf der Insel im Sdosten auf.', 'Wie Ihr vielleicht wisst, sind die Kinder von Iskaara sehr selbststndig. Sie lernen von klein auf, sich selbst zu versorgen.\n\nEs ist eine Art Mutprobe unter den lteren Kindern, sich auf den Eisberg sdwestlich von hier zu schleichen. Kiopo, das lteste unserer Kinder, ist gerade dort. Sagt ihm, dass ich Euch geschickt habe, dann wird er Euch einen unserer Schlitten anbieten!\n\nAh, das erinnert mich an meine Jugend... da drauen... mit meinen Freunden...', '', '', '', '', '', '', 47187),
(70972, 'deDE', 'Unsere treuen, schlaksigen Reittiere', '', '', '', '', '', '', '', '', 47187),
(70971, 'deDE', 'Waffen fr jeden Arm', '', '', '', '', '', '', '', '', 47187),
(70970, 'deDE', 'Gute Absichten', 'Haltet Alia Segelstrahl auf und zerstrt das Artefakt Valthrux.', 'Ich wei vielleicht, wo das Artefakt ist. Alia hat fanatisch vor sich hin geflstert, als Ihr all die Splitter zurckgebracht habt.\n\nSie sprach stndig von einer \"Hhle\" und davon, wie die Spinnen von ihr angezogen werden.\n\nIn der Gegend vor uns gibt es keine Hhle, deswegen glaube ich, dass tiefer in den Ruinen eine liegen knne.\n\nWir bleiben hier und halten den Fluchtweg offen, $n. Bitte rettet Alia und zerstrt dieses verfluchte Artefakt.', '', 'Ich hoffe, wir kommen rechtzeitig dort an, bevor Alia von dem Artefakt berwltigt wird.', 'Valthrux', '', '', '', 47187),
(70969, 'deDE', 'Teil der Gemeinschaft werden', '', '', '', '', '', '', '', '', 47187),
(70968, 'deDE', 'Teil des Stoffs, Teil der Gemeinschaft', '', '', '', '', '', '', '', '', 47187),
