(70963, 'deDE', 'Halt frs Handgelenk', '', '', '', '', '', '', '', '', 47187),
(70962, 'deDE', 'Ein gemtlicher Sitz', '', '', '', '', '', '', '', '', 47187),
(70961, 'deDE', 'Die ntige Rstung auf sich nehmen', '', '', '', '', '', '', '', '', 47187),
(70960, 'deDE', 'Hndlerkleidung', '', '', '', '', '', '', '', '', 47187),
(70959, 'deDE', 'Knuffig und knuddelig', '', '', '', '', '', '', '', '', 47187),
(70958, 'deDE', 'Perfektes Pilzpanorama', 'Sprecht mit Wchterhauptmann Sinjoirmi am Temporalen Konflux in Thaldraszus.', 'In der gehobenen Kche dreht sich alles darum, die genauesten Techniken auf die erlesensten Zutaten anzuwenden. Die Gerichte der gehobenen Kche sind oft den Reichen und Betuchten vorbehalten, aber hier beim Rubinfestmahl wollen wir davon nichts wissen!\n\nSchnabuli hat mir von der perfekten Zutat fr das heutige Motto erzhlt. Eine so seltene und exquisite, dass sie... noch nicht existiert! Verlockend, nicht wahr?\n\nDie Bronzenen haben ein Portal in eine gefhrliche Zukunft entdeckt. Eine, in der es einen schwarzen Trffel von unvorstellbarer Kstlichkeit gibt.\n\nIhr msst dorthin!', '', '', '', '', '', '', 47187),
(70957, 'deDE', 'Die See im Westen', 'Sprecht mit Zuckerzweig in der Schattenzuflucht auf den Ebenen von Ohn\'ahra.', 'Gefllt Euch die grne Landschaft um uns herum, $n?\n\nSie erinnert mich an ein Gericht von zwei Dryadenschwestern und deren Treantfreund, das ich einmal probieren durfte. Zuckerzweig war sein Name! Er lebt in der Schattenzuflucht an der Westkste der Ebenen.\n\nEs war eine Variation aus frischen Krutern, Gemse und Gewrzen. Und das Herz des Gerichts war eine Lage des kstlichsten Seetangs, den Ihr je gegessen habt!\n\nWas? Ihr habt noch nie Seetang gegessen? Dann msst Ihr einfach welchen sammeln. Und bringt doch bitte genug fr alle mit!', '', '', '', '', '', '', 47187),
