(70946, 'deDE', 'Niemand darf es fhren', 'berredet Alia, Valthrux zu zerstren.', 'Was Ihr gefunden habt, klingt, als htte die Macht des Artefakts alle, die sie bisher beansprucht haben, ins Verderben gestrzt.\n\nDie Drachenbrut, die hier lebte, hat sich deswegen gegenseitig umgebracht. Die Splitterflammen scheinen ebenfalls von seinem Einfluss korrumpiert zu werden.\n\nWir mssen dieses Artefakt finden. Es muss zerstrt werden, bevor es noch mehr Schaden anrichten kann.\n\nWir mssen Alia und Kattigat davon berzeugen.', '', '', '', '', '', '', 47187),
(70945, 'deDE', 'Danke, sehr Netz', '', '', '', '', '', '', '', '', 47187),
(70944, 'deDE', 'Eisfischen', '', '', '', '', '', '', '', '', 47187),
(70943, 'deDE', 'Harpunieren', '', '', '', '', '', '', '', '', 47187),
(70942, 'deDE', 'Hochlandfischen', '', '', '', '', '', '', '', '', 47187),
(70941, 'deDE', 'Angellcher', 'Sprecht mit Nunvuq bei Iskaara im Azurblauen Gebirge.', 'Erneut hallo! Wusstet Ihr, dass ich der besteste Fischer im Dorf werde? Ich habe mal einen riesigen Piranha gefangen. Er hat versucht, mein Gesicht zu fressen!\n\n<Rowie schaut sich gedankenverloren um.>\n\nOh, ja! Ich habe eine Nachricht fr Euch. Nunvuq in Iskaara will Euch etwas ber Angellcher beibringen.', '', '', '', '', '', '', 47187),
(70940, 'deDE', 'Sagen des Champions der Tuskarr', '', '', '', '', '', '', '', '', 47187),
(70939, 'deDE', 'Kochgert', '', '', '', '', '', '', '', '', 47187),
(70938, 'deDE', 'Gemeinschaftliche Festmahle', 'Sprecht mit dem groen Kinook bei Iskaara im Azurblauen Gebirge.', 'Da seid Ihr ja, $n! Die Suppe steht auf dem Tisch!\n\nBeeilt Euch besser und geht nach Iskaara. Der groe Kinook sucht nach Euch.\n\nEinmal hat er mir gesagt, ich soll einen schleimigen, ekligen Stachelfisch fr die Suppe holen, und ich wollte nicht, als rief ich: \"Nein, Chefkoch!\"\n\nEr war so wtend, dass ich dachte, er wrde mich in die Suppe werfen!', '', '', '', '', '', '', 47187),
(70937, 'deDE', 'Was Valthrux einst war', 'Findet Hinweise darauf, was das Artefakt Valthrux wirklich ist.', '<To\'tik flstert.>\n\nDas gefllt mir nicht. Mysterise Artefakte, die groartige Versprechen flstern? Das klingt nicht gut.\n\nAber wir knnen nicht einfach umkehren... ansonsten bekommen die Splitterflammen es noch in die Finger. Was auch immer \"es\" ist...\n\nIch kenne mich mit Ruinen wie diesen gut aus. Die blauen Drachen haben oft Notizen ber ihre Arbeit zurckgelassen. Haltet die Augen offen, dann knnt Ihr vielleicht welche finden.\n\nWir knnen die Hinweise, die Ihr entdeckt, nutzen, um Alia und Kattigat zu warnen.', '', '', '', '', '', '', 47187),
(70936, 'deDE', 'Gestohlene Tuskarrtotems', '', '', '', '', '', '', '', '', 47187),
(70935, 'deDE', 'Fangen und freilassen: Inselfinnenschwertfisch', '', '', '', '', '', '', '', '', 47187),
(70932, 'deDE', 'Ein wrziges Leben', 'Sprecht mit Gaunah am Obsidianthron.', 'Fr viele gehrt Fleisch zu einem Essen einfach dazu. Aber was gehrt zu jedem Fleischgericht dazu?\n\nGewrze!\n\nEin Gewrz bertrifft alle anderen in Geschmack, Textur und Seltenheit, und es gibt es hier auf den Inseln. Leider kann es nur bei Elementaren gefunden werden, die in den Tiefen der Obsidianfeste leben. Das Gebiet wird gerade von den Djaradin kontrolliert.\n\nVielleicht knnt Ihr mehr von diesem seltsamen Troll erfahren, den ich auf dem Weg hierher getroffen habe. Ich glaube sein Name war... Gaunah.', '', '', '', '', '', '', 47187),
(70931, 'deDE', 'Flsternde Fragmente', 'Sammelt $1oa flsternde Fragmente von den Splitterflammen.', 'Ich glaube, Valthrux versucht, durch den Splitter, den wir geborgen haben, mit uns zu kommunizieren.\n\nWir knnen das zu unserem Vorteil nutzen, solange wir unseren Verstand vor dem Einfluss des Artefakts schtzen.\n\nIch habe mich hinsichtlich der Splitterflammen geirrt. Sie haben leider schon mehrere Splitterfragmente gefunden.\n\nValthrux\' Flstern behauptet, sie sind kurz davor, den Standort zu lokalisieren.\n\nNehmt den Splitterflammen die Splitter ab, bevor sie das Artefakt finden!', '', '', '', '', '', '', 47187),
(70930, 'deDE', 'Teetrinken und abwarten', 'Sprecht mit Lilial Dmmerbruch im Schaudernetztal.', 'Heute ist ein Fest des Tees: gebraut, gekhlt oder ganz anders! Es gibt auch extravagante kleine Kuchen und Kekse.\n\nAber es gibt eine seltene Zutat auf den Inseln, von der ich glaube, dass sie eine ganz neue Geschmacksdimension entfalten knnte! Tief im insektenverseuchten Reich des Schaudernetztals wchst ein Busch mit dem wunderbarsten, erhebenden Laub: der Kaltbisspfeilblattbusch.\n\nDie Drachenschuppenexpedition hat die Gegend vor Kurzem erforscht, vielleicht kann einer von ihnen Euch helfen?', '', '', '', '', '', '', 47187),
(70929, 'deDE', 'Mehr Jagdtrophen', '', '', '', '', '', '', '', '', 47187),
