(70919, 'deDE', 'Quaken und Heilen', 'Bringt das Entchen in der Blase zurck ins kologenlager.', '<Das Entchen ist schon so lange in der Blase, dass es fest eingeschlafen ist. Es quakt leise, whrend es schnarcht.>\n\n<Vielleicht wissen die kologen, wie man ihm helfen kann?>', '', '', '', '', '', 'Bringt das Entchen in der Blase zurck ins kologenlager.', 47187),
