(70893, 'deDE', 'Gemeinschaftliches Festmahl', 'Fhrt $1oa Aufgaben beim gemeinschaftlichen Festmahl aus', 'Unser gemeinschaftliches Festmahl findet GENAU JETZT statt! Dabei trgt jeder etwas bei und wir machen die beste Suppe, die wir kochen knnen.\n\nIhr knntet mitmachen!', '', '', '', '', '', '', 47187),
