(70883, 'deDE', 'Grner Daumen', 'Sucht Gryrmpech in den Grten der Einigkeit auf.', 'Gre, $gSterblicher:Sterbliche;, ich habe etwas von unserem Chefgrtner Gryrmpech gehrt. Und zwar, dass die Grten im Chaos versinken, aber ich wei nicht, ob das nicht normal ist.\n\nEr hat mir versichert, dass er alles im Griff hat, also eigentlich hat er gesagt, er htte alles \"auf der Schaufel\", deswegen bin ich mir nicht sicher, was er genau meint, aber ich glaube, er wird es Euch verraten. Sucht ihn bitte auf, dann kann er Euch ber die Situation aufklren.', '', '', '', '', '', '', 47187),
(70882, 'deDE', 'Ruhmvorrte', '', '', '', '', '', '', '', '', 47187),
