(70879, 'deDE', 'Bericht ber die Rebellen', 'Trefft Hauptmann Drine im obersten Stockwerk des Sitzes der Aspekte.', 'Ich bin beeindruckt, was wir heute geschafft haben. Findet Ihr nicht auch, $n?\n\nWir haben die niedertrchtigen Machenschaften dieser mit den Primalisten verbndeten Rebellen erfolgreich beendet. Zumindest fr den Moment. Wir werden in Zukunft die Augen nach Dissidenten offen halten mssen.\n\nKehrt zu Hauptmann Drine zurck, sobald Ihr knnt. Sie wird unseren Bericht hren wollen.', '', '', '', '', '', '', 47187),
(70878, 'deDE', 'Feuerring', 'Beschtzt Maldra Flammenzunge, whrend sie das Portal der Primalisten schliet.', 'Die Primalisten haben in den tiefsten Abzweigungen der Glutschieferhhle ein feuriges Portal errichtet, aus dem sie Elementare entfesseln.\n\nIch kann es schlieen, aber meine Handlungen werden zweifellos den Zorn von dem wecken, was auch immer auf der anderen Seite wartet. Einschlielich dem Wiedergnger Magmaticus, dem die Primalisten helfen.\n\nIch werde Euren Schutz brauchen, wenn wir sie aufhalten wollen.', '', 'Dieser wtende Wiedergnger der Flammen muss eliminiert werden, bevor die Primalisten ihn auf die Dracheninseln loslassen knnen.', 'Magmaticus', '', '', '', 47187),
(70877, 'deDE', 'Quaken in der Zeit', 'Bringt das Entchen in der Blase zurck ins kologenlager.', '<Das Entchen ist verzweifelt und quakt leise vor sich hin, whrend seine Augen ngstlich umherblicken.>\n\n<Vielleicht wissen die kologen, wie man ihm helfen kann?>', '', '', '', '', '', 'Bringt das Entchen in der Blase zurck ins kologenlager.', 47187),
(70876, 'deDE', 'Fragmentierte Fokusse', 'Zerstrt $1oa Primalistenfokusse in der Glutschieferhhle.', 'Wenn Maldra die Wahrheit sagt, stellen die Rebellen die Runensteine in der Glutschieferhhle her.\n\nAuerdem wissen wir, von der Natur dieser Gerte ausgehend, dass Fokusse der Primalisten involviert sind.\n\nZerstrt die Fokusse. Ihr werdet sie erkennen, wenn Ihr sie seht.\n\nDie Rebellen drfen nicht noch mehr Waffen der Zerstrung herstellen.', '', '', '', '', '', '', 47187),
(70875, 'deDE', 'Schlimmer geht\'s nicht', 'Ttet $1oa Rebellen und $2oa Elementare in der Glutschieferhhle.', 'Die Rebellen in der Glutschieferhhle sind unerschtterlich loyal gegenber den Primalisten und stellen daher die grte Gefahr fr Valdrakken dar.\n\nEliminiert sie und alle Elementare, die sie entfesselt haben.', '', '', '', '', '', '', 47187),
(70874, 'deDE', 'Eine Feuerwand durchbrechen', 'Erhaltet Maldras elementaren Segen.', 'Die Rebellen in der Hhle wurden mit einem elementaren Segen erfllt, der es ihnen erlaubt, die Flammenwand sicher zu durchschreiten. Ich kann Euch denselben Segen gewhren.\n\nKeine Sorge, ich habe diesen Vorgang oft genug beobachtet. Ich sollte ihn problemlos imitieren knnen.', '', '', '', '', '', '', 47187),
(70873, 'deDE', 'Wasserfllen auf der Spur', 'Sammelt $1oa Wasserfallpartikel.', 'Die wahre Bedrohung liegt in der Glutschieferhhle. Dort werden diese Runensteine gemeielt und mit Urfeuer erfllt.\n\nIhr habt zweifellos die lodernde Flammenwand entdeckt, die den Eingang versperrt. Ich kann sie nicht entzaubern, aber vielleicht kann ich auf andere Weise helfen. Ich glaube, dass wir mit der richtigen Anwendung von Wasserfall unversehrt hindurchgehen knnen.\n\nSammelt Wasserpartikel von den Elementaren in der Nhe.', '', '', '', '', '', '', 47187),
(70871, 'deDE', 'Fischernetz von Iskaara', 'Bringt Tavio Materialien und lasst sie ein Fischernetz von Iskaara herstellen.', 'Ich sehe, Ihr versteht Euch gut mit den Dorfbewohnern.\n\nIhr wollt mehr darber lernen, wie wir angeln, sagt Ihr? Gut, zuerst einmal angelt niemand mit bloen Hnden. Ich kann Euch ein gutes, starkes Netz herstellen, das eines Tuskarrs der Iskaara wrdig ist.', '', '', '', '', '', '', 47187),
(70867, 'deDE', 'Bannschuppenfeste', '', '', '', '', '', '', '', '', 47187),
(70859, 'deDE', 'Was der Wchter wei', 'Beschafft den flsternden Splitter von Edavix, dem verderbten Wchter.', 'Ich begre Eure Hilfe, $C. Ich war die Magierin der Kirin Tor, die dieses Artefakt, Valthrux, und die Plne der Splitterflammen als Erste gefunden hat.\n\nDie Wiederbeschaffung und das Studium dieses angeblich empfindungsfhigen und mchtigen Artefakts ist von oberster Dringlichkeit. Und ich schwre, ich werde diejenige sein, die es tut.\n\nDie Splitterflammen mssen raten, wo es sein knnte, aber ich habe mit Magie einen Weg fr uns gefunden.\n\nEs gibt einen verderbten Wchter in der Nhe, der einen magischen Splitter besitzt, der mit Valthrux verbunden ist. Ich kann ihn nutzen, um den Rest des Artefakts zu finden.', '', 'Ein Wchter, verderbt durch die Macht von Valthrux. Er hlt den Schlssel zum Fundort des Artefakts.', 'Edavix', '', '', '', 47187),
(70858, 'deDE', 'Zurck ins Getmmel!', 'Wendet das eiskalte Gegengift auf Alia Segelstrahl an.', 'Na gut, das Gegengift ist fertig. Ich werde Alia sttzen, Ihr gebt den Inhalt der Phiole in ihren Mund.\n\nHoffentlich berlebt sie... Wir brauchen ihre Magie, um dieses Artefakt zu finden.', '', '', '', '', '', 'Sprecht mit Alia Segelstrahl.', 47187),
(70856, 'deDE', 'Ttet sie mit Feuer', 'Vernichtet $1oa infizierte Leichen mit der Flammenwerferfackel.', 'Diese ekligen Spinnen legen ihre Eier in Leichen ab.\n\nUnd manchmal in Lebendigen.\n\nWir haben einige Leichen der Splitterflammen gesehen, die ihnen zum Opfer fielen.\n\nWenn wir hier berleben und die Splitterflammen besiegen wollen, drfen wir nicht zulassen, dass die Eier schlpfen.\n\nNehmt diese Fackel. Sie ist mit der Macht von Luft und Feuer verzaubert. Richtet sie auf alles, was Ihr verbrennen wollt, und sie erledigt den Rest.\n\nDie Tuskarr machen keine halben Sachen mit Spinnen. Ich bin immer vorbereitet.', '', '', '', '', '', '', 47187),
(70854, 'deDE', 'Wie ist es gelaufen?', 'Kehrt zu Jyhanna in der Welpenkrippe in Valdrakken zurck.', 'Das habt Ihr toll gemacht, $n. Lubbins geht es schon viel besser und er ist bei bester Laune.\n\nJyhanna wird das wissen wollen, also geht schon zurck und berbringt ihr die tollen Neuigkeiten!', '', '', '', '', '', '', 47187),
(70853, 'deDE', 'Ein Freund fr Lubbins', 'Fangt eine Scheulibelle im Wildreservat an der Kste des Erwachens.', 'Wie wir bereits besprochen haben, braucht Lubbins zwei Dinge: einen Kumpel und einen Kampf.\n\nIch glaube, dass wir ihm beides auf einen Schlag besorgen knnen.\n\nDiese Gegend ist ein erstklassiges Paarungsgebiet fr Scheulibellen. Ihr solltet hier im Gebiet viele davon finden knnen, wenn Ihr Euch ein wenig umschaut.\n\nAber denkt dran, Ihr msst sie erst schwchen, bevor Ihr sie mit Eurer Falle fangen knnt.\n\nKommt zurck, wenn Ihr eine habt. Nach dem Kampf wird sie vermutlich etwas angeschlagen sein, aber ich habe ein paar Kampfbungssteine, die ihr direkt wieder auf die Beine helfen werden!', '', '', '', '', '', '', 47187),
(70851, 'deDE', 'Extreme Wildheit im Blut', 'Erfahrt, was Lubbins von Haniko braucht.', 'Es gibt vieles, was Ihr wissen msst. Lasst uns reden, dann knnen wir entscheiden, was das Beste fr Lubbins ist.', '', '', '', '', '', '', 47187),
(70850, 'deDE', 'Maldra steht das Wasser bis zum Hals', 'Rettet Maldra vor Orian Dunkelwasser.', 'Ausgezeichnete Arbeit. Whrend Ihr fr Unruhe gesorgt habt, habe ich das Lager ausgekundschaftet. Ich htte nicht erwartet, meine alte Freundin Maldra Flammenzunge hier zu finden.\n\nIch wusste, dass sie vermisst wird, aber den Gerchten zufolge hie es, sie htte sich den Rebellen angeschlossen. Soweit ich sehe, ist sie aber ihre Gefangene!\n\nWir knnen sie hier nicht zurcklassen. Rettet sie vor der Drachenbrut, die sie gefangen hlt!', '', 'Dieser Rebellenanfhrer hat seine Gefangene, Maldra Flammenzunge, mit Ketten aus Urwasser gefesselt.', 'Orian Dunkelwasser', '', '', '', 47187),
(70849, 'deDE', 'Das schreit nach einem Spezialisten', 'Sprecht mit Haniko im Wildreservat an der Kste des Erwachens.', 'Lubbins geht es schon viel besser, aber ich glaube, er braucht noch mehr Hilfe.\n\nVor einer Weile habe ich eine super kluge Forscherin der Drachenschuppenexpedition namens Haniko getroffen, die stndig mit Protodrachen arbeitet. Sie ist auch eine Kampfhaustiertrainerin. Ich wette, sie kann Lubbins besser helfen!\n\nich glaube, sie wollte zur Kste des Erwachens. Wenn Ihr dort hingeht, werdet Ihr sie sicher finden.\n\nIch bin so froh, dass ich Euch helfen konnte!\n\n<Sie winkt frhlich.>\n\nLebt wohl! Viel Glck, Lubbins!', '', '', '', '', '', '', 47187),
(70848, 'deDE', 'Vergessenes Drachenwappen', 'Bringt den Gegenstand zu Exadria.', '<Exadria knnte das haben wollen.>', '', '', '', '', '', '', 47187),
(70847, 'deDE', 'Uralter Obsidiananhnger', 'Bringt den Gegenstand zu Krallenpirscherin Kavia.', '<Krallenpirscherin Kavia knnte das haben wollen.>', '', '', '', '', '', '', 47187),
(70845, 'deDE', 'In Tyrs Fustapfen', 'Findet die erste Herausforderung von Tyr im Azurblauen Gebirge.', 'Hter Tyr hat alle Eventualitten bedacht. Er vermutete, dass die Handwerker des Reiches eines Tages ermchtigt werden mssen, und so erschuf er die Innovationsmaschine. Sie verfgt ber die Fhigkeit, ein einzigartiges Handwerksmaterial herzustellen, das einem Gegenstand Wissen verleiht, das jenseits der Fhigkeiten des sterblichen Verstands liegt.\n\nUm sicherzugehen, dass seine Maschine nicht in die falschen Hnde gert, erschuf er mich, um zu berwachen, wer ihre Macht sucht. Nur, wer ihr wrdig ist, wird das volle Potenzial der Maschine erwecken knnen.\n\nSeid Ihr der Herausforderung gewachsen?', '', '', '', '', '', 'Findet die erste Herausforderung von Tyr im Azurblauen Gebirge.', 47187),
(70843, 'deDE', 'Runensteine ruinieren', 'Zerstrt die Lager mit flammenden Runensteinen.', '<Dieser Runenstein ist dem anderen, den die Rebellen in Valdrakken platzieren wollten, erstaunlich hnlich.\n\nDieser Stein ist noch nicht fertig, aber Ihr entdeckt ganze Lager von vollendeten Runensteinen in einiger Entfernung.\n\nWenn Ihr diese Lager zerstrt, knnen die Rebellen die Runensteine nicht zum Einsatz bringen.>', '', '', '', '', '', '', 47187),
(70842, 'deDE', 'Sprengorte', 'Sammelt Karten des Nebligen Tals.', 'Ich bin sicher, dass die Rebellen ihre Plne fr zuknftige Angriffe irgendwo dokumentieren. Wir mssen herausfinden, was sie vorhaben, bevor es zu spt ist.\n\nDurchsucht ihr Lager nach markierten Karten wie der, die wir in Valdrakken gefunden haben.', '', '', '', '', '', '', 47187),
