(70838, 'deDE', 'Rebellensache', 'Ttet $1oa Rebellen und Primalisten.', 'Der Sammelort der Rebellen... genau der Ort, den wir gesucht haben. Wie gut, dass der Leichtsinn ihres Saboteurs uns hierhergefhrt hat.\n\nIch kann nicht fassen, dass meine Brder sich dazu herabgelassen haben, mit den Primalisten gemeinsame Sache zu machen. Das knnen wir so nicht stehen lassen. Schaltet die Rebellen und ihre Primalistenfreunde aus, bevor sie weiteren Schaden anrichten knnen.', '', '', '', '', '', '', 47187),
(70837, 'deDE', 'Verfolgung der Spur', 'Trefft Ermittler Erima beim Nebligen Tal.', '<Ermittler Erima betrachtet die Karte.>\n\nEs ist klar, was das X ber dem Sitz der Aspekte bedeutet.\n\nAber es ist auch ein Kreis um das Neblige Tal herum gezeichnet. Vielleicht ist das das nchste Ziel der Rebellen? Oder eine Operationsbasis.\n\nEs gibt nur einen Weg, es herauszufinden. Trefft mich im Tal.', '', '', '', '', '', '', 47187),
