(70781, 'deDE', 'Aus heiterem Himmel', 'Findet Harleen Hohnzirper an den Blaufederklippen.', 'Habt Ihr das gesehen?!\n\nDiese geflgelte Kreatur fiel gerade vom Himmel! Ich wei nicht, was fr ein Geschpf das ist, aber es ist sicher nicht auf den Inseln heimisch.\n\nWartet... Ich erinnere mich an eine schlagkrftige kleine Goblinfrau, die an den Blaufederklippen ber uns nach dem Weg gefragt hat. Glaubt Ihr, sie wei irgendetwas darber?', '', '', '', '', '', '', 47187),
(70780, 'deDE', 'Banner von Ohn\'ahra', '', '', '', '', '', '', '', '', 47187),
(70779, 'deDE', 'Tarjins Geschichten', 'Sammelt $1oa beeindruckende Drachenschdel von mchtigen Drachen und Protodrachen der Dracheninseln.', '<Tarjin blickt weiterhin auf die Insel in der Ferne, whrend er mit Euch spricht.>\n\nHaltet Ihr Euch der unglaublichen Legenden und Geschichten der Djaradin fr wrdig?\n\nIhr seid ja kaum so gro wie eine unserer Waffen. Pfft.\n\nIch bezweifle, dass Ihr den Mut habt, das Erbe meines Volkes anzutreten.\n\nberzeugt mich vom Gegenteil, wenn Ihr knnt. Sucht nach den Drachen, den einzigen wrdigen Rivalen auf diesen Inseln.\n\nBringt mir Trophen Eures Sieges ber die Strksten von ihnen.', '', '', '', '', '', '', 47187),
(70763, 'deDE', 'Weltenschnitzer A\'tir', '', '', '', '', '', '', '', '', 47187),
(70754, 'deDE', 'Die Feuerprimalisten lschen', 'Bringt den Urkern zu Rethelshi.', 'Rethelshi in Valdrakken wird dankbar sein, dies zur Erforschung der Primalisten in die Hnde zu bekommen.', '', '', '', '', '', '', 47187),
(70753, 'deDE', 'Die Luftprimalisten verwehen', 'Bringt den Urkern zu Rethelshi.', 'Rethelshi in Valdrakken wird dankbar sein, dies zur Erforschung der Primalisten in die Hnde zu bekommen.', '', '', '', '', '', '', 47187),
