(70751, 'deDE', 'Terillod der Andchtige', '', '', '', '', '', '', '', '', 47187),
(70750, 'deDE', 'Untersttzt das Abkommen', 'Fhrt Eure Bemhungen fort, dem Valdrakkenabkommen und seinen Verbndeten auf den ganzen Dracheninseln zu helfen.', 'Ihr da! Ja, ich spreche mit Euch. Oder seht Ihr noch jemand anderen hier?\n\n<Therazal wirft einen kurzen Blick auf einige Passanten.>\n\nIgnoriert sie. Sie sind nicht Teil dieses Auftrags. Von Euch habe ich gehrt und mit Euch wnsche ich zu sprechen!\n\nDas Valdrakkenabkommen hat mich damit beauftragt, diejenigen ausfindig zu machen, die sich auf den Inseln einen Namen gemacht haben und die danach streben, dass unsere Verbndeten und deren Sicherheit weiterhin oberste Prioritt bleiben.\n\nTut, was Ihr am besten knnt, $gKamerad:Kameradin;. Ihr sollt grozgig belohnt werden.', '', '', '', '', '', '', 47187),
(70748, 'deDE', 'Nur fr blaue Augen', 'Durchsucht die Azurarchive nach Malygos\' Notizen.', 'Kein Wunder, dass Eure Gefhrten noch nichts gefunden haben.\n\nDiese Bcher waren nur fr Augen der Blauen gedacht.\n\nDoch meine Gegenwart sollte ausreichen, damit wir die Geheimnisse einiger wichtiger Bnde entdecken knnen.', '', '', '', '', '', '', 47187),
(70747, 'deDE', 'Der azurblaue Zauberer', 'Sprecht mit Erzmagier Khadgar im Lager Antonidas.', 'Ich habe keine Zeit, um mich mit Zauberern herumzurgern.\n\nBitte kmmert Ihr Euch um diesen \"Erzmagier\", $p. Bringt in Erfahrung, was Ihr knnt, und nehmt Euch stets in Acht. Wir wissen noch nicht, ob wir es mit Freund oder Feind zu tun haben...\n\nUnseren Berichten zufolge liegt sdlich von hier ein groer Archivkomplex.\n\nDorthin mache ich mich auf.', '', '', '', '', '', '', 47187),
(70746, 'deDE', 'Blau ist nicht gleich blau', 'Begleitet Glutthal und Telash zum Lager Antonidas.', 'Hey, $p!\nGut, in diesen Gefilden ein bekanntes Gesicht zu sehen. Telash und ich haben uns gerade ber Berichte zu... Neuankmmlingen in der Umgebung unterhalten.\n\n<Glutthal senkt ihre Stimme.>\n\nBlaue Drachen.\n\nIn Anbetracht unserer... Vergangenheit mit den Blauen halten Telash und ich es fr notwendig, die Situation selbst unter die Lupe zu nehmen.\n\nBitte, schliet Euch uns an.', '', '', '', '', '', '', 47187),
(70745, 'deDE', 'Erzwungene Entspannung', 'Ttet die Elementarbeschwrerin.', 'Diese Primalisten, die Ihr gesehen habt, sehen meiner Ansicht nach nicht nach Anfhrern aus. Wer wrde sich schon vor einem kleinen Hund frchten?\n\nAlso, falls sie Vadne erwhnt haben, hrt sich das nach ihrer Anfhrerin an. Sie muss diejenige sein, die diese Elementare hereinbringt. Wir mssen die Beschwrerin ausschalten. Um solch einen rger verursachen zu knnen, muss sie sich ganz in der Nhe aufhalten. berprft die Hhle direkt unter uns. Ich wei, dass die weniger gewissenhaften Angestellten dort gerne eine lngere Pause einlegen.', '', 'Als Beschwrerin von Dampf und Flamme zieht diese Primalistin es vor, ihre Gegner bei lebendigem Leibe zu kochen.', 'Vadne Herzschinder', '', '', '', 47187),
(70744, 'deDE', 'Schaut Euch die Knochen an!', 'Macht $1oa Sauereien sauber.', '<Der Badmanager wrde es bestimmt zu schtzen wissen, wenn hier nicht berall Blut wre...>', '', '', '', '', '', '', 47187),
(70743, 'deDE', 'Armes Baby', 'Findet Elzaras Baby.', 'Ihr da, $PR! Seid Ihr halbwegs begabt?\n\nBehaltet Ihr Eure Prioritten im Auge?\n\nGut!\n\nMein armes Baby ist verschwunden. Rettet es, so schnell wie mglich. Es kommt in diesen schrecklichen Umstnden nicht alleine zurecht.', '', '', '', '', '', '', 47187),
(70742, 'deDE', 'Liegt in der Familie', 'Durchsucht das Obsidianobservatorium nach Hinweisen auf die Vergangenheit der Dracthyr.', 'Aus der Luft habe ich eines der Artefakte, die Edress am Eingang der Ruinen gefunden hatte, gesehen. Drinnen gibt es zweifelsohne noch mehr.\n\nSie sind irgendwie durch Magie geschtzt, aber ich muss nher herangehen, bevor ich sie untersuchen kann. Die Magie hier ist sehr alt.\n\nDas Gelnde scheint verlassen zu sein. Aber ich wrde nicht darauf vertrauen, dass das lange so bleibt, wenn wir erst einmal ttig werden. Haltet die Augen offen. Wir werden alles aufdecken, was wir knnen.', '', '', '', '', '', '', 47187),
(70741, 'deDE', 'Ein paar liebste Dinge', 'Sammelt $1oa verlorene Habseligkeiten.', '<So wie es aussieht, ist die Yougaklasse unterbrochen worden, und die Habseligkeiten der Studenten liegen berall verteilt.\n\nDiese Gegenstnde einzusammeln, wird dem Bad der Ruhigen Trume sicher helfen.>', '', '', '', '', '', '', 47187),
(70740, 'deDE', 'Dampfreinigung', 'Ttet $1oa Elementare im unteren Bad.', 'Xijan scheint zu glauben, dass die Elementarinvasion auf unser schnes Bad nur ein kleines Problem ist, aber diese Flut aus Flammen und Dampf muss sofort unter Kontrolle gebracht werden.\n\nWir hatten Musikgruppen engagiert, die im unteren Bad spielen sollten, aber die Elementare haben ihre Ausrstung zerstrt. Da wir in dieser Gegend noch nie ein solches Ausma an elementarer Zerstrung hatten, vermute ich, dass Primalisten dahinterstecken.\n\nFalls Ihr Euch ntzlich machen wollt, beseitigt die Elementare auf der Ostseite des unteren Bads. Dort planen wir die ersten Auftritte.', '', '', '', '', '', '', 47187),
(70739, 'deDE', 'Blutlinien, Sigkeiten und Teerai', 'Helft Jger Narman, einen traditionellen Segen fr seinen Heiratsantrag zu erhalten.', 'Ich habe mit Khanen gejagt, die schnellsten Bakar eingeholt und einen voll ausgewachsenen Brffelchbullen mit bloen Hnden niedergerungen. Als Jger habe ich nichts weiter zu beweisen.\n\nAls Partner hingegen habe ich noch viel zu lernen.\n\nWindweiser Dawa von Klan Ohn\'ir ist mein Herz und Glck. Ich mchte mich nur als seiner Liebe wrdig erweisen, doch ich wei nichts von Traditionen und Ritualen. Ich bentige die Weisheit der ltesten in Maruukai.', '', '', '', '', '', 'Sprecht mit Jger Narman auf der Anhhe der Shikaar in Maruukai.', 47187),
(70738, 'deDE', 'Die Yougaklasse', 'Findet die Lehrerin und $1oa Yougaschler.', 'Alles lief sehr gut, aber jetzt? Elementare sorgen fr einige... hm... kleine Herausforderungen.\n\nUnsere Gste genossen die Einrichtungen, als pltzlich all diese Elementare erschienen! Diese widerwrtigen Bestien haben alles gestrt. Vermutlich sogar die neue Yougalehrerin.\n\nOh ja, Youga sind neuartige Dehnungsbungen, bei denen Ihr gleichzeitig meditiert. Ich bin mir sicher, dass Lehrerin und Schler beide so entspannt sind, dass sie die Elementare nicht einmal bemerken.\n\nDennoch, es ist besser auf Nummer sicher zu gehen. Bitte, seht nach ihnen.', '', '', '', '', '', '', 47187),
(70732, 'deDE', 'bungskampf', 'Besiegt Gwosh im Haustierkampf.', 'Also gut! Nachdem Ihr den Stein auf Lubbins angewendet habt, sollten wir eine Proberunde veranstalten, um seine Fertigkeiten zu testen!\n\nEs gibt einen groen, alten Flunker namens Gwosh, der an der Kste nrdlich von hier lebt. Gwosh liebt das Kmpfen! Naja, eher das Spielen. Er kommt auch super mit anderen Haustieren aus!\n\nDas wird der perfekte Spa... ich meine Kampf... fr Lubbins.', '', '', '', '', '', '', 47187),
(70730, 'deDE', 'Geber der Shikaar', 'Helft dem Windweisen Dawa bei der Vorbereitung des perfekten Antrags.', 'Oh, $p.\n\nFhlt Ihr Euch wohl unter der Sonne? Fhlt Ihr Euch sicher in ihrer hellen Umarmung? Bedeutet jeder neue Tag Hoffnung fr die Zukunft und eine Chance, Euer Leben so zu leben, wie Ihr es Euch schon immer ertrumt habt?\n\nDann kennt Ihr die Liebe so wie ich.\n\nNarman vom Klan Shikaar ist meine Sonne. Er ist meine Wrme. Er ist mein Licht. Er ist meine Hoffnung.\n\nEin solcher Mann verdient einen Antrag, der seiner wrdig ist.\n\nWir mssen uns von den Ohn den Weg weisen lassen.', '', '', '', '', '', '', 47187),
(70723, 'deDE', 'Die Erdprimalisten zerschmettern', 'Bringt den Urkern zu Rethelshi.', 'Rethelshi in Valdrakken wird dankbar sein, dies zur Erforschung der Primalisten in die Hnde zu bekommen.', '', '', '', '', '', '', 47187),
(70722, 'deDE', 'Was Lubbins braucht', 'Sprecht mit Flicki in Iskaara.', 'Ich glaube, ich wei jetzt, was wir tun mssen, $n.\n\nAber lasst uns zuerst darber reden!\n\nIch habe sogar ein Geschenk fr Euch, wenn wir fertig sind. Toll, oder?', '', '', '', '', '', '', 47187),
(70721, 'deDE', 'So schn, ich fall in Ohn\'macht...', 'Helft dem Windweisen Dawa und Jger Narman bei ihren Antrgen.', 'Es gibt einen kleinen Teich beim Spiegel des Himmels, wo Narman und ich uns whrend meiner Initiandenausbildung zum ersten Mal begegnet sind.\n\nInitianden reisen an diesen Ort, um Ohn\'ahra nher zu sein und so den Wind zu spren. Zuerst sah ich ihn in der Spiegelung des Wassers, als meine Augen pltzlich durch eine Brise geffnet wurden. Es gibt auf den Ebenen keinen schneren Anblick.\n\nDer Teich bildet den perfekten Ort fr unseren Antrag.', '', '', '', '', '', '', 47187),
