(70708, 'deDE', 'Grotte', 'Trinkt etwas mit Kolgar.', 'Fhlt sich an, als wren es Jahre gewesen. Aber auch irgendwie nur nach Minuten.\n\nIch knnte jemanden zum Reden brauchen, wenn Ihr Zeit httet.\n\nWollt Ihr uns etwas zu trinken holen? Holt einfach, was Ihr wollt. Geht auf mich.', '', '', '', '', '', '', 47187),
(70706, 'deDE', 'Portal: Schattenzuflucht', 'Findet das inaktive Portal bei der Schattenzuflucht auf den Ebenen von Ohn\'ahra.', 'Unsere Expedition berichtet von einem inaktiven Stein bei den ppigen Hngen im Sdwesten. Es ist ein gutes Stck entfernt, aber es lohnt sich, jemanden mit Eurer Kenntnis fr die Untersuchung dort hinzuschicken.', '', '', '', '', '', '', 47187),
(70703, 'deDE', 'Das Vermchtnis von Tyrhold', 'Untersucht mit Koranos die Silberschuppe in Tyrhold.', 'Hter Tyr liebte seine Rtsel. In dem Geschenk, das er uns gegeben hat, liegt sicherlich eine tiefere Bedeutung. Da er diese Schuppe hchstwahrscheinlich in der ehemaligen Zitadelle geschmiedet hat, ist sie vielleicht der Schlssel, der uns dabei hilft, ihre Geheimnisse zu enthllen.\n\nGeht mit Koranos nach Tyrhold, $n. Ich bin mir sicher, dass er als vertrauenswrdiger Berater und Hter dieses Lands Einsicht in diese Angelegenheit erhalten wird.', '', '', '', '', '', 'Sprecht mit Koranos in Tyrhold.', 47187),
(70702, 'deDE', 'Fortgesetzte Portalerkundung', 'Trefft Thaelin Schwarzamboss im Auenposten der Rubinschuppen an der Kste des Erwachens.', '<Der laute, kreischende Ruf des kleinen Boten erregt Eure Aufmerksamkeit. Er drckt Euch eine Notiz in die Hand und rennt davon.\n\nAuf dem Zettel ist eine Nachricht von Thaelin Schwarzamboss, der Eure Hilfe bentigt.>', '', '', '', '', '', '', 47187),
(70701, 'deDE', 'Bakar trumen von verirrten Riesenwildschafen', 'Bringt die verirrten Riesenwildschafe zurck zum Klan Aylaag.', 'Einige Riesenwildschafe des Klans sind mal wieder von der Herde weggewandert.\n\nDer Grat um uns ist fr unsere Schfer zu gefhrlich, um nach ihnen zu suchen. Es wre ein groer Segen fr uns, wenn Ihr einen unserer Bakars nehmen und die Riesenwildschafe zurckbringen knntet. Unsere Schfer knnen Euch die richtige Richtung weisen.', '', '', '', '', '', '', 47187),
