(70697, 'deDE', 'Eine Expertenmeinung', 'Sprecht mit Flicki im Azurblauen Gebirge.', 'Lubbins Wunden sind verheilt, aber ich frchte, sein Selbstvertrauen hat stark gelitten. Ich glaube, es ist an der Zeit, andere um Hilfe zu bitten.\n\nWeit im Sdwesten in einer entlegenen Region des Azurblauen Gebirges gibt es eine Kampfhaustiertrainerin namens Flicki. Sie gehrt zu den weltbesten Experten in dieser Sache.\n\nStattet ihr bitte einen Besuch ab. Ich bin sicher sie kann Lubbins helfen!', '', '', '', '', '', '', 47187),
