(70647, 'deDE', 'Wo nur, wo knnte er blo sein?', 'Rettet Lubbins und bringt ihn zu Jyhanna bei der Krippe \"Kleinschuppe\" in Valdrakken zurck.', '$n, Ich bin so froh, Euch zu sehen! Ich bin ganz krank vor Sorge und knnte Eure Hilfe brauchen.\n\nIch habe vor Kurzem einen verlassenen Protodrachenwelpen gerettet und Lubbins getauft, weil er so liebenswert ist! Ich habe ihn hierhergebracht, um mich um ihn zu kmmern und vielleicht ein gutes Zuhause als Haustier fr ihn zu finden.\n\nAber jetzt ist er verschwunden und ich habe Angst, dass er sich verirrt hat oder gar verletzt ist. Ich muss mich um die anderen Kleinen hier kmmern, sonst wrde ich ihn ja selbst suchen gehen. Wrt Ihr wohl so gut, nach ihm zu suchen?', '', '', '', '', '', '', 47187),
