(70641, 'deDE', 'Ein augenffnender Schwur', 'Sprecht mit Mitgliedern des roten Drachenschwarms am Rubinlebensschrein.', 'Einen Moment noch, $p. Ich mchte mich persnlich bei Euch fr Eure Hilfe bei der Wiederherstellung des Schwursteins bedanken.\n\nIch wusste nichts von den Dracthyr, bevor Ihr auf der Verbotenen Insel erwacht seid. Es war nicht klar, was Eure Ankunft fr uns bedeutet. Ob Eure Art ein Segen fr die Verteidigung des Leben hier sein wrde... oder ein Fluch.\n\nIch mchte Euch ermutigen, mehr ber den Schwurstein herauszufinden. Sprecht mit Mitgliedern meines Schwarms hier beim Rubinlebensschrein. Vielleicht werdet Ihr Bekanntes in unseren Sagen und Geschichten erkennen.', '', '', '', '', '', '', 47187),
(70640, 'deDE', 'GESUCHT: Boss', 'Ttet Frigellus in der Nhe von Lager Antonidas.', '<Die Schrift der Seite leuchtet in einem sanften blauen Licht.>\n\nDer Elementar Frigellus, einst ein geliebtes Spielzeug von Malygos, litt unter der Vernachlssigung durch seinen Herrn.\n\nWhrend dieses einst glckliche Dorf immer weiter zerfiel, wurde das neckische und verspielte Wesen von den beln, die dieses Land plagen, entstellt und verdreht.\n\nBitte neutralisiert dieses Wesen.\n\nTeilt Euren Erfolg anschlieend dem Hter Cynegos mit.', '', '', 'Frigellus', '', '', '', 47187),
