(70633, 'deDE', 'Die Maschine auf Touren bringen', 'Benutzt die abgefllte Essenz, um die Innovationsmaschine mit Energie zu versorgen.', 'Ihr habt gute Arbeite geleistet und die erste Herausforderung bestanden, die Hter Tyr hinterlassen hat. Obwohl es nur der erste Schritt auf Eurer Reise ist, glaube ich daran, dass Ihr Euch gut schlagen werdet. Ihr habt Euch die Gelegenheit verdient, die Geheimnisse der Schmiede aufzudecken.\n\nGebt die abgefllte Essenz in die Innovationsmaschine, und wartet ab, was passiert.', '', '', '', '', '', '', 47187),
(70627, 'deDE', 'Was ist mit dem Winterpelzklan?', 'Trefft Sonova Schneeweh bei Therons Wacht.', 'Wir knnten einem anderen Klan beitreten... wenn wir wssten, dass es sicher ist.\n\nIch befrchte, dass die Primalisten auch andere Klans so wie unseren in Versuchung gebracht haben.\n\nLaut dieser \"Drachenschuppenexpedition\" haben sie eine Klauenfeste nahe des Winterpelzklans.\n\nVielleicht sind sie auch schon verdorben. Oder sie hren unsere Warnung an. So oder so, sie brauchen uns.\n\nIn Therons Wacht gibt es einen \"Furbolgexperten\", Sonova Schneeweh. Bitte sucht ihn auf und bringt in Erfahrung, was er wei.', '', '', '', '', '', '', 47187),
(70620, 'deDE', 'Wie Schuppen von den Augen', 'Sammelt $1oa Adamantschuppen fr Ralathor den Zerfurchten in Valdrakken.', 'Viele Leute fragen mich, wie ich so gut im Huten geworden bin. Denen kann ich nur sagen: Es kommt alles von den Schuppen!\n\nWollt Ihr mehr darber erfahren? Bringt mir Schuppen, dann zeige ich Euch, was ich meine.', '', '', '', '', '', '', 47187),
(70618, 'deDE', 'Der Ruf der Schmiede', 'Sammelt $1oa Sereviterz fr Sekita den Whler in Valdrakken.', 'Die Schmiede... sie ruft nach mir. Und sie bittet um Serevit. Ihr da! Bringt mir Serevit! Ja, Unmengen an Serevit! <Sekita lacht manisch.>', '', '', '', '', '', '', 47187),
(70617, 'deDE', 'Alles meins, meins, meins', 'Sammelt $1oa Drakoniumerz fr Sekita den Whler in Valdrakken.', 'Nichts ist so ntzlich wie Drakoniumerz. Man kann so viel damit machen! Es ist einfach das perfekte Erz, in jeder Hinsicht rein.\n\nBringt mir Drakonium. Ich muss es haben. Ihr seid doch $gBergarbeiter:Bergarbeiterin;, oder? Dann an die Arbeit!', '', '', '', '', '', '', 47187),
(70613, 'deDE', 'Gebt eine Runde Rinde aus', 'Sammelt $1oa Krmmrinde fr Agrikus in Valdrakken.', '$p, Ihr seid doch $gein fhiger Kruterkundiger:eine fhige Kruterkundige;, nicht wahr? Stndig kommen Alchemisten hnderingend an meine Tr... wenn ich eine Tr htte... und flehen mich um Krmmrinde an. Wir sind fast ausverkauft!\n\nHelft Ihr mir, noch welche zu sammeln? Ich frchte, wenn die Alchemisten ihre Trnke nicht brauen knnen, fangen sie an, mit meinem Besitz zu experimentieren.', '', '', '', '', '', '', 47187),
(70595, 'deDE', 'Schneiderei ist gefragt', 'Erfllt Schneidereiauftrge fr das Handwerkerkonsortium.', 'Ha, ha, hallo, $p! Die Handwerksauftrge kommen am laufenden Band!\n\nWenn Ihr Arbeit sucht, hat das Handwerkerkonsortium immer genug Auftrge zu erfllen!\n\nIhr knnt einen Blick auf unser schwarzes Brett werfen, oder, falls Ihr bereits ein eigenes Kundennetzwerk habt, persnliche oder Gildenbestellungen abarbeiten! Seid immer fleiig, fleiig, fleiig!', '', '', '', '', '', '', 47187),
