(70591, 'deDE', 'Ingenieursknste sind gefragt', 'Erfllt Ingenieurskunstauftrge fr das Handwerkerkonsortium.', 'Ha, ha, hallo, $p! Die Handwerksauftrge kommen am laufenden Band!\n\nWenn Ihr Arbeit sucht, hat das Handwerkerkonsortium immer genug Auftrge zu erfllen!\n\nIhr knnt einen Blick auf unser schwarzes Brett werfen, oder, falls Ihr bereits ein eigenes Kundennetzwerk habt, persnliche oder Gildenbestellungen abarbeiten! Seid immer fleiig, fleiig, fleiig!', '', '', '', '', '', '', 47187),
