(70586, 'deDE', 'Zu viele Kche', 'Stellt $1oa Wildstoffkochmtzen fr Fulafong in Valdrakken her.', 'Wenn ich eines in meinen Jahren als Schneiderin gelernt habe, $p, dann, dass zu viele Kche alles verderben.\n\nIn diesem Fall wollte ich gerade was trinken gehen, als im letzten Moment eine Bestellung fr einen ganzen Kleiderschrank voll Kochuniformen reinkam.\n\nWenn Ihr die Mtzen nhen knntet, wrde ich mich um alles andere kmmern.', '', '', '', '', '', '', 47187),
(70582, 'deDE', 'Alleine besser weben', 'Stellt $1oa Wildstoffballen fr Fulafong in Valdrakken her.', 'Wenn ich eines in meinen Jahren als Schneiderin gelernt habe, $p, dann, wie wichtig regelmige bung ist.\n\nbt Euch stets in Eurem Handwerk, auch wenn Ihr glaubt, Ihr habt bereits alles gemeistert. Ihr sollt in der Lage sein, auch ohne meine Aufsicht exzellente Stoffe zu weben.\n\nbt doch diese Woche ein wenig. Stellt ein paar Wildstoffballen der hchsten Qualitt her.', '', '', '', '', '', '', 47187),
(70571, 'deDE', 'Trommelwirbel!', 'Stellt $1oa Wildbalgtrommeln fr Balgformer Koruz in Valdrakken her.', 'Unsere Trommeln sind weit und breit bekannt. Die Zentauren haben sich diese Fhigkeiten ber Generationen erarbeitet. Das heit aber leider, dass unsere Trommeln derzeit Mangelware sind.\n\nWie ich sehe, knnt Ihr durchaus auch etwas. Mgt Ihr mir vielleicht helfen, einige Trommeln fr unsere Lager herzustellen?', '', '', '', '', '', '', 47187),
(70569, 'deDE', 'Ein Korb fr Trorb', 'Stellt $1oa Blumenkrbe des Kruterkundigen fr Balgformer Koruz in Valdrakken her.', 'Ich habe viele geschtzte Kunden, aber Trorb ist einer meiner Lieblinge. Zuletzt kam er zu mir, weil sein Kruterbeutel zerschlissen war.\n\nIch habe ihm angeboten, ihm eine Auswahl an Krben als Ersatz fr seinen Beutel anzufertigen.\n\nWrdet Ihr mich bei dieser Aufgabe untersttzen, $p? Trorb wrde Euch danken.', '', '', '', '', '', '', 47187),
(70567, 'deDE', 'Wenn man einem Bakar einen Knochen zuwirft', 'Stellt $1oa knochengefertigte Armbrste fr Balgformer Koruz in Valdrakken her.', 'Ich hatte so schne knochengefertigte Bogen, aber unsere Bakar haben sie sich geschnappt, bevor sie jemand nutzen konnte. Bakar kauen nun einmal gern auf Knochen herum, Bogen hin oder her. Jetzt sind sie ruiniert!\n\nKnnt Ihr mir dabei helfen, Ersatz anzufertigen?', '', '', '', '', '', '', 47187),
(70565, 'deDE', 'Besonderheit durch Sttigung', 'Stellt $1oa Anhnger der bevorstehenden Gefahren fr Tuluradormi in Valdrakken her.', 'Oh, $gJuwelier:Juwelierin;, gefllt Euch meine Halskette?\n\nNatrlich tut sie das. Aber ich kann sie nicht angemessen ausstellen, wenn sie nicht heraussticht.\n\nIch hab\'s! Warum stellt Ihr nicht einige einfache Anhnger her, mit denen wir den Markt fluten knnen. Wenn erst jeder Euren Schmuck trgt, wird der funkelnde Schliff meiner Halskette alle anderen berstrahlen!', '', '', '', '', '', '', 47187),
(70564, 'deDE', 'Brillant', 'Stellt $1oa Kopflupen aus gesplittertem Onyx fr Tuluradormi in Valdrakken her.', '$gJuwelier:Juwelierin;, eine Ausstellung steht an, aber ich befrchte, dass die Besucher die wahre Schnheit der einzelnen Schliffe ohne die richtigen Linsen nicht erkennen knnen.\n\nSie mssen nichts Besonderes sein. Stellt nur ein paar Kopflupen her, damit unsere Kunden gut sehen knnen.', '', '', '', '', '', '', 47187),
(70560, 'deDE', 'Das mchtigste Werkzeug: Gute Dokumentation', 'Stellt $1oa Kompendien des Kernforschers fr Talendara in Valdrakken her.', 'Mein Inschriftenlehrling, seid Ihr heute in der Stimmung, zu schreiben? Die Drachenschuppenexpedition hat unzhlige Notizen von ihren Abenteuern mitgebracht und uns gebeten, ihre Zettelwirtschaft zu einem ordentlichen Kompendium zusammenzufassen, in dem sie unterwegs nachschlagen knnen. Ach, aber meine Hand ist heute einfach nicht fr diese Aufgabe gemacht. Darf ich mich noch einmal an Euch wenden?', '', '', '', '', '', '', 47187),
(70559, 'deDE', 'Federleichte Hilfe', 'Stellt $1oa befestigte Federkiele des Schreibers fr Talendara in Valdrakken her.', 'Mein Inschriftenlehrling, ich freue mich, Euch zu sehen.\n\nHeute Morgen habe ich einige Novizen gebeten, sich an der Inschriftenkunde zu versuchen. Aber sie haben alle mit viel zu viel Druck geschrieben und die Spitzen ihrer Federkiele abgebrochen!\n\nIch frage nur ungern, aber knntet Ihr einige Federkiele herstellen, um das Lager zu fllen?', '', '', '', '', '', '', 47187),
(70557, 'deDE', 'Fernrohre fern', 'Stellt $1oa bronzene Feuerflieger fr Klickiklack Schmetterschlag in Valdrakken her.', 'Groartige Gerte, Fnkchen, heute habe ich was groes fr Euch!\n\nScheinbar ist unter den Jgern ein Feuerwerkstrend ausgebrochen. Sie versuchen, die Enten damit in die Luft aufzuscheuchen. Ich wette, die Enten sind zu klug fr sowas, aber das hindert uns ja nicht daran, Profit aus der Sache zu schlagen! Seid Ihr dabei?', '', '', '', '', '', '', 47187),
(70550, 'deDE', 'Willkommen im Konvent', 'Sprecht mit Xavin im Kobaltkonvent, um zu sehen, welche Mglichkeiten die Umgebung zu bieten hat.', 'Wir knnten Eure Hilfe brauchen.\n\nDie Splitterflammen haben die Kontrolle ber den Groteil des Kobaltkonvents erlangt.\n\nBitte, helft uns im Kampf gegen sie. Wir sind zwar nicht viele, aber auch wir knnen das eine oder andere tun, um Euch zu helfen.', '', '', '', '', '', '', 47187),
(70542, 'deDE', 'Rennen des Azurblauen Gebirges', '', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(70541, 'deDE', 'Jagdtaktiken: Begleiter', 'Whlt, ob Ihr auf der groen Jagd an der Seite eines Bakars oder Ohunas kmpfen mchtet.', 'Euer Ruhm bei den Maruuk wchst. Ihr knnt nun an der Seite eines zhen Bakars oder flinken Ohunas kmpfen.', '', '', '', '', '', '', 47187),
(70540, 'deDE', 'Der beste Freund des Ingenieurs', 'Stellt $1oa Mehrzweckwerkzeuge fr Klickiklack Schmetterschlag in Valdrakken her.', 'He, Fnkchen, Habt Ihr mein...\n\nhm... gebt mir doch das...\n\nDas ist es! Ich glaube, es ist an der Zeit, dass wir ein paar mehr Werkzeuge in diesem Laden haben, Ihr wisst, was ich sagen will?', '', '', '', '', '', '', 47187),
(70533, 'deDE', 'Trunk, neu gelt', 'Stellt $1oa Schauderfeuerle fr Conflago in Valdrakken her.', 'Wusstet Ihr, dass Schauderfeuerl ein ausgezeichnetes Reagenz ist, um Trnke zu veredeln? Ich schon. Und jetzt habe ich keines mehr. Ich kann nicht ohne einen guten Vorrat an len arbeiten. Bitte, $p, helft mir, die Vorrte in meinem Labor aufzustocken.', '', '', '', '', '', '', 47187),
(70532, 'deDE', 'Hilfe fr die Plnderer', 'Stellt $1oa erfrischende Heiltrnke fr Conflago in Valdrakken her.', 'Oh, $p, ich bin so froh, Euch zu sehen. Mehrere Champions wurden beim letzten Angriff auf die Primalisten verletzt. Wir brauchen dringend Heiltrnke. $gEin Abenteurer:Eine Abenteurerin; wie Ihr hat sicherlich einige griffbereit. Wir brauchen eine ganze Menge.', '', '', '', '', '', '', 47187),
(70526, 'deDE', 'Rennen der Ebenen von Ohn\'ahra', '', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(70501, 'deDE', 'Jagdschein', 'Schliet die bungsaufgabe fr die Groe Jagd ab.', 'Ah, seid Ihr endlich bereit, Euch als $gJger:Jgerin; zu beweisen? Denkt daran, dass es nicht einfach darum geht, umherzurennen und alles zu erlegen, was sich bewegt. Die Shikaar jagen bewusst. Wir jagen, um den Klan zu nhren und einzukleiden, um unsere Strke gegen mchtige Feinde zu beweisen und um die Natur im Gleichgewicht zu halten.\n\nWir jagen das Land nicht leer, wir sen whrenddessen die Saat fr knftige Groe Jagden. Zeigt uns, dass Ihr imstande seid, diese Anweisungen zu befolgen, dann drft Ihr $geiner:eine; von uns werden.\n\nIch habe jedoch wenig Vertrauen, dass Eure Begleitung dort Erfolg hat.', '', '', '', '', '', '', 47187),
(70450, 'deDE', 'Otterabwehr', 'Vertreibt die lstigen Ottuks.', 'Hallo, $gmein Freund:meine Liebe;. Diese garstigen Ottuks hier klauen mir stndig meinen Fang!\n\nIch persnlich wrde sie einfach in die Luft jagen, aber unsere Tuskarrfreunde sind von der Idee wenig angetan. Ich habe deshalb diese Ottukabwehrapparatur MK-H4I entwickelt, aber... leider bin ich kein besonders guter Schwimmer.\n\nIhr scheint mir eher frs khle Nass gemacht zu sein. Also seid doch so gut, aktiviert das Gert und schwimmt ein paar Runden, um sie zu vertreiben, hm?', '', '', '', '', '', '', 47187),
(70446, 'deDE', 'Eine persnliche Geschichte', 'Trefft Glutthal am Obsidianobservatorium.', 'Beim Erforschen der Archive habe ich Verweise gefunden, die darauf hindeuten, dass es sich beim Obsidianobservatorium um einen Ort von persnlicher Bedeutung fr den Erdwchter handelt. Ich kann nur vermuten, welches Wissen sich dort ber die Geschichte unseres Schwarms verbirgt.\n\nIm Anbetracht von Glutthals Interesse an diesem Thema habe ich sie von meiner Entdeckung in Kenntnis gesetzt. Ich bete nur, dass das kein Fehler war.\n\nSie ist voraus, um etwas Aufklrung zu betreiben. Bitte behaltet sie im Auge. Sie ist eine kompetente Soldatin, aber dieses Thema ist ziemlich... bengstigend. Wer wei, worauf Ihr stot.', '', '', '', '', '', '', 47187),
(70444, 'deDE', 'Die Felder der Wildheit', 'Trefft Gurgthock an den Feldern der Wildheit.', 'Auf die mutigsten Shikaar!\n\nVersammelt Eure besten Kmpfer und geht zu den Feldern der Wildheit. Vielleicht werdet Ihr zum mchtigsten von allen gekrnt!\n\nBeweist Eure Kraft. Zeigt uns Eure Kampfesknste!\n\nEs gelten die Teilnahmebedingungen.', '', '', '', '', '', '', 47187),
(70439, 'deDE', 'Wildes Arkana', '', '', '', '', '', '', '', '', 47187),
(70438, 'deDE', 'Fliegende Fische', 'Sammelt Fische, um das Angelloch zu bestcken, und besteigt Euren Drachen, um sie von oben abzuwerfen.', 'Die Fische knnten etwas besser beien, meint Ihr nicht?\n\nDa kommt mir eine Idee. Der Legende nach waren diese Seen und Flsse nicht immer voller Fische. Angeblich wurden diese Wasserlcher mit Fischen bestckt, als die Drachen darber segelten und sie fallen lieen! Knnt Ihr das glauben?\n\nVielleicht knntet Ihr es mit Eurem Drachen mal versuchen?', '', '', '', '', '', '', 47187),
(70437, 'deDE', 'Auf nach Tyrhold', 'Trefft Alexstrasza beim Sitz der Aspekte.', 'Jahrhunderte sind vergangen, seit die Schwrme zuletzt Tyrhold besucht haben.\n\nDennoch mssen wir dorthinreisen und herausfinden, ob der Mutterschwurstein noch genutzt werden kann.\n\nSprecht am Sitz der Aspekte mit mir. Wir mssen in Erfahrung bringen, welche Gefahren uns bei Tyrs ehemaliger Festung erwarten.', '', '', '', '', '', 'Trefft Euch mit Alexstrasza bei Tyrhold.', 47187),
