(70414, 'deDE', 'Wankender Boden', 'Platziert die zerschmetternden Totems, um die gefangenen Hhlensteine zu befreien.', 'Im Namen von Khaz\'goroth, was geht hier vor?\n\nDieses Magma hat wirklich seinen eigenen Willen und verzehrt die elementaren Hhlensteine von unten. Hier ist nicht blo Meister Zufall am Werke... Ich werde dahinterkommen!\n\nPlatziert diese zerschmetternden Totems neben jedem der gefangenen Elementare, um sie zu befreien!', '', '', '', '', '', '', 47187),
(70410, 'deDE', 'Drachenreiterrennen - Blitzfrost-berflug', '', '', '', '', '', '', '', '', 47187),
(70390, 'deDE', '(DNT) Chloe\'s Onboarding Kill Quest', 'Kill %1oa CREATURE NAME in POI NAME.', 'Bitte ttet diese Kreaturen, die noch nicht geschaffen wurden, und helft mir beim Lernen!', '', '', '', '', '', '', 47187),
(70377, 'deDE', 'Heruntergekommene Mode', 'Findet den Besitzer der Sonnenbrille.', '<Eine abscheuliche Sonnenbrille tropft nur so von Schleim, aber sie sieht sehr teuer aus.\n\nJemand vermisst sie sicherlich. Dieser Stil ist gerade hei begehrt.>', '', '', '', '', '', '', 47187),
(70376, 'deDE', 'Zweite Herausforderung von Tyr: Macht', 'Schliet die zweite Herausforderung von Tyr auf den Ebenen von Ohn\'ahra ab.', '<Als Ihr Euch nhert, strahlt die Inschrift auf der Statue ein sanftes Leuchten aus.>\n\n\"Fhrt die Macht des Hters und zeigt die unerschrockene Entschlossenheit der Standhaften.\"', '', '', '', '', '', '', 47187),
(70374, 'deDE', 'Himia die Gesegnete', 'Besiegt die Elemente.', 'Die Elemente beanspruchen dieses Land fr sich und begren Euer Eindringen nicht.\n\nOh, Elemente, habt Ihr unseren Beschtzer vergessen...? Luft! Unsichtbar, doch allgegenwrtig und lebenswichtig fr jegliche Existenz. So leicht vergessen, wie man sie einatmet. Nachdem Ihr mir gegenbergestanden habt, werdet Ihr es nie wieder vergessen.', '', '', '', '', '', 'Kehrt zur ltesten Nazuun in Teerakai zurck.', 47187),
(70373, 'deDE', 'Todesschwingengurlugull!', 'Steigt in den Springer ein und besiegt Todesschwingengurlugull!', 'Todesschwingengurlugull! Todesschwingengurlugull! Todesschwingengurlugull tgrbrrl!!\n\nBrrruuummm blrglg!!\n\n<Ihr braucht keinen Dolmetscher, um zu verstehen, dass ihr die Murlocversion von Todesschwinge zur Strecke bringen sollt. Bevor Ihr zustimmen oder ablehnen knnt, hrt Ihr schon das Brllen eines Maschinenmotors auf Euch zukommen!>', '', 'Todesschwingengurlugull! Todesschwingengurlugull! Todesschwingengurlugull tgrbrrl!!', 'Todesschwingengurlugull', '', '', '', 47187),
(70371, 'deDE', 'Todesschwingengurlugull!', 'Steigt in den Springer ein und besiegt Todesschwingengurlugull!', 'Todesschwingengurlugull! Todesschwingengurlugull! Todesschwingengurlugull tgrbrrl!!\n\nBrrruuummm blrglg!!\n\n<Ihr braucht keinen Dolmetscher, um zu verstehen, dass ihr die Murlocversion von Todesschwinge zur Strecke bringen sollt. Bevor Ihr zustimmen oder ablehnen knnt, hrt Ihr schon das Brllen eines Maschinenmotors auf Euch zukommen!>', '', 'Todesschwingengurlugull! Todesschwingengurlugull! Todesschwingengurlugull tgrbrrl!!', 'Todesschwingengurlugull', '', '', '', 47187),
(70370, 'deDE', 'Berufsexamen', 'Macht Haephestas Persnlichkeitstest, um herauszufinden, welcher Beruf am besten zu Euch passt.', 'Hallo! Httet Ihr Interesse daran, mit dem Handwerkerkonsortium zusammenzuarbeiten, um reichlich Gewinn zu machen und Kunden in ganz Azeroth mit wertvollen Gtern und Dienstleistungen zu versorgen?\n\nAusgezeichnet! Welche beiden Berufe habt Ihr gelernt?\n\n... Hmm? Ich habt nur einen Beruf? Was fr eine verpasste Gelegenheit!\n\n<Haephesta denkt kurz nach.>\n\nIch wei! Ich stelle Euch eine Reihe von Fragen ber Eure Persnlichkeit und schon finden wir heraus, welcher weitere Beruf am besten zu Eurem bisherigen Beruf passt! Was sagt Ihr?', '', '', '', '', '', '', 47187),
(70368, 'deDE', 'Berufsexamen', 'Macht Haephestas Persnlichkeitstest, um herauszufinden, welcher Beruf am besten zu Euch passt.', 'Hallo! Httet Ihr Interesse daran, mit dem Handwerkerkonsortium zusammenzuarbeiten, um reichlich Gewinn zu machen und Kunden in ganz Azeroth mit wertvollen Gtern und Dienstleistungen zu versorgen?\n\n... Hmm? Ihr habt keinen Beruf? Was fr eine verpasste Gelegenheit!\n\n<Haephesta denkt kurz nach.>\n\nIch wei! Ich stelle Euch eine Reihe von Fragen ber Eure Persnlichkeit und schon finden wir heraus, welcher Beruf am besten zu Euch passt! Was sagt Ihr?', '', '', '', '', '', '', 47187),
