(70352, 'deDE', 'Wie Schuppen von den Augen', 'Ttet Flunker und territoriale Protodrachen mit Toluiqi.', 'Ihr da, Fremdling! Ihr habt schon mal Protodrachen gettet, nicht wahr?\n\nDann mchte ich meinen, dass wir mit Eurer Erfahrung und meinen Jagdknsten zusammen eine ganze Reihe von ihnen zur Strecke bringen knnten. Hier in der Nhe liegen Quellen, die drakonische Bestien anlocken.\n\nHelft mir, meiner trichten besseren Hlfte zu beweisen, dass ich die bessere Jgerin bin.', '', '', '', '', '', '', 47187),
(70351, 'deDE', 'Gartenfest', 'Sprecht mit Akora bei den Rubinlebensbecken.', 'Ich habe mich seit Jahren um diesen Garten gekmmert und mich auf den Tag vorbereitet, an dem ich endlich meine Lebensaufgabe annehme. Und nun ist dieser Tag gekommen!\n\nIch liebe alle Bume und Blumen und Pflanzen... und selbst die Krabbeltiere, die sich dazwischen verstecken. Ich kann den Geist der Natur, den groen Drachengeist, spren, wenn ich mich um den Garten kmmere.\n\nEs gibt nur noch eines zu tun. Ich werde den groen Drachengeist beschwren, genau wie in den Legenden.\n\n<Akoras Lcheln strahlt vor Freude.>\n\nTrefft mich unten im Garten bei dem Becken, wo ihre Knochen ruhen. Ich erklre Euch den Rest dort.', '', '', '', '', '', '', 47187),
(70341, 'deDE', 'Wohlverdienter Sieg', 'Kehrt zur Innovationsmaschine in Valdrakken zurck.', 'Die kleinsten Dinge knnen die grten Schtze enthalten.\n\nBringt die Essenz zur Innovationsmaschine.', '', '', '', '', '', '', 47187),
(70339, 'deDE', 'In Tyrs Fustapfen: Die Ebenen von Ohn\'ahra', 'Findet die zweite Herausforderung von Tyr auf den Ebenen von Ohn\'ahra.', 'Obwohl Ihr Eure erste Herausforderung gut gemeistert habt, solltet Ihr nicht glauben, dass Euch alles so leicht gelingt. Hter Tyr wollte, dass die Innovationsmaschine nur von denen genutzt wird, die wrdig sind, sie weise einzusetzen.\n\nWenn Ihr Euch nicht abschrecken lasst, werdet Ihr die zweite Herausforderung auf den Ebenen von Ohn\'ahra finden. Ich freue mich darauf, Eure Fhigkeiten zu prfen, $gAbenteurer:Abenteurerin;.', '', '', '', '', '', 'Findet die zweite Herausforderung von Tyr auf den Ebenen von Ohn\'ahra.', 47187),
(70338, 'deDE', 'Denkt niemand an die Kinder?!', 'Rettet die Jungen.', 'Wenn Sylvie verstrt ist, dann muss das bedeuten, dass ihre Jungen da drinnen sind!\n\nDie Riesen mssen ihre Jungen entfhrt haben, whrend sie infiziert und zu schwach war, sie zu retten.\n\nDie Jungtiere sind in einem ziemlich lebhaften Alter, hoffentlich waren sie bisher flink genug, den Riesen zu entkommen...\n\nHier, benutzt mein Unsichtbarkeitsamulett... Schnell, Ihr msst sie retten, bevor sie gefressen werden!', '', '', '', '', '', '', 47187),
(70337, 'deDE', 'Glutwacht', 'Bringt das Windspiel der Ohn\'ir nach Glutwacht.', 'Seid gegrt, Fremdling.\n\nDie Winde brachten Kunde von einer Gruppe, die Zuflucht in den Ruinen von Glutwacht gesucht hat. Sie scheinen sich nur fr die Vergangenheit zu interessieren, whrend wir Zentauren fr die Gegenwart unter dem Segen Ohn\'ahras leben.\n\nNichtsdestoweniger sind sie Gste unserer Heimstatt. Ich habe dieses Windspiel fr sie angefertigt, damit sie Ohn\'ahras Gegenwart wahrnehmen knnen. Mge es ihnen Freude und Behaglichkeit bereiten.', '', '', '', '', '', '', 47187),
(70335, 'deDE', 'Einfache Ausgrabungswerkzeuge', '', '', '', '', '', '', '', '', 47187),
(70319, 'deDE', 'Nergazurai', 'Bringt ein Ottukherz, einen Felszahnoberschenkelknochen, eine Hornschreiterschuppe und einen Geiermuskelmagen zu Muqur dem Regenberhrten am Baumschrittauenposten.', 'Mein Onkel erzhlte mir viele Geschichten von seinem Kampf gegen einen Hornschreiter namens Nergazurai. Er berichtete von den fuchsienfarbigen Schuppen, die durch die Ebenen sausen, wenn Nergazurai auf der Suche nach Beute ist, von seinen messerscharfen Klauen und seinem giftigen Biss.\n\nIch war gerade auf der Jagd, als ich seine Silhouette ersphte, aber es war zu spt: Er verpasste mir eine ble Bisswunde an der Schulter. Er war so furchtbar, wie mein Onkel beschrieben hatte, aber irgendwie kam ich mit dem Leben davon.\n\nIch muss aber die Infektion von der Bisswunde reinigen. Bitte, sammelt die Reagenzien, die ich brauche. Mir bleibt nicht mehr viel Zeit.', '', '', '', '', '', '', 47187),
(70279, 'deDE', 'Blut von Drachen', 'Ttet Karkidan.', 'Wie Ihr sicher schon gesehen habt, gibt es in diesem Land Kreaturen, die ber ihre normale Gre hinauswachsen.\n\nWir betrachten diese Bestien als von den wilden Gttern gesegnet. Sie werden von Jgern oft als ehrenvolle Ziele angesehen, denn so beweisen sie ihre Strke. Eine dieser Bestien, die wir Karkidan nennen, befindet sich in der Nhe. Ich wre sehr beeindruckt, wenn Ihr es schaffen wrdet, Karkidan zu erlegen.', '', '', '', '', '', '', 47187),
(70268, 'deDE', 'Wiederbelebte Erinnerungen', 'Gebt Veritistrasz das Tagebuch.', 'Ihr habt ein teilweise zerstrtes Tagebuch gefunden. Es scheint aus der Sicht einer jungen schwarzen Drachenfrau aus der Zeit vor der Verderbnis geschrieben zu sein.\n\nZwar ist der hintere Teil unleserlich, aber beim berfliegen des ersten Teils kristallisiert sich ein Name heraus. Veritistrasz.', '', '', '', '', '', 'Gebt Veritistrasz das Tagebuch im Rubinsanktum.', 47187),
(70244, 'deDE', 'Den Nokhud an den Kragen', 'Betretet das Dorf mit Khanam Matra Sarest und erobert es von den Nokhud zurck.', 'Seit Tausenden von Jahren haben die Teerai das Horn von Drusahl, unsere heiligstes Relikt, bewacht. Mit der Plnderung dieses Dorfes hat Balakar alles verraten, was es bedeutet, Maruuk zu sein. Fr ihn kann es keine Erlsung mehr geben.\n\nWir mssen das Horn zurckerobern, bevor Balakar es zerstren kann, und alle noch lebenden Teerai retten. Ich werde Euch begleiten, um diesen falschen Khan persnlich zu richten. Die Nokhud werden den Zorn der Khanam Matra zu spren bekommen!', '', '', '', '', '', '', 47187),
(70242, 'deDE', 'Leben um Leben', 'Sammelt ein inaktives Gef bei Trellain im Rubinlebensschrein ein.', 'Ich spre, dass sein Freund eine tiefe Narbe in sich trug. Etwas an diesem Ort hat sie wieder geffnet... vielleicht damit sie diesmal vollstndig heilen kann.\n\nJetzt muss Kolgar ebenfalls heilen.\n\nAuf der Terrasse ber uns findet Ihr meinen Freund Trellain. Er arbeitet mit den Verzauberern. Sagt ihm, dass ich eines der Gefe bentige, die er auf der Arbeit verwendet. Er wird Euch bereitwillig eins berlassen.', '', '', '', '', '', '', 47187),
(70241, 'deDE', 'Bis zum bitteren Ende', 'Schafft Badoras zu Duroz und Kolgar.', 'Es ist gerade passiert. Ich... Er hat geschlafen und ich hab nur kurz nicht hingesehen und... Wir sind jeden Tag hierhergekommen, er wollte nur bei den Welpen sitzen. Ich wusste nicht, dass er...\n\n<Kolgars Gesicht ist trnenverschmiert. Er reibt sich mit dem Handrcken ber die Augen.>\n\nNein, ich wusste es. Ich wusste es. Aber ich wei nicht, was ich jetzt tun soll. Was mache ich nur mit ihm?\n\nWrdet Ihr... Wrdet Ihr bitte Badoras suchen?', '', '', '', '', '', '', 47187),
(70240, 'deDE', 'Schmerzbehandlung', 'Sammelt $1oa milchweie Knallblumen, $2oa blhende Schattenlilien und eine gefllte Lebensbeckenphiole.', 'Ihr habt ihn gerade rechtzeitig hergebracht. Ich kann erkennen, dass er starke Schmerzen hat, auch wenn er sie gut ertrgt. Das mssen wir alle, wenn die Zeit kommt.\n\nIch frchte, es ist das Alter, das ihn qult, und keine Krankheit, aber vielleicht kann ich sein Leid ein wenig lindern.\n\nWrde es Euch etwas ausmachen, ein paar Knallblumen, Seichtwasserlilien und reines Wasser aus dem Garten in der Nhe zu holen? Wenn Ihr genug davon findet, kann ich daraus ein Schmerzmittel herstellen.', '', '', '', '', '', '', 47187),
(70239, 'deDE', 'Unausgesprochene Reue', 'Geht ein Stck mit Duroz und Kolgar, um nach Hilfe zu suchen.', 'Duroz ist alt, krank und stur wie ein Kodo. Nichts konnte ihn davon abhalten, mit dem Luftschiff hierherzufliegen. Alles, was ich machen konnte, war, ihm als Gehstock zu dienen.\n\nIch habe ihn oft genug auf dem Schlachtfeld beobachtet, um zu wissen, wann er Schmerzen verheimlicht. Es geht ihm hier drauen jeden Tag schlechter. Knnt Ihr mir helfen, ihn zu den Trnkebrauern zu bringen? Bier reicht ihm nicht mehr.\n\nWenn Ihr unsere Waffen tragen knnt, kann ich ihm beim Gehen helfen.', '', '', '', '', '', '', 47187),
(70236, 'deDE', 'Ausgelstes Drachenauge', 'Bringt den Gegenstand zu Emilia Bellersen.', '<Das knnte etwas sein, wonach Emilia Bellersen sucht.>', '', '', '', '', '', '', 47187),
(70235, 'deDE', 'Reparaturrechnung', 'Stellt $1oa Serevitreparaturhmmer fr Stahlformerin Kuroko in Valdrakken her.', 'Die Dracheninseln haben seit Jahrtausenden keinen Konflikt wie diesen gesehen. Unsere Arbeit steht auer Frage, aber unter der stndigen Nutzung leidet jede gute Rstung. Ich habe eine groe Bestellung an Serevitreparaturhmmern und brauche alle, die ich bekommen kann, um sie zu erfllen. Wenn Ihr aushelft, gebe ich Euch gerne mehr Informationen, um Eure Schmiedekunst der Dracheninseln zu verbessern.', '', '', '', '', '', '', 47187),
(70229, 'deDE', 'Boku der Mystiker', 'Findet Boku in Teerakai.', 'Die Mystiker wurden vor ein paar Tagen zur Gratwasserzuflucht gerufen, aber ein Mystiker ist geblieben. Sein Name ist Boku. Er befindet sich oben auf dem Hgel am Schrein von Ohn\'ahra.\n\nEr ist noch ein Initiand, aber es sollte ihm mglich sein, mit Ohn\'ahra Zwiesprache zu halten und ihren Segen zu erhalten. Mit Ohn\'ahra an unserer Seite gewinnen wir vielleicht den Krieg, bevor er beginnt.', '', '', '', '', '', 'Findet Boku in Teerakai.', 47187),
(70221, 'deDE', 'Zeigt Euren Eifer', '', '', '', '', '', '', '', 'Erhaltet den Eifer des Handwerkers von Thomas Heller.', 47187),
(70220, 'deDE', 'Schattenzuflucht', 'Sprecht mit Wachhauptmann Alowen, Sariosa, Sidra der Heilerin und Viranikus.', 'Wir mssen den Rest des grnen Drachenschwarms informieren, dass die Barriere vor dem Uralten Zweig bedroht ist. Gerithus und ich haben eine Menge zu besprechen.\n\n$n, ich werde Euch mit meinem Mal versehen. Die anderen Drachen, die es erkennen, werden wissen, dass Ihr $gmein vertrauenswrdiger Bote:meine vertrauenswrdige Botin; seid.\n\nGeht und versammelt meinen Schwarm. Er muss davon erfahren und sich auf den Kampf vorbereiten.', '', '', '', '', '', '', 47187),
(70215, 'deDE', 'Neugier ist der Schlssel', 'Sprecht mit Warpwirkerin Delandra im Lager Antonidas.', 'Mein Zgern, ber diese Symbole zu sprechen, lag nicht daran, dass ich Euch nicht vertraut habe, sondern an der unergrndlichen Natur dieser Symbole und auch der Steine, auf denen sie stehen.\n\nJa, Steine. Und zwar mehrere, verteilt ber die ganzen Inseln.\n\n<Warpwirkerin Delandra wirft Euch einen Blick zu. Ein Hauch von Neugierde und Aufregung sind in ihren Augen zu erkennen.>\n\nIhr wusstet das nicht.\n\nNun gut. Eure Beharrlichkeit und Eure Bereitschaft, mich aufzusuchen, zeigen mir, dass Ihr Eure jngste Entdeckung unbedingt verstehen wollt. Vielleicht ist es Zeit, dass wir das im Detail besprechen.', '', '', '', '', '', '', 47187),
(70213, 'deDE', 'Harkyn Grymmstein', '', '', '', '', '', '', '', '', 47187),
(70212, 'deDE', 'Penumbrus', '', '', '', '', '', '', '', '', 47187),
(70210, 'deDE', 'Nicht vergessene Tradition', 'Platziert Rucherwerk und beseitigt geisterhafte Bestien an den Ewigen Kurganen.', 'Es ist Tradition bei den Aylaag, dass wir, wenn wir in diesem Lager kampieren, zu den Ewigen Kurganen pilgern, und um sichere Reisen bitten und darum, von dem verschont zu bleiben, das unsere Vorfahren heimgesucht hat. Die Anwesenheit der Nokhud macht diese Pilgerreise gefhrlich.\n\nWenn es Euch nichts ausmacht, wrde ich Euch bitten, diese Tradition fr uns weiterzufhren.', '', '', '', '', '', '', 47187),
(70209, 'deDE', 'Quaken und angreifen', '', '', '', '', '', '', '', '', 47187),
