(70198, 'deDE', 'Der Ruf zu den Inseln', 'Trefft Naleidea Flussglanz in Durotar.', 'Unsere Verbndeten versammeln sich in Durotar. Dies ist eine sehr aufregende Zeit!\n\nSchliet Euch uns an, $n! Zeit, zu den Dracheninseln aufzubrechen!', '', '', '', '', '', '', 47187),
(70197, 'deDE', 'Der Ruf zu den Inseln', 'Trefft Toddy Schnurrbart im Hafen von Sturmwind.', 'Seid Ihr bereit fr das Abenteuer Eures Lebens? Ich bin es auf jeden Fall!\n\nUnsere Verbndeten haben sich versammelt und alle Vorrte sind verladen. Worauf wartet Ihr also noch?\n\nTrefft mich bei den Docks von Sturmwind. Zeit, zu den Dracheninseln aufzubrechen!', '', '', '', '', '', '', 47187),
(70196, 'deDE', 'Reservatreinigung', '', '', '', '', '', '', '', '', 47187),
(70195, 'deDE', 'Im Sturm erobert', 'Rettet Altan und sucht nach Hinweisen zum Fremdling.', 'Berichten zufolge wurden die Nokhud von einem Fremdling begleitet, der noch nie zuvor gesehene Magie wirkt. Dieser Fremdling ist durch unsere Reihen gepflgt wie ein Sturm.\n\nWenn die Nokhud Verbndete haben, die so viel Chaos anrichten knnen, mssen wir so viel wie mglich ber sie herausfinden.\n\nIch habe meinen Ohuna, Altan, entsandt, um den Fremdling ausfindig zu machen. Er ist bisher nicht zurck und deshalb mache ich mir Sorgen. $n, knnt Ihr nach Hinweisen zu diesem Fremdling suchen und herausfinden, was Altan zugestoen ist?', '', '', '', '', '', '', 47187),
