(70185, 'deDE', 'Mysterise Bestie', 'Findet und ttet die Bestie und bringt etwas als Beweis zu Spherin Tomul.', '<Ihr erkennt einen groen Pfotenabdruck in der Erde. Ihr seht Euch um und stellt fest, dass keine der Kreaturen in der Nhe Pfoten hat, geschweige denn so groe.\n\nVielleicht lassen sich die Zentauren beeindrucken, wenn Ihr diese riesige Bestie erlegt.>', '', '', '', '', '', 'Bringt den Pelz von Konkhular zu Spherin Tomul.', 47187),
(70184, 'deDE', 'Geheimnisse der Spezialisierung: Schmiedekunst', '', '', '', '', '', '', '', '', 47187),
(70183, 'deDE', 'Geheimnisse der Spezialisierung: Alchemie', '', '', '', '', '', '', '', '', 47187),
(70182, 'deDE', 'Der se Geschmack des Sieges', 'Kehrt zur Innovationsmaschine in Valdrakken zurck.', 'Auch kleine Dinge knnen groes Potenzial besitzen. Die abgefllte Essenz mag sich leicht wie eine Feder anfhlen, aber sie besitzt immense Macht.\n\nBringt sie zur Innovationsmaschine.', '', '', '', '', '', '', 47187),
(70181, 'deDE', 'Erste Herausforderung von Tyr: Finesse', 'Schliet die erste Herausforderung von Tyr im Azurblauen Gebirge ab.', '<Als Ihr Euch nhert, strahlt die Inschrift auf der Statue ein sanftes Leuchten aus.>\n\n\"Fhrt die Macht des Hters und tragt ihr Licht in eine bessere Zukunft fr uns alle.\"', '', '', '', '', '', '', 47187),
(70180, 'deDE', 'Starthilfe? Kommt sofort!', 'Helft Greyzik, das mysterise Gert mit Energie zu versorgen.', 'Einige Leute in der Stadt behaupten, dieses Gert wre von dem legendren Titanenhter Tyr erschaffen worden.\n\nDas Problem ist, dass wir es nicht zum Laufen bekommen! Wir haben alle blichen Tricks probiert, Auseinanderbauen, Gyroskopie, sanfte Elektroschocks. Bis auf die Elektroschocks hat nichts funktioniert. Moment... ich hatte gerade eine tolle Idee.\n\nSeht Ihr den Gyrokopter dort drben? Springt rein und seht, ob Ihr diesem Titanending etwas mehr... Saft geben knnt.', '', '', '', '', '', '', 47187),
(70179, 'deDE', 'Doppelter Dienst', 'Beschafft Baumaterialien von Erdelementaren.', 'Seid gegrt! Ihr seht ganz stark aus, knnt Ihr mir vielleicht aushelfen?\n\nAzkra und ich sind damit beauftragt, auf diesen Turm aufzupassen. Er befindet sich in einem, wie soll ich sagen, \"bemerkenswerten vorsanierten Zustand\". Als wir mit den Reparaturen begannen, wurden wir von Erdelementaren angegriffen!\n\nAlso dachte ich mir: \"Zefren, warum kmmerst du dich nicht um die Erdelementare und besorgst gleichzeitig ein paar Baumaterialien?\" Und genau da kommt Ihr ins Spiel! Knnt Ihr mir helfen?', '', '', '', '', '', '', 47187),
(70178, 'deDE', 'Expeditionsversorgungspaket', 'Untersucht die neuen Werkzeuge, die durch das Expeditionsversorgungspaket im Drachenschuppenbasislager erhltlich sind.', '$gForscher:Forscherin;, Eure Entdeckungen sind von unschtzbarem Wert.\n\nDa drauen gibt es noch vieles mehr, das es zu entdecken gilt, und wir haben genau die richtigen Werkzeuge, um Euch dabei zu helfen.\n\nKommt zurck zum Drachenschuppenbasislager und rstet Euch mit dem Expeditionsversorgungspaket aus.', '', '', '', '', '', '', 47187),
(70175, 'deDE', 'Abgebrochene Leiste', 'Bringt den Gegenstand zu Emilia Bellersen.', '<Das knnte etwas sein, wonach Emilia Bellersen sucht.>', '', '', '', '', '', '', 47187),
(70174, 'deDE', 'Die Shikaar', 'Trefft Sansok Khan.', 'Sansok Khan ist die fhigste Jgerin unseres Klans. Obwohl sie nicht hren kann, hat sie ihre Fhigkeiten als Jgerin und Anfhrerin immer wieder bewiesen.\n\nFr uns alle ist sie Mentorin, eine vertrauenswrdige Anfhrerin und erbitterte Verteidigerin der Maruuk.\n\nEs ist eine Ehre, mit ihr zu sprechen.', '', '', '', '', '', '', 47187),
(70172, 'deDE', 'Berggeheimnisse', '', '', '', '', '', '', '', '', 47187),
(70171, 'deDE', 'Glckliche kleine Zuflle', 'Findet Hudsons letztes Werk.', '<Ranpiatas Augen werden feucht.>\n\nBin ich es? Bin ich der Grund, dass er den Funken verloren hat?\n\nEr sagt, er liebt mich, aber... Ihr habt gehrt, wie es ihm geht, wenn er nicht malt.\n\nIch will nur das Beste fr ihn. Wenn es das Beste fr ihn ist, dann... werde ich gehen.\n\nEs gibt ein letztes Werk, das er weggeworfen hat. Das letzte Werk, an dem er sich versucht hat, bevor er aufgegeben hat.\n\nIch konnte nicht zusehen, wie er es wegwirft, also habe ich es in unserem Haus versteckt. Bitte... bringt es zu ihm... als Erinnerung.', '', '', '', '', '', '', 47187),
(70170, 'deDE', 'Die Dmonen austreiben', 'Besorgt Hudsons verlorene Gemlde von den finalen Dungeonbossen der Hallen der Infusion, der Akademie von Algeth\'ar, des Azurblauen Gewlbes und von Neltharus.', 'Ich frchte, er kann sehr stur sein.\n\nAber ich kann ihn nicht einfach aufgeben. Wir werden es einfach noch einmal versuchen mssen!\n\nEs gibt noch mehr Gemlde da drauen, die er rausgeworfen hat. Und zwar an noch gefhrlicheren Orten. Ich hoffe wirklich, dass Ihr der Herausforderung gewachsen seid!', '', '', '', '', '', '', 47187),
(70169, 'deDE', 'Selbst Bume brauchen Freunde', 'Sprecht mit Rauvros.', 'Ich wei, dass Ihr und Ran nur versucht, mir zu helfen.\n\nAber ich glaube nicht, dass mir zu helfen ist. Der Funke in mir... mein Wille zu malen... ist einfach... weg.\n\nAber Ran hat recht. Ich bin Euch schuldig, es zumindest zu versuchen.\n\nBringt Euren aufstrebenden Knstlerfreund zu mir.', '', '', '', '', '', '', 47187),
(70168, 'deDE', 'Traurige kleine Zuflle', 'Besorgt Hudsons verlorene Gemlde von den finalen Dungeonbossen der Rubinlebensbecken, des Angriffs der Nokhud und der Brackenfellhhle.', 'Ihr habt den ganzen Weg auf Euch genommen... Es tut mir leid.\n\nMein Hudson hat es frher geliebt, zu malen. Es war sein Leben! Ich wei nicht, woher diese Blockade kommt.\n\nVor ein paar Wochen hat er auf dem Rckweg von einem Malausflug all seine unvollendeten Gemlde genommen und sie in einem Wutanfall weggeworfen.\n\nIch bitte Euch... knntet Ihr sie ausfindig machen? Vielleicht ist das der Funke, den er braucht.\n\nHudson scheut sich auf der Suche nach den besten Ausblicken nicht vor gefhrlichen Orten. Ich hoffe, Ihr seid darauf vorbereitet.', '', '', '', '', '', '', 47187),
(70166, 'deDE', 'Die Freuden der Malerei', 'Bringt Rauvros\' Gemlde der Vorstellung zu Hudson.', 'Gefllt Euch meine Sammlung? Das sind alles Werke des grten Malers aller Zeiten, Hudson.\n\nSie sind selten und mglicherweise wertvoll: Er ist ein Einsiedler und hat seit einer Weile nichts Neues gemalt. Oh, wie gerne ich ihn doch mal treffen... oder von ihm lernen wrde!\n\nIhr... wirkt recht verwegen. Wrdet Ihr ihn fr mich aufspren? H-hier! Nehmt ein paar meiner Werke mit. Vielleicht findet er sie ja beeindruckend!\n\nOder er findet sie schrecklich... oje.', '', '', '', '', '', '', 47187),
(70164, 'deDE', 'Eine ausgetftelte Gelegenheit', 'Sprecht mit Chronomant Phosildral und Sibrit Klackerpapp in den Ruinen des Lebensgewlbes.', 'Httet Ihr wohl einen Moment Zeit, $p? Ich stehe kurz vor einem Durchbruch!\n\nNach dem Einsturz des Horts habe ich mehr als nur meine Kampfeskraft eingebt. Ich habe meine Identitt als Dracthyr verloren. Vielleicht knnt Ihr das verstehen.\n\nEs hat mir immer groe Freude bereitet, Dinge auseinanderzunehmen und wieder zusammenzusetzen. Deshalb dachte ich, die Expedition wre genau das Richtige fr mich. Aber dieses Artefakt bereitet mir Kopfzerbrechen.\n\nKnntet Ihr Phosildral und Sibrit bitten, meine Notizen durchzusehen? Ich will mich als formidable Denkerin beweisen... ihnen, aber auch mir selbst gegenber.', '', '', '', '', '', '', 47187),
(70163, 'deDE', 'Kreuz und quer durch die Hhlen - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(70161, 'deDE', 'Kreuz und quer durch die Hhlen', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(70159, 'deDE', 'Ein Geschmack von Heimat', 'Fragt bei Hordenmitgliedern im Drachenschuppenbasislager, ob jemand Euch die notwendigen Zutaten leihen kann.', 'Na endlich! Noch ein Dracthyr, der uns zur Hand geht.\n\nMein Bruder und ich wollten ein paar Essensrationen zubereiten, aber...\n\n<Scaralesh deutet auf seine Umgebung.>\n\nHier ist alles so anders. Man findet hier kaum die Zutaten, die wir frher zum Kochen genommen haben.\n\nAber wir knnen uns anpassen. Fragt die Horde, ob sie etwas als Ersatz fr Gemse, Proteine und emulgierende Flssigkeit haben. Dann knnen wir endlich wieder richtig kochen.', '', '', '', '', '', '', 47187),
(70158, 'deDE', 'Gartenpromenade - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(70157, 'deDE', 'Gartenpromenade', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(70156, 'deDE', 'Ein uraltes Erwachen', 'Ermchtigt das Portal.', 'Das Portal liegt direkt hinter mir. Schwer zu sagen, wie viel Zeit noch bleibt, bis die schwindende Verzauberung des Gefes komplett versiegt oder, schlimmer noch, bricht.\n\nDie dann freigesetzte instabile Energie kann katastrophale Folgen haben.\n\nWollen wir fortfahren?', '', '', '', '', '', '', 47187);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(70155, 'deDE', 'Schauen, zuhren, atmen', 'Angelt mit Threshrak.', 'Seid gegrt, $R. Nicht viele halten an, um hallo zu sagen. Und schon gar nicht, um hier etwas zu verweilen. Die meisten haben es auf dem Weg zu ihrem nchsten Reiseziel etwas eiliger.\n\nWrdet Ihr gerne mit mir angeln?', '', '', '', '', '', '', 47187),
(70154, 'deDE', 'Ein Tor nach Irgendwo', 'Folgt Warpwirkerin Delandra zum Portal.', 'Die Verzauberung wird uns vor der instabilen Energie im Inneren beschtzen.\n\nIch ffne den Weg zum nchsten Stein.\n\nSobald Ihr durchgegangen seid, bleibt in der Nhe. Wenn wir ankommen, werde ich Eure Hilfe brauchen, um das Gert mit Energie zu versorgen.', '', '', '', '', '', '', 47187),
(70148, 'deDE', 'Ohne Zweck', 'Sucht nach Kralle Ethrethi in der Botschaft von Schwingenrast.', 'Httet Ihr kurz Zeit fr mich?\n\nIch mache mir um einen Dracthyr Sorgen, der hier durchgekommen ist. Er hat meinen Partnern und mir allerlei Fragen gestellt, schien mit unseren Antworten allerdings... unzufrieden.\n\nEr nannte sich \"Kralle Ethrethi\". Ich glaube, das macht ihn zu einem ziemlichen Neuling in Euren Rngen, oder?\n\nIch hatte das Gefhl, dass er etwas Hilfe brauchen knnte. Wrdet Ihr mir dabei helfen, den Frieden zu wahren?\n\nIch hab ihn drben mit Kholmar reden sehen.', '', '', '', '', '', '', 47187),
(70146, 'deDE', 'Hochlandgegenschlag', '', '', '', '', '', '', '', '', 47187),
(70139, 'deDE', 'Wo ein Schutz ist, ist auch ein Weg', 'Ermittelt den Schaden an den Schutzsteinen im Tyrholdreservoir.', 'Dieses Reservoir wurde einst von drei Schutzsteinen beschtzt, die Tyr hier platziert hat.\n\nSie waren dazu gedacht, die auf den Dracheninseln vorherrschende Elementarenergie zu stabilisieren.\n\nAls Ihr mich geweckt habt, konnte ich Schaden am westlichen Schutz spren. Ich frchte, dass die Primalisten sich auch an den anderen Schutzen vergangen haben.\n\nSo oder so, wir mssen zunchst den Schaden ermitteln, um herauszufinden, was wir als Nchstes tun.', '', '', '', '', '', '', 47187),
(70136, 'deDE', 'Keine Zeit fr Schmerzen', 'Holt den Zeitwandererstab und die Zeitwanderernotizen und erlegt den wahnsinnigen Alpha im Wallenden Wald in Thaldraszus.', 'Uff... Einen Moment...\n\nMein erster Auftrag... Instabile Temporalenergie sickert in den Wald... Beeintrchtigt die Wildtiere... Muss die Auswirkungen feststellen und die Magie fr die Zeitwanderer sammeln...\n\n<Zera schttelt ihren Kopf fr einen Moment.>\n\nIch hatte gerade ein Rudel Vorquin beobachtet, als ein von Zeitmagie berquellender wildgewordener Br mich angegriffen hat. Er hat mich berrascht. Ich bin gerade so entkommen.\n\nKnntet Ihr meine fehlende Ausrstung fr mich finden, $C? h, vielleicht msst Ihr Euch auch um diesen Bren kmmern.', '', '', '', '', '', '', 47187),
(70135, 'deDE', 'Eindringende Elementare', 'Ttet $1oa Urelementare in der Botschaft von Schwingenrast.', 'Die Handwerker und Forscher der Drachenschuppenexpedition sind ungeeignet fr die Hrte der Schlacht.\n\nAber wir beide nicht, $p.\n\nLasst uns hier auf den Dracheninseln diese Kraft nutzen, um jene zu schtzen, die sich nicht selbst schtzen knnen.\n\nBeseitigt die Elementare, die vom Norden eindringen, sodass die Expedition sich auf ihre hheren Ziele konzentrieren kann.', '', '', '', '', '', '', 47187),
(70134, 'deDE', 'Erinnerungen', 'Holt Veritistrasz\' Zeitkapsel.', 'Danke, dass Ihr mir zugehrt habt, Jungspund. Es gibt einen Gefallen, um den ich Euch bitten mchte.\n\nKeine Sorge, keine weiteren Geschichten.\n\nAls wir diesen Ort verlassen haben, habe ich eine Art... Zeitkapsel hinterlassen. Knntet Ihr... Knntet Ihr sie mir bringen? Wir haben die Kapsel hinter einer der Sulen am Fue des Rubinlebensschreins versteckt.\n\nIch habe sie mit einem Siegel versteckt. Wenn Ihr es aktiviert, solltet Ihr die Kapsel sehen knnen.', '', '', '', '', '', '', 47187),
(70132, 'deDE', 'Ein Weilchen bleiben', 'Setzt Euch eine Weile und betrachtet die Landschaft.', '<Der alte Zwerg reagiert nicht auf Euch, als Ihr Euch nhert, sondern blickt mit gerunzelter Stirn ber die Landschaft. Es ist ein wohltuender Ausblick, vielleicht solltet Ihr ebenfalls eine Pause einlegen und die Landschaft betrachten.>', '', '', '', '', '', '', 47187),
(70129, 'deDE', 'Zehenmatsch der Schreckliche', 'Helft Rowie, Zehenmatsch den Schrecklichen zu erlegen.', 'Ihr habt recht, ich bin nicht stark genug, um es mit diesem Yeti aufzunehmen... zumindest nicht alleine!\n\nDoch Ihr seid hier!\n\nDer Bau des bsen Yetis, Zehenmatsch des Schrecklichen, liegt vor uns. Diese Hhle ist... gro. Aber nicht gruselig! Okay, vielleicht ein bisschen gruselig.\n\nKnntet Ihr reingehen und ihn schon mal etwas mrbe machen? Ich... Ich bin direkt hinter Euch!', '', '', '', '', '', '', 47187),
(70126, 'deDE', 'Der letzte Schliff', 'berzeugt Miguels Kunden, sich bei knftigen Handwerksauftrgen an ihn zu wenden.', 'Ah, $p, schn, Euch zu sehen.\n\nIhr wart eine herausragende Hilfe fr das Handwerkerkonsortium und fr Thomas und mich persnlich. Vielen Dank.\n\nEs gibt noch eine Sache, die Ihr als Handwerker wissen solltet, und zwar, wie man Beziehungen mit Kunden pflegt.\n\nIch habe heute einen Handwerksauftrag fr einen Kunden erledigt. Knntet Ihr in meinem Namen mit ihm reden? Versucht, ihn dazu zu berreden, in Zukunft mit seinen Handwerksbedrfnissen zu mir zu kommen. Erinnert ihn daran, dass er zu mir persnlich kommen muss, wenn er hochwertige Waren haben mchte.', '', '', '', '', '', '', 47187),
(70125, 'deDE', 'Wo ist Furorion?', 'Fragt Sendrax, wann die Drachen ankommen sollten.', 'Hm, ich frage mich, wo Furorion bleibt.\n\nEr sagte, er wrde hier auf uns warten, zusammen mit einem Botschafter von Alexstrasza der Lebensbinderin, Knigin der Drachen.\n\nEs sieht einem Drachen nicht hnlich, ein Versprechen nicht zu halten.\n\nNun denn! Wenigstens ist diese eifrige, kleine Drakonide hier, um uns zu empfangen. Fragt sie doch einmal, wann die anderen ankommen.', '', '', '', '', '', '', 47187),
(70124, 'deDE', 'bungsmaterialien', 'Sammelt $1oa Urprotowelpenschuppen.', 'Die Protodrachen hier unterscheiden sich von allem, was ich bisher gesehen habe.\n\nIhre Schuppen scheinen von Natur aus feuerfest zu sein, strker als Stahl, und sie ben dabei nicht an Flexibilitt ein. Unglaublich.\n\nDie Handwerker wollen unbedingt einige davon in die Hnde bekommen, um damit zu arbeiten.\n\nBeginnt mit den Welpen. Ihre kleineren Schuppen sollten biegsamer sein und uns dabei helfen, unsere Techniken zu verbessern.', '', '', '', '', '', 'Trefft Thaelin Schwarzamboss in der Botschaft von Schwingenrast.', 47187),
(70123, 'deDE', 'Urgeziefer', 'Ttet $1oa Urprotodrachen an der Wilden Kste.', '<Azurathel wirft einen misstrauischen Blick auf die Protodrachen, die hinter ihm auf dem Gebirgskamm lauern.>\n\nIch knnte schwren, dass diese Protodrachen jedes Mal, wenn ich ihnen den Rcken zuwende, nher an das Lager herankommen...\n\nDas sind nicht die Drachen, die Furorion uns hier vorstellen wollte.\n\nDie Protodrachen sind skrupellose Raubtiere, mit denen man nicht verhandeln kann. Wir mssen ebenso skrupellos sein.\n\nDezimiert sie, um sie unter Kontrolle zu halten, oder diese Expedition ist zu Ende, bevor sie begonnen hat.', '', '', '', '', '', 'Trefft Schuppenkommandant Azurathel in der Botschaft von Schwingenrast.', 47187),
(70122, 'deDE', 'Forscher in Not', 'Rettet 3 Mitglieder der Drachenschuppenexpedition an der Wilden Kste.', 'Missversteht das wissenschaftliche Vorgehen der Expedition nicht als Zaghaftigkeit, $p.\n\nWir sind keine Einsiedler, die in weit entfernten Trmen ihre Bcher studieren.\n\nWir sind Abenteurer, die in jedem Winkel Azeroths nach Wissen aus erster Hand suchen!\n\nDiese Leidenschaft fr Abenteuer bringt uns oftmals in Gefahr, und einige Expeditionsmitglieder haben sich ein bisschen mehr vorgenommen, als sie bewltigen konnten...\n\nAber hey, die Gefahr macht es nur spaiger!', '', '', '', '', '', 'Trefft Toddy Schnurrbart in der Botschaft von Schwingenrast.', 47187),
