(70070, 'deDE', 'Aber... ich bin der Held der Enten', 'Findet Knallentchen und stellt sicher, dass er zu Gracus zurckkehrt.', 'Einen Moment... Irgendetwas ist doch...\n\n<Gracus sieht sich um.>\n\nKnallentchen! Der Racker muss wieder flussabwrts sein! Egal, wie oft ich es ihm sage, stndig versucht er, mit den Flunkern zu spielen!\n\nIhr msst fr mich nach ihm sehen. Hoffentlich wurde er nicht wieder verschluckt.', '', '', '', '', '', 'Sprecht mit Gracus ber das, was Ihr gesehen habt.', 47187),
(70069, 'deDE', 'Andere nennen mich Entenhter', 'Fttert $1oa Entchen und kehrt zu Gracus zurck.', 'Meine Tage werden krzer... doch meine Pflichten sind noch nicht erfllt.\n\nDie Brut sollte am Fluss sein. Ich habe sie in der Hoffnung dort gelassen, dass es sie selbststndiger macht. Bald werden sie sich selbst verteidigen mssen.\n\nHeute verlassen sie sich noch auf Euch. Bringt ihnen bitte das Essen, das Ihr gefangen habt, und die Entchen dann zu mir. Passt auf Pilot auf, sie springt stndig von irgendetwas runter.', '', '', '', '', '', '', 47187),
(70068, 'deDE', 'Kobaltkatastrophe', '', '', '', '', '', '', '', '', 47187),
(70067, 'deDE', 'Eine Botschaft an die Nokhud', '', '', '', '', '', '', '', '', 47187),
(70064, 'deDE', 'Fr Imbu!', '', '', '', '', '', '', '', '', 47187),
(70062, 'deDE', 'Einige nennen mich Kferfnger', 'Sammelt $1oa Flugbrutkferstcke.', 'Ah, $gjunger:junge:r; $R, ich knnte Eure Hilfe brauchen. Ich habe hier Generationen von Leben grogezogen.\n\nAm liebsten habe ich die Entchen. Aber mein Krper ist alt und schwach geworden... doch das hlt den Kreislauf nicht auf.\n\nIch brauche Euch, um Nahrung fr meine Brut zu fangen.', '', '', '', '', '', '', 47187),
(70061, 'deDE', 'bungsflgel', 'Weist einen Welpen dazu an, $2oa aufgebrachte Unkrautlinge, $3oa aufdringliche Welpenstecher und $4oa unerbittliche Windste zu erledigen.', 'Die Drachen waren recht lange weg von den Inseln, $p. Um ehrlich zu sein, sind einige unserer Fhigkeiten verkmmert, whrend sie von Generation zu Generation weitergegeben wurden.\n\nDiese Welpen sollten einfach zu unterrichten sein, doch wir haben ein paar Probleme, sie im Zaum zu halten.\n\nSagt...\n\nIch habe gesehen, dass selbst Majordomus Selistra bei den wichtigsten Aufgaben auf Euch vertraut. Wrdet Ihr uns Eure Untersttzung gewhren und einem unserer Kinder helfen?', '', '', '', '', '', '', 47187),
(70060, 'deDE', 'Akademieaufstieg - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(70059, 'deDE', 'Akademieaufstieg', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(70058, 'deDE', 'Freund zu reparieren', 'Sammelt $1oa weiche Rubinfedern, $2oa Stofffetzen und $3oa Glasperle in der Nhe des Rubinlebensschreins, um Glcksente zu reparieren.', 'Glcksente wurde verletzt, whrend wir rumgeflogen sind... Es ging ihr so gut und dann bin ich... Ich bin gegen einen Baum gestoen!\n\n<Lillistrasza deutet traurig auf die beschdigte Stoffente auf ihrem Kopf.>\n\nIhre Fllung fllt raus! Ihre Federn sind ganz verbogen! Eines ihrer Augen ist verschwunden! Neiiiiin!\n\nIhr knnt doch helfen, Glcksente zu reparieren, oder?', '', '', '', '', '', '', 47187),
(70055, 'deDE', 'Siegel der Strme', 'Bringt das Siegel der Strme zu Sturmjger William in Sturmwind.', '<Jemand mit groem magischen Wissen wrde so etwas sicherlich gerne studieren wollen.>', '', '', '', '', '', 'Bringt das Siegel der Strme zu Sturmjger William in Sturmwind.', 47187),
(70052, 'deDE', 'Klippenrundstrecke - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
