(70050, 'deDE', 'Sturmjagd', 'Sprecht mit Sturmjger William am Hafen von Sturmwind.', 'Die hbschen Leutchen schicken Euch also auf ein kleines Abenteuer, wie?\n\nKeine Sorge. Bis jemand diese Elementarstrme in den Griff bekommt, knnen wir eh nicht losschippern.\n\nSprecht mit Sturmjger William. Er ist in der Expedition fr die Untersuchung der Strme verantwortlich und kann Euch sicher mit der ntigen Ausrstung versorgen.\n\nIch koordiniere von hier den Rest der Vorbereitungen, whrend Ihr da drauen Spa habt.\n\nDafr seid Ihr mir aber was schuldig, klar?', '', '', '', '', '', 'Sprecht mit Sturmjger William am Hafen von Sturmwind.', 47187),
(70049, 'deDE', 'Die Strme beruhigen', 'Sammelt $1oa Partikel urtmlicher Energie von Gegnern an Orten aktiver Urstrme in Kalimdor und den stlichen Knigreichen.', 'Diese Primalisten sind erbarmungslos und entfesseln elementare Verwstung in den stlichen Knigreichen und Kalimdor.\n\nIhr msst genau so viel Entschlossenheit zeigen, $n. Das ist der einzige Weg, sie aufzuhalten.\n\nFindet heraus, wo sie als Nchstes eindringen, entfernt die Gegner im Gebiet des Ursturms, bevor es zu spt ist, und macht ihre Plne zunichte.\n\nWir mssen Azeroth beschtzen!', '', '', '', '', '', '', 47187),
(70048, 'deDE', 'Eine Urbedrohung', 'Sammelt $1oa Partikel urtmlicher Energie von Gegnern an Orten aktiver Urstrme in Kalimdor und den stlichen Knigreichen.', 'Raszageth hat keine Zeit verschwendet, ihre Primalistenstreitkrfte auszubauen.\n\nDie Kirin Tor haben massive Strme entdeckt, die an Schlsselpunkten in Kalimdor und den stlichen Knigreichen freigesetzt werden.\n\nDie Primalisten entfesseln die Elemente, um ihre Macht zu strken. Es scheint, als htten sie nicht nur auf den Dracheninseln, sondern auch in den Lndern der Allianz und der Horde vor, Chaos zu stiften.\n\nSucht den Feind auf und studiert seine Methoden. Wir mssen ihn aufhalten, bevor es zu spt ist.', '', '', '', '', '', '', 47187),
(70047, 'deDE', 'Eisige Gefngnisse', '', '', '', '', '', '', '', '', 47187),
(70042, 'deDE', 'Jede Menge Mglichkeiten', 'Besorgt mehrere Gegenstnde fr Wisch den Schleicher.', 'Ihr habt mir einen Schrecken eingejagt, ich dachte schon, ich wre erwischt worden!\n\nSchaut Euch die ganzen mutigen Forscher an, bereit die Dracheninseln zu erobern... Taschen voller Werkzeuge und Ausrstung.\n\nWir knnten hier reich werden!\n\nSeht Euch um, ob Ihr einige Gegenstnde in die Finger bekommt, und ich teile den Profit mit Euch.', '', '', '', '', '', '', 47187),
(70041, 'deDE', 'Der Zorn der Sturmfresserin', 'Nutzt Khadgars Flugscheibe und haltet die Primalistenarmee auf.', 'Raszageth versucht, alle Arkanmagie aus dem Turm zu ziehen, sodass sie ihn zerstren kann!\n\nKalecgos tut, was er kann, um sie aufzuhalten, und ich versuche, mit meiner Magie die Leyenergie wiederherzustellen.\n\nIch frchte, wir halten nicht mehr viel lnger durch. Genau in diesem Moment befinden sich weitere Primalisten auf dem Weg hier hoch, um uns zu berwltigen!\n\nNehmt meine modifizierte Arkanscheibe. Haltet die eintreffenden Primalisten auf... und lasst uns auf ein Wunder hoffen.', '', '', '', '', '', 'Sprecht mit Kalecgos am Fu des Vakthros.', 47187),
(70040, 'deDE', 'Sturz durch die Zeit', 'Versammelt Eure Verbndeten und sprecht anschlieend mit Nozdormu.', 'Als die Magie der Bronzenen mit der der Ewigen kollidierte, befrderte sie Chronormu und Eternus in einen unkontrollierten Sturz durch die Zeit.\n\nWhrend sie fallen, zerreien sie das Gewebe der Zeit selbst und senden zahllose Wellen durch Raum und Zeit. Wir mssen sie aufspren und zurckholen. Nur so knnen wir weitere Schden vermeiden. Ich sehe, dass Ihr Chronormus Fall beenden werdet.\n\nIch wrde Euch bitten, die Verbndeten zu versammeln, die Ihr braucht, um Chronormu zu retten. Ich werde mich unterdessen auf ihre Magie konzentrieren.', '', '', '', '', '', 'Versammelt Eure Verbndeten und sprecht anschlieend mit Nozdormu.', 47187),
(70035, 'deDE', 'Ruriqs Stromschnellenritt', '', '', '', '', '', '', '', '', 47187),
(70034, 'deDE', 'Handwerkerversorgung: Salamantherschuppe', 'Liefert eine Salamantherschuppe an Haephesta beim Rubinlebensschrein.', 'Braucht Ihr Arbeit, $gKrschner:Krschnerin;? Ich soll fr die Kunden des Handwerkerkonsortiums die Schuppe eines Salamanthers sammeln.\n\nIch mag Handwerkerin sein, aber die Botengnge knnen sie allein unternehmen!\n\nAber... ach, vielleicht knnt Ihr ja eine auftreiben?', '', '', '', '', '', 'Liefert eine Salamantherschuppe an Haephesta beim Rubinlebensschrein.', 47187),
(70033, 'deDE', 'Handwerkerversorgung: Lederstiefel des Pioniers', 'Liefert Lederstiefel des Pioniers an Haephesta beim Rubinlebensschrein.', 'Auf der Suche nach Arbeit, $gLederverarbeiter:Lederverarbeiterin;? Das Handwerkerkonsortium will ein Paar Stiefel fr seine Kundschaft von mir.\n\nDie wissen anscheinend nicht, wie gefragt ich bin. Wisst Ihr, wie viele Forschersleute allein heute mit lchrigem Schuhwerk vorbeigekommen sind?\n\nNehmt diese Mae, falls Ihr Zeit habt. Vielleicht kann man mit diesem Konsortium ja gut Geschfte machen.', '', '', '', '', '', 'Liefert Lederstiefel des Pioniers an Haephesta beim Rubinlebensschrein.', 47187),
(70032, 'deDE', 'Handwerkerversorgung: Juweliersbrille', 'Liefert Kopflupen aus gesplittertem Onyx an Haephesta beim Rubinlebensschrein.', 'Sucht Ihr Arbeit, $gJuwelenschleifer:Juwelenschleiferin;? Das Handwerkerkonsortium hat mich gebeten, eine Brille fr deren Kunden herzustellen.\n\nMich! Als ob ich Zeit fr diesen Nonsens htte.\n\nIhr knnt das doch bernehmen, oder?', '', '', '', '', '', 'Liefert Kopflupen aus gesplittertem Onyx an Haephesta beim Rubinlebensschrein.', 47187),
(70031, 'deDE', 'Handwerkerversorgung: Glattes Nudelholz des Kochs', 'Liefert ein glattes Nudelholz des Kochs an Haephesta beim Rubinlebensschrein.', 'Seid Ihr auf der Suche nach einer bezahlten Beschftigung, $gInschriftenkundiger:Inschriftenkundige;?\n\nEine Gesellschaft namens Handwerkerkonsortium ist mit einem Auftrag an mich herangetreten.\n\nDieser knnte fr einen Lehrling wie Euch genau das Richtige sein.', '', '', '', '', '', 'Liefert ein glattes Nudelholz des Kochs an Haephesta beim Rubinlebensschrein.', 47187),
(70030, 'deDE', 'Handwerkerversorgung: Qualittsgesichertes Optikmodul', 'Liefert ein qualittsgesichertes Optikmodul an Haephesta beim Rubinlebensschrein.', 'Ah, $gein Ingenieur:eine Ingenieurin;, und grade zur rechten Zeit!\n\nIch muss ein paar Bauplne berarbeiten, aber eine groe Frau ist vorbeigeschneit und wollte ein Optikmodul haben.\n\nIhr kennt Euch doch mit so was aus, oder?\n\nBringt es zum Rubinlebensschrein, wenn Ihr es fertighabt. Sie hat irgendwas vom Handwerkerkonsortium erzhlt.', '', '', '', '', '', 'Liefert ein qualittsgesichertes Optikmodul an Haephesta beim Rubinlebensschrein.', 47187),
(70029, 'deDE', 'Handwerkerversorgung: Runenverzierte Serevitruten', 'Liefert $1oa runenverzierte Serevitruten an Haephesta beim Rubinlebensschrein.', 'Ihr scheint ein magisches Hndchen zu haben, $gVerzauberer:Verzauberin;. Knntet Ihr mir bei einem Auftrag helfen?\n\nDas Handwerkerkonsortium hat fr einen Kunden mehrere Ruten aus Serevit angefordert, aber das Verzaubern von Ruten ist nicht gerade mein Spezialgebiet.\n\nWenn Ihr Euch darum kmmern wollt, wird Euch Haephesta beim Rubinlebensschrein fr Eure Mhe entlohnen!', '', '', '', '', '', '', 47187),
(70028, 'deDE', 'Handwerkerversorgung: Salzvorkommen', 'Liefert $1oa Salzvorkommen an Haephesta beim Rubinlebensschrein.', 'Lust auf Arbeit, $gBergarbeiter:Bergarbeiterin;?\n\nIch hab mich mit Haephesta unterhalten und die meinte, das Handwerkerkonsortium braucht Salz fr seine Kunden.\n\nIch wrde ja selbst was schrfen, aber, na ja, mir fehlt die Motivation.\n\nSeid doch so nett und besorgt ihnen welches!', '', '', '', '', '', 'Liefert $1oa Salzvorkommen an Haephesta beim Rubinlebensschrein.', 47187),
(70027, 'deDE', 'Handwerkerversorgung: Stoffbnder des Inspektors', 'Liefert Stoffbnder des Inspektors an Haephesta beim Rubinlebensschrein.', 'Sucht Ihr Arbeit, $gSchneider:Schneiderin;? Das Handwerkerkonsortium hat mich gebeten, Gelenkbnder fr deren Kunden zu fertigen.\n\nIch wei zu schtzen, dass die Forschersleute auf unsere Webarbeiten neugierig sind, doch mir fehlt die Zeit.\n\nHttet Ihr mglicherweise Interesse?', '', '', '', '', '', 'Liefert Stoffbnder des Inspektors an Haephesta beim Rubinlebensschrein.', 47187),
(70026, 'deDE', 'Handwerkerversorgung: Lavakfer', 'Liefert $1oa Lavakfer an Haephesta beim Rubinlebensschrein.', 'Seid Ihr auf der Suche nach Arbeit, $gKruterkundiger:Kruterkundige;? Ich soll fr die Kunden des Handwerkerkonsortiums ein paar Kfer sammeln.\n\nDas Land wimmelt zwar nur so vor Lebewesen, doch auch dieser Auftrag erfordert Zeit.\n\nKnntet Ihr ein paar Kfer mitbringen, wenn Ihr drauen umherstreift?', '', '', '', '', '', 'Liefert $1oa Lavakfer an Haephesta beim Rubinlebensschrein.', 47187),
(70025, 'deDE', 'Handwerkerversorgung: Drakoniumsichel', 'Liefert eine Drakoniumsichel an Haephesta beim Rubinlebensschrein.', 'Ihr wirkt, als httet Ihr nicht viel zu tun. Wie sieht\'s aus mit ein bisschen Arbeit?\n\nDas Handwerkerkonsortium hat bei mir eine Drakoniumsichel in Auftrag gegeben. Natrlich knnte ich die im Handumdrehen schmieden, aber in meinen Augen ist das eher was fr Lehrlinge.\n\nFertigt die Sichel und bringt sie zum Rubinlebensschrein. Eine Draenei namens Haephesta wird Euch entlohnen.', '', '', '', '', '', 'Liefert eine Drakoniumsichel an Haephesta beim Rubinlebensschrein.', 47187),
