(69984, 'deDE', 'Goldgefasster Drachenzahn', 'Bringt den Gegenstand zu Exadria.', '<Ihr seid auf den berrest eines gefallenen Drachen gestoen. Exadria wird ihn sicher sehen wollen.>', '', '', '', '', '', '', 47187),
(69983, 'deDE', 'Flammengeschnitzter Knochen', 'Bringt den Gegenstand zu Krallenpirscherin Kavia.', '<Geheimnisvolle Djaradinrunen, die in einen Knochen geschnitzt wurden. Krallenpirscherin Kavia wrde sich das bestimmt ansehen wollen.>', '', '', '', '', '', '', 47187),
(69981, 'deDE', 'Kundenzufriedenheit', 'Fragt die Kunden des Handwerkerkonsortiums, ob sie mit ihren Umfertigungen zufrieden sind.', 'Hey, $C, habt Ihr kurz Zeit, bei etwas zu helfen?\n\nEinige unserer Stammkunden haben Umfertigungen beim Handwerkerkonsortium in Auftrag gegeben, aber wir haben schon seit einer Weile nichts mehr von ihnen gehrt.\n\nWenn Ihr ihnen ber den Weg lauft, dann stellt doch bitte fest, ob sie mit ihren Einkufen zufrieden sind, ja? Man muss die Kunden glcklich, glcklich, glcklich machen!', '', '', '', '', '', 'Liefert die Ausrstung an Mahra Baumbieger bei der Flussgabelkreuzung.', 47187),
(69980, 'deDE', 'Seeranke: Angler Tinnaks Geschenk', 'Bringt das Seil aus Seeranken zu Nunvuq in Iskaara.', '<Ihr seht, wie die Spektralhand des armen Fischers immer noch einen Faden hlt, der aus sehr starkem und doch leichtem Tang gewoben wurde. Nunvuq in Iskaara knnte ihn vielleicht brauchen.>', '', '', '', '', '', '', 47187),
(69979, 'deDE', 'Jagd der Wrde', 'Erlegt den Bullenlteste Tausendmeilen.', 'Man erhlt nicht einfach Weisheit, man erarbeitet sie sich. Wenn Ihr wnscht, Euch als wrdig zu beweisen, dann werdet Ihr das auf die gleiche Art wie der Rest meines Volkes machen und es in der Praxis lernen.\n\nFindet und erlegt den Bullenltesten Tausendmeilen, der sich unserer Jagd schon seit Generationen entzieht.\n\nDas wird Euch die Weisheit verleihen, nach der Ihr sucht.', '', 'Der Bullenlteste Tausendmeilen ist bereits Generationen von Jgern entkommen. Vielleicht gelingt es Euch ja, dieses Wildtier endlich zu fangen.', 'Tausendmeilen', '', '', '', 47187),
