(69965, 'deDE', 'Qualittssicherung', 'Testet Haephestas Werkzeuge an Geoden in der Nhe fr das Handwerkerkonsortium.', 'Sucht Ihr nach Arbeit, $C?\n\nIch vertrete eine neues Handelsunternehmen, das Handwerkerkonsortium, das Handwerker und deren Kunden ber unser Netzwerk von Handwerksauftrgen verbindet.\n\nDie Drachenschuppenexpedition hat eine Bestellung fr einige verzauberte Bergbauwerkzeuge aufgegeben. Die Werkzeuge sind fertig, aber wir wrden sie gerne testen, bevor wir die Bestellung abschlieen.\n\nWir werden Euch natrlich fr Eure Dienste bezahlen.', '', '', '', '', '', '', 47187),
