(69946, 'deDE', 'Eine Meisterin ihres Fachs', 'Sucht Meisterin Khadin auf und befragt sie zu ihrer beruflichen Weisheit.', 'Als ich diese Ebenen bereiste, traf ich eine alte Zentaurin in einer Hhle im Norden, die ihr Handwerk offensichtlich gemeistert und weise Ratschlge parat hatte.\n\nSie hat mir geholfen, das Erlernte von den Dracheninseln besser zu verstehen.\n\nWenn Ihr Euch in Eurem Beruf spezialisieren mchtet, sucht diese Meisterin des Wissens auf. Sie hie Khadin und gehrte zum Klan Teerai.', '', '', '', '', '', 'Sprecht mit Khadin in Khadins Hhle.', 47187),
(69944, 'deDE', 'Sturmjagd', 'Sprecht mit Sturmjgerin Suhrakka am Zeppelinturm.', 'Nun, der Zauberer wei auf jeden Fall, wie man einen gewaltigen Auftritt hinlegt, nicht wahr?\n\nWir knnen nicht in See stechen, bis jemand diese Elementarstrme in den Griff bekommt.\n\nWendet Euch an Sturmjgerin Suhrakka. Sie ist im Rahmen der Expedition fr die Erforschung der Strme verantwortlich und kann Euch sicher mit der ntigen Ausrstung ausstatten.\n\nIch koordiniere derweil die brigen Vorbereitungen. So kann ich wenigstens ein paar Bnde zur Drachengeschichte studieren, bevor wir aufbrechen.', '', '', '', '', '', 'Sprecht mit Sturmjgerin Suhrakka am Zeppelinturm.', 47187),
(69939, 'deDE', 'Sylvanbeistand', 'Beschafft Schnee im Hrnchen und gebt ihn dem erschpften Otter.', 'Ah, $n, da seid Ihr ja! Ich suche Euch schon berall.\n\nSchon wieder hat eins unserer hiesigen Kleintiere in letzter Zeit keine Leckerlis bekommen. Zieht doch mal los und findet was Ses zum Anbeien, was meint Ihr?', '', '', '', '', '', '', 47187),
