(69936, 'deDE', 'Obervandale Zambul', 'Bezwingt Aufseher Zambul.', 'Gute Arbeit. Diese Schnder knnen meine Ahnen nicht mehr dazu zwingen, fr sie zu kmpfen. Wir mssen uns aber noch um den Wstling kmmern, der ihnen Befehle zuruft.\n\nDas ist ihr Aufseher, Zambul. Er muss aufgehalten werden.\n\nErledigt ihn.', '', '', 'Aufseher Zambul', '', '', '', 47187),
(69934, 'deDE', 'Blutende Herzen', 'berbringt die medizinischen Vorrte.', 'Die Trnke sind fertig, jetzt mssen sie nur noch geliefert werden.\n\nBringt eine Kiste zu einer kleinen Hhle in der Schlucht unter uns. Es wird niemand da sein, um sie entgegenzunehmen, aber seid Euch sicher, dass sie dort guten Nutzen findet.\n\nBringt die nchste Kiste zum Lazarett im Posten der Gelikyr. Ein alter Freund kmmert sich dort um die Patienten.\n\nIch... wei, dass das nicht Eure Aufgabe ist. Und die meine ist es auch nicht wirklich. Aber Ihr wart erstaunlich hilfreich, und diese Medizin knnte Leben retten.', '', '', '', '', '', '', 47187),
(69933, 'deDE', 'Der Preis der Neugier', 'Nehmt einen Ableger von der robusten Ranke.', 'Schaut ber die Schlucht, $R. Primalisten haben vor Tagen den Posten der Gelikyr angegriffen, und der Kampf hat noch kein Ende gefunden.\n\nDie Leute brauchen Salben und mssen genht werden. Ich kann alles Ntige herstellen, aber langsam gehen mir die Zutaten aus. Da Ihr Euch dazu entschlossen habt, in mein Heim einzudringen, betrachtet Euch als $gFreiwilliger:Freiwillige;.\n\nGeht zu meinem Garten und schnappt Euch die grte Ranke, die Ihr finden knnt. Brecht sie an der Wurzel ab und bringt sie dann zu mir.', '', '', '', '', '', '', 47187),
(69932, 'deDE', 'Jedes Leben zhlt', 'Sammelt Zutaten, um den Verband des kleinen Strahlstroms zu ersetzen.', 'Trnke fr Gelikyr herzustellen, bedeutet, dass ich keine Zeit fr meine anderen Pflichten habe.\n\nIn meinem Garten ist eine Ente mit einer gebrochenen Rippe gelandet. Ich habe ihre Wunde behandelt, aber der Verband msste gewechselt werden. Und da Ihr so erpicht darauf seid, zu helfen...\n\n<Szareth drckt Euch eine Liste mit Zutaten in die Hand.>\n\nDies werdet Ihr brauchen. Bringt den Rest bitte zu mir.', '', '', '', '', '', '', 47187),
(69930, 'deDE', 'Basrikron', '', '', '', '', '', '', '', '', 47187),
(69925, 'deDE', 'Die Strme beruhigen', 'Sammelt $1oa Partikel urtmlicher Energie von Gegnern an Orten aktiver Urstrme in Kalimdor und den stlichen Knigreichen.', 'Diese Primalisten sind erbarmungslos und entfesseln elementare Verwstung in den stlichen Knigreichen und Kalimdor.\n\nIhr msst genau so viel Entschlossenheit zeigen, $n. Das ist der einzige Weg, sie aufzuhalten.\n\nFindet heraus, wo sie als Nchstes eindringen, entfernt die Gegner im Gebiet des Ursturms, bevor es zu spt ist, und macht ihre Plne zunichte.\n\nWir mssen Azeroth beschtzen!', '', '', '', '', '', '', 47187),
(69923, 'deDE', 'Eine Urbedrohung', 'Sammelt $1oa Partikel urtmlicher Energie von Gegnern an Orten aktiver Urstrme in Kalimdor und den stlichen Knigreichen.', 'Raszageth hat keine Zeit verschwendet, ihre Primalistenstreitkrfte auszubauen.\n\nDie Kirin Tor haben massive Strme entdeckt, die an Schlsselpunkten in Kalimdor und den stlichen Knigreichen freigesetzt werden.\n\nDie Primalisten entfesseln die Elemente, um ihre Macht zu strken. Es scheint, als htten sie nicht nur auf den Dracheninseln, sondern auch in den Lndern der Allianz und der Horde vor, Chaos zu stiften.\n\nSucht den Feind auf und studiert seine Methoden. Wir mssen ihn aufhalten, bevor es zu spt ist.', '', '', '', '', '', '', 47187),
(69919, 'deDE', 'Ein Handwerk in Not', 'Sprecht mit Azley und erfahrt mehr ber das Erfllen von Handwerksauftrgen.', 'Ihr scheint mir geschickt im Handwerken zu sein. Mchtet Ihr vielleicht ein paar Handwerksauftrge fr andere Abenteurer bernehmen und reich, reich, reich werden?\n\nDie Regeln des Handwerkerkonsortiums sind schnell erklrt und dann knnt Ihr an allen Handwerksstationen auf den Dracheninseln Auftrge annehmen!', '', '', '', '', '', '', 47187),
(69918, 'deDE', 'Erschtterung unserer Fundamente', 'Ttet Steinbrecherin Tokara, Molka die Schleiferin und die Elementare, die sie entfesselt haben.', 'Steinbinder der Djaradin drohen damit, die Fundamente dieses Gebudes zu zerstren! Wir mssen sie aufhalten!\n\nWir hatten noch nicht einmal die Gelegenheit, die Zitadelle zurckzuerobern, und jetzt steht sie kurz davor, unter unseren Fen wegzubrechen.\n\nTut, was Ihr knnt, $n...und damit meine ich: Legt sie um!', '', 'Ebenso wie Steinbrecherin Tokara ist Molka eine geschickte Bearbeiterin des harten Obsidiansteins unter der Zitadelle.', 'Molka die Schleiferin', '', '', '', 47187),
(69915, 'deDE', 'Gezielte Werbung', 'Holt Flugbltter von den Flussgabelziegen und den strenden Ziegen zurck.', 'Hi, hi, hi! Seid Ihr auf der Suche nach Auftrgen?\n\nWir veranstalten einen RIESIGEN Erffnungsverkauf fr unseren neuen Handwerksauftragsservice und mssen dafr ordentlich Aufmerksamkeit auf uns ziehen! ...Doch der Wind hat meine Flugbltter davongeweht und ich glaube, ein paar der rtlichen Ziegen sind mit ihnen davongerannt.\n\nKnntet Ihr meine Handzettel zurckbringen?', '', '', '', '', '', '', 47187),
(69914, 'deDE', 'Die Djaradin sind erwacht', 'Erhaltet Eure Befehle von Majordomus Selistra.', 'Ich wnschte, wir htten mehr Zeit fr standesgeme Begrungen, aber wir knnen nicht alle Chronormu sein, stimmt\'s?\n\nIch bin Selistra, Majordomus von Alexstrasza der Lebensbinderin, Knigin der Drachen.\n\nKnigin Alexstrasza hat mich gebeten, ihre besten Gre zu berbringen und Euch zu ihr bei den Lebensbecken zu eskortieren.\n\nAber ich frchte, bevor wir zu ihr aufbrechen knnen, muss ich Euch um Eure Hilfe bitten.\n\nUnsere uralten Rivalen, die Djaradin, sind von ihrem Schlummer unter der Erde erwacht und haben bereits einen nahegelegenen Auenposten berfallen!', '', '', '', '', '', 'Trefft Euch mit Sendrax in der Botschaft von Schwingenrast.', 47187),
(69912, 'deDE', 'Mein erster echter Notfall!', 'berredet Sendrax, ihr Notsignal abzufeuern, um die Drachen ber Eure Ankunft zu unterrichten.', '<Sendrax wirkt verwirrt.>\n\nIch habe nie erlebt, dass Majordomus Selistra zu irgendetwas zu spt kommt, schon gleich gar nicht SO viel zu spt zu SO etwas Wichtigem.\n\nSehr ungewhnlich...\n\n<Sendrax kommt ein Gedanke.>\n\nIch knnte mein Notsignalfeuer nutzen, um Selistra ber Eure Ankunft zu unterrichten. Dann wird man Euch sicherlich sofort begren!\n\nAllerdings habe ich mein Notsignal noch nie abgefeuert...', '', '', '', '', '', 'Trefft Euch mit Furorion in der Botschaft von Schwingenrast.', 47187),
(69911, 'deDE', 'Entschuldigt das Chaos', 'Helft Botschafter Fastrasz, die Botschaft wieder aufzubauen.', 'Ich wnschte, ich knnte Euch besser auf den Dracheninseln begren, aber ich bin nur der Wachposten.\n\n<Sendrax deutet auf den Turm hinter sich.>\n\nIhr knntet versuchen, mit Botschafter Fastrasz im Besucherzentrum zu sprechen. Er kann vielleicht einige Eurer Fragen beantworten, bis die Drachen hier sind.\n\nPasst auf, wo Ihr hintretet. Er hat vor Kurzem Schutt weggerumt.', '', '', '', '', '', '', 47187),
(69910, 'deDE', 'Wo ist Furorion?', 'Fragt Sendrax, wann die Drachen ankommen sollten.', 'Wie ungewhnlich.\n\nEbyssian hat gesagt, Furorion wrde hier unsere Ankunft erwarten, zusammen mit einem Botschafter von Alexstrasza der Lebensbinderin, Knigin der Drachen.\n\nEs sieht einem Drachen nicht hnlich, ein Versprechen nicht zu halten.\n\nWenigstens ist diese eifrige Drakonide hier, um uns zu empfangen. Wrdet Ihr bitte herausfinden, wann die anderen ankommen?', '', '', '', '', '', '', 47187),
(69904, 'deDE', 'Verdchtig ruhig', 'Findet Norikos Lehrlinge im Lager Antonidas.', 'Habt Ihr einen Augenblick Zeit, $p? Ich habe von meinen beiden Lehrlingen, Stiebitz und Tucki, schon eine Weile nichts mehr gehrt.\n\nIch mache mir Sorgen.\n\nSie sollten Vorrte fr das Gasthaus besorgen. Allzu weit drften sie nicht gekommen sein...\n\nBitte findet sie, aber seid gewarnt. Sie sind... ziemlich anstrengend.', '', '', '', '', '', '', 47187),
(69902, 'deDE', 'Theorie in Praxis', 'Helft Tyrgon, die Kreatur zu heilen.', '$n, ich bentige Eure Untersttzung...\n\nEs erwartet doch hoffentlich niemand, dass ich hier bastele, den Welpen beruhige, heile und gleichzeitig die Kinder unterrichte! Alles gleichzeitig zu machen, wird wahrlich berschtzt.\n\nNun, Ihr knnt damit anfangen, indem Ihr diese Blumen benutzt. Ich werde einige Minuten Vorbereitungszeit bentigen, um den Protowelpen zu heilen.\n\nHoffentlich ist das dann fr die Kinder auch noch... lehrreich.', '', '', '', '', '', '', 47187),
(69901, 'deDE', 'Einbeziehen eines Experten', 'Sammelt $1oa Sonnenlichtblumen.', 'Hat Iyali gesagt, wie lange dieses Wesen schon leidet? Wenn es wegen der Schmerzen nicht mehr essen kann, mssen wir es schnell behandeln.\n\nNormalerweise wrde es in einem Lager der Drachenschuppenexpedition die notwendigen Vorrte dafr geben, doch im Grenzland der Dracheninseln kommt man nicht so leicht an Ressourcen. Es gab sprbare Verzgerungen auf den Versorgungsrouten.\n\nAber keine Bange. Das Land wird uns schon versorgen! Wenn Ihr mir Sonnenlichtblumen bringt, kann ich eine Salbe mischen, die den Drachen beruhigt, damit ich ihn besser behandeln kann.', '', '', '', '', '', '', 47187),
(69900, 'deDE', 'Die Quelle identifizieren', 'Ttet den experimentierenden Primalisten im Wildreservat.', 'Nach dem, was die Kinder gesagt haben, knnte es sein, dass sich ein Primalist im Wildreservat herumtreibt.\n\nDies erfordert eine sofortige Untersuchung.\n\nAndere Forscher haben festgestellt, dass die Primalisten immer wieder Eier und Welpen stehlen, um ihnen Macht einzuflen und sie zu verderben. Diejenigen, die diesem Prozess nicht standhalten, erleiden einen langsamen Tod... Aber das interessiert die Primalisten nicht sonderlich...\n\nSie mssen raus aus dem Reservat. Kmmert Ihr Euch darum. Ich werde derweil versuchen, die Kinder abzulenken. Sie drfen nichts davon erfahren.', '', '', '', '', '', '', 47187),
(69899, 'deDE', 'Geheime Forschung', 'Helft Iyali und ihren Freunden.', 'Ich wei, dass ich mich komisch verhalte. Tut mir leid!\n\nIhr habt Euch vermutlich schon gedacht, dass ich nicht die ganze Wahrheit sage.\n\nIch kann Euch von meinem Geheimnis erzhlen... wenn Ihr wollt. Aber Ihr msst versprechen, den Erwachsenen nichts zu verraten.', '', '', '', '', '', '', 47187),
(69898, 'deDE', 'Fleisch mit einer Portion Wissenschaft', 'Sammelt $1oa Stcke extraleckeres Flussbestienfleisch.', 'h, ja, also ich, ich habe noch mehr Hausaufgaben... Professor Tyrgons Stunden sind echt schwer! Jetzt soll ich rausfinden, was Protowelpen, h, fressen! Jawohl...\n\nWartet, ich kenne die Antwort darauf. Sie fressen Flussbestien!\n\nKnnt Ihr mir ein Stck Flussbestienfleisch bringen? Es wre perfekt, zu \"Anschauungszwecken\" etwas Flussbestienfleisch fr mein Projekt zu haben.\n\nEs muss aber ein WIRKLICH gutes Stck sein, okay? Ich meine... wie von den dicklichen Flussbestien. So eins, was ein Mamaprotodrache anschleppen wrde, um die Protowelpen richtig stark zu machen, weil... h... es Herr Tyrgon so glcklich macht.', '', '', '', '', '', '', 47187),
(69897, 'deDE', 'Verhaltensanalyse-\"Hausaufgaben\"', 'Streichelt $4oa schlafende Welpen und meldet Euch dann wieder bei Iyali.', 'Ich muss mit jemandem sprechen, der sich mit Protowelpen auskennt. Wie die, die im Wildreservat leben!\n\nSind die so wtend wie die Groen? Beien die oder spucken sie Feuer auf einen?\n\nWas wre, wenn ich... h... IHR einen Protowelpen streicheln wrdet? Wrden sie wissen, dass Ihr nett seid und ihnen zu helfen versucht?\n\nIch frage fr die Wissenschaft, natrlich. Tyrgon sagt uns immer, dass wir unsere Hypa.. nein... Hippo... hmpf! Hippothresen... hnn! THEORIEN auf die Probe stellen sollen!\n\nIch glaube, dass sie gerne gestreichelt werden wollen und dass sie sich dann besser fhlen wrden. Knntet Ihr das fr mich untersuchen?', '', '', '', '', '', '', 47187),
(69896, 'deDE', 'Unglcklicher Umweg', 'Trefft Elementaristin Taiyang in den Ruinen des Lebensgewlbes.', 'Ich wusste, dass ich mich in Gefahr begeben wrde, wenn ich der Drachenschuppenexpedition beitrete. Aber ich hatte nicht damit gerechnet, gegen Elementare kmpfen zu mssen!\n\nAn unserer Ausgrabung, den Ruinen des Lebensgewlbes, herrscht das pure Chaos! Steinerne Monstrositten steigen aus dem Boden empor! Wir haben eine Elementaristin zu unserer Beratung angefordert, aber ich glaube, sie wird jede Hilfe brauchen, die sie bekommen kann.\n\nVielleicht knntet Ihr das bernehmen? Unser Lager liegt gleich jenseits des Flusses.', '', '', '', '', '', '', 47187),
