(69870, 'deDE', 'Bilder mit Bedeutung', 'Trefft Akunda die Katalogisiererin und Kanonierin Fren in der Nhe der berlaufenden Stromschnellen.', 'Bilder bringen die Leute zusammen, $p.\n\nUnsere Katalogisierer rcken zur Sicherheit nur im Doppelpack aus und es war schn zu sehen, wie Mitglieder verschiedener Fraktionen und Hintergrnde auf diesen unglaublichen Inseln auf der Suche nach Wissen zusammengearbeitet haben.\n\nEines dieser eifrigen Duos kartografiert gerade einen der zentralen Flsse der Kste des Erwachens.\n\nWenn Ihr unserer Sache behilflich sein wollt, stot zu ihnen und helft ihnen dabei, die hiesige Fauna zu katalogisieren.', '', '', '', '', '', 'Trefft Akunda die Katalogisiererin und Kanonierin Fren in der Nhe der berlaufenden Stromschnellen.', 47187),
(69869, 'deDE', 'Ein Paradies fr Katalogisierer', 'Sprecht mit Katalogisiererin Coralie im Drachenschuppenbasislager.', '<Dok Charly ist auer Atem, als er Euch einen Brief berreicht, der Euch fr weiteres Training zurck ins Basislager der Drachenschuppenexpedition einldt. Er versucht, das Anliegen eifrig zu erklren.>\n\nNetter Elf. Stolzer, winziger Mann. Viele Kameras. Ja?\n\n<Dok Charly nickt aufgeregt, whrend er auf Eure Antwort wartet.>', '', '', '', '', '', 'Sprecht mit Katalogisiererin Coralie im Drachenschuppenbasislager.', 47187),
