(69096, 'deDE', 'Taivans Bestimmung', 'Versucht, die Zentaurenwaise Chimei zu trsten.', 'Seht Ihr das Zentaurenkind, das ganz alleine da drben am Bachufer sitzt?\n\n<Sie deutet nach Nordosten, wo Ihr ein Zentaurenkind aufs Wasser starren seht.>\n\nChimei hat whrend des Angriffs der Nokhud beide Eltern verloren. Alle krperlichen Wunden konnte ich heilen, doch ich habe Chimei bisher noch nicht essen sehen oder sprechen hren. Sitzen und starren, den ganzen Tag.\n\nDas bersteigt meine Fhigkeiten und ich wei nicht, was ich tun soll. Knntet Ihr versuchen, mit Chimei zu sprechen, $n?', '', '', '', '', '', '', 47187),
(69095, 'deDE', 'Heimwrts mit Hund', 'Reitet mit Taivan zurck nach Maruukai.', 'Dank Euch und Taivan sind alle stabilisiert, doch viele der Dorfbewohner mssen noch etwas in Maruukai bleiben, um sich zu erholen.\n\nWarum fhrt Ihr beiden nicht gemeinsam den Zug zurck? Ihr seid schlielich die Helden der Stunde!', '', '', '', '', '', '', 47187),
(69094, 'deDE', 'Zentauren retten', 'Rettet verwundete Zentauren in Daruukhan.', 'Die Heimtcke der Nokhud kennt keine Grenzen! Lediglich Handwerker leben in Daruukhan. Sie hatten absolut keine Chance gegen die Ruber.\n\nWir brauchen dringend Eure Hilfe, $n. Die Nokhud sind noch in der Nhe, und wir mssen die Verwundeten versorgen!\n\nDurchsucht das Dorf und bringt die berlebenden zu mir. Wir kmmern uns dann um sie und stabilisieren sie, so gut es geht!', '', '', '', '', '', '', 47187),
(69093, 'deDE', 'Ein neues Mysterium', 'Sprecht mit Naleidea Flussglanz im Drachenschuppenbasislager.', '<Dok Charly ist auer Atem, als er Euch einen Brief berreicht, der Euch zurck ins Basislager der Drachenschuppenexpedition einldt. Er versucht, das Anliegen eifrig zu erklren.>\n\nVersiegelte Tr. Titanengeheimnisse. Ja?\n\n<Dok Charly nickt aufgeregt, whrend er auf Eure Antwort wartet.>', '', '', '', '', '', 'Sprecht mit Naleidea Flussglanz im Drachenschuppenbasislager.', 47187),
(68799, 'deDE', 'Rckkehr zum Rubinlebensschrein', 'Kehrt zum Rubinlebensschrein zurck.', 'Und dies ist nur der Anfang Eurer Reise auf dem Rcken eines Drachen!\n\nHaltet die Augen stets nach neuen Abenteuern und Erfahrungen offen und besucht uns in unseren Auenposten, die berall auf den Dracheninseln verteilt sind.\n\nDoch kehrt nun frs Erste zu Alexstrasza zurck und setzt Eure Erkundungen dieser Lande fort.', '', '', '', '', '', 'Kehrt zu Alexstrasza beim Rubinlebensschrein zurck.', 47187),
(68798, 'deDE', 'Drachenglyphen fr Anfnger', 'Sammelt die Drachenglyphe am Himmelhochobservatorium und sprecht dann mit Lithragosa, um Euer Talent einzusetzen.', 'Natrlich sind nicht nur Glensera und ich an diesen Abenteurern interessiert. Lithragosa freut sich auch darauf, Euer Geschick im Drachenreiten zu verbessern und ihr habt glcklicherweise Celormu bereits getroffen.\n\nAuf den Dracheninseln befinden sich auerdem Glyphen, die Euch helfen, mehr Tricks und Fhigkeiten frs Drachenreiten zu erlernen. Eine befindet sich sogar gleich hier im Himmelhochobservatorium.\n\nSobald Ihr sie gefunden habt, kann Lithragosa Euch zeigen, wie Ihr sie einsetzt!', '', 'Diese Glyphen, die man auf den Dracheninseln vorfindet, werden Euch helfen, mehr Tricks und Fhigkeiten fr das Drachenreiten zu erlernen.', 'Drachenglyphe', '', '', '', 47187),
(68797, 'deDE', 'Ein neues Paar Hrner', 'Trefft Glensera und verwendet das Podium der Transformation, um das Aussehen Eures Drachen zu verndern.', 'Wie auch den Sterblichen ist den Drachen ihr ueres sehr wichtig. Euer Drache kann sein Aussehen ebenfalls verndern, je nachdem, was Ihr findet und erlebt.\n\nSprecht mit Glensera am Podium der Transformation und seht selbst!', '', '', '', '', '', '', 47187),
(68796, 'deDE', 'Das Himmelhochobservatorium', 'Reist zum Himmelhochobservatorium an der Kste des Erwachens.', 'Das sind die Grundlagen im Drachenreiten! Ihr macht das ziemlich gut.\n\nJetzt wrde ich Euch gerne den anderen vorstellen, die auch in dieses Abenteuer verwickelt sind. Wir haben uns drben im Himmelhochobservatorium eingerichtet.\n\nCelormu kann Euch dorthin fhren. Sprecht mit ihm, wenn Ihr Euch fr den Flug bereit fhlt!\n\nWir sehen uns dann dort!', '', '', '', '', '', 'Trefft Lord Andestrasz im Himmelhochobservatorium.', 47187),
(68795, 'deDE', 'Drachenreiten', 'Sprecht mit Lord Andestrasz im Rubinlebensschrein.', 'Euch ist vermutlich bereits aufgefallen, dass die Dracheninseln sehr weitlufig sind.\n\nEinige der Drachen haben ein flammendes Interesse daran, in diesem erneuerten Land jede Ecke zu erkunden und jedes Geheimnis aufzudecken, auch wenn man es nicht vom Boden aus erreichen kann. Sie freuen sich ber ein zweites Paar Augen, das ihnen auf ihrer Reise hilft und werden im Tausch gerne einen Reiter ber das Land tragen.\n\nSprecht mit Lord Andestrasz hier im Rubinlebensschrein. Er wird Euch erklren, was sie vorhaben.', '', '', '', '', '', 'Sprecht mit Lord Andestrasz im Rubinlebensschrein.', 47187),
(68794, 'deDE', 'Drachenbund', 'Sprecht mit Alexstrasza am Sitz der Aspekte in Valdrakken.', 'Dass Ihr den Dracheninseln geholfen habt, ist nicht unbemerkt geblieben, $n.\n\nDie Lebensbinderin hchstpersnlich mchte Euch als Belohnung fr die Dienste, die Ihr den Drachen erwiesen habt, etwas zeigen.\n\nBesteigt die Turmspitze und sprecht mit ihr. Alle Aspekte erwarten Euch.', '', '', '', '', '', 'Sprecht mit Alexstrasza am Sitz der Aspekte in Valdrakken.', 47187),
(68644, 'deDE', 'S wie Zucker', 'Helft bei der Behandlung von Sylvie.', 'Na bitte! Jetzt habe ich alles, was ich fr Sylvie brauche!\n\nUnd genau zur richtigen Zeit. Ich bezweifle, dass sie noch viel lnger durchgehalten htte.\n\nAllerdings... brauche ich jemanden, der mir hilft. Ich wrde ja Calli fragen, aber... wrdet Ihr mir vielleicht noch mal helfen?\n\nGebt mir Bescheid, sobald Ihr bereit seid, $n.', '', '', '', '', '', '', 47187),
(68643, 'deDE', 'Vitamine und Mineralien', 'Sammelt $1oa mineralerfllte Wasserphiolen.', 'Ich htte eigentlich damit rechnen knnen, dass es Steria nicht gefallen wrde, wenn ich Euch darum bitte, Tiere zu bekmpfen...\n\nSelbstverstndlich gibt es alternative Forschungsmethoden.\n\nNehmt diese Phiolen und sammelt etwas Wasser von den Eiskristallen in der Nhe.\n\nMeine Theorie ist, dass sie Mineralien beinhalten, die mit der Energie von Leykristallen angereichert sind... was wiederum die Ursache fr den Ausbruch hier sein knnte.', '', '', '', '', '', '', 47187),
(68642, 'deDE', 'Arbeit nadelt', 'Sammelt $1oa arkanerfllte Federkiele.', 'Ich will Sylvie helfen, aber ich will Calli auch nicht lnger warten lassen.\n\nUm Sylvie die Medizin zu verabreichen, brauche ich arkanerfllte Federkiele von den Kristallrcken. Die werden sicherlich nichts dagegen haben, wenn Ihr ihnen ein paar davon ausrupft.\n\nUnd passt auf die Bakar auf! Sie fressen Kristallrcken und werden es nicht gerne sehen, wenn ihr sie anfasst. Wenn es also hart auf hart kommt und Ihr Euch verteidigen msst, lsst sich bei ihnen auch der ein oder andere Federkiel finden.\n\nAber... versucht es bitte nicht, darauf ankommen zu lassen.', '', '', '', '', '', '', 47187),
(68641, 'deDE', 'Ohne Moos nix los', 'Sammelt $1oa Drakmoosklumpen.', 'Armes Kleines...\n\nSie muss krank geworden sein, nachdem sie etwas Verunreinigtes gegessen hat.\n\nZum Glck war mein Grovater Druide und hat mir beigebracht, wie man arkan hervorgerufene Krankheiten behandelt.\n\nIch habe nicht alles Ntige bei mir, doch in der Umgebung sollte sich was finden lassen.\n\nZuerst brauche ich etwas Drakmoos. Das ist eine seltene Flechtenart, die nur auf Drachenknochen wchst.', '', '', '', '', '', '', 47187),
(68639, 'deDE', 'Eisbren auf der Jagd', 'Ttet $1oa infizierte Kaltpelze.', 'Die Spezies, die wir untersuchen sollen, sind die Kaltpelze.\n\nIhr Jagdrevier wurde von den Leylinien verunreinigt. Arkane Energie breitet sich im Wasser und in den Pflanzen aus... und in Beutetieren wie den Slyvern.\n\nDoch im Gegensatz zu anderen Organismen, berleben die Kaltpelze den Prozess und schpfen daraus sogar Kraft.\n\nAllerdings werden sie dadurch auch aggressiv... was wiederum ein Problem darstellt. Legt Euch mit ein paar von ihnen an, damit ich Aufzeichnungen zu ihrer Strke und Aggressivitt machen kann.\n\nMein Bericht wird den Kirin Tor bei der Entscheidung helfen, wie mit ihnen weiter vorzugehen ist.', '', '', '', '', '', '', 47187),
(68087, 'deDE', 'Gefahr in Daruukhan', 'Sprecht mit dem Boten der Teerai, um von Selbekhs dringender Bitte zu erfahren.', 'Ich frchte, ich kann nichts weiter tun, als Euch und Taivan nach Maruukai zurckzuschicken.\n\nWartet... Wer kommt da? Hoffentlich nicht noch ein Fremder mit einem riesigen Bakar!', '', '', '', '', '', '', 47187),
(68085, 'deDE', 'Werdegang eines Hirten', 'Bringt Taivan im Mallakh bei, Riesenwildschafe zu hten.', 'Ihr wollt, dass ich Euren Bakar im Schafehten ausbilde? Das ist es jedenfalls, was wir hier tun, doch ich habe noch nie einen Bakar von solcher STATUR ausgebildet...\n\nDie Riesenwildschafe scheinen sich immerhin nicht an seiner Anwesenheit zu stren und sie besitzen ein gutes Gespr fr den Charakter, das knnt Ihr mir glauben.\n\nIch bin bereit, ihm einen Versuch zu geben, aber ein Htebakar muss nicht nur sanft sein, sondern auch klug. Wenn er nicht die Kontrolle ber die Herde gewinnen kann, werden die Riesenwildschafe ihm auch nicht gehorchen. Es ist schwieriger, als es aussieht! Los, versucht es, ich werde zusehen.', '', '', '', '', '', '', 47187),
(68084, 'deDE', 'Der ruhige Riese', 'Bringt Taivan zu Schfer Tevatei im Mallakh, um dort ausgebildet zu werden.', 'Wenn Taivan wirklich so \"handzahm\" ist, wie Jadar sagt, ist er vielleicht besser als Htebakar geeignet!\n\nDie Aylaag sind meisterhafte Riesenwildschfer und nicht so stolz, dass sie berschwngliche Geschenke brauchen, um einem anderen Klan zu helfen.\n\nBringt Taivan bitte zu Schfer Tevatei im Mallakh, einem Ort zwischen zwei Hgeln im Sdwesten, wo sie ihre Bakar ausbilden.\n\nOhn\'ahra, bitte macht, dass das funktioniert. Sonst wei ich nicht mehr weiter.', '', '', '', '', '', '', 47187),
(68083, 'deDE', 'Nchster Versuch, Taivan!', 'Kehrt zu Heilerin Selbekh in Maruukai zurck und berbringt ihr die schlechte Nachricht.', 'Kehrt zu den Teerai zurck und sagt ihnen, dass nicht einmal ich Taivan zu einem Jagdbakar ausbilden kann. Er ist einfach nicht dafr gemacht.\n\nEr ist das handzahmste Tier, das ich je gesehen habe. Ich wette, er wrde sogar noch versuchen, sich mit dem Jagdwild anzufreunden, wenn man ihn liee. Ha!', '', '', '', '', '', 'Kehrt zu Heilerin Selbekh in Maruukai zurck.', 47187),
(67921, 'deDE', 'Der Jagdhund', 'Jagt gefhrliche Wildtiere mit Taivan, um zu beweisen, dass er wrdig ist, ausgebildet zu werden.', 'Geht und jagt in der Nhe Tiere mit Eurem riesigen Bakar. Je grer, umso besser. Ich werde Euch von hier aus beobachten und entscheiden, ob er einer Shikaarausbildung wrdig ist.\n\nSeid gewarnt, ich akzeptiere nur die Besten.', '', '', '', '', '', '', 47187),
(67772, 'deDE', 'Das Problem mit Taivan', 'Helft Heilerin Selbekh, Taivan fr die Ausbildung vorzubereiten.', 'Hallo, willkommen zurck in Maruukai. Ich bin Selbekh, Heilerin des Klans Teerai.\n\nHabt Ihr ein Hndchen fr Tiere, $n? Vielleicht ist der Einfluss eines Neulings genau das, was ich brauche.\n\nTaivan hier, wenn auch ein besonders guter Begleiter, ist zu einer Art Last fr meinen Klan geworden. Ich frchte, dass ich ihn wegschicken muss, wenn wir keinen guten Nutzen fr ihn finden. Wrdet Ihr mir helfen?', '', '', '', '', '', '', 47187),
(67744, 'deDE', 'Shezra', '', '', '', '', '', '', '', '', 47187),
