(67741, 'deDE', 'Archivring', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(67724, 'deDE', 'Schtzende Flammen', 'Sammelt $1oa Stcke Schaudernetzseide.', 'Kattigat und ich sind hierhergekommen, um uns zu beweisen, indem wir die Splitterflammen aufhalten und Valthrux sichern.\n\nUnd jetzt mssen wir auf diese Elfe aufpassen, nachdem sie ein paar Eisspinnenbisse abbekommen hat. Wir haben noch nicht einmal gegen die Splitterflammen gekmpft, und die Spinnen knnten uns erledigen, bevor es berhaupt dazu kommt!\n\nWir mssen sie in Schach halten.\n\nGlcklicherweise gibt es eine natrliche Methode, die Spinnen zu vertreiben. Wenn man die Seide ihrer Kokons verbrennt, entsteht ein Geruch, der sie abschreckt.\n\nGreift Euch etwas Seide und ich werfe sie dann ins Feuer. Das wird sie abhalten!', '', '', '', '', '', '', 47187),
(67717, 'deDE', 'Gespinstknigin Ashkaz', '', '', '', '', '', '', '', '', 47187),
(67700, 'deDE', 'Zu den Dracheninseln!', 'Nehmt die Abgewetzte Drachenschuppe vom Hafen von Sturmwind zu den Dracheninseln.', 'Groartige Neuigkeiten, $p! Unsere erste Expedition ist auf den Dracheninseln gelandet.\n\nDank Eurer Bemhungen und denen der anderen Mitglieder der Drachenschuppenexpedition haben wir einen geschtzten Landeplatz eingerichtet und Kontakt mit der Botschaft des Drachenschwarms aufgenommen.\n\nWollt Ihr uns auf unserer nchsten Reise zu den Dracheninseln begleiten?', '', '', '', '', '', 'Trefft Toddy Schnurrbart an der Kste der Dracheninseln.', 47187),
(67606, 'deDE', 'Dryadenhausmittel', 'Beschafft einen schmackhaften Schlpflingschmaus und gebt ihn dem verzweifelten Entchen.', 'Whrend Ihr fort wart, habe ich von einem Traumhasen gehrt, dass eines der hiesigen Entchen sich nicht wohl fhlt. Zum Glck wei ich genau, was man dagegen tun kann!\n\nWann immer ich schlecht gelaunt bin, nasche ich etwas Ses! Als Expertin fr niedliche, liebenswrdige Kreaturen wei ich, dass das in diesem Fall auch funktionieren wird.\n\nDieses besondere Entchen hat eine Vorliebe fr ein Dessert namens schmackhafter Schlpflingschmaus. Wrdet Ihr bitte eines finden und dem armen Schtzchen bringen? Immerhin ist das die dryadische Art!', '', '', '', '', '', '', 47187),
(67605, 'deDE', 'Donnernde Ebenen', 'Erringt Ayangas Horn.', 'Auf dem Grat wandert eine groe Sturmbestie. Viele Jger der Shikaar haben versucht, sie zu erlegen, nur um vor seiner Wildheit zu fallen.\n\nWenn es Euch nach Jagdruhm drstet, knnt Ihr gern versuchen, die Bestie zu erschlagen. Bringt uns ihr Horn als Tribut.', '', 'Eine garstige Donnerechse, die dazu neigt, Zentaurenlager zu zerstren.', 'Ayanga', '', '', '', 47187),
(67566, 'deDE', 'Frostland-berflug - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(67565, 'deDE', 'Frostland-berflug', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(67564, 'deDE', 'Handwerkerpost', 'Hndigt die Rechnung des Handwerkerkonsortiums an Thomas Heller aus.', '$gAbenteurer:Abenteurerin;, seid Ihr auf dem Weg zum Lebensschrein?\n\nWrde es Euch etwas ausmachen, Thomas Heller diese Rechnung vorbeizubringen? Er hat ein paar handgefertigte Flaschen bestellt und unser Glasblser hat endlich die Kosten fr die bentigten Materialien.\n\nIhr solltet ihn den Weg hier weiter runter finden. Wahrscheinlich slzt er gerade irgendeine arme Seele damit voll, wie toll sein Gatte ist...\n\nIch bin mir sicher, dass er Euch fr Eure Zeit entlohnen wird.', '', '', '', '', '', 'Hndigt die Rechnung des Handwerkerkonsortiums an Thomas Heller beim Rubinlebensschrein aus.', 47187),
(67299, 'deDE', 'Weg mit den Drachen', 'Nutzt einen Arkanstrahler, um $1oa Protodrachen zu tten.', 'Die Primalisten haben unser Lager ohne Unterlass mit ihren Drachen angegriffen!\n\nWir konnten sie dank unserer Schilde zurckhalten, aber wir knnten etwas Hilfe dabei brauchen, sie aus der Luft zu holen.\n\nNutzt einen unserer Strahler, um die Drachen auszuschalten!', '', '', '', '', '', '', 47187),
(67298, 'deDE', 'Die Wunder der Welt', 'Findet heraus, wie Thomas seine handwerklichen Einsichten erhlt.', 'Mein Mann Thomas hat durch seine Erkundungen dieses urzeitlichen Landes viele Einsichten gewonnen.\n\nVielleicht wrdet Ihr eine hnliche Inspiration erfahren, wenn Ihr in seine Fustapfen tretet?', '', '', '', '', '', '', 47187),
(67297, 'deDE', 'Iskaara-Tour - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
