(67295, 'deDE', 'Das ist meine Spezialitt', 'Sprecht mit Miguel Heller ber eine Berufsspezialisierung.', 'So so, Ihr habt Euch also einer Spezialisierung gewidmet, ja? Wunderbare Sache das, wenn man sich eine exklusive Fertigkeit angeeignet hat.\n\nAls Mitglied des Handwerkerkonsortiums wre es mir eine Ehre, Euch dabei zu helfen, Eure Knste zu verfeinern.\n\nVielleicht habt Ihr ja einen Moment Zeit, um Euch mein Wissen anzuhren oder etwas zu lernen, das Euch auf Euren Abenteuern hilft?', '', '', '', '', '', '', 47187),
(67222, 'deDE', 'Verdunkelte Wolken', 'Vertreibt die Primalisten von der Windspielanhhe.', 'Die Primalisten haben die Windspielanhhe mit ihren unsinnigen Lehren infiziert. Unsere Verwandten dort sind nrrisch, diese Ideen zu dulden.\n\nWenn wir dabei helfen, diesen heiligen Boden von ihrer Anwesenheit zu befreien, werden die anderen Klans uns vielleicht untersttzen, wenn es ntig wird. Glaubt Ihr, Ihr knntet helfen?', '', '', '', '', '', '', 47187),
(67221, 'deDE', 'Ein Kpfchen fr Metall', 'Sammelt $1oa Stcke kristallisiertes Drakonium in der Aschenscherbenspalte.', 'Um das Potenzial der Schmiede des Erdwchters voll auszuschpfen, msst Ihr die Grundlagen zur Herstellung obsidianversengter Legierung erlernen. Nur dann knnt Ihr in die Fustapfen von Neltharions grten Schmieden treten.\n\nBringt mir ein Stck kristallisiertes Drakonium, das sich tief in der Aschenscherbenspalte finden lsst. Im Gegenzug werde ich Euch das Wissen vermitteln, nach dem Ihr sucht.', '', 'Gefhrlich belebt durch die Macht des innewohnenden Drakoniums.', 'Kristallisierter Stahlsplitter', '', '', '', 47187),
(67220, 'deDE', '10.0 [DNT] [GAMEPLAY TEST] - [SPAWNTRACKING] (JSS)', '', '', '', '', '', '', '', '', 47187),
(67178, 'deDE', 'Weie Augen, blauer Drache', 'Helft Yumodormu, Setogosa zu besiegen', 'Knntet Ihr sicherstellen, dass die Partie so fair wie mglich verluft, $PC?\n\nSetogosa ist bekannt dafr, die Regeln so zu biegen und brechen, wie es ihr passt.\n\nIch wrde nur ungern sehen, dass Yumadormu verliert, nur weil sie betrgt.', '', '', '', '', '', '', 47187),
(67177, 'deDE', 'GESUCHT: Verschlinger', 'Ttet den Verschlinger und besorgt seine Hrner.', 'Wenn Ihr Euch in den Reihen der Tuskarr aufhalten wollt, solltet Ihr Euch ntzlich machen!\n\nIn letzter Zeit hat sich in der Nhe ein wildes Tier eingenistet, das wir Verschlinger nennen.\n\nNoch mehr seiner Art scheinen in diese Gegend zu migrieren. Das knnen wir zu unserem Vorteil nutzen.\n\nTtet den Verschlinger und bringt mir seine Hrner. Wir werden sie nutzen, um unseren Auenposten zu erweitern.', '', 'Eine gewaltige Bestie fernab ihrer blichen Jagdgrnde.', 'Verschlinger', '', '', '', 47187),
(67175, 'deDE', 'Wie man ein Spielzeugboot vom Explodieren abhlt', 'Sprecht mit Toolks Mutter und holt dann das Spielzeugboot.', 'Ich bringe ein Kind nur ungern um sein Spielzeug, aber es wrde sich fr die Kirin Tor als uerst wertvoll erweisen, zu untersuchen, wie es so viel Arkana absorbieren konnte.\n\nAndererseits mchte ich unsere neuen Verbndeten von den Tuskarr auch nicht krnken. Ich besitze einen Zauberstab, der die Magie entfernen knnte...\n\nSprechen wir zuerst mit Toolks Mutter und entscheiden dann ber das weitere Vorgehen.', '', '', '', '', '', '', 47187),
(67174, 'deDE', 'Arkane Aufdeckung', 'Untersucht Tuskarrobjekte bei Khuris Angelplatz auf Anzeichen fr arkane Magie.', 'Seid gegrt! Ich bin Miva Sternauge und ich leite die arkanen Untersuchungen in diesem Gebiet.\n\nDas azurblaue Gebirge ist berall von Magie erfllt. Teile davon sind harmlos... whrend andere wiederum recht gefhrlich sein knnen.\n\nMir wurde aufgetragen, sicherzustellen, dass in den Besitztmern der Tuskarr keine arkane Energie zurckbleibt.\n\nWir hatten schon einen Vorfall im Lager Antonidas, bei dem eine Angelkiste spontan in Flammen aufgegangen ist!\n\nKnntet Ihr meinen Detektor nehmen und einige Objekte hier untersuchen? Ich muss noch etwas mit Julk dort drben besprechen.', '', '', '', '', '', '', 47187),
(67173, 'deDE', 'Diebische Gnolle', '', '', '', '', '', '', '', '', 47187),
(67167, 'deDE', 'Zeit fr ein Duell!', 'Fordert $1oa Dracthyr zu einem Hearthstone-Spiel heraus.', 'Jetzt, wo ich meine Karten zurckhabe, kann ich mich darauf konzentrieren, neue Mitglieder fr meinen Club zu rekrutieren! Ich habe daran gedacht, die Dracthyr zu fragen... \n\nOh, da gibt es noch etwas, bei dem Ihr mir helfen knnt, $n!\n\nIch werde ein bisschen damit beschftigt sein, andere Drachen zum Mitmachen zu bewegen, und ich mchte unbedingt die Dracthyr dabeihaben.\n\nWrde es Euch etwas ausmachen, fr mich mit ihnen zu sprechen? Aber seid gewarnt: Viele von ihnen haben noch nie gespielt.', '', '', '', '', '', '', 47187),
(67154, 'deDE', 'Entropische berreste', 'Sammelt $1oa Stcke verglasten Sand von Kreaturen in den Wandernden Sanden.', 'Wenn Entitten die Zeitlinien passieren, kann es passieren, dass sich die Sande der Zeit an ihren Krpern ansammeln.\n\nNormalerweise lst sich der Sand recht schnell wieder, aber manchmal sorgen die entropischen Fluktuationen der Zeitreisen dafr, dass der Sand zu Glas wird. In solchen Fllen lsst er sich nur schwer entfernen. So habe ich mir schon mehrere Paar neue Schuhe ruiniert.\n\nVerglaster Sand hat sich als uerst wertvoll fr unsere Zwecke herausgestellt. Es wre in unserem besten Interesse, so viel wie mglich davon zu gewinnen.', '', '', '', '', '', '', 47187),
(67143, 'deDE', 'Jemandem sein Herz schenken', 'Stellt ein Herz in der Flasche |A:Professions-Icon-Quality-Tier3-Small:20:20|a mit einem beliebigen Handwerksberuf her.', 'Denkt Ihr, Ihr knntet die gesammelten Elementaressenzen in diese Flasche geben?\n\nDas Rezept ist ganz einfach, Ihr knnt es genau so verwenden wie jedes andere Rezept.\n\nFalls Euch die hochqualitativen Reagenzien abhandengekommen sind oder Ihr sie aufgebraucht habt, knnt Ihr jederzeit neue von den Elementaren bei der Flunkerhhle bekommen.', '', '', '', '', '', 'Bringt das Geschenk zu Miguel Heller beim Rubinlebensschrein.', 47187),
(67142, 'deDE', 'Wyrmfutter', 'Sammelt lavaverkohltes Fleisch von den Krustenlauerern im Glutstrom.', 'Fr die Obsidianzitadelle zu kmpfen und sie zu beschtzen, macht ganz schn hungrig... und wir Drachen knnen eine ganze Menge essen. Wir mssen unsere Vorrte auffllen.\n\nUnter der gehrteten Lava lauern einige sehr schmackhafte Wrmer, die sich durch das Magma winden! Ihr werdet ihnen vermutlich nicht viel abgewinnen knnen, doch fr einen hungernden Drachen ist das die reinste Delikatesse.\n\nNehmt unseren Diener Gulchak mit und richtet seinen Zeiger auf Unregelmigkeiten in der Lava. Er wird die Wrmer anlocken, dann msst Ihr sie nur noch einfangen.', '', '', '', '', '', '', 47187),
(67137, 'deDE', 'Professionelle Ausrstung', 'Sprecht mit Mahra Baumbieger.', 'Sagt, ich habe von Haephesta gehrt, dass Ihr ebenfalls $gein arbeitender Handwerker:eine arbeitende Handwerkerin; seid.\n\nWir wrden Euch gerne kostenlos mit einer Profiausrstung ausstatten. Dafr sind Geschftspartner doch da, nicht wahr?\n\nSprecht mit unserer Schneiderin, Mahra Baumbieger, um Ma nehmen zu lassen.', '', '', '', '', '', 'Sprecht mit Mahra Baumbieger beim Rubinlebensschrein.', 47187),
(67111, 'deDE', 'Der kummergeplagte Lehrling', 'Sammelt $1oa gefrorene Giftdrsen.', 'Diese Mission war von Anfang an ein Fehler. Alia Segelstrahl bat uns um Hilfe, um zu verhindern, dass die Splitterflammen in den Besitz eines gefhrlichen Artefakts kommen. Wir hatten es in diesen Ruinen ausfindig gemacht.\n\nAber die Splitterflammen haben uns hier besiegt und die Gegend wurde von Eisspinnen berrannt. Alia wurde schwer vergiftet, und ich frchte, dass sie ohne das Gegenmittel nicht lange berleben wird.\n\nIch kann es herstellen, aber ich brauche dazu Giftdrsen von den Spinnen in der Nhe. Ich habe Angst, Alia hier zurckzulassen. Knntet Ihr welche fr mich finden?', '', '', '', '', '', '', 47187),
(67100, 'deDE', 'Ein Geschenk fr Miguel', 'Sprecht mit Thomas ber Qualitt und sammelt anschlieend $2oa feurige Geister in der Nhe der Flunkerhhle fr Miguels Geschenk.', '$p, knntet Ihr mir einen Gefallen tun?\n\nIch mchte ein Geschenk fr Miguel, meinen Mann, besorgen.\n\nEr bedeutet mir so viel, aber ich war in letzter Zeit so beschftigt, dass ich keine Zeit hatte, ihm etwas zu machen.\n\nKnntet Ihr mir helfen, etwas Hochwertiges fr ihn herzustellen?', '', '', '', '', '', '', 47187),
(67099, 'deDE', 'Drachenaugen', 'Sprecht mit Myridian, Zepharion und Evorian in den umliegenden Gebieten.', 'Wir wissen, dass die Djaradin uns direkt angreifen werden, aber es gibt noch andere Gefahren da drauen, die mir Sorgen bereiten. Gefahren, die nicht ganz so offensichtlich sind.\n\nIch habe drei Drachen losgeschickt, welche die Umgebung erkunden und potenzielle Gefahren lokalisieren sollen.\n\nTrefft Euch mit ihnen und sammelt ihre Berichte ein. Kehrt anschlieend zu mir zurck, damit wir uns auf das, was die Djaradin geplant haben, bestmglich vorbereiten knnen.', '', '', '', '', '', '', 47187),
(67096, 'deDE', 'Flug des Wallenden Walds - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(67095, 'deDE', 'Flug des Wallenden Walds', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(67094, 'deDE', 'Als Dryade hat man immer zu tun', 'Helft Thalendra, die vielen kleinen Tiere von Valdrakken zu fttern.', 'Es ist wunderbar, Valdrakken wieder so lebendig zu sehen. Aber es gibt so viele Dinge, die unter den Tausenden von Jahren der Vernachlssigung gelitten haben, nicht zuletzt all die entzckenden kleinen Tiere in der Stadt! Leider haben wir nicht genug Dryaden, um uns um sie alle zu kmmern.\n\nSagt mal, wie wrde es Euch gefallen, zur Ehrendryade von Valdrakken ernannt zu werden? Einige der entzckenden kleinen Freunde der Stadt mussten schon viel zu lange ohne ihre Lieblingsleckerlis auskommen. Wollt Ihr mir nicht helfen, sie zu versorgen?', '', '', '', '', '', '', 47187),
(67093, 'deDE', 'Ein anomaler Schrein', 'Findet einen Weg, das verborgene Relikt im Sandverlorenen Sanktum einzusammeln, und kehrt dann zu Nozdormu beim Sitz der Aspekte in Valdrakken zurck.', 'Mein Forschungsteam hat ganz in der Nhe ein seltsames Sanktum entdeckt. An dessen Auenseite haben wir Schriftzeichen ausgemacht, Titanenrunen, um genau zu sein. Wir glauben, dass sie auf Aman\'thul den Hochvater verweisen, den Anfhrer der Titanen.\n\nWir wollten das Sanktum genauer untersuchen, haben dabei aber dessen Verteidigung ausgelst. Ein riesiges Sandamalgam hat uns den Weg versperrt, und wir sind nur ganz knapp mit dem Leben entkommen.\n\nWir sind uns nicht ganz sicher, was es beschtzt, aber es muss etwas Wichtiges sein. Knnt Ihr der Sache nachgehen?', '', '', '', '', '', 'Kehrt zu Nozdormu in Valdrakken zurck.', 47187),
(67084, 'deDE', 'Die silberne Bestimmung', 'Platziert die uralten Titanenstahlbarren in der Schmiede und beendet die Aufgabe, die Tyr Euch aufgetragen hat.', '<Das Echo von Tyr wird durch Eure Anwesenheit aktiviert.>\n\nEure nchste Aufgabe steht nun bevor, meine Freunde.\n\nVertraut die Barren dem Feuer an und aktiviert die Schmiede. Ich habe die ntigen Ablufe bereits fr Euch vorbereitet.\n\nDie Silberschuppe enthlt den Bauplan. Sein Nutzen wird sich Euch offenbaren.', '', '', '', '', '', 'Sprecht mit Alexstrasza in Tyrhold.', 47187),
(67081, 'deDE', 'Eine Infusion der Materialien', 'Beschafft Euch $1oa uralte Titanenstahlbarren und bezwingt den urtmlichen Tsunami in den Hallen der Infusion.', '<Das Abbild von Tyr spricht erneut.>\n\nIhr habt die Schmiede reaktiviert. Die nchste Aufgabe wird nicht so einfach sein.\n\nIn der Schuppe sind Bauplne geritzt fr etwas, das Ihr fr mich schmieden sollt. Irideus, einem meiner treuen Hter, habe ich die ntigen Materialien fr diese Aufgabe anvertraut. Es gibt nur noch sehr wenige von ihnen und sie sind unter besonderen Umstnden entstanden.\n\nSucht nach Irideus in den Hallen der Infusion. Ich hoffe, dass die Anlage unter seinen wachsamen Augen weiterhin ordnungsgem ihrem Betrieb nachgeht.', '', '', '', '', '', '', 47187),
(67080, 'deDE', 'Handwerkerversorgung: Alchemistische Lsung des Drachen', 'Verwendet das Rezept \'Gemischressourcen zurckgewinnen\' und stellt $1oa Flaschen einer alchemistischen Lsung des Drachen fr Haephesta beim Rubinlebensschrein her.', 'Seid Ihr auf der Suche nach Arbeit, $gAlchemist:Alchemistin;?\n\nDas Handwerkerkonsortium ist mit einem \"Handwerksauftrag\" an mich herangetreten. Es besteht Interesse an meinen alchemistischen Lsungen. Diese Geschftspraktiken klingen zwar interessant, doch ich habe einfach zu viel um die Ohren.\n\nVielleicht ist dies eine Gelegenheit fr Euch, Lehrling. Stellt eine alchemistische Lsung her, indem Ihr Eure vorherigen Gemischressourcen zurckgewinnt, und bringt sie zu Haephesta, die sich etwas weiter den Pfad entlang befindet.', '', '', '', '', '', '', 47187),
(67079, 'deDE', 'Schlsselmomente', 'Beschafft Euch die primre und die sekundre Sicherheitsscheibe in Tyrhold.', 'Die Sicherheitsvorkehrungen in der Schmiede sind strenger als in jedem anderen Bereich Tyrholds. Das wird eine ziemliche Herausforderung, $C.\n\nNur bestimmte Einheiten der Zitadelle knnen die Sicherheitsmanahmen umgehen, und um einer Sicherheitsverletzung vorzubeugen, verlangen die Protokolle stets mehr als einen Code.\n\nDiese Einheiten werden Ihre berbrckungsscheiben nicht freiwillig hergeben, Ihr werdet sie ihnen mit Gewalt abnehmen mssen. Seid vorsichtig, $n.', '', '', '', '', '', '', 47187),
(67078, 'deDE', 'Anweisungen zum Abschied', 'Platziert die Silberschuppe in der Schmiede von Tyrhold.', '<Das Echo spricht mit uralter Stimme.>\n\nAn meine lieben Freunde, ich entschuldige mich fr meine pltzliche Abreise.\n\nAber ich verspreche, dass Ihr nicht ohne meine Hilfe seid. Ich wei, dass fr Euch die Zeit groer Not gekommen ist, aber um sicherzustellen, dass dieses Geschenk nicht missbraucht wird, muss ich von Euch verlangen, eine Reihe an Aufgaben auszufhren.\n\nDie erste ist einfach: Reaktiviert die Schmiede innerhalb von Tyrhold. Die Silberschuppe ist der Schlssel.', '', '', '', '', '', 'Sprecht mit Koranos in Tyrhold.', 47187),
(67077, 'deDE', 'Erinnerungen an die Vergangenheit', 'Sprecht mit Nozdormu und seht die Erinnerung an die Vergangenheit.', 'An diesem Ort sahen wir unseren Freund Tyr zum letzten Mal.\n\nWir verstanden die Beweggrnde nicht, warum er uns verlassen musste, auer, dass es wichtig war.\n\nAuch wenn dies unseren Herzen unertrgliches Leid bereitet, denke ich, dass dieser Funke uns gerufen hat, um diesem Zeitpunkt noch einmal beizuwohnen. Mit Nozdormus Hilfe knnen wir vielleicht diesen Moment erneut durchleben und nachsehen, ob es einen anderen Hinweis gibt, den Tyr uns hinterlassen hat.', '', '', '', '', '', '', 47187),
(67076, 'deDE', 'Ein Funken der Entdeckung', 'Untersucht den Titanenfunken in Tyrhold.', 'Obwohl dieser Funke eigenartig ist, spre ich, dass er mir bekannt ist. Ich bin mir nicht sicher, was sein Nutzen ist, aber ich glaube, er fhrt uns einen Schritt nher zur Lsung dieses Rtsels.\n\nFolgt ihm, um herauszufinden, ob Ihr seinen Zweck aufdecken knnt, whrend ich in der Zwischenzeit versuche, mehr herauszufinden.', '', '', '', '', '', 'Sprecht mit Kalecgos in Tyrhold.', 47187),
(67075, 'deDE', 'Die innere Magie', 'Zieht verborgene Magie aus den Konsolen in Tyrhold, um das Geheimnis der Silberschuppe zu enthllen.', 'Faszinierend. Es gibt so viele Rtsel in dieser Zitadelle, die niemand, auer Hter Tyr selbst, versteht. Falls wir das weiter erschlieen mchten, mssen wir Tyrhold weiter erkunden.\n\nIch glaube, dass die Schuppe weitere Geheimnisse zutage frdern wird, die an diesem Ort aufbewahrt liegen.\n\nWobei es ein Problem gibt. Die Wchter Tyrholds sind immer noch... instabil. Es ist mglich, dass sie durch Eure Erkundungen gestrt werden und versuchen einzuschreiten. Nehmt diese Leitung. Sie wird Euch helfen, falls die Wchter sich als rgernis erweisen sollten.', '', '', '', '', '', '', 47187),
(67074, 'deDE', 'Das Geschenk aus Silber', 'Sprecht mit Alexstrasza, um Tyrs Geschenk zu enthllen.', 'Kurz vor seinem Tod gab Hter Tyr uns eine Drachenschuppe aus reinstem Silber. Wir haben sie whrend unserer Abwesenheit in den Gewlben von Valdrakken gelagert, aber ich glaube, es ist an der Zeit, sie wieder zu teilen.\n\nWir wissen zwar nicht, was ihr Zweck ist, aber sie war schon immer ein Symbol der Einheit und der Freundschaft. Als $gwahrer Verbndeter:wahre Verbndete; der Drachen mchten wir sie mit Euch teilen. Sprecht mit mir, wenn Ihr bereit seid, $n.', '', '', '', '', '', '', 47187),
(67073, 'deDE', 'Rote Dmmerung', 'Findet Alexstrasza.', 'Wir sind so kurz davor, unsere Krfte wiederzuerlangen... Sollte Razageth erfolgreich sein, bevor unsere Krfte zurckkehren, dann droht Azeroth eine dunkle Zukunft.\n\nDas drfen wir nicht zulassen, $n!\n\nSchnell, Ihr msst Alexstrasza finden und ihr helfen, bevor alles verloren ist!', '', '', '', '', '', '', 47187),
(67067, 'deDE', 'Verloren im Springmaislabyrinth', 'Sammelt $1oa Stngel von wildem Springmais.', 'Es gibt eine Drachenkchin in Valdrakken? Wirklich? Ich muss sie bitten, meine Bogenlichtsuppe zu probieren! Es ist ein altes Familienrezept.\n\nIch kenne die Pflanze, von der Ihr sprecht. Sie wchst bei den Flssen hier in der Gegend, aber sie hat einige Probleme verursacht.\n\nDie Stngel von Springmais scheinen die Nahrungsgrundlage vieler Kfer und kleiner Salamanther zu sein, die wiederum die natrliche Beute von Flunkern sind. Das ist nicht so schlimm, wenn man sie von Weitem sehen kann, aber einige von ihnen sind richtig verstohlen.\n\nIch an Eurer Stelle wrde die Augen offen halten.', '', '', '', '', '', 'Kehrt zu Rumiastrasza beim Rubinfestmahl in Valdrakken zurck.', 47187),
(67066, 'deDE', 'Kstlichkeiten zum Abtauchen', 'Fangt einen pikanten Deviantbandfisch.', 'Rumi und Schnabuli?\n\nGrundgtiger, das ist so lange her. Mit einem Kochduo aus Drache und Ente Fisch zu essen, klingt wie der Anfang einer Geschichte, die die lteste Poa den Kindern erzhlt. So ein Ereignis lsst sich nur schwer vergessen!\n\nDer Fisch war ein pikanter Deviantbandfisch, ein Topfavorit der Tuskarr! Sie sind selten, aber es gibt sie gleich hier vor der Kste.\n\nDoch ich warne Euch: Die Azurzhne sind in der Balz. Diese blutdurstigen Biester beien Euch glatt ein Stck ab, wenn Ihr Euch an ihrer liebsten Knabberei zu schaffen macht.', '', '', '', '', '', 'Kehrt zu Rumiastrasza beim Rubinfestmahl in Valdrakken zurck.', 47187),
(67065, 'deDE', 'Futurist-frische Fungi', 'Fangt 7 zeitversengte Trffler in der Zukunft der Primalisten.', 'Ein kstlicher Pilz? Alternative Zukunftslinien sind keine Vorratsschrnke, die man mal eben fr einen Vormittagssnack plndert.\n\nDennoch... Ich wrde lgen, wenn ich sage, ich htte nie davon getrumt, Rumis und Schnabulis Kochknste noch einmal zu kosten.\n\nAlso gut! Ihr habt meine Erlaubnis, das Portal zu durchschreiten, doch ich wrde Euch raten, nicht allein zu gehen.\n\nMeine Wchter haben bereits von diesen dunklen Pilzen gesprochen. Anscheinend bleiben sie nie lange am selben Ort. Was auch immer das heien mag.', '', '', '', '', '', 'Kehrt zu Rumiastrasza beim Rubinfestmahl in Valdrakken zurck.', 47187),
(67064, 'deDE', 'Wandernde Delikatesse', 'Sammelt $1oa glimmende Wandertangknollen.', 'Oh, Rumiastrasza! Ich hatte einen wunderbaren Abend mit den Dryadenschwestern Celina und Felina, als wir fr sie gekocht haben.\n\nDer Tang, den wir gegessen haben, ist eine einzigartige Art, glimmender Wandertang genannt. Feschfischschwrme entlang der ganzen Kste ernhren sich davon. Ich wre nicht berrascht, wenn sie Euch angreifen, whrend Ihr versucht, ihre Nahrungsquelle am Meeresboden zu pflcken.\n\nRichtet den Kchen meine besten Gre aus, wenn Ihr sie seht. Sie sind hier in unserer Zuflucht stets willkommen.', '', '', '', '', '', 'Kehrt zu Rumiastrasza beim Rubinfestmahl in Valdrakken zurck.', 47187),
(67063, 'deDE', '10.000 Jahre des Bratens', 'Sammelt $1oa wrzige Lavagewrze.', 'Gewrze? Oh! Ihr msst zu der groen alten Drachenkchin gehr\'n. Die mit dem kleinen Entenkoch auf dem Kopf.\n\nDie Djaradin sammeln Pulver, wrzige Lavagewrze, von den feurigen Elementaren da unt\'n.\n\nSchaut mich nich\' so an! So nennen die Djaradin die nun mal, nich\' ich!\n\nViel Glck da unten. Ich wrd nich\' allein geh\'n, wenn ich Ihr wr.', '', '', '', '', '', 'Kehrt zu Rumiastrasza beim Rubinfestmahl in Valdrakken zurck.', 47187),
(67053, 'deDE', 'Dem Frieden eine Chance', 'Stellt Euch den Vertretern der Horde vor.', 'Das Licht sei mit Euch, $p.\n\nDiese Expedition steht unter dem Schutz der Horde wie der Allianz. Unsere Befehle sind klar: die Mitglieder der Expedition untersttzen, ganz gleich, wem sie sonst die Treue geschworen haben.\n\nDie Vertreter der Horde, Kriegsherrin Grimmaxt und ihre Tochter Shuja, stehen auf der anderen Seite des Lagers Wache.\n\nIch habe mit Kriegsherrin Grimmaxt gegen die Geiel gekmpft. Sie ist eine erhabene Streiterin und wird dieser Expedition uerst dienlich sein.\n\nBietet ihr Eure Untersttzung an. Beweist ihr, dass die Allianz ihren Verpflichtungen nachkommt.', '', '', '', '', '', 'Sprecht mit Kriegsherrin Breka Grimmaxt in der Botschaft von Schwingenrast.', 47187),
(67050, 'deDE', 'Frostbeulen: Ursachen und Symptome', 'Platziert die Totems und befreit die gefangenen Tuskarrjger im Azurblauen Gebirge.', 'In den Totems Elemente leben, $R. Lasst frei und brecht Eis. Befreit Tuskarrfreunde!', '', '', '', '', '', '', 47187),
(67047, 'deDE', 'Wrme gegen das Frsteln', 'Sammelt $1oa Kaltbisspfeilbltter.', 'Ich glaube, die Pflanze, die Ihr sucht, hat einen schmalen Stngel und rote Bltter.\n\nIhr werdet es jedoch schwer haben, nicht auf diese garstigen Krabbeltiere zu stoen, whrend Ihr Pflanzen sammelt. Ich wrde Euch raten, ihnen aus dem Weg zu gehen, so gut Ihr knnt, oder immer ein scharfes Schwert zur Hand zu haben, wenn das nicht geht.\n\nUnd lasst Eure Drachenfreundin wissen, dass sie mich zur Wiedergutmachung auf eine oder zwei Tassen von dem Zeug einladen kann, wenn ich wieder in der Stadt bin.', '', '', '', '', '', 'Kehrt zu Rumiastrasza beim Rubinfestmahl in Valdrakken zurck.', 47187),
(67044, 'deDE', 'Eine Heldensage: Yanikk', 'Lauscht der Geschichte von Yanikk.', 'Lasst mich Euch die Geschichte von Yanikk erzhlen.', '', '', '', '', '', '', 47187),
(67039, 'deDE', 'Eine erstaunliche Reise', 'Findet die verschwundenen Tiere.', 'Einige Haustiere des Klans sind auf der letzten Reise zwischen den Lagern verschollen. Sie sind keine Jagdtiere, deswegen bezweifle ich, dass sie da drauen alleine zurechtkommen!\n\nKnntet Ihr vielleicht nach ihnen suchen? Sie sind vielleicht keine Jagdpartner, aber sie sind dennoch wichtige Klanmitglieder!', '', '', '', '', '', '', 47187),
(67036, 'deDE', 'Der Zorn der Kirin Tor', 'Verwendet den Arkanstrahler, um Khadgar im Kampf gegen die Primalisten zu untersttzen.', 'Ich habe die Teile des Gerts zusammengesetzt, die Ihr geborgen habt.\n\nPlatziert es in der Nhe von Khadgar und nutzt es, um die Primalisten zurckzuschlagen!\n\nWir mssen nur noch etwas lnger durchhalten, bis Kalecgos kommt.', '', '', '', '', '', '', 47187),
(67035, 'deDE', 'Wahrung des Wissens', 'Findet $1oa uralte Folianten in der Nhe des Lagers Antonidas.', 'Gre, $R. Ich bin Althanus. Ich wnschte, wir htten uns in einer weniger... chaotischen Zeit kennengelernt.\n\nWir haben den Kirin Tor geholfen, die Geschichte dieses Ortes zu studieren, als pltzlich die Primalisten angriffen.\n\nIch frchte, dass noch einige Folianten da drauen sind und Gefahr laufen, bei diesem entsetzlichen berfall zerstrt zu werden.\n\nIch bitte Euch, diese Folianten zu bergen! Wenn sie zerstrt wurden, ist die Geschichte dieses Ortes verloren.', '', '', '', '', '', '', 47187),
(67034, 'deDE', 'Von Wind und Wasser', 'Sammelt Reagenzien von den Tosende Drachenquellen.', 'Im Osten gibt es eine groartige Drachenquelle, die als Nistgrund fr wilde Adler dient. Die Federn, die sie verlieren, behalten ihre Magie fr eine ganze Weile und werden in vielen Ritualen genutzt.\n\nDie Gegend beheimatet auch wilde Elementargeister, und ihre Kerne sind ebenfalls ntzlich.\n\nBringt mit eine Handvoll von beidem... und denkt daran, dass die Adler heilig sind. Ich werde keine Federn annehmen, fr die sie verletzt wurden.', '', '', '', '', '', '', 47187),
(67033, 'deDE', 'Verteidigung zusammensetzen', 'Findet $1oa Teile des Arkanstrahlers.', 'Die Primalisten waren hinter den Kirin Tor her, seit wir im Azurblauen Gebirge angekommen sind. Sie verabscheuen unseren Umgang mit der Arkanmagie.\n\nIch werde Kalecgos mitteilen, dass er aus den Azurarchiven zurckkehren soll. Bis dahin mssen wir sie aufhalten.\n\nAnscheinend wurde eines unserer arkanen Hauptverteidigungssysteme whrend des Angriffs zerstrt. Bringt mir die Teile, dann kann ich es wieder zusammensetzen.', '', '', '', '', '', '', 47187),
