(67007, 'deDE', 'Archivassistenz', 'Sprecht mit Kemora bei den Archiven in Valdrakken.', '<Die klare, saubere und mit elegantem Strich geschriebene Schrift verblasst schnell vor der feuchten, verschmierten Tinte des Pergaments und einem Geruch, der an ein verschttetes, vergorenes Getrnk erinnert.>\n\nABENTEUERSUCHER, ARCHIVIERUNGSLIEBHABER\n\nDie Archive wenden sich an alle, die Antworten suchen, sich nach Entdeckungen sehnen und die Geheimnisse der Vergangenheit und vielleicht sogar der Zukunft lften wollen!\n\nDieser Aufruf ist nichts fr zaghafte oder wankelmtige Personen.\n\nNur wissbegierige und mutige Abenteurer drfen sich bewerben.\n\n- Kemora', '', '', '', '', '', '', 47187),
