(67004, 'deDE', 'Gute Dinge in groen Kisten', 'Findet einen Tresor des Erdwchters fr mich und bringt ihn her, damit wir uns den Inhalt teilen knnen.', 'Durch unsere Bemhungen haben wir alles, was wir brauchen, um einen Tresor des Erdwchters zu ffnen. Unter der Zitadelle gibt es mehrere Tresore. Findet einen und ich werde Euch belohnen.\n\nIch habe Ketten geschmiedet, um ihn zu transportieren. Wenn Ihr ihn herkriegt, knnen wir uns die Reichtmer teilen.\n\nDer Tresor knnte schon transportiert werden. Ich habe auch andere ausgesandt, um ihn zu suchen.', '', '', '', '', '', 'Kehrt zu Einheizer Volrax zurck, mit oder ohne den Tresor des Erdwchters.', 47187),
