(66998, 'deDE', 'Feuer mit... Wasser bekmpfen', 'Ttet Lavaelementare in der Ausbrechenden Hhle.', 'In all den Jahren, in denen ich mich um die Lavaelementare gekmmert habe, habe ich sie nie in diesem Zustand gesehen! Wir knnen sie kaum in ihrer Hhle halten.\n\nHabt Ihr einen Moment Zeit? Wir sichern den Ausgang, whrend Ihr ihre Reihen drinnen ausdnnt.\n\nHier, nehmt diese Wasserelementarflasche mit.\n\nIch habe immer ein paar Wasserelementarflaschen dabei, wenn ich mich der Lavaelementare annehme. Natrliche Feinde sind immer eine gute Ablenkung!', '', '', '', '', '', '', 47187),
(66997, 'deDE', 'Krippenspiel', 'Trefft Euch mit Vaeros im Garten der Rubinlebensbecken.', 'Ich bin so dankbar, dass Lasztak die Berufung eines Welpenhters angenommen hat! Insbesondere, da gerade so viele dieser kleinen Schtzchen ihre Zhne kriegen.\n\nDarber hinaus stehen den Krippengrten noch andere Herausforderungen bevor. Die Welpen sind gestresst und die Hter sind... nun, noch gestresster als sonst.\n\nBitte, wenn Ihr mal einen Moment entbehren knnt, dann besucht mich unten in den Grten. Wir knnten Eure Hilfe auch brauchen!', '', '', '', '', '', '', 47187),
