(66972, 'deDE', 'Alter Steinhauer', 'Erlegt den alten Steinhauer beim Lager Antonidas.', 'Ich habe eine finstere Aufgabe fr Euch, $p. Nicht jeder Tod ist ein Zeichen von Knnen. Manche sind ein Akt der Gnade.\n\nIm Wald stlich des Lagers Antonidas wandert ein alter Mammutbulle umher. Ich habe ihn vor einer Weile aus der Ferne gesehen und ich kann sein trauriges Trompeten immer wieder hren. Er hat eindeutig groe Schmerzen.\n\nEr hat damit angefangen, blindlings durch das Dickicht zu stampfen, und ich mache mir Sorgen, dass er zu einer Gefahr fr andere werden knnte.\n\nEs wrde mein altes Herz erleichtern, wenn Ihr eine ebenso mde Seele zur Ruhe betten wrdet. Bringt mir seinen Stozahn, damit wir ihm die letzte Ehre erweisen knnen.', '', 'Ein uralter Mammutbulle, der sich und andere gefhrdet.', 'Alter Steinhauer', '', '', 'Sprecht mit Hemet Nesingwary Jr. im Lager im Nirgendwo.', 47187),
(66971, 'deDE', 'Das Gesicht des Todes', 'Erlegt Frostrachen nrdlich der Winterpelzhhle.', 'Sagt mir, $gmein Freund:meine Liebe;, habt Ihr je dem Tod ins Gesicht geblickt?\n\n<Nesingwary macht eine dramatische Pause.>\n\nWas rede ich denn da? Natrlich habt Ihr das.\n\nSchlielich hat der Tod viele Gesichter.\n\nDie Tuskarr von Imbu sagen, eines dieser Gesichter lebt in diesen Hgeln. Seinen Namen nur auszusprechen, bedeutet, einen gewaltsamen, eisigen Tod heraufzubeschwren:\n\nFrostrachen.\n\n<Nesingwary sieht sich argwhnisch um.>\n\nNun, jetzt msst Ihr ihn jagen, allein schon mir zuliebe!', '', 'Ein legendres Omen fr den Tod auf dem Eis.', 'Frostrachen', '', '', 'Sprecht mit Hemet Nesingwary Jr. im Lager im Nirgendwo.', 47187),
