(66969, 'deDE', 'Klans der Ebenen', 'Meldet Euch bei Sansok Khan in Maruukai.', 'Whrend Ihr auf die Ankunft der Botschafterin wartet, wrde Sansok Khan gerne hren, wie Euer Treffen mit den Klans verlief. Sie hat mich geschickt, um Euch zu finden und zu bitten, sie im Zentrum von Maruukai fr ein Gesprch zu treffen.', '', '', '', '', '', '', 47187),
(66968, 'deDE', 'Die Meute eindmmen', 'Erlegt Yetor nahe Rhonins Schild.', '<Nesingwary deutet neben den Pfad.>\n\nSeht Ihr diese Abdrcke im Schnee? \n\nYetispuren.\n\nIrgendwas muss sie aufgescheucht haben, wenn sie so nahe an der Strae jagen. Versucht, ihren Rudelfhrer ausfindig zu machen. Wir wollen nicht, dass sie anfangen, Reisende zu berfallen!\n\nWenn er eine besonders fiese Bestie ist, nehmt seinen Kopf mit. Das sollte die anderen abschrecken.', '', 'Was ist schlimmer als ein groer Yeti? Ein groer Yeti mit Freunden.', 'Yetor', '', '', 'Sprecht mit Hemet Nesingwary Jr. im Lager im Nirgendwo.', 47187),
(66964, 'deDE', 'Artefakte in den falschen Hnden', 'Findet Alia Segelstrahl in den Verlorenen Ruinen im Azurblauen Gebirge.', 'Wir haben hier Myriaden, nein, eine unberschaubare Menge an Problemen!\n\nWo soll ich nur anfangen?!\n\nDie Kirin Tor haben eine Verschwrung der Splitterflammen aufgedeckt. Sie sind hinter einem Artefakt namens \"Valthrux\" her.\n\nEs verfgt ber immense Kraft und knnte sogar... empfindsam sein?! Das ist ein exponentielles Wachstum an Gefahr, falls Ihr aufgepasst habt.\n\nAlia Segelstrahl ist mit ein paar Tuskarr nach Sden aufgebrochen, um die Splitterflammen zu untersuchen. Sie htte schon lngst zurck sein sollen.\n\nBitte findet sie und haltet die Splitterflammen davon ab, dieses Artefakt in die Finger zu bekommen!', '', '', '', '', '', '', 47187),
(66963, 'deDE', 'Lieferschwierigkeiten', 'Berichtet Katalogisierer Wulferd im nahe gelegenen Basislager, dass seine Lieferung nicht so bald eintreffen wird.', 'Ich habe versucht, Vevesi klarzumachen, dass ich den Karren aus dem Schlamm bekomme.\n\nAber nein, er musste ja darauf bestehen, Magie zu benutzen... Und da seht Ihr, was er damit angerichtet hat.\n\n<Schlepperin Bennet seufzt.>\n\nIch versuche, Vevesi zur Einsicht zu bringen. Knntet Ihr whrenddessen den Hgel zum Basislager hinauflaufen und Katalogisierer Wulferd erklren, dass er mglicherweise eine neue Kiste Kamerazubehr aus Boralus kommen lassen muss?', '', '', '', '', '', 'berbringt Katalogisierer Wulferd im Drachenschuppenbasislager die schlechten Neuigkeiten.', 47187),
