(66958, 'deDE', 'Schtzen und geleiten', 'Erlegt Bluthorn stlich von Iskaara.', 'Ich habe krzlich mit einigen Jgern aus Iskaara gesprochen und sie haben mir ein grausiges Bild beschrieben.\n\nOffenbar hat ein besonders mordlustiges Rhinozeros, Bluthorn, alle kleineren Brffelche zu Brei verarbeitet.\n\nDie Brffelche haben schon genug Konkurrenz im Azurblauen Gebirge, ohne dass sie sich darum sorgen mssen, dass ihre Herden von einem brutalen Eindringling ausgednnt werden!\n\nBringt mir sein Horn. Ich wrde gerne einen guten Eindruck bei unseren Tuskarrfreunden hinterlassen!', '', 'Ein fieses Wildtier, das die rtliche Brffelchpopulation dezimiert.', 'Bluthorn', '', '', 'Sprecht mit Hemet Nesingwary Jr. im Lager im Nirgendwo.', 47187),
(66957, 'deDE', 'Ein Schatten im Eis', 'Untersucht den Gipfel des Gletschers, der Lager Antonidas berragt.', 'Als ich das Lager Antonidas passiert habe, habe ich einige beunruhigende Gerchte aufgeschnappt. Angeblich wurden berall in den Froststeppen verwundete Tiere gefunden. Von manchen blieben nicht mehr als Blutspritzer zurck.\n\nWas immer dahintersteckt, hat den Magiern ordentlich Angst eingejagt, und Tiere gibt es in der Gegend auch kaum noch.\n\nSeht Euch am Gipfel des Gletschers um. Ich wrde meine Zwergenaxt darauf verwetten, dass ein Eliteraubtier sich dort herumtreibt.\n\nBringt mir eine Trophe von ihm zurck, damit wir die Kirin Tor beruhigen knnen.', '', 'Ein boshafter Riese, der gerne mit seiner Beute spielt.', 'Frostfaust', '', '', 'Sprecht mit Hemet Nesingwary Jr. im Lager im Nirgendwo.', 47187),
(66956, 'deDE', 'Drachenjger Igordan', '', '', '', '', '', '', '', '', 47187),
(66952, 'deDE', 'Der Gnolle teure Kleider', 'Sammelt 20 Gnollstoffe von den Gnollen der Dracheninseln fr Dothenos vom Valdrakkenabkommen.', 'Die Gnolle sind eine stndige Bedrohung durch ihre blutigen berflle und Angriffe auf die Expeditionen und die Bewohner der Dracheninseln. Wie also bleiben ihre Kleider so sauber?\n\nNachdem Ihr diese Plnderer bekmpft habt, wrdet Ihr einige Proben ihrer getragenen Kleidung zur Analyse fr mich sammeln?', '', '', '', '', '', '', 47187),
(66950, 'deDE', 'Herz eines Riesen', 'Sammelt 5 Riesenkerne von den Berg-, Eis- oder geschmolzenen Riesen der Dracheninseln fr Temnaayu von den Tuskarr von Iskaara.', 'Auf den Dracheninseln treiben sich verschiedene Riesen herum. Angeblich befinden sich in ihrem Kern wunderschne Edelsteine. Normalerweise jagen wir die Kreaturen auf den Inseln nicht wegen ihrer Schtze, aber diese Riesen haben mchtig Unfrieden gestiftet.\n\nWenn wir die zerstrerischen Riesen sowieso aus dem Weg rumen, knnen wir dabei auch diese Juwelen einheimsen.', '', '', '', '', '', '', 47187),
(66948, 'deDE', 'Ankunft der Botschafterin', 'Erfahrt mehr ber die Lage in den Smaragdgrten.', 'Ich gebe zu, dass ich die Smaragdgrten mein Leben lang nicht verlassen habe, daher habe ich auch nie einen Zentauren getroffen und schon gleich gar keinen Sterblichen vom Festland.\n\nDennoch bin ich nicht auf einen freundschaftlichen Besuch hier, sondern vielmehr, um die Hilfe der Zentauren bei der Bergung unseres Schwursteins und dem Schutz der uns Anvertrauten zu erbitten.\n\nIch bin froh zu sehen, dass Ihr ebenfalls gekommen seid, um zu helfen. Es gibt viel zu besprechen.', '', '', '', '', '', '', 47187),
(66947, 'deDE', 'Sprint des Azurblauen Gebirges - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66946, 'deDE', 'Sprint des Azurblauen Gebirges', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66944, 'deDE', 'Pfauenpigmente', 'Sammelt 8 Pfauenfedern von den Pfauen der Dracheninseln fr Gnoklin Quirkspule von der Drachenschuppenexpedition.', 'Die Pfaue der Dracheninseln haben so hbsche bunte Federn! Ich bin mir sicher, wir knnen daraus Pigmente gewinnen, die unsere Schreiber als Tinte verwenden knnen.', '', '', '', '', '', '', 47187),
(66943, 'deDE', 'Schreibholz', 'Sammelt 15 Rindenpergamente von den verrottenden Treants der Dracheninseln fr Dothenos vom Valdrakkenabkommen.', 'Wir haben bei unseren Studien auf den Dracheninseln ungewhnliche Informationen herausgefunden. Beispielsweise verhlt sich die Rinde der Treants, die von Verfallmagie betroffen sind, hnlich wie Pergament aus Tierhuten.\n\nDieses Rindenpergament ist merkwrdigerweise in der Lage, die Magie noch mchtigerer Inschriften zu binden. Wie ntzlich! Knnt Ihr uns helfen, welches zu beschaffen?', '', '', '', '', '', '', 47187),
(66940, 'deDE', 'Elixierexperiment', 'Sammelt 15 Einheiten Gorlocschleim von den Gorlocs der Dracheninseln fr Dhurrel von den Zentauren der Maruuk.', 'Unsere Alchemisten haben krzlich eine Reihe neuer Zutaten fr ihre Experimente ausprobiert. Ihr neuestes Interesse ist... interessant... um es vorsichtig auszudrcken.\n\nWie es scheint, weist Gorlocschleim einige Eigenschaften auf, die in bestimmten Elixieren sehr ntzlich sind.', '', '', '', '', '', '', 47187),
(66939, 'deDE', 'Die Jagd auf den Meisterjger', 'Macht Jagd auf Meisterjger Krakle nahe Imbus Schild.', 'Ich hrte von einer der Wachen im Lager im Nirgendwo, dass irgendein schndlicher Unhold die rtliche Tierwelt verstmmelt. Nennt sich selbst \"Meisterjger\".\n\nJagen ist das eine, aber wenn jemand Lebewesen derart qult, kann ich nicht unttig bleiben. \n\nUnd auerdem, mein Wagen knnte einen Glcksbringer brauchen.\n\n<Nesingwary spuckt zur Seite.>\n\nBringt mir seine Pranken zurck.', '', 'Ein boshafter Gnoll, dem es gefllt, unschuldige Tiere zu qulen.', 'Meisterjger Krakle', '', '', 'Sprecht mit Hemet Nesingwary Jr. im Lager im Nirgendwo.', 47187),
