(66931, 'deDE', 'Wer macht hier Krach?', 'Findet die Ursache fr die Unruhe im Rubinlebensschrein.', 'Das war kein gewhnliches Erdbeben.', '', '', '', '', '', '', 47187),
(66929, 'deDE', 'Schnappt sie Euch alle', 'Holt Yumadormus Kartenset zurck.', 'Knntet Ihr mir vielleicht helfen, meine Karten zurckzubekommen, $PC? \n\nIch habe Setogosa gesagt, dass ich sie brauche, um anderen Schlern zu zeigen, wie man Hearthstone spielt. Ich mchte einen Club grnden, aber sie gibt sie nicht zurck!\n\nSie war schon immer unfreundlich zu mir, aber jetzt geht sie noch ein bisschen weiter als sonst.', '', '', '', '', '', '', 47187),
