(66897, 'deDE', 'Brennstoff fr die Schmiede', 'Sammelt 10 Magmakerne von den Lavakreaturen der Dracheninseln fr Dhurrel von den Zentauren der Maruuk.', 'Um die besten Klingen herzustellen, braucht man eine Hitze, die nur ein Magmakern liefern kann. Wir versuchen, immer einige als Brennstoff fr unsere Schmieden auf Lager zu haben. In letzter Zeit gehen uns aber die Kerne aus und wir knnten etwas Nachschub brauchen.\n\nMagmakerne lassen sich von den meisten Lavakreaturen auf den Dracheninseln erbeuten.', '', '', '', '', '', '', 47187),
(66895, 'deDE', 'So wie der alte Boss', 'Eliminiert Vyzos die Prophetin.', 'Die Weltenbrecherdrachkin sind ein vertrauensvoller Haufen. ber die Jahre hinweg sind wir vielen Anfhrern gefolgt, in der Hoffnung, dass sie uns zur Stunde des Zwielichts fhren und die Rckkehr von Todesschwinge einluten.\n\nAber Todesschwinge ist nicht zurckgekehrt und die Stunde des Zwielichts ist nie eingetreten.\n\nEs ist Zeit fr einen neuen Anfhrer. Ihr knnt helfen, diesen Wechsel zu vollziehen.', '', 'Der aktuelle Anfhrer nach einer langen Reihe an Anfhrern.', 'Vyzos die Ausbeute', '', '', '', 47187),
(66893, 'deDE', 'Schnabelhafte Rckgewinnung', 'Heilt $1oa verletzte Hornschreiter bei den berlaufenden Stromschnellen.', 'ber Wasserelementare wei ich zwar nichts, aber mit Hornschreitern kenne ich mich aus!\n\nIch habe eine Salbe zusammengestellt, die die Schreiter gesund und kampfbereit hlt. Ich hatte noch nie die Gelegenheit, sie einem echten Hornschreiter zu verabreichen, aber ich habe so viel gebt, wie ich nur konnte.\n\nEs wird Zeit, unseren ganzen Mut zusammenzunehmen und unsere Freunde damit einzuschmieren!', '', '', '', '', '', '', 47187),
(66892, 'deDE', 'Wasserwahnsinn', 'Ttet $1oa Wasserelementare bei den berlaufenden Stromschnellen.', 'Elementare tten die Hornschreiter! Ich wei, wie man groe Kreaturen in den Griff bekommt, doch ich htte nie gedacht, es mit einem Elementar aufnehmen zu mssen! Die sind nicht mit Donnerechsenjungen zu vergleichen...\n\n<Dazakros seufzt betrbt auf.>\n\nTut mir bitte einen Gefallen und erledigt ein paar dieser Elementare. Hornschreiter haben mehr Verstand, als wir ihnen zutrauen. Sie werden sie sich schon wehren, wenn sie knnen!', '', '', '', '', '', '', 47187),
(66891, 'deDE', 'Explosive Asche', 'Sammelt 20 Teile explosiver Asche von den Phnixen auf den Dracheninseln fr Gnoklin Quirkspule von der Drachenschuppenexpedition.', 'Die geschmolzenen Phnixe der Dracheninseln hinterlassen eine ungewhnliche Aschesubstanz, wenn sie sterben. Man knnte sie nutzen, um einige Materialverstrkungen fr komplexe, lebensverndernde Maschinen herzustellen. Obwohl ich sie wahrscheinlich eher fr Sprengstoff nutzen wrde.', '', '', '', '', '', '', 47187),
(66890, 'deDE', 'Gestohlene Werkzeuge', 'Sammelt 20 gestohlene Werkzeuge von den Gnollen der Dracheninseln fr Dothenos vom Valdrakkenabkommen.', 'Wir werden von Gnollen geplagt, die unsere Versorgungskarawanen angreifen. Sie scheinen von den Ingenieurswerkzeugen, die damit transportiert werden, regelrecht besessen zu sein. Wir knnen nicht riskieren, dass gewaltttige Plnderer unsere spezialisierten Werkzeuge verstehen lernen! Auerdem haben die Diebsthle unserem Produktionsfortschritt mehr geschadet, als ich zugeben mchte.\n\nWenn Ihr einige der gestohlenen Ingenieurskunstwerkzeuge zurckerlangen knntet, wren wir wieder im Zeitplan.', '', '', '', '', '', '', 47187),
(66886, 'deDE', 'Smaragdgartenaufstieg - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66885, 'deDE', 'Smaragdgartenaufstieg', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66884, 'deDE', 'Feuerfeste Ausrstung', 'Sammelt 10 feuerfeste Ausrstungsgegenstnde von den Djaradin der Dracheninseln fr Temnaayu von den Tuskarr von Iskaara.', 'Die Rstung der Djaradin kann sogar tosenden Flammen standhalten. So etwas wre fr uns sehr ntzlich, wenn wir sie bekmpfen wollen!\n\nSeht, was Ihr von den Djaradin beschaffen knnt. Dann knnen wir die Teile untersuchen und dieselben Verzauberungen auf unsere eigenen Rstungen anwenden.', '', '', '', '', '', '', 47187),
(66883, 'deDE', 'Uralter Hornring', 'Bringt den Gegenstand zu Exadria.', '<Exadria knnte das haben wollen.>', '', '', '', '', '', '', 47187),
(66882, 'deDE', 'Verlorenes Gefechtspaket', 'Bringt den Gegenstand zu Krallenpirscherin Kavia.', '<Krallenpirscherin Kavia knnte das haben wollen.>', '', '', '', '', '', '', 47187),
