(66879, 'deDE', 'Hornschreiterchaos', 'Trefft Dazakros bei den berlaufenden Stromschnellen.', 'Hornschreiter! Sie haben Schnbel, mit denen sie Knochen knacken, schnelle Beine, mit denen sie Gefahren entkommen, und Mgen, die so ziemlich alles auf den Inseln vertragen.\n\nDas ist die mit Abstand einfachste Berufung! Nur ich zusammen mit meinen liebsten groen Vgeln. Und sollte doch mal was sein, wei ich, wie man alle Kreaturen der Inseln wieder in den Griff bekommt.\n\nWrde es Euch etwas ausmachen, mich zu den Plateaus der Hornschreiter im Norden zu begleiten? Ich knnte ein zustzliches Paar Hnde brauchen, whrend ich mich einrichte.', '', '', '', '', '', '', 47187),
(66878, 'deDE', 'Moor-Durchflug - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66877, 'deDE', 'Moor-Durchflug', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66875, 'deDE', 'Die Vergangenheit bewahren: Akademie von Algeth\'ar', 'Beschafft den Traumirrwisch der verworrenen Erinnerungen von der Direktorin in der Akademie von Algeth\'ar.', 'Wie wundervoll! Die Akademie von Algeth\'ar ist wieder geffnet. Direktorin Doragosa ist sicher froh, wieder in ihren Hallen der Lehre zu sein.\n\nEs ist schon ein Weilchen her, dass ich die Gelegenheit hatte, mit meiner lieben alten Freundin zu sprechen. Vielleicht knntet Ihr hingehen und sehen, ob sie Euch zum Tee empfngt. Dann httet Ihr auch die Mglichkeit, Euch an der Akademie einzuschreiben, denn ich hrte, dass sie jetzt fr alle Studenten offen sei.\n\nIch dachte, das knnte Euch interessieren, so oft, wie Ihr mich und diese Archive besucht.', '', '', '', '', '', '', 47187),
(66874, 'deDE', 'Die Vergangenheit bewahren: Hallen der Infusion', 'Beschafft den holografischen Verteiler vom urtmlichen Tsunami in den Hallen der Infusion.', 'Wusstet Ihr, dass es tief unter Tyrhold eine riesige Anlage gibt... die Hallen der Infusion? So geheimnisvoll! So fesselnd! So voller Mglichkeiten!\n\nHter Tyr hat dort viele seiner Geheimnisse aufbewahrt. Ich frage mich, welche das sein mgen? Er war wirklich der genialste aller Hter.\n\n<Kemora blickt vertrumt.>\n\nAber die Primalisten richten gerade ein riesiges Chaos an. Sie werden wohl alle Wunder Hter Tyrs zerstren, wenn sie nicht aufgehalten werden. Bitte, beseitigt sie, bevor sie zu viel Schaden anrichten.', '', '', '', '', '', '', 47187),
(66868, 'deDE', 'Die Vergangenheit bewahren: Vermchtnis von Tyr', 'Erbeutet die zeitverlorene Kuriositt von Chronolord Deios in Uldaman.', 'Ich habe die Archive nach Informationen ber Hter Tyr durchsucht und war berrascht, dass smtliche Hinweise auf Uldaman entfernt wurden. Nur auf einer halben Seite stand noch etwas ber ein dort verborgenes Geheimnis.\n\nFaszinierend, oder? Ich wette, er hat dort auch noch andere Geheimnisse versteckt. Vielleicht knntet Ihr ja mal mit ein paar Freunden zusammen nachsehen. Ich wre uerst dankbar fr alles, was Ihr mir bringen knnt.', '', '', '', '', '', '', 47187),
(66864, 'deDE', 'Reliktwiederbeschaffung: Brackenfellhhle', 'Besorgt den Fetisch der Faultriarchin von Faultriarchin Zornauge in der Brackenfellhhle.', 'Ah! Ihr knnt mir helfen. Die Gnolle der Brackenfellhhle sollen angeblich Verfall einsetzen, ein mchtiges Werkzeug in den richtigen Hnden. Gnolle haben nicht die richtigen Hnde.\n\nWir sollten gebhrende Nachforschungen in dieser dringenden Angelegenheit anstellen. Geht in die Hhle und bringt etwas von ihrer Magie mit, damit ich... damit wir sehen, welche Mchte sie sich zunutze gemacht haben.\n\nAber seid vorsichtig und geht nicht allein. Die Brackenfellgnolle knnen Eure Knochen zu Staub zerfallen lassen.\n\nDas wre jammerschade.', '', '', '', '', '', '', 47187),
(66860, 'deDE', 'Reliktwiederbeschaffung: Vermchtnis von Tyr', 'Erbeutet das Stundenglas der Wandernden Sande von Chronolord Deios in Uldaman.', 'Kemora hat mich nach smtlichen Hinweisen auf Hter Tyr und Uldaman suchen lassen. Meine Papierschnitte haben eigene Papierschnitte von all den Bchern, dich ich fr sie durchwhlt habe.\n\nFast alle Erwhnungen wurden herausgerissen oder vernichtet. Mit Ausnahme von der hier, die ich... ihr spter zeigen will. Anscheinend wurde in Uldaman etwas Wertvolles versteckt. Es wrde mich sehr freuen, wenn Ihr mir das bringen knntet.\n\nNatrlich nur, damit ich Kemora bei ihrer Forschung helfen kann.', '', '', '', '', '', '', 47187),
(66848, 'deDE', 'Zeichen im Wind', 'Helft Ohn Seshteng bei ihrem Ritual.', 'Ohn\'ahra spricht nicht in einer Sprache, wie wir es tun. Der Wind trgt ihre Stimme. Wir Mystiker haben uns darin gebt, ihre Prsenz zu erspren, ihrem Ruf zu folgen und ihre Nachrichten zu deuten.\n\nIch habe die Materialien, die Ihr gesammelt habt, genutzt, um Totems an diesen besonderen Ruf zu binden. Helft mir mit dem Ritual, ihre Stimme zu konzentrieren. Dann werde ich ihr Lied deuten.', '', '', '', '', '', '', 47187),
(66847, 'deDE', 'Gewlbe der Inkarnationen: Zorn der Sturmfresserin', 'Betretet das Gewlbe der Inkarnationen und besiegt Raszageth.', 'Nein! Wir haben die Inkarnationen eingeschlossen, um diese Welt zu retten, und nun will Raszageth sie befreien!\n\nDas darf ihr nicht gelingen, $n. Alles Leben auf Azeroth schwebt in groer Gefahr, wenn Ihr sie nicht aufhaltet!\n\nIch muss zu Nozdormu im Sitz der Aspekte zurckkehren und mich auf das vorzubereiten, was da kommt. Doch sorgt Euch nicht, ich werde Euch nicht ohne Untersttzung zurcklassen. Kalecgos und Khadgar werden zu Euch aufschlieen, wenn Ihr das Gewlbe betretet.\n\nViel Glck, Champion.', '', '', '', '', '', 'Sprecht mit Kalecgos beim Sitz der Aspekte in Valdrakken.', 47187),
(66846, 'deDE', 'Karte des Herzens', 'Helft der Erscheinung, eine neue Karte herzustellen.', 'Der Tag, an dem die Dracheninseln in ihren Schlummer verfielen, war auch der Tag meines letzten Spiels. Das Schicksal war grausam: Ich verlor meine strkste Karte, bevor ich antreten konnte.\n\nIhr msst wissen, dass Guo-Hees Karte frher meine war. Ich wei nicht, wie ihre Vorfahren in den Besitz dieser Karte gekommen sind.\n\nUnd leider kann ich sie jetzt nicht zurckfordern, nachdem sie seit Generationen in ihrem Familienbesitz war. Das war wirklich dumm von mir.\n\nVielleicht knnten wir beide zusammen eine Karte herstellen. Eine wirklich einzigartige Karte. Ja! Werdet Ihr mir helfen?\n\nGebt mir Bescheid, wenn Ihr bereit dafr seid.', '', '', '', '', '', '', 47187),
(66845, 'deDE', 'Eine wahre Raritt', 'Findet den Geist des Drakoniden und nehmt ihm die legendre Karte ab.', 'Letzte Nacht, als ich unter meiner Decke lag und versuchte, in den Schlaf zu finden, fllte pltzlich eine unnatrliche Klte das Gasthaus.\n\nDann erschien aus dem Nichts der Geist eines Drakoniden! Er hat mein Gepck durchsucht und sich danach in Luft aufgelst!\n\nAls ich heute Morgen erwachte, war das Erschreckendste daran aber, dass der Geist meine Lieblingskarte gestohlen hatte!\n\nWrt Ihr so lieb, den Geist fr mich aufzuspren und mir meine Karte zurckzubringen? Sie ist mein wertvollster Besitz.', '', 'Egal, welche Grnde es auch geben mag, es gibt immer bessere und weisere Mglichkeiten, als zu stehlen.', 'Mysterise Erscheinung', '', '', '', 47187),
(66844, 'deDE', 'Der groe Shokhari', 'Ttet Himmelsfchsin Shokhari.', 'Von allen Tieren, die ich hier geseh\'n hab, war keins so stolz, wie die groe Himmelsfchsin Shokhari.\n\nZu schade, dass sie \'nen Gnollschamanen gefress\'n hat, weil sie jetz\' vom Verfall verrckt geword\'n ist. Als ich geseh\'n hab, wie sie eins ihrer Jungen gefress\'n hat, da wusst ich, dass was nicht stimmt.\n\nIch hab ihr die Jungen weggenommen, wollte sie herbring\'n. Aber Shokhari hat mich angegriff\'n und mich gut erwischt. Htt\'s fast nicht berlebt.\n\nShokhari muss von ihrem Leid befreit werd\'n. Wenn der Verfall noch mehr von ihrem Verstand befllt, hat sie\'s bald auf uns abgeseh\'n.', '', 'Diese einst so majesttische Slyvern, die ber diese Wlder geherrscht hat, ist dem Verfall anheimgefallen.', 'Himmelsfchsin Shokhari', '', '', '', 47187),
(66843, 'deDE', 'Wo ist Lukh?', 'Findet Lukh.', 'Ach! Habt Ihr meinen Assistenten, Lukh, gesehen?\n\nDer Junge wollte sich kurz umsehen, aber er ist seit einer Stunde verschwunden!\n\nIch habe ihm gesagt, es ist hier nicht sicher genug fr einen Spaziergang, aber der Junge ist so dickkpfig wie ein Widder.\n\nIch kann es ihm nicht bel nehmen. Es ist schn hier drauen, und er liebt Blumen.\n\nKnntet Ihr mir helfen, ihn zu finden? Mein Wagen und ich werden am Dreifllerundblick gebraucht!', '', '', '', '', '', '', 47187),
(66841, 'deDE', 'Ein Fragment der Vergangenheit', 'Bergt das Artefakt und bringt es zu Thanessa Silberblh.', 'Ich hab Euch im Lager rumrennen und den Leuten helfen gesehen. Meint Ihr, Ihr knntet auch dem alten Gannar helfen?\n\nIch hab ein Gebiet untersucht und da ist mir was ins Auge gefallen. Ich glaube, es ist eine antike Tonscherbe oder ein Krug oder so, gleich sdlich von hier am Rand des Wasserfalls.\n\nJetzt bin ich kein groer Schwimmer, aber ich wrde Euch ein paar Mnzen geben und Ihr bringt Euren Fund zu Thanessa Silberblh.', '', '', '', '', '', 'Bringt das Artefakt zu Thanessa Silberblh.', 47187),
(66840, 'deDE', 'Wassersicherheit', 'Bringt drei Wasserproben zu Manny Lies.', 'Meine wichtigste Pflicht ist sicherzugehen, dass fr alle frisches Trinkwasser bereitsteht.\n\nMit den Gnollen im Osten und deren Verfall muss ich dafr sorgen, dass das Lager sicher ist.\n\nIch will niemanden verunsichern, indem ich Proben nehme, aber ich halte einen Test fr notwendig.\n\nBringt mir Proben von den drei Wasserfllen in der Nhe. Ich werde Euch grozgig entlohnen.', '', '', '', '', '', '', 47187),
(66839, 'deDE', 'Brauzeit!', 'Sammelt Blutbeeren, Bronzehornbeeren und Drachenblattblten.', 'Wir Kumpel hatten ein wenig Freizeit und Lust auf ein Bier, also sind wir zum Gasthaus gelaufen.\n\nAber, ach, kaum zu fassen! Die hatten nichts zum Trinken! Was ist das fr ein Saftladen? Einer von den Lden der Steinangels, so einer!\n\nAlso nehmen wir\'s selber in die Hand! Im Wald stlich von hier gibt es ein paar Blumen und Kruter, aus denen wir einen sen Met brauen knnten. Wollt Ihr mir helfen und ein paar Blumen pflcken? Es wird sich lohnen!', '', '', '', '', '', '', 47187),
(66838, 'deDE', 'Es ist kalt hier oben', 'Sammelt dicke Brenpelze von Dichtmhnenbren.', 'Eine gute Wirtin muss die Wnsche der Gste vorhersehen knnen. Leider war ich nicht darauf vorbereitet, wie kalt die Nchte hier drauen werden knnen. Hoppla?\n\nMeine Gste werden Decken brauchen... gute, dicke Decken. Vielleicht Brenpelze?\n\nIn den Wldern stlich von hier leben einige groe Bren. Wenn Ihr mir einige ihrer Pelze bringt, werde ich Euch gut bezahlen!\n\nBitte? Denkt doch nur an die Abenteurer und ihre kalten, kalten Fe...', '', '', '', '', '', '', 47187),
(66837, 'deDE', 'Nichts zum Frhstck', 'Sammelt Fleisch von den Vorquinschreitern und gestreiften Brffelchen sdlich des Dreifllerundblicks.', 'Mein Bruder Valdo htte eigentlich Vorrte bestellen sollen. Aber es ist eine Woche vergangen und keine Lieferung ist angekommen.\n\nIch bin nicht berrascht. Der faule Sack hat stattdessen wahrscheinlich ein Nickerchen gemacht! Jetzt gehen uns die Lebensmittel aus und ich bin zu beschftigt mit meinen... und Valdos Aufgaben, um auch noch auf die Jagd zu gehen!\n\nWrdet Ihr fr uns auf die Jagd gehen? Das Fleisch der Vorquinschreiter und gestreiften Brffelche sdlich von hier wrde die Kche gut aufstocken, bis ich wieder Vorrte bestellen kann.', '', '', '', '', '', '', 47187),
