(66834, 'deDE', 'Rellen der Gelehrte', 'Bietet Eure Opfergaben in der Opferhhle dar und erfahrt jede von Rellens Lehren.', 'Bringt Eure Opfergaben in die zentrale Hhle. Hier knnt Ihr die Legende von Rellen dem Gelehrten miterleben, der den Zentauren die Lebensgrundlage gab, wie wir sie heute kennen.', '', '', '', '', '', '', 47187),
(66833, 'deDE', 'Marmoni in Bedrngnis', '', '', '', '', '', '', '', '', 47187),
(66831, 'deDE', 'Zuhause ist, wo die Frsche sind', 'Trefft Keshki bei den Lebensbecken, um die geretteten Frsche freizulassen.', 'Wir haben alle Frsche beisammen, $n! Ich schtze, wir bringen die Frsche so oder so zu Akora. Bei den Lebensbecken werden sie sicher sein, bis die Flunker das Interesse verlieren und weiterziehen.\n\nhm, nun ja, jetzt haben wir wohl nichts gefunden, um Akora aufzumuntern. Ich hoffe, dass sie das versteht...', '', '', '', '', '', '', 47187),
(66830, 'deDE', 'Verflunkert nochmal!', 'Verwendet Keshkis Glhwrmchenkrug um $1oa schikanierte Frsche in Sicherheit zu bringen.', 'Oh, diese Flunker machen mich so wtend!\n\n<Keshki stampft so wtend mit dem Fu auf, dass ihre Brille verrutscht.>\n\nGroe, gierige Fieslinge! Nur weil die Hhle nach ihnen benannt ist, heit das nicht, dass sie berall rumspringen und alles fressen drfen, was kleiner als sie ist!\n\nHier, nehmt meinen Krug mit Glhwrmchen... Das ist der beste Freund eines jeden Froschenthusiasten. Es beruhigt die Frsche so sehr, dass Ihr sie einsammeln und auer Gefahr bringen knnt.\n\nUnd wenn Euch ein paar Flunker in die Quere kommen, dann scheut Euch nicht davor, es ihnen heimzuzahlen!', '', '', '', '', '', '', 47187),
(66828, 'deDE', 'Wirren in der Hhle', 'Trefft Keshki bei der Flunkerhhle.', 'Ich habe Akora noch nie so aufgebracht erlebt. Normalerweise ist ihr Gemt so sonnig wie ihre Blumen, aber diese Legende bedeutet ihr sehr viel. Sie spricht die ganze Zeit darber. Hm...\n\n<Keshki richtet sich die Brille.>\n\nIch wei nicht viel ber Pflanzen. Und ich glaube nicht, dass sich jemand auer mir ber Frsche freuen wrde...\n\nAber nrdlich von hier gibt es einen ruhigen Ort, an den ich gerne zum Nachdenken gehe, die Flunkerhhle. Vielleicht finden wir da etwas, das sie aufheitert... oder zumindest einen Plan, wie wir ihr helfen knnen.', '', '', '', '', '', '', 47187),
(66827, 'deDE', 'Die Blumen unserer Arbeit', 'Sammelt $1oa gereifte Drachenfrchte, $1oa duftende Drachenblumen und $1oa ppige Samenkapseln im Garten, um sie dem Drachengeist darzubieten.', 'Den Legenden zufolge singt die Stimme nur fr diejenigen, die ihre Hingabe fr das Leben beweisen.\n\nIch habe mich jahrelang um diesen Garten gekmmert. Und ich glaube, dass meine Pflanzen und ich endlich bereit sind.\n\nIch bereite hier beim Teich schon mal alles vor. Ihr knnt mir whrenddessen bei der Ernte helfen!\n\nSammelt Samenkapseln von den Bschen, Drachenblumen auf den sonnigen Feldern und Drachenfrchte hoch oben in den Bumen. Fr Letztere knnt Ihr Euch gerne meine alte Harke leihen. Und passt auf! Die Bltter knnen recht angriffslustig sein!', '', '', '', '', '', '', 47187),
(66825, 'deDE', 'Eine rubinrote Lebensberufung', 'Nehmt an der lebensberufenden Zeremonie beim Rubinlebensschrein teil.', '$p! Wie schn, dass Ihr da seid! Wir fangen gleich mit einer lebensberufenden Zeremonie an, und es wre uns eine Ehre, wenn Ihr uns dabei untersttzen knntet.\n\nDie Berufung einer Drachenbrut ist von groer Bedeutung. Manche werden meisterhafte Grtner, andere kmmern sich um bestimmte Wildtiere.\n\nDiese Angehrigen der Drachenbrut haben ihre Ausbildung abgeschlossen und sind nun bereit fr ihre ersten Berufungen. Sie wren sicherlich ganz entzckt, wenn Ihr daran teilhaben wrdet. Prsentiert ihnen bitte, sobald Ihr bereit seid, jeden der Gegenstnde auf dem Tisch.', '', '', '', '', '', '', 47187),
(66805, 'deDE', 'Schlssel der Loyalitt', 'Sammelt $1oa groe Obsidianschlssel.', '', '', '', '', '', '', 'Bringt den zusammengesetzten Schlssel zu Sabellian in der Obsidianzitadelle.', 47187),
(66788, 'deDE', 'BegEIstert von der Zukunft', 'Helft Mutter Elion, das Gebiet wiederherzustellen.', 'Ich kann es kaum glauben! Eier des schwarzen Drachenschwarms! Nach all der Zeit!\n\nAber seht nur, in welchem Zustand sich dieser Ort befindet! Das darf auf keinen Fall so bleiben! Fr diese Eier ist nur das Beste gut genug.\n\nAllerdings haben diese beiden Wichtigtuer, die wie Kleinkinder um die Gunst der Lebensbinderin zanken, sicherlich keinen Gedanken an uns verschwendet! Ihr hingegen werdet eine alte Eierhterin doch nicht im Stich lassen, nicht wahr?', '', '', '', '', '', '', 47187),
