(66785, 'deDE', 'Die letzte Eierhterin', 'Sprecht mit Mutter Elion.', 'Ich kann Eure Sorge nachvollziehen, $C, aber alles wird bald richtiggestellt werden, da es aussieht, als ob wir bald Besuch bekommen.\n\nBleibt, wenn Ihr mchtet, und beobachtet, was passiert. Es sollte recht reinigend wirken.\n\nDoch sprecht mit unserer Eierhterin, wenn Ihr einen Moment Zeit habt. Sie knnte Eure Untersttzung brauchen.', '', '', '', '', '', 'Sprecht mit Mutter Elion.', 47187),
(66784, 'deDE', 'Den Sturm aushungern', 'Ttet alle Sturmbeschwrer der Primalisten, um das Sturmkorridorportal zu schlieen.', 'Ihr schlagt Euch nicht schlecht, wenn man bedenkt, dass Euch nur zwei Beine zur Verfgung stehen!\n\nEs spielt keine Rolle, wie gut wir uns schlagen, solange die Primalisten weiterhin Verstrkung erhalten. Wir mssen dieses Portal schlieen, den Sturmkorridor!\n\nSchlagt Euch zu der nahe gelegenen Hhle durch und ttet die Sturmbeschwrer der Primalisten, die das Portal geffnet halten. Ich werde Euch beistehen, wenn ich kann.', '', '', '', '', '', '', 47187),
(66783, 'deDE', 'Erneuerung der Gelbde', 'Helft Sansok Khan, Tigari Khan, Khanam Matra Sarest und Merithra, Gaben auszutauschen.', 'Vor Jahrhunderten habe ich einen Schwur der Freundschaft und Zusammenarbeit mit den ersten Zentauren geschlossen. Obwohl sich seitdem viel gendert hat, finde ich, dass es an der Zeit fr uns ist, diesen Schwur zu erneuern.\n\nEs wurde eine Rezitation verfasst, um zuknftigen Zentaurengenerationen zu helfen, sich an ihren Bund mit dem grnen Drachenschwarm zu erinnern. Jeder Vers muss mit einer Opfergabe der Khane beantwortet werden. Ich hoffe, die Zentauren erinnern sich noch an ihre ursprnglichen Bedeutungen.\n\nDie Wahl der Gabe ist entscheidend. Whlt die richtige Opfergabe und unser Bndnis ist geschlossen.', '', '', '', '', '', '', 47187),
(66781, 'deDE', 'Eine Frage des Geschmacks', 'Findet einen Stein, an dem Mordigan Eisenkiefer lecken kann, in Walfngerwinkel.', 'So viel Respektlosigkeit hier!\n\nEin paar stinkende Gorlocs klauen Teile unserer Ausrstung und schon mssen wir alles stehen und liegen lassen... Ha! Ich hab schon Steine geleckt, da habt Ihr noch in die Windeln gemacht! Dazu brauch ich keine gnomischen Spielereien.\n\nBringt mir einen Stein und ich werd\'s Euch beweisen!', '', '', '', '', '', 'Kehrt zu Mordigan Eisenkiefer zurck.', 47187),
(66780, 'deDE', 'Thronanwrter', 'Sprecht mit Furorions Anhngern.', 'Ich habe mich immer wieder der Aufgabe gewidmet, Azeroth vor der Zerstrung zu bewahren, und dieser Narr glaubt, er knne einfach herabschieen und den Titel des Aspekts fr sich beanspruchen? Ha.\n\nSprecht mit meinem Schwarm, $n. Hrt Euch an, was er ber mich zu sagen hat und was ich fr diese Welt getan habe.', '', '', '', '', '', '', 47187),
(66779, 'deDE', 'Ersichtlicher Erbe', 'Sprecht mit den Anhngern von Sabellian.', 'Als Erbe Neltharions und Anfhrer des einzig berlebenden Schwarms der schwarzen Drachen hatte ich nicht erwartet, mein Geburtsrecht verteidigen zu mssen. Und schon gar nicht gegen einen selbstherrlichen Welpen, der jnger ist als Ihr, $gSterblicher:Sterbliche;.\n\nDessen ungeachtet braucht Ihr mir nicht aufs Wort zu glauben und knnt gerne mit den Mitgliedern meines Schwarms sprechen, wenn Euch diese offensichtlichen Fakten nicht gengen.', '', '', '', '', '', '', 47187),
