(66777, 'deDE', 'Uktuluter Kstenachter', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66737, 'deDE', 'Ein guter Anfang', 'Pflanzt Samen in $1oa Felder mit fruchtbarer Erde und lasst sie aufwachsen.', 'Vaeros ist gewissenhaft, doch Welpen haben ein angeborenes Talent fr rger. Meine stellen natrlich eine Ausnahme dar... doch nicht alle Drachen ziehen ihre Gelege auf und knnen die Bedeutung dieser Station nachvollziehen.\n\nEs widerstrebt mir zutiefst, Auenaktivitten Vorzug gegenber dem Studium zu geben, doch ich werde Euch helfen, den Garten effektiver zu schtzen. Nehmt diese Samenkrner und pflanzt sie in der Nhe ein. Sobald sie erblht sind, vertreibt ihr Duft die meisten Insekten.\n\nDie Grtner knnen Euch helfen... und vielleicht auch meine bronzenen Brder und Schwestern, wenn Ihr Euch benehmt.', '', '', '', '', '', '', 47187),
(66735, 'deDE', 'Schnippschnapp', 'Schneidet $1oa berwuchernde Strucher zurck.', 'Dass die Bienen die Welpen verschrecken, ist nicht das einzige Problem. Whrend die Bestubung normalerweise eine gute Sache ist, hat der jngste Schwarm die Flora auer Kontrolle geraten lassen.\n\nKnntet Ihr bitte meine Gartenschere nehmen und die Strucher zurckschneiden? Einige haben bereits begonnen, gefhrliche Wucherungen auszubilden, aber ich hoffe, wir knnen weitere davon abhalten, dies zu tun. Vorsicht ist ja bekanntlich besser als Nachsicht.\n\nUnd ich knnte gerade... wirklich eine ordentliche Portion Vorsicht brauchen, $n.', '', '', '', '', '', '', 47187),
(66734, 'deDE', 'Gute Biene zum bsen Spiel', 'Beruhigt mit dem Rauchdiffusor $2oa lstige Bienen, sammelt sie ein und lasst sie in der Nhe des Sees frei.', 'Oh, gepriesen sei die Lebensbinderin! Jemand mit einem Paar freier Hnde!\n\nDiese Grten sind blicherweise ein wundervoller Spielplatz fr unsere Welpen, aber seitdem hier alles aufblht, vermehren sich die Bienen unkontrolliert. Die Blumen vermehren sich geradezu prchtig, und damit auch die Bienen. Die Welpen sind verngstigt, die Drachen sind genervt und gestern erst wurde einer von ihnen gestochen...\n\n<Vaeros atmet tief durch, um sich zu beruhigen, und sieht Euch dann flehend an.>\n\nKnntet Ihr bitte die Bienen einfangen und sie an den See umsiedeln? Nehmt diesen Rauchdiffusor, damit knnt Ihr sie beruhigen.', '', '', '', '', '', '', 47187),
