(66730, 'deDE', 'Wahre berlebende', 'Findet den alten Grimmhauer am gefrorenen See im Azurblauen Gebirge und sprecht mit ihm.', 'Ich wei, dass wir ziemlich angeschlagen sind, doch wir drfen nicht vergessen, warum wir hier sind. Unser Volk zhlt auf uns, und ich habe nicht vor, es im Stich zu lassen. Wir mssen in dieser wilden Gegend einen vorbergehenden Platz fr uns finden und ich wei auch schon genau den richtigen Ort.\n\nUnd jetzt Schluss mit den Klagen und BEWEGUNG!', '', '', '', '', '', 'Findet den Alten Grimmhauer am gefrorenen See im Azurblauen Gebirge und sprecht mit ihm.', 47187),
