(66724, 'deDE', 'Die Leuchtfischerin', 'Besorgt $1oa Leuchtfische und platziert sie im Gabenkorb.', 'Es tut mir leid, dass Ihr in diese Angelegenheit verwickelt worden seid, $gReisender:Reisende;.\n\nMein Bruder neigt dazu, zu... bertreiben. Dies ist nur die neueste seiner Narreteien, doch diese knnte ihn das Leben kosten.\n\nEr hrt nicht auf mich. Er wird vermutlich auch nicht auf Euch hren.\n\nDoch es gibt jemanden, auf den er vielleicht hren wrde: unsere Vorfahrin, Kauriq die Leuchtfischerin.\n\nBitte fangt ein paar Leuchtfische und bringt sie her. Mit ihnen werde ich versuchen, mit dem Geist von Kauriq zu sprechen, der in diesem Stein wohnt.', '', '', '', '', '', '', 47187),
