(66719, 'deDE', 'Einen Schritt zurck', 'Schtzt Euch vor dem Ruf.', '$gMein Freund:Meine Liebe;, mit groem Bedauern muss ich gestehen, dass ich mit der Plage vertraut bin, die Eure Art in diesen Ruinen heimsucht. Wenn Ihr weiter vordringt, werdet Ihr gewiss ihrem Wahnsinn anheimfallen.\n\nSei es durch Eure Erziehung oder Eure Natur... der Ruf, den Ihr vernehmt, ist psychologischer Art. Ihr versprt ein Verlangen, das gestillt werden muss.\n\nEs beschmt mich zu sagen, dass ich die Mittel besitze, diese Verwnschung zu nhren. Es wird nicht dasselbe sein, aber Ihr werdet handlungsfhig bleiben... fr den Moment.', '', '', '', '', '', '', 47187),
(66718, 'deDE', 'Gnolle mssen sterben', '', '', '', '', '', '', '', '', 47187),
(66715, 'deDE', 'Die Extraktion', 'Rettet Tuskarr aus dem Schneebalglager im Azurblauen Gebirge.', 'Am wichtigsten ist es jetzt, meine Leute zurckzubringen. Vorzugsweise unverletzt.\n\nUnd so schwer es mir auch fllt, dies zuzugeben: Ich bin nicht in der Lage, allein zu kmpfen.\n\nWerdet Ihr uns helfen?', '', '', '', '', '', 'Sprecht mit Frostbiss, um mehr ber die Tuskarrjger zu erfahren.', 47187),
