(66711, 'deDE', 'Delikate Dunkelheit', 'Sammelt $1oa Flussschnecken fr Hadari.', 'Aufgrund der Lebensweise unseres Klans sind manche Ressourcen knapp. Wir haben nicht die ntige Zeit, um dem Land seine Metallressourcen zu entreien.\n\nDie verstorbene Khan hat viele Handelsverbindungen zu einer Reihe von Leuten aufgebaut, und ich habe vor, ihre Dienste auch weiterhin in Anspruch zu nehmen.\n\nIn der Bucht in der Nhe finden sich Eimer, in denen wir Flussschnecken fangen. Sie gelten bei einigen unserer Nachbarn als Delikatesse. Bringt mir welche davon, damit ich damit handeln kann.', '', '', '', '', '', '', 47187),
