(66709, 'deDE', 'Das Einmaleins der Feldsanitter', 'Helft dem Alten Grimmhauer, sich von seinen Wunden zu erholen.', '<Schwer zu sagen, wie lange dieser verwundete Tuskarr schon alleine hier im Wald liegt, doch ohne Hilfe wird er nicht mehr lange durchhalten.>', '', '', '', '', '', '', 47187),
(66708, 'deDE', 'Reiter im Schnee', 'Findet die vermissten Jger der Tuskarr im Azurblauen Gebirge.', 'Seid gegrt, $C. Diese magische Kuppel ist wahrlich beeindruckend, nicht wahr? Doch obwohl sie uns vor der klirrenden Klte und den Gefahren der Wildnis schtzt, knnen wir uns nicht ewig auf die Kirin Tor verlassen.\n\nVor einigen Tagen sind einige unserer erfahrensten Jger in die Wlder aufgebrochen, um nach Essen und Vorrten zu suchen, aber sie sind nicht zurckgekehrt. Ich wei, ihr Anfhrer, der Alte Grimmhauer, ist ein erfahrener Wanderer und Jger, aber wir knnen unsere Sorge um ihn und seinen Jagdtrupp nur schwer abstellen.\n\nKnnt Ihr sie fr mich aufspren?', '', '', '', '', '', 'Findet die vermissten Jger der Tuskarr im Azurblauen Gebirge.', 47187),
(66706, 'deDE', '[DNT]QuestNameHere', '', '', '', '', '', '', '', '', 47187),
(66704, 'deDE', 'Mugurlglrlgl!', 'Murglgulglrrlglgul!', 'Mrglgulglrrlglgul! Grurguglullgurl!\n\nGruglrlgllrugl rrgulgrulgrgl grugll gurgull gur. Murgllgllrugl gurgllglrl Murgul gruggullgl. Murguglegurgllgur gurgll gurgulgul guruulgurllgr guuglrllgl.\n\nMgrgulllglll gurl gugll.\n\n<Ihr seid Euch nicht sicher, was genau er Euch sagen will, aber er gestikuliert wild, als wrde er auf jemanden oder etwas einstechen. Dieser Murloc will wohl, dass Ihr etwas ttet.>', '', '', '', '', '', '', 47187),
(66703, 'deDE', 'Schneeballeffekt', 'Holt $1oa Schneebalgtotems von den Schneebalgschamanen im Azurblauen Gebirge.', 'Schneebalggnolle klug. Wissen, wenn Essen auf Eis machen, Essen lnger haltbar. Aber nicht gewhnliches Eis, nein. Magisches Eis viel besser!\n\nIst Werk von Schamanen. Und sie Frostbiss hiergelassen haben, um neben kstlichem Tuskarrfleisch zu verhungern.\n\nWenn $R Tuskarr helfen will, nicht viel Zeit bleiben.\n\nAber Frostbiss wei, wie Zauber brechen.\n\nWarum Frostbiss helfen? Mag Schamanen auch nicht.', '', '', '', '', '', '', 47187),
(66700, 'deDE', 'Der schwarze Locus', 'Bringt den schwarzen Locus zu Telemantin Aerilyn.', 'Er ist wirklich sehr faszinierend, nicht wahr? Der Locus war zu viel fr die Splitterflammen. Aber er passt genau in meine Hnde. Schon seltsam.\n\n<Adenedal schttelt den Kopf.>\n\nVielleicht nicht. Nicht heute. Nicht mehr. Nehmt ihn mir ab. Er ist nicht meine Brde.\n\nAuf Wiedersehen, $gmein lieber Freund:meine liebe Freundin;.', '', '', '', '', '', '', 47187),
(66699, 'deDE', 'Befragung der Einheimischen', 'Sprecht mit den Tuskarr im Lager Antonidas.', 'Kalecgos ist weise, den Rat der Tuskarr einzuholen. Sie haben Generationen an Erfahrung mit diesem Gebiet.\n\nViele rasten hier auf ihrem Weg zu den verschiedenen Lagern entlang des Gebirges.\n\nFragt herum! Einer von ihnen muss etwas ber lokale Leylinien wissen.', '', '', '', '', '', '', 47187),
(66698, 'deDE', 'Riesenwildschafe zhlen', 'Sprecht mit dem Hirten der Aylaag und fhrt die verlorenen Schafe zurck zum Klan.', 'Eine unserer wichtigsten Ressourcen sind unsere Riesenwildschafe. Jeder Verlust wirkt sich deutlich auf die Strke unseres Klans aus.\n\nEin paar der Riesenwildschafe sind davongelaufen und haben den Anschluss an die Herde verloren. Unsere Schfer knnten bei der Rckfhrung der verlorenen Schafe Eure Hilfe brauchen.', '', '', '', '', '', '', 47187),
(66692, 'deDE', 'Rubinlebensschrein-Schleife - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66691, 'deDE', 'Waking Shores - Race 01 - Intermediate', 'Gleitet durch die Ringe.', 'Der Kurs hat einen hnlichen Aufbau wie der vorherige, nur mit mehr Varianz bei der Platzierung der Kontrollpunkte.\n\nFalls Ihr steckenbleibt, bettigt die Pfeife, dann setze ich Euch zurck.', '', '', '', '', '', '', 47187),
(66690, 'deDE', 'Angriff der Nokhud: Der letzte Ahne', 'Besiegt Balakar Khan und erbeutet das Medaillon der Ahnen beim Angriff der Nokhud.', 'Ihr habt bewiesen, dass Ihr uns $gein Verbndeter:eine Verbndete; seid und aufrichtiges Interesse an unseren Werten und unserer Lebensweise habt. Es gibt noch einen Vorfahren, von dem ich Euch gerne erzhlen wrde, aber es ist gefhrlich.\n\nTtet den verrterischen Balakar, Anfhrer der Nokhud, niemandes Sohn. Sein wertvolles Medaillon legt er niemals ab. Bringt es mir und ich werde ewig in Eurer Schuld stehen.', '', '', '', '', '', '', 47187),
(66689, 'deDE', 'Mehr als ein Stein', 'Zeigt die sturmberhrten Splitter Watu.', '<Die Splitter fhlen sich glatt und warm an. In ihrem Kern blitzt es.>\n\n<Vielleicht wissen Watu oder Olekk mehr darber.>\n\n<Beim Gedanken daran, den Splitter aus der Hand zu geben, presst Ihr ihn instinktiv an Eure Brust. Ihr wollt ihn nie wieder loslassen.>', '', '', '', '', '', 'Kehrt zu Watu im Nadelholzposten zurck.', 47187),
(66688, 'deDE', 'Zeichen des Windes', 'Sammelt Windgaben und legt sie in das Opfergef in der Nhe des singenden Steines.', 'Als die Elemente, die wahren Urwesen dieser Welt, die Zentauren herausforderten, trat Himia dem Geschenk entgegen, das wir erhalten hatten: mit dem Wind.\n\nEin singender Stein ragt auf den Ebenen auf. Dort knnt Ihr Eure Gaben dem Wind darbieten, um ihre Erinnerung zu erwecken. Solche Gaben knnen berall um uns herum gefunden werden: eine Vogelfeder, ein Pflanzensamen, Flussschilf.', '', '', '', '', '', '', 47187),
(66687, 'deDE', 'Land der Eliten', 'Sammelt $1oa Schattenspinnernetze, $2oa Slyvernkrallen und $3oa Donnerrckgratschuppen.', 'Ihr solltet von Rellen dem Gelehrten wissen, der den Zentauren die Mittel gab, in einem gnadenlosen Land zu berleben. Seine Erinnerung erfordert Opfergaben von wrdigen Tieren.\n\nGebt Acht, $gReisender:Reisende;, sie sind nicht so gefhrlich, wie sie vor onen waren, doch sie sind immer noch die Eliteraubtiere dieser Ebenen.', '', '', '', '', '', '', 47187),
(66684, 'deDE', 'Sturmjger', 'Vernichtet die Primalisten und ihre Quelle der Sturmmagie.', '<Watu reit den Splitter raus und schnappt nach Luft.>\n\nIch... habe komplett die Kontrolle verloren. Olekk hatte recht. Diese schreckliche Magie muss das Werk der Primalisten sein. Haltet sie bitte auf!\n\nIch muss meinen Bruder zurck ins Lager bringen.', '', '', '', '', '', '', 47187),
(66683, 'deDE', 'Verzweifelte Analyse', 'Stellt Nachforschungen ber die sturmberhrten Splitter im Nadelholzposten an.', '<Watu murmelt mit geschlossenen Augen und verschrnkten Armen vor sich hin.>\n\nNatrlich muss es ausgerechnet ein Hirsch sein, der mich aufspiet. Jetzt bin ich nur eine weitere Person, die Hilfe braucht. Mein Bruder heimst den ganzen Ruhm ein, und zu Hause wird das niemanden berraschen.\n\n<Watu blickt auf.> Was? Was habt Ihr da? Leuchtende Steine? Ja, ich kann mir einen davon anschauen, aber bringt den Rest zu jemand anderem. Ich bin Jger, kein Archologe. <Watu schnaubt und starrt auf sein Bein.> Vielleicht ist es ja Zeit fr einen Karrierewechsel. Na los, Ihr habt Euch als ntzlicher erwiesen als ich.', '', '', '', '', '', '', 47187),
(66681, 'deDE', 'Gewitter ziehen auf', 'Ttet $1oa sturmberhrte Tiere im Weisenkronenpinienwald.', 'Wenn Ihr in den Pinienwald geht, dann erlegt doch bitte alle sturmberhrten Tiere. Es fllt mir nicht leicht, Euch darum zu bitten, aber ihnen kann nicht geholfen werden. Sie leiden und verbreiten Aggressivitt.\n\nIch schtze, dass es sich dabei um das Werk der Primalisten handelt. Das muss von ihrem Auenposten in der Nhe kommen. Ich habe dort einen seltsamen magischen Altar gesehen.\n\nIch werde mir das noch mal anschauen. Wenn ich nicht zurck sein sollte, wenn Ihr wieder da seid, kann Spher Watu Euch ber ein paar weitere Aufgaben informieren. Wir sind fr jede Hilfe dankbar.', '', '', '', '', '', '', 47187),
(66680, 'deDE', 'Riesenwildschfchen zhlen', 'Freundet Euch mit Wunsch mithilfe von Essen an und benutzt Wunsches Pfeife, um $3oa verirrte Riesenwildschafe im Weisenkronenpinienwald zu retten.', 'Wie frustrierend. Das stammt von einem tollwtigem Hirsch, dem mein Bruder Olekk und ich whrend unseres letzten Erkundungsgangs begegnet sind.\n\n<Watu deutet auf sein blutiges Bein und zuckt zusammen.>\n\nSeid Ihr hier, um zu helfen? Nach dem Angriff der Primalisten ist unsere Riesenwildschafherde in den Pinienwald geflchtet. Dort sind die Tiere nun verstreut. Hier im Lager sind wir auf ihre Wolle und Milch angewiesen.\n\nNehmt diese Pfeife. Sie ist das Signal fr Wunsch, die Riesenwildschafe zurckzubringen. Sondo der Metzger hat auch noch besondere Leckerlis, falls Wunsch etwas motiviert werden muss.', '', '', '', '', '', '', 47187),
(66679, 'deDE', 'Rubinlebensschrein-Schleife', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66676, 'deDE', 'Reinschleichen', 'Kehrt zu Radiya an den Quellen von Ohn\'iri zurck.', 'Das ist Lizi... Sie ist meine geheime Freundin. Ich kmmere mich um sie, seit sie von ihrer Mutter verstoen wurde.\n\nDas sieht nicht gut aus. Was auch immer sie ihr angetan haben, bersteigt mein Wissen. Ich muss sie nach Hause bringen. Meine Ohn mag mich fr den Rest der Zeit festsetzen, aber Lizi muss Hilfe erhalten. Ich bin Euch unendlich dankbar, $p. Es tut mir leid, dass dies mehr Schwierigkeiten bereitet als gedacht.\n\nWenn Ihr nichts gegen ein weiteres Abenteuer habt... wrdet Ihr Euch dann mit mir dem Zorn meiner Ohn stellen? Wir treffen uns an den Quellen!', '', '', '', '', '', 'Kehrt zu Radiya an den Quellen von Ohn\'iri zurck.', 47187),
(66675, 'deDE', 'Aspektmacht', 'Helft Alexstrasza am Mutterschwurstein.', 'Der Mutterschwurstein ist ein uraltes Geschenk der Titanen an unsere Schwrme. Wenn unsere Informationen stimmen, knnen wir ihn reaktivieren und so unsere Aspektkrfte wiederherstellen.\n\nDer Erfolg mag ungewiss sein, aber wenn es auch nur eine kleine Chance gibt, muss ich es versuchen.\n\n$n, ich wrde mich freuen, wenn Ihr mir helfen wrdet.', '', '', '', '', '', '', 47187),
(66671, 'deDE', 'Pfad ins Nirgendwo', 'Trefft Maddi Streuschuss im Lager im Nirgendwo im Azurblauen Gebirge.', 'Ihr seht wie $gein gewillter und fhiger Abenteurer:eine gewillte und fhige Abenteurerin; aus! Wie wrde es Euch gefallen, der Drachenschuppenexpedition auszuhelfen?\n\nWir haben ein nettes kleines Lager mitten in der Wildnis errichtet.\n\nEs gbe dort einiges fr Euch zu tun, vorausgesetzt, Ihr wollt den Weg dorthin auf Euch nehmen.\n\nSprecht mit meiner Schwester Maddi, wenn Ihr dort ankommt. Sie wird Euch einfhren.', '', '', '', '', '', 'Trefft Maddi Streuschuss im Lager im Nirgendwo im Azurblauen Gebirge.', 47187),
(66660, 'deDE', 'Auf die Pltze, fertig...', 'Schliet Euch Andantenormu und Siaszerathel in der Vergangenheit an.', '<Nozdormus sieht sich mit unstetem Blick um.>\n\nJe tiefer sie fallen, desto schneller bewegen sie sich. Sie reien Lcher in das Gewebe der Zeit und schlagen groe Wellen. Ihr werdet schnell sein mssen, um sie zu fassen.\n\n<Nozdormus Fokus wird schrfer und richtet sich auf Euch.>\n\nIch werde meine Zeitwanderer entsenden, um Euch dabei zu helfen, ber die Pfade der Zeit zu navigieren und Eure Bemhungen zu beschleunigen. Vermeidet es, Euch mit den temporalen Einheimischen abzugeben, und hrt nicht auf, bis Ihr Chronormu gefunden habt!\n\nGeht. Uns bleibt nicht viel Zeit.', '', '', '', '', '', '', 47187),
(66658, 'deDE', 'Der Angriff der Nokhud: Wiederholen ist gestohlen', 'Begebt Euch zum Angriff der Nokhud, besiegt Teera und Maruuk und platziert ihre Waffen im Kurgan von Teerakai.', 'Die Waffen von Teera und Maruuk wurden entwendet, bevor wir Grabrufer Arban aufgehalten haben. Unsere grten Vorfahren knnten erneut auf diesen Ebenen kmpfen... fr die Nokhud.\n\nBegebt Euch zum Angriff der Nokhud. Findet Maruuk und Teera. Wenn Ihr sie bezwungen habt, bringt ihre Waffen zum Grabhgel von Teerakai zurck. Wir werden sie an einem Ort, der sich leichter schtzen lsst, mit der ihnen gebhrenden Ehre wieder zur Ruhe betten.', '', '', '', '', '', '', 47187),
(66657, 'deDE', 'Und bleibt tot!', 'Betretet das grte Hgelgrab und bezwingt Grabrufer Arban.', 'Grabrufer Arban hat sich im grten Grabhgel verschanzt. Dort ruhen die ersten Vorfahren der Maruuk. Verhindert, dass er Maruuk und Teera erweckt!', '', '', '', '', '', '', 47187),
(66656, 'deDE', 'Definitiv letzte Ruhe', 'Besiegt jeden der ruhmreichen Zentaurengeister und benutzt dann Zorigs Totem der Erholung, um sie zu befreien.', 'Die Ahnen sind von dieser dunklen Magie gepackt. Sie werden kmpfen, statt zu folgen. Die Ukhel haben unsere strksten Krieger und Jger erweckt. Es wird nicht leicht, sie aufzuhalten.\n\nIch komme mit und helfe Euch. Es wird Zeit, den Speer meiner Mutter wieder in die Schlacht zu fhren.\n\nIch habe ein Totem hergestellt, das den unterworfenen Geistern dabei hilft, zurck in ihre Kurgane zu finden. Verwendet es, sobald Ihr sie bezwungen habt.', '', '', '', '', '', '', 47187),
(66655, 'deDE', 'Reagenzien zur Ent-Nekromantierung', 'Sammelt $1oa intakte Schdel von auferstandenen Gefhrten und $2oa Klumpen heiliger Erde.', 'Ich frchte, die Geister werden ihre Grber nicht wiederfinden, selbst wenn wir sie aus den Klauen der Ukhel befreien.\n\nDie Ukhel zwingen selbst deren Tierbegleiter, die sie ihr Leben lang begleitet und beschtzt haben, zurck ins Leben.\n\nBringt mir die Schdel dieser Tiere und die heilige Erde, die von diesen Ungeheuern entweiht wurde. Zusammen sollten diese Reagenzien dafr sorgen, dass unsere Vorfahren endlich Frieden finden.', '', '', '', '', '', 'Trefft Euch mit Zorig tiefer in den Ewigen Kurganen.', 47187),
(66654, 'deDE', 'Schndervernichtung', 'Ttet Schnder der Nokhud und Grabstrer der Ukhel und erobert die Ahnenwaffen zurck, die sie gestohlen haben.', 'Meine Mutter war eine Heldin. Sie verdient Frieden und Ruhe, nicht diese... Versklavung! Das verdient keiner unserer Helden.\n\nSie mssen dafr bezahlen. Und unsere Vorfahren mssen wieder mit ihren Waffen ruhen, ehrenvoll. Holt die Waffen von diesen Grabschndern zurck!', '', '', '', '', '', 'Trefft Euch mit Zorig tiefer in den Ewigen Kurganen.', 47187),
(66652, 'deDE', 'Zurck an den Heiler', 'Untersucht das Ritual der Ukhel auf dem Grabhgel in der Nhe.', 'Ich erkenne von hier aus nicht, was sie tun, aber ich frchte, sie entweihen die Kurgane.\n\nBitte begebt Euch zum nchsten Grab und versucht, ihr Ritual zu vereiteln.\n\nUnd wenn Ihr irgendwas findet, das erklrt, warum sie es durchfhren, so bringt es mir bitte.', '', '', '', '', '', 'Bringt den Speer zurck zu Zorig.', 47187),
(66651, 'deDE', 'Verdchtige Klangeschfte', 'Trefft Initiand Zorig in den Ewigen Kurganen.', 'Die Klans Nokhud und Ukhel haben die Ewigen Kurgane eingenommen. Dahinter kann nur eine boshafte Absicht stecken. Unsere ehrwrdigen Vorfahren ruhen dort.\n\nIch habe unseren Initianden Zorig zu Nachforschungszwecken entsandt. Er ist bisher nicht zurckgekehrt.\n\nEs mangelt ihm an Selbstvertrauen, auch wenn er fhig ist. Bitte helft ihm, diesem unheilvollen Treiben ein Ende zu setzen!', '', '', '', '', '', '', 47187),
(66650, 'deDE', 'Finale des Schicksals', 'Besiegt $1oa verschiedene Bosse schicksalhafter Schlachtzge.', '<Ihr seid ganz ruhig. Die Natur dieser Erfahrung bleibt unergrndlich, aber sie fhlt sich nicht mehr ungewohnt an. Ihr beherrscht jetzt diese Herausforderungen, und die Klarheit ist Eure letzte Belohnung.>\n\n<Mit klarem Verstand und ruhiger Hand schreitet Ihr ein letztes Mal voran. Gestaltet Euer eigenes Schicksal und seht, wie es sich vor Euch entfaltet.>', '', '', '', '', '', '', 47187),
(66647, 'deDE', 'Wenn Elementare den Fokus verlieren', 'Holt den Elementarfokus zurck.', 'Kalecgos und ich sind in den Lften ber dem Berg unter schwerem Beschuss. Die Primalisten sind unerbittlich und ihre Armee ist endlos.\n\nSchon bald knnten Kalecgos und ich von ihren Truppen berrannt werden.\n\nAber ich habe einen Plan.\n\nAm Fu des Berges befindet sich eine Orcin namens Ruvin Steinzermalmer. Die Kirin Tor haben sie schon unzhlige Male bekmpft.\n\nSie hat ein Gert, das elementare Energien absorbieren und umlenken kann.\n\nNehmt es ihr ab und trefft mich anschlieend weiter drinnen.', '', 'Ruvin besitzt den mchtigen Elementarfokus.', 'Ruvin Steinzermalmer', '', '', 'Trefft Khadgars Projektion tiefer in der Bergkette von Vakthros.', 47187),
(66646, 'deDE', 'Kausalitten unter Kontrolle bringen', 'Ttet die Zeitelementare.', 'Die Ewigen haben die Zeitenergien zur Aggressivitt gezwungen. Das ist nicht gut.\n\nBitte ttet alle Zeitelementare, die Ihr seht, whrend Ihr Botschafterin Chronormu helft. Ich bleibe hier und helfe ihr dabei, Eternus zu halten.', '', '', '', '', '', '', 47187),
(66633, 'deDE', 'Eindruck machen', 'Rammt ein Banner der schwarzen Drachen in die Leichname von $1oa Djaradin.', 'Diese Djaradin glauben, dass der schwarze Drachenschwarm erledigt ist. Sie frchten oder respektieren Furorions Autoritt nicht.\n\nWir mssen eine Ansage machen, um sie daran zu erinnern, dass der Obsidianschwarm zurck und strker als je zuvor ist.\n\nTtet die Djaradin und markiert jeden Leichnam, damit sie auch ja nicht vergessen, wer hier regiert.', '', '', '', '', '', '', 47187),
(66622, 'deDE', 'Entlaufene Werkzeuge', 'Rettet $1oa entlaufene Werkzeuge.', 'Das ist ja furchtbar! Meine *hicks* Werkzeuge sind scheinbar weggerannt, als ich nicht aufgepasst habe. Ich will gar *hicks* nicht daran denken, dass sie ganz allein da drauen sind, total *hicks* verngstigt!\n\nKnntet Ihr sie fr mich einsammeln? Seid einfach geduldig und *hicks* versucht, sie zu beruhigen, dann werden sie sich fr *hicks* Euch bestimmt erwrmen!', '', '', '', '', '', '', 47187),
(66612, 'deDE', 'Dilemma der Krabbenhterin', 'Ttet $1oa Gorlocs im Klippensturzlager.', 'Die Krabben sind in Gefahr!\n\nUnd diese hier hatten eine wirklich harte Zeit. Ihr vorheriger Lebensraum wurde von den Primalisten berrannt und ich fhrte sie an diesen Ort, wo sie von Gorlocs angegriffen werden!\n\nIch dachte, dass sie hier sicher sein wrden, aber die Gorlocs nhren nur die Aggressivitt der Krabben und bescheren ihnen so ein frhzeitiges Ableben.\n\nBitte beseitigt einige Gorlocs und helft den Krabben bei der Flucht!', '', '', '', '', '', '', 47187),
(66611, 'deDE', 'Saubere Luft', 'Ttet $1oa Insekten.', 'Knnt Ihr das hren? Insekten! berall. Und einige von denen sind ziemlich gro.\n\nWarum nutzt Ihr und Euer gleitender Freund nicht den thermischen Aufwind hinter mir, um etwas dagegen zu unternehmen?', '', '', '', '', '', '', 47187),
(66598, 'deDE', 'Fachwissen der Nachtgeborenen', 'Findet Warpwirkerin Delandra im Lager Antonidas im Azurblauen Gebirge.', 'Uralte Symbole sind nicht wirklich mein Ding. Aber...\n\n<Thaelin durchsucht seine Taschen und holt schlielich eine Karte hervor. Am Anfang des Pergaments steht der Name Antonidas in groer, schlampiger Schrift.>\n\nAha! Hier ist es!\n\nEin kleiner Marsch, aber einige dieser alten Magienutzer findet Ihr... hier.\n\n<Er deutet auf einen Punkt auf der Karte.>\n\nVielleicht haben die Euch was anzubieten.', '', '', '', '', '', '', 47187),
(66597, 'deDE', 'Der alte Stein', 'Untersucht den gravierten uralten Monolithen.', 'Dieser Stein hinter mir ist nur ein Teil von... wie nennt Ihr das... uralter Technologie, ber die wir hier auf den Inseln gestolpert sind.\n\nAber wir sind noch nicht ganz sicher, was genau es ist. Wirklich verblffend.\n\nWir haben einigen Freunden eine Nachricht geschickt, ob sie vielleicht helfen knnen. In der Zwischenzeit knnt Ihr vielleicht rausfinden, wie man das benutzt?', '', '', '', '', '', '', 47187),
(66596, 'deDE', 'Flstern in den Winden', 'Sprecht mit Erzmagier Khadgar in Sturmwind.', 'Hallo, $p. Es ist lange her und ich wnschte, wir htten mehr Zeit zum Plaudern.\n\nAber ich hatte gerade eine recht erhellende... nein, eher unheilvolle... ja, eine unheilvolle Unterhaltung mit einem alten Freund.\n\nManchmal kann eine Enthllung immerhin beides sein.\n\nIch muss Euch berichten, was ich erfahren habe.', '', '', '', '', '', '', 47187),
(66595, 'deDE', 'Schlummernde Entdeckung', 'Bringt die Nachricht zu Thaelin Schwarzamboss im Auenposten der Rubinschuppen an der Kste des Erwachens.', '<Fragt Euch nicht, wie dieses merkwrdige Pergament in Eurer Tasche gelandet ist. Wichtig ist der Inhalt der Nachricht.>\n\nMitglieder der Drachenschuppenexpedition:\n\nEure Untersttzung ist gefragt! Meldet Euch sofort beim Auenposten der Rubinschuppen!\n\n<Bevor die Unterschrift erkennbar wird, verschwindet die magische Schrift der Notiz auch schon wieder in einer Wolke wei-blulichen Staubs und hinterlsst dabei ein leeres Papier und einen angenehm blumigen Duft.>', '', '', '', '', '', '', 47187),
(66589, 'deDE', 'Expeditionskoordination', 'Rekrutiert Forscher, Handwerker und Gelehrte in ganz Sturmwind fr die Expedition zu den Dracheninseln.', 'Mein Name ist Toddy. Ich trommle unseren Trupp von frhlichen Abenteurern unter dem Banner der Drachenschuppenexpedition zusammen. Wir reden spter ber die Details. Im Moment sollten wir uns darauf konzentrieren, die Mannschaft zu versammeln.\n\nJede Expedition, die was auf sich hlt, hat abwechslungsreiche Mitglieder. Wir brauchen Gelehrte, Handwerker und natrlich Forscher.\n\nAlso? Was steht Ihr hier noch rum? Stellt die Mannschaft zusammen!', '', '', '', '', '', 'berbringt die Nachricht von Eurem Erfolg Toddy Schnurrbart am Hafen von Sturmwind.', 47187),
(66586, 'deDE', 'Vermchtnis von Tyr: Geheimnisse der Vergangenheit', 'Geht nach Uldaman im dland. Macht den Grund fr die Erschtterungen ausfindig.', 'Damit Raszageth die anderen Inkarnationen nicht befreien kann, mssen wir die Macht der Aspekte wiederherstellen.\n\nDoch das wird nicht einfach werden. Die Titanen schweigen und Hter Tyr ist schon lange tot.\n\nKnigin Alexstrasza hat jedoch einen Plan. Im dland liegt eine Titanenanlage namens Uldaman. Sie glaubt, Tyrs Gefhrten htten eine Scheibe mit seinen Erinnerungen in den Tiefen der Anlage verborgen.\n\nBegebt Euch mit Euren Verbndeten nach Uldaman und findet die Scheibe fr die Drachenknigin. Wollen wir hoffen, dass wir den Aspekten mit Tyrs Wissen erneut zu Macht verhelfen knnen.', '', '', '', '', '', '', 47187),
(66582, 'deDE', 'Energiegewinnung', 'Sammelt Energie in dem Gef fr Warpwirkerin Delandra im Lager Antonidas.', 'Normalerweise ist das Sammeln von Energie unproblematisch. Doch die Energie, die wir bentigen, ist gewaltig und instabil. Dieses verzauberte Gef sollte als sicheres Transportmittel dienen.\n\nIm Sdwesten gibt es ein Gebiet, in dem es vor energiegeladenen Kreaturen nur so wimmelt. Die anomale Energie dieser Kreaturen ist mchtig, aber instabil.\n\nSammelt ihre Energie und kehrt zu mir zurck. Dann brechen wir gemeinsam zur restlichen Reise auf.', '', '', '', '', '', '', 47187),
(66578, 'deDE', 'A > B Reward Test (Low Health)', '', '', '', '', '', '', '', '', 47187),
(66577, 'deDE', 'Einladung der Aspekte', 'Sprecht mit Furorion, um etwas ber die Ratsversammlung zu erfahren.', 'Ah, $p. Ihr kommt gerade rechtzeitig.\n\nIch habe mich gerade mit Lordkommandant Turalyon und seinen Verbndeten getroffen, und sie haben die Einladung der Aspekte auf die Dracheninseln angenommen.\n\nIhr werdet doch sicher mitkommen? Es wre nicht dasselbe ohne Euch!\n\nIch schtze, Euch sind die unbekannten Gesichter aufgefallen, die hier versammelt sind. Die Geflgelten nennen sich Dracthyr. Sie kennen mich erst seit Kurzem, sind aber schon groe Bewunderer.\n\nAch, wo sind meine Manieren! Wir sollten uns unterhalten.', '', '', '', '', '', '', 47187),
(66575, 'deDE', 'Gegenstand als Auftragsgeber: Phiole', 'Bringt den Gegenstand zu Wegbehterin Alvi.', '<Diese merkwrdige Phiole, die zwischen dem Kleinkram im Tarasekversteck lag, scheint mit einer dickflssigen, blubbernden Flssigkeit gefllt zu sein.>\n\n<Es wre klug, sie Alvi zu zeigen.>', '', '', '', '', '', '', 47187),
(66559, 'deDE', 'Zurck zum Lager', 'Kehrt zu Prfer Rowe in Walfngerwinkel zurck.', 'Ich habe Mordigan wie einen besessenen Zwerg da rausrennen sehen. Ich gehe ihm hinterher und stelle sicher, dass er in einem Stck zurckkommt.\n\nWenn Ihr entlang der Klippe geht und die Wasserflle hinunterspringt, solltet Ihr es vermeiden knnen, noch mehr Gorlocs aufzuscheuchen.\n\nWir sehen uns im Lager.', '', '', '', '', '', '', 47187),
(66558, 'deDE', 'Rowie', 'Findet Rowie.', 'Ihr wart es doch, $gder:die; mit den anderen aus Brackenfell zurckgekehrt ist, nicht wahr? Dann wisst Ihr vermutlich, was mit Kaqiata passiert ist...\n\nIhr Sohn Rowie ist vllig verstrt, seit Brena und die anderen ohne sie zurckgekehrt sind. Ich bleibe hier, falls er zurckkehrt, aber knntet Ihr vielleicht nach ihm suchen?\n\nIch glaube, dass er in Richtung Osten zur Eishhle fortgelaufen ist. Er hat etwas davon erzhlt, dass er da drin einen Yeti bekmpfen will!', '', '', '', '', '', '', 47187),
(66557, 'deDE', 'Akademische Bekanntschaften', 'Findet einen weiteren Experten in Furbolgsprachen im Lager im Nirgendwo.', 'Aye, diese Winterpelzvariante der Furbolgsprache stellt sich als ziemlich harte Nuss heraus, selbst fr mich.\n\nIch hab ein paar Kollegen im Lager im Nirgendwo, die vielleicht helfen knnen. Ich hab gehrt, dass es noch andere Furbolgstmme in der Umgebung gibt. Vielleicht hilft es, unsere Aufzeichnungen zu den verschiedenen Dialekten miteinander zu vergleichen.', '', '', '', '', '', '', 47187),
(66556, 'deDE', 'Eishhle in Sicht', 'Untersucht die Hhle.', 'Nun, Euer Akzent ist frchterlich und zehntausend Jahre der Isolation und der linguistischen Drift helfen da auch nicht... aber ich glaube, zumindest einen groben Eindruck bekommen zu haben.\n\nDer gemeinsame Nenner dessen, was sie versucht haben zu sagen, war etwas ber einen \"schlechten Hhlenwind\" oder eine \"bse Sturmhhle\". Entweder das, oder ihre Wsche war zu Donnerstag?\n\nNun, das ist nicht so, als wrde man Gnomisch lernen. Es wird einige Stolpersteine geben. Bei dem Teil mit der Hhle bin ich mir allerdings ziemlich sicher, also lasst uns dort anfangen.', '', '', '', '', '', '', 47187),
(66555, 'deDE', 'Ein Moment der Geduld', 'Helft bei Sonovas bersetzung.', 'Aye, klingt nach einem echten Chaos da oben. Als wre da ein Sturm durch, der alles auseinandergenommen hat. Ich kann schon verstehen, warum sie so aufgebracht sind, aber warum greifen sie deshalb uns an?\n\nEs wre deutlich einfacher, wenn wir das einfach ausdiskutieren knnten, aber die Winterpelze sind besonders schweigsam und sprechen anscheinend kein gewhnliches Furbolgisch. Furbolgianisch? Ach, Ihr wisst schon.\n\nIch vermute mal, dass Ihr es nicht geschafft habt, Euch whrend Eures Besuchs mit einem von denen zu unterhalten, oder?', '', '', '', '', '', '', 47187),
(66554, 'deDE', 'Aggressive Selbstverteidigung', 'Ttet $1oa Winterpelzfurbolgs.', 'Bei dem Aufruhr, in dem die Winterpelze sich befinden, wird es ihnen wahrscheinlich nicht besonders gefallen, wenn Ihr Euch da oben ein wenig umseht.\n\nScheut nicht davor zurck, Euch zu verteidigen, wenn sie es darauf anlegen. Eine entschiedene Erinnerung, dass Ihr fr so etwas nicht zu haben seid, knnte ihnen vielleicht wieder etwas Vernunft einbluen.\n\nVersucht aber, niemanden zu tten, okay? Ich wei, wie das manchmal mit Euch Abenteurern so ist.', '', '', '', '', '', '', 47187),
(66553, 'deDE', 'Aushhlung', 'Findet $1oa Hinweise in der Winterpelzhhle.', 'Die Winterpelze sind ganze besondere Furbolgs.\n\nIch wrde sie als ein bisschen \"eigenbrtlerisch\" einstufen. Sie sind wie Geister aus dem Untergrund, ihre Pelze lassen sich im Schnee kaum ausmachen.\n\nFrher blieben sie unter sich, aber jetzt sind sie so richtig aggressiv. Sie haben unser Lager ohne jede Provokation angegriffen!\n\nIrgendwas stimmt nicht, sonst htten sie das nicht getan. Ich kann sie ja nicht fragen, was los ist... noch nicht, aber vielleicht knnt Ihr in ihrem Dorf nach Hinweisen suchen?', '', '', '', '', '', '', 47187),
(66550, 'deDE', '[PH] More Storms!', '', '', '', '', '', '', '', '', 47187),
(66549, 'deDE', 'Rennen der Kste des Erwachens', '', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66534, 'deDE', 'Ausflug auf festem Boden', 'Erkundet Orgrimmar.', 'Wie es scheint, wurde unsere Ankunft doch bemerkt. Vielleicht gibt es noch Hoffnung fr diese Leute.\n\nIch wende mich an Ebyssian und die Anfhrer der Horde, um die Sache ausbgeln. Seht Ihr Euch derweil um.\n\nSchaut mal, was dieser Ort zu bieten hat. Schlielich werden wir hier wohl einiges an Zeit verbringen.\n\nKommt anschlieend zu uns. Hoffentlich haben wir bis dahin all das langweilige Zeug geklrt.', '', '', '', '', '', '', 47187),
(66529, 'deDE', 'Eintausend Worte', 'Fotografiert Derwischian neben dem Protodrachenskelett.', 'Nach allem, was wir hier erfahren haben, kann ich mir kaum vorstellen, ohne ein Andenken weiterzuziehen.\n\nWrt Ihr so freundlich, ein Bild von mir und diesen Protodrachenfossilien zu machen?', '', '', '', '', '', '', 47187),
(66528, 'deDE', 'Knig ohne Krone', 'Untersucht das Protodrachenskelett.', 'Dieser uralte Protodrache muss zu Lebzeiten eine atemberaubende Kreatur gewesen sein. Vielleicht die grte, die das Wildreservat je gesehen hat.\n\nAber das hat wohl nicht ausgereicht. Untersucht das Skelett genauer, damit wir vielleicht etwas ber seine letzten Momente erfahren.', '', '', '', '', '', '', 47187),
(66527, 'deDE', 'Professionelle Fotografie', 'Nutzt die vertikale Verstrkungsapparatur und fotografiert den schlummernden Protodrachen.', 'Ihr seid $gder beste Fotograf, den:die beste Fotografin, die; ich je ausgebildet habe... zumindest von denen, die noch leben. Es ist ein gefhrlicher Beruf.\n\nWo wir grade von Gefahren sprechen. Unser letztes Motiv ist ein groer Protodrache, von dem wir glauben, er knnte eins der nchsten Eliteraubtiere dieses Reservats werden. Geht auf Tuchfhlung und macht ein Foto!', '', '', '', '', '', '', 47187),
(66526, 'deDE', 'Die Wildnis erhalten', 'Befreit 5 gefangene Protowelpen oder gefangene Protodrachen.', 'Das Wildreservat ist eines der wenigen Gebieten, in denen Protodrachen florieren. Aber die Primalisten stren ihre Nistgrnde, indem sie Protowelpen und Protodrachen einfangen und Experimente an ihnen durchfhren.\n\nZeigt ihnen keine Gnade. Macht diese Primalistenwilderer ausfindig, lscht sie aus und befreit ihre Gefangenen. Das berleben der Protodrachen hngt davon ab!', '', '', '', '', '', '', 47187),
(66525, 'deDE', 'Wettbewebsfotografie', 'Fotografiert ein energieerflltes Protodrachenei und einen energieerfllten Protodrachen.', 'Nachdem Ihr nun die ersten eigenen Erfahrungen mit einigen Anfngermotiven gesammelt habt, wie wre es, wenn wir etwas Gewagteres versuchen?\n\nIch habe einen wunderschnen Protodrachen in der Gegend hinter uns fliegen sehen. Wunderschne Hrner, Schuppen, die vor Elektrizitt knistern... Vielleicht ist es das Werk der Primalisten, aber es ist zweifellos Kunst!\n\nSeht, ob Ihr ein Bild vom Protodrachen und von einigen seiner Eier schieen knnt. Vielleicht msst Ihr ein wenig klettern, um einen guten Winkel zu bekommen!', '', '', '', '', '', '', 47187),
(66524, 'deDE', 'Fotografie fr Anfnger', 'Macht Bilder von den Protodrachen.', 'Ihr wollt also $gein berhmter Katalogisierer:eine berhmte Katalogisiererin; werden, so wie ich? Dann seid Ihr bei mir genau richtig!\n\nDas Wildreservat strotzt nur so vor Wissen, das archiviert werden will! Und wie ich das mache, wollt Ihr wissen? Natrlich mit meinem praktischen Katalogisierer 3000 Dracheninseledition, jetzt mit verbessertem Bewegungssensor!\n\nUm Erfahrung damit zu sammeln, solltet Ihr ein Protodrachenei, einen Welpen, der das Fliegen lernt, und einen jagenden Protodrachen fotografieren. Trefft mich beim uralten Protodrachenskelett westlich von hier, dann werde ich Eure Fotos bewerten.', '', '', '', '', '', '', 47187),
(66523, 'deDE', 'Die Esse schren', 'Sammelt Reagenzien fr die Schmiede, indem Ihr Flunkerfelle, inaktive Glutkegel und kalbende Kerne im Bereich um das Lager Antonidas sammelt.', 'Falls Ihr nach einem Ausbilder sucht, muss ich Euch leider sagen, dass ich... h, Ihr kein Lehrling seid! Mein Beileid. Erlaubt mir, mich vorzustellen.\n\nIch bin Hterin Vernagos und gehre zu den Verwaltern dieser Ruinen. Um genau zu sein, ist die Aufgabe, diesen Arbeitsplatz zu alter Pracht zu verhelfen, auf meine doch sehr mden Schultern gefallen.\n\nKnntet Ihr mir etwas zur Hand gehen? Alle Reagenzien, die ich bentige, lassen sich in der Nhe finden: Eiselementarkerne, Glutkegel, Flunkerleder...\n\nGngige und einfach zu sammelnde Materialien. Was sagt Ihr?', '', '', '', '', '', 'Kehrt zu Hterin Vernagos im Lager Antonidas zurck.', 47187),
(66517, 'deDE', 'Eine neue Quelle fr Waffen', 'Sammelt 25 intakte Dracthyrwaffen von den Splitterflammen auf den Dracheninseln fr Dhurrel von den Zentauren der Maruuk.', 'Diese Splitterflammen sind eine groe Bedrohung fr unsere Grenzen. Ihre Waffen machen mir Sorge. Sammelt so viele davon, wie Ihr knnt, dann knnen wir sie auf Schwchen untersuchen oder sie sogar fr unsere Verteidigung nutzen.\n\nIch vertraue auf Euch. Und wenn Ihr diese Aufgabe fr uns erledigt, werde ich Euch in unsere Schmiedekunst einweisen.', '', '', '', '', '', '', 47187),
(66516, 'deDE', 'Banale Edelsteine, wohl kaum!', 'Sammelt 25 \"banale\" Edelsteine von den Djaradin auf den Dracheninseln fr Gnoklin Quirkspule bei der Drachenschuppenexpedition.', 'Was fr eine Verschwendung. Die Djaradin dieses Landes nutzen mchtige Edelsteine als banale Dekorationen, nur als Schmuck! Und das, obwohl es so viele Verwendungszwecke fr Edelsteine gibt: Teleskope, Spiegel, Fokussierungspointer. Und dass unzhlige Edelsteine magische Eigenschaften haben, brauche ich gar nicht erst zu erwhnen.\n\nWir mssen etwas dagegen tun. Erleichtert die Djaradin um ihre Edelsteine und bringt sie mir. Ich sorge dann dafr, dass sie eine bessere Verwendung finden. Aber passt auf Euch auf, denn die Djaradin sind erbitterte Krieger.', '', '', '', '', '', '', 47187),
(66513, 'deDE', 'Ausflug auf festem Boden', 'Erkundet Sturmwind.', 'Vielleicht sollten wir uns ein Bild von dieser Stadt machen, wenn das unsere neue Heimat werden soll. Eine Aufklrungsmission sozusagen.\n\nGeht. Schaut, was dieser Ort zu bieten hat. Ich werde Furorion folgen und versuchen, zu helfen, wo ich kann.\n\nVersucht allerdings, die Einheimischen so wenig wie mglich aufzuscheuchen. Ich bezweifle, dass viele von ihnen an den Anblick von Drachen unter ihnen gewhnt sind.\n\nTrefft Euch mit uns, sobald Ihr das Gebiet ausgekundschaftet habt.', '', '', '', '', '', '', 47187),
(66511, 'deDE', 'Angesehen bei den Tuskarr von Iskaara', 'Sprecht mit Murik in Iskaara.', 'Ihr beweist immer wieder, dass Ihr ein integrales Mitglied unserer Gemeinschaft seid.\n\nUm das zu wrdigen, habe ich einen Vorratsbeutel fr Euch vorbereitet. Trefft mich in Iskaara.', '', '', '', '', '', '', 47187),
(66509, 'deDE', 'Paranoid 1', '', 'Agura hat mich hierhergeschickt, um Blumen gegen meine ngstlichkeit zu pflcken. Aber da sind lauter Kreaturen, die mir schreckliche Angst einjagen.', '', '', '', '', '', '', 47187),
(66504, 'deDE', 'Ein Splitter kristallisierten Manas', 'Bringt den Kristall zu Lathos.', '<Der kleine, blaue Kristall vibriert leicht bei Berhrung und gibt dann einen tiefen Ton von sich, der wie ein entferntes Lied klingt. Die Worte hallen wie eine sanfte Melodie in Eurem Kopf.>\n\nLathos wird das interessant finden.', '', '', '', '', '', 'Bringt den Kristall zu Lathos.', 47187),
(66503, 'deDE', 'Aus Nchstenliebe', 'Untersucht die Spitze des verfallenen Turms im Lager Antonidas.', 'Ah, wie ich sehe, haben Euch meine Lehrlinge in ihre kleinen Spiele verwickelt.\n\n<Noriko kichert.>\n\nEs scheint, als wren sie... und auch Ihr... da auf etwas gestoen. Das Geheimnis dieser Ruinen gibt sich uns langsam zu erkennen. Und es steckt mehr dahinter als nur verblasste Abbildungen und Lieder...\n\nEtwas ruft von diesem Turm.\n\nIch sehe die Faszination in Euren Augen. Geht. Ihr habt meine Erlaubnis.\n\nIch bin gespannt, was Ihr findet.', '', '', '', '', '', 'Kehrt zu Noriko im Lager Antonidas zurck.', 47187),
(66500, 'deDE', 'Wege des Sehens', 'Deckt antike Abbildungen im Lager Antonidas auf.', 'Wir machen gar nichts! Wir machen rein gar nichts!\n\nEinen Moment...\n\nIhr seht ziemlich wichtig aus, $R... Mchtet Ihr ein Geheimnis wissen?\n\nWie sich herausstellt, sind diese Ruinen voller magischer Kunst! Und wir knnen sie sehen!\n\n<Stiebitz streckt stolz die Brust raus.>\n\nIch kann Euch zeigen, wie Ihr sie auch sehen knnt! Aber... erzhlt Noriko bitte noch nichts davon.', '', '', '', '', '', '', 47187),
(66493, 'deDE', 'Ab dafr!', 'Werft Pakete zu den Lehrlingen der Kirin Tor im Lager Antonidas.', '<Ihr hrt gedmpfte Stimmen vom anderen Ende des Portals.>\n\nHey! Hey, Ihr da!\n\nIch habe Post fr unsere Auszubildenden im Aueneinsatz: Hilfspakete, Geschenke, Dinge, die sie per magischen Kurier bestellt haben...\n\nNormale Standardzustellung.\n\nWrdet Ihr mir den Gefallen tun und sie austeilen?', '', '', '', '', '', '', 47187),
(66489, 'deDE', 'Die Verteidigung aufstellen', 'Ermchtigt Azurblaue Verteidiger in Lager Antonidas.', 'Der Hter Cynegos und ich hatten gerade ber die Auswirkungen des Angriffs der Primalisten auf die Plne zum Angriff auf den Kobaltkonvent gesprochen, und ich hatte eine Idee.\n\n<Celeste holt aus den Tiefen ihres Gewandes einen Zauberstab hervor.>\n\nNehmt meinen Stab und ermchtigt ihre Waffen!\n\nEin bisschen Feuer sollte genau das Richtige sein...', '', '', '', '', '', '', 47187),
(66488, 'deDE', 'GESUCHT: Frigellus', 'Ttet Frigellus in der Nhe von Lager Antonidas.', '<Die Schrift der Seite leuchtet in einem sanften blauen Licht.>\n\nDer Elementar Frigellus, einst ein geliebtes Spielzeug von Malygos, litt unter der Vernachlssigung durch seinen Herrn.\n\nWhrend dieses einst glckliche Dorf immer weiter zerfiel, wurde das neckische und verspielte Wesen von den beln, die dieses Land plagen, entstellt und verdreht.\n\nBitte neutralisiert dieses Wesen.\n\nTeilt Euren Erfolg anschlieend dem Hter Cynegos mit.', '', '', 'Frigellus', '', '', '', 47187),
(66484, 'deDE', 'Kennt Euren Feind: Protodrachen', 'Jagt ein paar Protodrachen im Gebiet um das Hohe Bltterdach.', 'Das Gebiet ist voll von diesen mchtigen Bestien! Glcklicherweise hat das Untersuchungsfernrohr Euch ermglicht, einige Schwachstellen zwischen ihren harten Schuppen zu finden. Ihr knnt Euch auch ein paar Tricks einfallen lassen, um ihren scharfen Klauen und Zhnen auszuweichen.', '', '', '', '', '', '', 47187),
(66482, 'deDE', 'Trophenjagd: Erdschlund', '', '[PH] Get rid of that annoying flying lizard!', '', '', 'Erdschlund', '', '', '', 47187),
(66473, 'deDE', 'Das Land erwacht', 'Besiegt den urzeitlichen Zorn und den urzeitlichen Hagel am Rundblick der Gelikyr.', 'Die Scheusale in dieser Hhle waren zu viel fr mich.\n\n<Sharnax hustet schwer.>\n\nIch habe gesehen, wozu Ihr imstande seid.\n\nIhr msst diese Elementare fr mich tten, bevor sie ihr volles Potenzial entfalten. Wir drfen nicht zulassen, dass die Primalisten die Kontrolle ber Tyrhold erlangen!', '', '', '', '', '', '', 47187),
(66472, 'deDE', 'Prima Listen', 'Liefert das Bndel mit Primalistenbefehlen an Kommandant Thadezus auf der Brcke am Rundblick der Gelikyr.', 'Die Portale sind geschlossen, die Elementare gettet und die Primalisten aufgehalten... vorerst.\n\n<Sharnax lacht.>\n\nGibt es irgendetwas, das wir nicht knnen, $C? Ich schtze, die Zeit wird es uns zeigen.\n\nBringt die Plne zum Kommandanten. Er wird sicherlich erfreut sein, zu hren, dass wir erfolgreich waren.', '', '', '', '', '', 'Sprecht mit Kommandant Thadezus bei der Brcke am Rundblick der Gelikyr.', 47187),
(66471, 'deDE', 'Prima Planung', 'Sammelt $1oa Befehle der Primalisten von Primalisten in der Nhe auf der oberen Terrasse des Rundblicks der Gelikyr.', 'Der Kommandant hat mich dazu beordert, einen Vorposten zu errichten und dabei jeglichen Widerstand auszumerzen. Es war allerdings erst im Nachhinein, nachdem ich sie alle erledigt hatte, dass mir etwas bewusst wurde.\n\n<Sharnax stt einen langen Seufzer aus.>\n\nDie Primalisten haben ber Tyrhold geredet.\n\nIch bezweifle, dass Ihr aus denen noch ein Wort rausbekommt. Ihr msst dennoch fr mich herausfinden, wie ihre Plne aussehen.', '', '', '', '', '', 'Trefft Sharnax vor der Hhle am Rundblick der Gelikyr.', 47187),
(66470, 'deDE', 'Der Vorsto', 'Erhaltet nebelberhrte, irdene und eisgeschmiedete Portalsteine und schliet die $7oa Elementarportale.', '<Sharnax kratzt sich am Kinn.>\n\nDer Kommandant hatte recht. Die Primalisten rufen Verstrkungen aus den Elementarebenen.\n\n<Sharnax lchelt.>\n\nEs wre eine Schande, wenn ihren Portalen etwas zustoen wrde, $C.', '', '', '', '', '', 'Trefft Sharnax vor der Hhle am Rundblick der Gelikyr.', 47187),
(66468, 'deDE', 'Was einst Unser war', 'Besiegt die Primalisten, die den Rundblick der Gelikyr besetzt haben.', '<Thadezus spottet ber Euren Ansatz.>\n\nSeid Ihr $gein Sterblicher, der:eine Sterbliche, die; auch was tut? Sonst geht uns besser aus dem Weg, $C!\n\nIch habe eine Menge guter Soldaten an diese Primalisten verloren.\n\nWir haben eine Idee, was sie vorhaben, doch zunchst mssen wir den Feind in die Flucht schlagen und jene retten, die unter meinem Kommando stehen.', '', '', '', '', '', 'Sprecht mit Sharnax am Rundblick der Gelikyr.', 47187),
(66467, 'deDE', 'Kunst imitiert das Leben', 'Erlegt den groen Giftspross.', 'Als ich das letzte Mal in dieser Hhle war, habe ich eine riesige Blume gezeichnet, die einen ekelhaften, dickflssigen Saft absonderte. Das ist eine meiner besten Zeichnungen, das wrde ich nie vergessen.\n\nWas an diesen Tarasekspeeren haftet, ist der Saft eben jener Blume, da bin ich mir sicher. Sie mssen angefangen haben, ihn als Gift fr ihre Waffen zu verwenden.\n\nEs ist eine wunderschne Blume und sie tten zu mssen, ist eine wahre Schande. Aber uns bleibt keine Wahl, wir mssen die Tarasek daran hindern, das Gift fr ihre Waffen zu verwenden. $n, ich bitte Euch, merzt diese Blume aus und setzt all dem ein Ende.', '', '', 'Groer Giftspross', '', '', '', 47187),
(66465, 'deDE', 'Kurz geschnappt', 'Zerstrt $1oa Giftspeervorrte.', 'Selbst nach dem Tod ihres Anfhrers werden die Tarasek nicht aufhren, ihre vergifteten Speere zu nutzen, und wenn wir sie noch so hflich bitten. Ich kann nicht riskieren, dass auch nur eine dieser Waffen gegen einen ahnungslosen Reisenden eingesetzt wird.\n\nSie mssen alle vernichtet werden. Wenn Ihr keine Lager bei den Becken gesehen habt, dann bewahren die Glutzhne ihre Speere wohl nher an der Quelle auf.\n\nEs wird nicht noch einmal jemand wegen meiner Achtlosigkeit verletzt werden. Sucht die Hhle auf und zerstrt alle Waffenlager, die Ihr finden knnt.', '', '', '', '', '', '', 47187),
(66464, 'deDE', 'Das Feld der Wildheit: Meister der Jagd!', 'Besiegt Jagdmeisterin Amaa.', 'Jetzt ist es also so weit. Ihr und Eure Crew habt das groe Los gezogen. Ein Kampf gegen den Champion, Jagdmeisterin Amaa selbst. Klopft Euch aber noch nicht auf die Schulter. Sie ist unbarmherzig. Es war schn, Euch gekannt zu haben.\n\nWenn sie Euch erledigt hat, kann ich dann Eure Sachen haben?', '', '', '', '', '', '', 47187),
(66463, 'deDE', 'Das Feld der Wildheit: Elementare Rache!', 'Besiegt den Champion der Primalisten.', 'Eine nderung der Aufstellung in letzter Minute! Irgendein Primalistenangeber will dem Wettkampf beitreten, um Euch gegenberzutreten. Und ich sage nicht nein zu einem wtenden Elementardrachen.\n\nIch bin sicher, Ihr schafft das. Und wenn nicht... Dafr habt Ihr ja die Verzichtserklrung unterzeichnet, oder?', '', '', '', '', '', '', 47187),
(66462, 'deDE', 'Das Feld der Wildheit: Verloren im Traum!', 'Besiegt Sherath und Taresh.', 'Wisst Ihr, fr die Dracheninseln sieht man hier ganz schn wenige Drachen. Aber wir haben ein Drachkinduo, das angefragt hat, sich zusammen fr den Wettkampf eintragen zu drfen.\n\nSie wirken begierig, sich zu beweisen, also viel Glck!', '', '', '', '', '', '', 47187),
(66461, 'deDE', 'Das Feld der Wildheit: Gegner aus dem Vulkan!', 'Besiegt Ceeqa den Friedensstrer.', 'Einer der ersten Freiwilligen fr diesen Wettkampf kam von der Kste des Erwachens. Ein groer Djaradin, deutlich weniger wtend als seine Verwandten.\n\nEr scheint den Kampf als Sport zu genieen. Hey, mir soll\'s recht sein.', '', '', '', '', '', '', 47187),
(66460, 'deDE', 'Das Feld der Wildheit: Frst des Verfalls!', 'Besiegt Nachtfaul.', 'Ich habe versucht, einen dieser garstigen Gnolle fr diesen Spierutenlauf zu bekommen. Leider wei keiner meiner Kollegen, wie man mit ihnen spricht.\n\nWir konnten aber eine ihrer merkwrdigen Schpfungen fangen. Die sollte als angemessener Gegner herhalten! Gebt Bescheid, wenn Ihr bereit seid, mit der zweiten Runde zu beginnen!', '', '', '', '', '', '', 47187),
(66459, 'deDE', 'Das Feld der Wildheit: Schrecken des Sumpfes!', 'Besiegt Maneet.', 'Willkommen, alle zusammen, auf den Feldern der Wildheit!\n\nDieses Feld wird gewhnlich fr traditionelle Anlsse genutzt, aber die Zentauren haben mir grozgigerweise erlaubt, whrend der Nebensaison hier meinen Laden aufzubauen. Sie meinen, damit wrde ich ihre Strke auf die Probe stellen und ihnen Ehre bringen.\n\nWollt Ihr den Titel des Champions gewinnen? Lasst mich wissen, wenn Ihr bereit seid, dann knnt Ihr die Einfhrungsherausforderung annehmen.', '', '', '', '', '', '', 47187),
(66458, 'deDE', 'Vermchtnis von Tyr: Geheimnisse der Vergangenheit', 'Geht nach Uldaman: Vermchtnis von Tyr im dland und besorgt die Scheibe.', 'Damit Raszageth die anderen Inkarnationen nicht befreien kann, mssen wir die Macht der Aspekte wiederherstellen.\n\nUnglcklicherweise sind die Titanen mit anderen Dingen beschftigt und Hter Tyr ist schon lange tot.\n\nKnigin Alexstrasza hat jedoch einen Plan vorgebracht. In den Tiefen des dlands liegt eine Titanenanlage namens Uldaman. Anscheinend haben Verbndete Tyrs dort eine Scheibe mit seinen Erinnerungen versteckt.\n\nJedoch wurde diese Anlage angeblich von Troggs berrannt. Sammelt Eure Verbndeten und begebt Euch nach Uldaman. Beschlagnahmt die Scheibe im Namen der Drachenknigin!', '', '', '', '', '', '', 47187),
(66457, 'deDE', 'Schluss mit der blauen Periode', 'Ttet Blauschuppe.', 'Die Glutzhne folgen alle einem bergroen Koloss, den ich Blauschuppe nenne. Er war schon immer von der aggressiveren Sorte, aber bisher hat er seinen Haufen von Plnderern von den Hauptstraen ferngehalten. Sicher, sie waren territorial, aber nicht feindselig. Bis jetzt zumindest.\n\nBlauschuppe muss fr diese pltzliche Eskalation verantwortlich sein. Findet ihn und streckt ihn nieder.', '', 'Anfhrer der Glutzhne. Nicht sehr fr Verhandlungen.', 'Blauschuppe', '', '', '', 47187),
(66456, 'deDE', 'Eine giftige Palette', 'Sammelt 8 vergiftete Speere.', 'Ich bin vielleicht nicht besonders gut bei meiner Arbeit, aber wenigstens habe ich aufgepasst, als ich gelernt habe, wie man sie macht. Jede Wegbehterin, die etwas auf sich hlt, wei, wie man ein ordentliches Gegengift braut. Ich brauche nur genug Gift fr die richtige Mischung.\n\nNori hat gesagt, die Speere der Tarasek, die sie angegriffen haben, wren damit bedeckt gewesen. Findet sie und bringt mir ihre Speere. Wenn mein Gefhl stimmt, werde ich aus den Rckstnden an den Speerspitzen ein Gegengift herstellen knnen.\n\nIch hoffe nur, wir haben genug Zeit.', '', '', '', '', '', '', 47187),
(66449, 'deDE', 'Elementare Machenschaften', 'Rettet $1oa gefhrdete Welpen und eliminiert $2oa Sengklauenphnixe sowie Aschebinderin Tornecha.', 'Staubbinder der Qalashi wollen unsere Welpen gefangen nehmen. Offenbar plant ihr Anfhrer, sie fr finstere Machenschaften einzusetzen. Das drfen wir nicht zulassen!\n\nDoch die Djaradin sind nicht der einzige Gegner. Unsere Welpen werden auch von Phnixen verfolgt, die noch gefhrlicher sind.\n\nIhr msst die Welpen beschtzen und die Gegner ausschalten. Osoria hilft Euch.', '', 'Eine gefhrliche Gegnerin, die die Manipulation von Asche und Ru beherrscht.', 'Aschebinderin Tornecha', '', '', '', 47187),
(66448, 'deDE', 'Wegbehter auf Abwegen', 'Findet Wegbehterin Alvi.', 'Die Wegbehter sorgen auf den Straen von Thaldraszus fr Sicherheit, so lange ich zurckdenken kann. Es ist eine Pflicht, die meine Familie seit Generationen ehrenhaft erfllt.\n\nLeider scheint sich meine Schwester Alvi in letzter Zeit nicht sonderlich fr diese Ehre zu interessieren. Eigentlich sollte sie mir hier jeden Morgen Bericht erstatten, aber ich habe seit ber einem Tag nichts mehr von ihr gehrt.\n\nWenn Ihr stlich von hier eine bronzene Drakonide beim Tagtrumen und Faulenzen antrefft, habt Ihr meine Schwester gefunden. In dem Fall wrde ich Euch bitten, sie zu mir zu schicken. Ansonsten msste ich sie wohl oder bel selbst aufsuchen.', '', '', '', '', '', '', 47187),
(66447, 'deDE', 'Jenseits der Barriere', 'Untersucht das Lebensgewlbe in den Ruinen des Lebensgewlbes.', 'Die Barriere ist weg! Schauen wir uns das Gewlbe an!', '', '', '', '', '', '', 47187),
(66445, 'deDE', 'Ehre den Gefallenen', 'Holt die folgenden Gegenstnde von den Djaradin zurck.', 'Die Djaradin haben keinen Respekt vor der Heiligkeit der Zitadelle und den toten Krpern unserer Art! Sie brechen ihnen die Knochen und berauben sie ihrer persnlichen Gegenstnde, um sie als Trophen zu behalten.\n\nSolch eine Respektlosigkeit nagt am Herz eines jeden stolzen schwarzen Drachen. Sie haben es verdient, mit Ehre behandelt zu werden.\n\nErkmpft Euch die Gegenstnde zurck, die die Djaradin von den Leichen unserer Gefallenen gestohlen haben.', '', '', '', '', '', '', 47187),
(66442, 'deDE', 'Geistige Bettigung', 'Helft, die Kugeln an der Titanenbarriere in den Ruinen des Lebensgewlbes auszuprobieren.', 'Wir haben jetzt vier Kugeln der Elemente! Lasst uns sehen, welche Hypothese sich als richtig erweist!', '', '', '', '', '', '', 47187),
(66441, 'deDE', 'Destillierte Anstrengungen', 'Ttet Assquian in der Hhle stlich der Ruinen des Lebensgewlbes.', 'Die Kugel des Ursteins ist ein glcklicher Fund, aber Acadia und Tae\'shara haben widersprchliche Thesen, was die Barriere betrifft.\n\nIch habe meine eigene Vermutung. Vielleicht kommen wir der Antwort mit weiteren Kugeln der Elemente nher.\n\nEiner der Forscher hat einen bergroen Wasserelementar in einer nahe gelegenen Hhle entdeckt. Besiegt den Elementar, vielleicht findet Ihr bei ihm eine weitere Kugel.', '', 'Spher berichten, dass dieser Elementar schnell an Gre gewinnt.', 'Assquian', '', '', '', 47187),
(66439, 'deDE', 'Schnellfeuerplne', 'Sammelt Urflammenfragmente von Streitkrften der Primalisten in der Flunkerhhle.', 'Elementarkugeln, hm? Wenn es Erde gibt, gibt\'s auch Feuer!\n\nDie Primalisten drben bei den Flunkernestern formen das Land mit Lava. Wenn irgendjemand Interesse an einer Kugel der Urflammen hat, dann sind sie es.\n\nSchaltet sie aus und seht, ob sie etwas Ntzliches haben!', '', '', '', '', '', '', 47187),
(66438, 'deDE', 'Abgehobene Ziele', 'Findet Spherin Ri\'tal in der Flunkerhhle.', 'Luft ist ein mchtiges Element. Es schneidet durch Fels und blht die Segel, um uns an unser Ziel zu bringen.\n\nMeine Hypothese ist, dass die Luft besonders effektiv sein wird, wenn wir diese Barriere durchbrechen wollen. Es ist wirklich ganz einfach.\n\nMeine Spher haben die Kugel der Urstrme aufgesprt. Spherin Ri\'tal kann Euch zu ihr fhren. Ihr findet sie in der Nhe der Flunkerhhle. Schnell!', '', '', '', '', '', '', 47187),
(66437, 'deDE', 'Ein Schlsselelement', 'Bringt die Kugel des Ursteins zu Elementaristin Taiyang in den Ruinen des Lebensgewlbes.', '<Diese Erdkugel pulsiert vor Energie>\n\n<Elementaristin Taiyang wei vielleicht etwas damit anzufangen.>', '', '', '', '', '', '', 47187),
(66436, 'deDE', 'Ausgegrabene Unruhestifter', 'Ttet $1oa Erdelementare in den Ruinen des Lebensgewlbes.', 'Die Erdelementare versuchen nicht nur, uns zurckzuschlagen, sie zerstren sogar zurckgelassene Artefakte und Ausrstung! Es ist, als htte man sie programmiert, alles Titanische zu zerstren...\n\nSolange wir uns gegen sie verteidigen mssen, knnen wir diese Sttte nicht weiter studieren. Bitte helft uns, sie zu vertreiben!', '', '', '', '', '', '', 47187),
(66435, 'deDE', 'Bergungsunternehmung', 'Rettet $1oa bedrngte Forscher aus den Ruinen des Lebensgewlbes.', 'Als Schamanin habe ich schon mit vielen Elementaren gearbeitet, aber ich habe noch nie solch aggressive Exemplare gesehen!\n\nDie Expedition hat ein Gewlbe der Titanen entdeckt, aber eine Barriere verschliet die innere Kammer. Als wir versucht haben, sie aufzulsen, haben wir wohl einen Sicherheitsmechanismus aktiviert... pltzlich waren wir von wtenden Elementaren umgeben!\n\nAls die Elementare angriffen, waren noch viele unserer Forscher bei den Ausgrabungen. Viele von ihnen sitzen dort fest und KEINER unter ihnen ist ein Kmpfer. \n\nBitte geht dort hinunter und untersttzt ihren Rckzug!', '', '', '', '', '', '', 47187),
(66429, 'deDE', 'In ewiger Erinnerung', 'Trefft Rannan beim Lager im Nirgendwo.', 'Bitte... Ich brauche einen Moment.\n\nKehrt ins Lager im Nirgendwo zurck, $p. Ich treffe Euch dort.', '', '', '', '', '', '', 47187),
(66428, 'deDE', 'Freundschaft gesichert', 'Verwendet die I.R.R.E.S.T., um die arkane Barriere zu entfernen.', 'Perfekt! Die I.R.R.E.S.T. ist kalibriert und bereit fr den Einsatz! Durch Euch!\n\nWarum ich sie nicht benutze? Ganz einfach!\n\nMan muss alle Eventualitten in Betracht ziehen.\n\nNehmen wir an, sie wrde explodieren. Wer wrde sie reparieren, wenn ich verletzt, bewusstlos oder tot bin? Knnt Ihr Euch das vorstellen?\n\nUnd jetzt geht und bannt die Barriere, damit wir ins Lager zurckkehren und Lathos versorgen knnen. Ich werde... mich im Hintergrund halten.', '', '', '', '', '', '', 47187),
(66427, 'deDE', 'Eine lauernde Bedrohung', 'Ttet Tharohn.', 'Die arkanen Wunden, die ich erlitten habe, knnen auf dem Schlachtfeld nicht geheilt werden. Ich frchte, sie sind zu schwer, als dass ich kmpfen knnte.\n\nIch muss Euch schon wieder um Hilfe bitten, $n.\n\nIhr msst Tharohn finden und sie daran hindern, weitere Konsolen zu berladen.\n\nDadurch verschafft Ihr Rannan ein paar wertvolle Augenblicke, um die I.R.R.E. zu kalibrieren... I.R.R.E.R. Wie auch immer er es gerade nennt.\n\nVielleicht knnen wir die Machenschaften der Splitterflammen dann vereiteln.', '', 'Ein Anfhrer der Splitterflammen, der um jeden Preis die Macht der Ruinen von Karnthar an sich reien will.', 'Arkane Manipulatorin Tharohn', '', '', '', 47187),
(66426, 'deDE', 'Die Zeit luft davon', 'Erreicht den Ostturm.', 'Ich kann spren, wie die arkane Woge genau jetzt anschwillt.\n\nIch vermute, es bleibt nicht mehr viel Zeit, bis die Ruinen Rannans S.P.A.M. wie einen weit entfernten Stern am Nachthimmel aussehen lassen.\n\nWir mssen dort hingelangen und es aufhalten.\n\nBitte seid vorsichtig, $p.\n\nTrefft uns am stlichen Turm. Dort werden wir die Situation besprechen.', '', '', '', '', '', 'Trefft Rannan und Lathos beim stlichen Turm.', 47187),
(66425, 'deDE', 'Arkane berladung', 'Helft Rannan, die arkanen Blasen zu entfernen.', 'Na bitte, fertig!\n\nHier ist die I.R.R.E.R.!\n\nTA TA TAAAA!\n\nIch habe sie auf die Frequenz der Energie um die Drachenkonsolen herum kalibriert und mit einer Glyphe der Bannmagie versehen.\n\nDie I.R.R.E.R wird die Arkanenergie bannen und die Drachenkonsole ausschalten, aber die Glyphe wird mit jeder Nutzung schwcher.\n\nZiemlich praktisch, nicht wahr?\n\nIch habe vier dieser Konsolen in unserer Nhe entdeckt. Schaltet sie ab!', '', '', '', '', '', '', 47187),
(66423, 'deDE', 'Sorgen und Besttigungen', 'Findet Hinweise auf den Ursprung der Ruinen.', 'Die Tode dieser Splitterflammen verdeutlichen, wie gefhrlich die Ruinen von Karnthar sind.\n\nAber Rannan glaubt, dass die I.R.R.E. mit einigen Modifikationen dennoch die Energien dort zu bndigen vermag.\n\nWieder einmal behandeln wir nur die Symptome und nicht die Ursache.\n\nDurchsucht die Ruinen nach Hinweisen und versucht herauszufinden, was ihr ursprnglicher Nutzen war. Und beeilt Euch, $n. Wir haben womglich nicht gengend Zeit.', '', '', '', '', '', '', 47187),
(66422, 'deDE', 'Die Expedition geht weiter!', 'Trefft Rannan und Lathos beim Turm.', 'Eine antike Sttte, eine Organisation mit rtselhaften Motivationen... selbst Rannans I.R.R.E. und ihre Analysen...\n\nDas alles weckt den Entdecker in mir.\n\nWir mssen mehr darber herausfinden, was hier vor sich geht.\n\nIm Sden gibt es eine Treppe, die hoch zu einem Turm fhrt. Gehen wir schnell weiter.', '', '', '', '', '', '', 47187),
(66421, 'deDE', 'Die Sturmschneise', '', '', '', '', '', '', '', '', 47187),
(66419, 'deDE', 'Alle fr Einen', '', '', '', '', '', '', '', '', 47187),
(66412, 'deDE', 'Weiter so, Blattington', 'Sprecht mit Blattington in den Grten.', 'Eine Bitte htte dieser alte Drakonid noch an Euch, bevor Ihr geht.\n\nFrher, als Frst Blattington und ich uns gerade kennengelernt hatten, gingen wir zusammen auf alle mglichen Abenteuer. Ich glaube, dass er deshalb immer davonzieht. Ihm fehlt das Erkunden.\n\nLeider kann ich ihm das nicht mehr ermglichen, Ihr aber schon! Ich wei, Ihr knntet ihn an Orte bringen, die ich mir nicht mal ertrumen kann.\n\nWir sollten Blattington allerdings vorher fragen, was er davon hlt.', '', '', '', '', '', '', 47187),
(66391, 'deDE', 'In die Ruinen!', 'Trefft Rannan und Lathos in den Ruinen von Karnthar.', 'Httet Ihr Interesse daran, etwas ber meine Erfindung, die I.R.R.E. zu erfahren? Nein?\n\nNun, ich erzhle es Euch trotzdem... weil sie was gefunden hat.\n\nHeute hat sie eine GEWALTIGE WOGE arkaner Energie entdeckt, die von den Ruinen von Karnthar ausgeht. Lathos glaubt, dass die Splitterflammen etwas damit zu tun haben. Das ist die PERFEKTE Gelegenheit, die I.R.R.E. vorzufhren!\n\nWollt Ihr mitkommen? Das wird der Hammer.', '', '', '', '', '', '', 47187),
(66369, 'deDE', 'Der irdene Schutz', 'Aktiviert den irdenen Schutz.', 'Mit den Ringen, die Ihr gesammelt habt, habe ich einen Schutz ermchtigt. Dieser hat die Felsen der Erde selbst um sich herum gesammelt und einen lebendigen Irdenen erschaffen, um dieses Gebiet zu beschtzen.\n\nTestet den irdenen Schutz, um zu sehen, ob er funktioniert.', '', '', '', '', '', '', 47187),
(66368, 'deDE', 'Insel im Sturm', 'Eliminiert $1oa lodernde Manifestationen und Schmelzer Igneus.', 'Ich hatte nicht viel Zeit zu rasten. Der elementare Angriff ist unerbittlich!\n\nIch wrde einen Moment der Ruhe willkommen heien. Das wrde mir erlauben, mehr Zauberschutze fr unsere Verteidigung herzustellen.\n\nSeht, was Ihr tun knnt, um die Zahlen der Angreifer zu mindern.', '', '', 'Schmelzer Igneus', '', '', '', 47187),
(66364, 'deDE', 'Drachen steigen lassen', 'Sammelt 10 frische Protodrachenschwingen von den Protodrachen der Dracheninseln fr Temnaayu von den Tuskarr von Iskaara.', 'Lasst mich Euch etwas ber eine einzigartige Gelegenheit erzhlen.\n\nDie Protodrachen haben einen erstaunlichen Bewegungsreichtum in ihren Schwingen. Und die Verrippung! Sie ist uerst dehnbar. Wir bauen unsere Drachen meistens aus gespannten Huten, aber jetzt verbreiten die Protodrachen Chaos. Wenn Ihr mir einige ihrer Schwingen bringt, knnte ich Flugdrachen bauen, die der Stolz des Stammes wren.', '', '', '', '', '', '', 47187),
(66363, 'deDE', 'Basiliskenbuckelschild', 'Sammelt 20 starre Basiliskenblge von den Basilisken der Dracheninseln fr Dhurrel von den Zentauren der Maruuk.', 'Verkettete Schuppen sind der Schlssel, um einen Pfeil abzuwehren. Unsere Buckelschilde sind die Besten der ganzen Ebenen. Aber mir fehlen Basiliskenblge fr die nchste Bestellung.\n\nIch kann Euch ansehen, dass Ihr Euch fr unser Handwerk interessiert. Sammelt Basiliskenblge auf den Dracheninseln, dann weise ich Euch in unsere Techniken ein.', '', '', '', '', '', '', 47187),
(66356, 'deDE', 'Eisenbaum', '', '', '', '', '', '', '', '', 47187),
(66354, 'deDE', 'Der Funke', 'Rekonstruiert die beschdigten Teile des Schwursteins.', 'Die Schmiede ist bereit. Jetzt muss sie nur angefeuert werden.\n\nPlatziert die beschdigten Schwursteinfragmente in der Schmiede, und Furorion wird den Funken spenden, der den Prozess entzndet.', '', '', '', '', '', '', 47187),
(66353, 'deDE', 'I.R.R.E. Anomalien', 'Benutzt die I.R.R.E., um drei arkane Anomalien zu bannen.', 'Hier gibt es JEDE MENGE arkaner Energie...\n\nDoch die I.R.R.E. kann dabei helfen! Das ist ein wahrhaft innovatives Gert... das steckt auch so im Namen: \"Innovative, Revolutionre Rannan-Erfindung\"! Sie kann arkane Energie aufspren UND bannen.\n\nHier... haltet mal! Sprt Ihr schon die MACHT in Euren Hnden? Nein?\n\nNun, wenn Ihr sie schon mal in der Hand habt, knnt Ihr damit ja auch diese Anomalien bannen!', '', '', '', '', '', '', 47187),
(66352, 'deDE', 'Was der Feind wei', 'Findet Dokumente der Splitterflammen und bringt sie zu Lathos.', 'Es ist wichtig herauszufinden, was das Ziel der Mission der Splitterflammen in diesen Ruinen ist... und was das alles mit der arkanen Woge zu tun hat.\n\nWir werden das auf die gute alte Art machen: Aufklrung und Spionage.\n\nDie Ruinen sind von Anhngern der Splitterflammen berlaufen. Ich bin mir sicher, dass einige von ihnen Befehle bei sich tragen, die uns Einblicke in ihre mysterisen Vorhaben erlauben.\n\nNutzt alle Mittel, die Euch zur Verfgung stehen, um an diese Dokumente zu gelangen.', '', '', '', '', '', '', 47187),
(66351, 'deDE', 'Rauch ber dem Berg', 'Findet Pfadfinderin Yips\' Fluggert.', '<Pfadfinder Jeb betrachtet die Bergkette hinter dem Lager und schnaubt.>\n\nDas gefllt mir nicht. Pfadfinderin Yips htte schon vor Tagen hier sein sollen. Sie sollte mir helfen, diesem Haufen von Jungforschern beizubringen, wie man sicher diese Sulen hinaufklettert.\n\nJetzt sehe ich Rauch in der Ferne.\n\nDas gefllt mir ganz und gar nicht.', '', '', '', '', '', '', 47187),
(66349, 'deDE', 'bungsfelsen', 'Entfernt $1oa Steine.', 'Entfernt diese Steine!', '', '', '', '', '', '', 47187),
(66344, 'deDE', 'Mit dem Wind im Rcken', 'Fliegt mit Gerithus und Merithra.', 'Die Primalisten haben also Klan Nokhud fr ihre Sache gewonnen.\n\nBisher konnten wir die Primalisten zurckhalten, doch die Nokhud haben eine neue Waffe ins Spiel gebracht: eine Drachentterballiste. Ich frchte, dass Solethus nicht der letzte Drache sein wird, der ihrer verdorbenen Sturmmagie zum Opfer fllt.\n\nKommt. Ich bringe Euch zum Drachenrefugium der Schattenzuflucht. Und Ihr knnt mir erzhlen, was Ihr von den Nokhud wisst, whrend die Khanam Matra ihre Streitkrfte sammelt. Wir mssen uns auf den nchsten Schritt vorbereiten.', '', '', '', '', '', '', 47187),
(66340, 'deDE', 'Ausflug ins Azurblaue', 'Triff Pakina und Masud den Weisen an der Flussgabelkreuzung.', 'Wir haben unseren Teil getan. Ich muss jedoch hierbleiben, um ber den Schwurstein zu wachen und den grnen Drachenschwarm zu fhren. Doch wisset, dass Ihr Euch unsere Dankbarkeit und unser Vertrauen verdient habt.\n\nIch habe erfahren, dass die Kirin Tor um Hilfe bitten, den Azurschwurstein zu beanspruchen. Damit bringt Ihr uns der Heilung Azeroths einen Schritt nher.\n\nFindet Pakina und Masud den Weisen von den Kirin Tor. Sie haben weitere Informationen. Gute Reise und angenehme Trume, $n.', '', '', '', '', '', '', 47187),
(66339, 'deDE', 'Angriff der Nokhud: Der Wind gehrt dem Himmel', 'Besiegt Balakar Khan und rettet Ohn\'ahra beim Angriff der Nokhud.', 'Ist Eure Zeit bei uns zu Ende, $n, oder werdet Ihr uns einmal mehr helfen?\n\nMeine Spher haben berichtet, dass Balakar sich in seine Festung zurckgezogen hat, wo er Ohn\'ahra festhlt. Das ist inakzeptabel!\n\nUnd in der Zwischenzeit strmen die Plnderer der Nokhud ber die Ebenen und richten Chaos an. Whrend wir gegen sie kmpfen, knnt Ihr die Festung der Nokhud infiltrieren und Ohn\'ahra retten. Wrdet Ihr das fr uns tun?', '', '', '', '', '', '', 47187),
(66337, 'deDE', 'Sturmbrecher', 'Bezwingt Koroleth.', '$n, zu mir! Der Sieg ist zum Greifen nahe!\n\nDie Reihen der Primalisten sind durchbrochen und ihr Krieg steht vor dem Ende. Alles, was wir bislang erreicht haben, ist nur von Bedeutung, wenn wir diese entscheidende Schlacht gegen die Primalistenanfhrerin Koroleth gewinnen.\n\nLasst es uns gemeinsam zu Ende bringen, Ihr und ich! Zusammen! In den Kampf, $GBruder:Schwester;!', '', 'Die Primalistenanfhrerin versucht, das Refugium der grnen Drachen zu zerstren.', 'Koroleth', '', '', '', 47187),
(66336, 'deDE', 'Die Insel des Smaragds', 'Trefft Merithra im Uralten Zweig.', 'Euer Beitrag zu all dem ist mir nicht entgangen, $gSterblicher:Sterbliche;. Es ist zu einem groen Teil Eurer Tapferkeit zu verdanken, dass wir die Primalisten besiegen konnten.\n\nIch habe die Zentauren eingeladen, sich mir unter dem Uralten Zweig anzuschlieen. Ihr, zusammen mit der Khanam Matra und ihrem Volk, seid in unserem Zuhause willkommen.\n\nFolgt diesem Pfad durch den Bogen ber das Wasser und zu den dahinterliegenden Bumen. Dort werde ich auf Euch warten.', '', '', '', '', '', '', 47187),
(66335, 'deDE', 'Dekonstruktion weiterer Pylonen', 'Markiert die Primalistenpylonen mit der verzauberten Saat.', 'Da diese teuflischen Waffen nun zerstrt sind, kann der grne Drachenschwarm mit voller Strke in die Schlacht eingreifen.\n\nWir sind mit der Lage am Boden besser vertraut. Wir mssen die Ziele fr den Angriff von Merithra und ihren Drachen ausleuchten, damit sie aus der Luft angreifen knnen.\n\nMerithra hat mir diese verzauberte Saat gegeben. Platziert sie in der Nhe von Primalistenpylonen. Wir werden ihr Licht dazu verwenden, um Angriffe fliegender Drachen anzufordern.', '', '', '', '', '', '', 47187),
(66333, 'deDE', 'Gerechtigkeit fr Solethus', 'Ttet $1oa Kriegstreiberinnen der Nokhud und zerstrt $2oa Drachentterballisten.', 'Solange auch nur ein grner Drache noch atmet, werden diese Primalisten den Uralten Zweig nicht ohne Gegenwehr entweihen.\n\nWir wollen bei dieser Schlacht unseren Beitrag leisten, doch solange diese Drachentterballisten auf dem Schlachtfeld stehen, kommen wir nicht vorwrts. Sie werden von den strksten Kriegern der Nokhud bewacht, Ihr werdet Euch also auch noch um diese Krieger kmmern mssen.\n\nZerstrt die Ballisten und die Kriegstreiberinnen der Nokhud. Eliminiert diese Bedrohung, und die grnen Drachen werden in dieser Schlacht das Blatt wenden.', '', '', '', '', '', '', 47187),
(66331, 'deDE', 'Die Primalistenfront', 'Sprecht mit Spherin Tomul, Ari und Belika, Ohn Seshteng und Merithra in der Sturmschneise.', 'Die Khanam Matra berichtet, dass sie und ihre Streitkrfte bei den Smaragdgrten angekommen sind. Sie haben Koroleth und ihre Primalisten gefunden. Allem Anschein nach sammelt sich eine gewaltige feindliche Invasion am Strand im Norden.\n\nWeise wie sie ist, hat sie mehrere Spher abgestellt, die verschiedene strategische Orte auf dem Schlachtfeld im Blick behalten. Geht und sammelt ihre Berichte. Trefft mich und meine Streitkrfte anschlieend an der Front. Ruhm erwartet uns im Kampf. Und sollten wir erfolgreich sein, Vergeltung auch.', '', '', '', '', '', '', 47187),
(66329, 'deDE', 'Das Horn blasen', 'Seid $gZeuge:Zeugin; von Balakars und Koroleths Plnen.', 'Warum wrden sie Ohn\'ahra herbringen? Es sei denn...\n\n$n! Ich glaube nicht, dass Balakar vorhat, das Horn zu zerstren. Ich glaube, das ist eine Falle! Wir mssen einen Weg an diesem Wind vorbei finden, schnell!', '', '', '', '', '', '', 47187),
(66328, 'deDE', 'Grner Drache am Boden', 'Trefft die Khanam Matra beim Wasserloch.', 'Die Drachen sind ber den Ebenen im Westen zu Boden gegangen. Wir mssen schnell zu ihnen gelangen, bevor die Nokhud uns zuvorkommen.\n\nWir wollen nicht, dass sie nur wegen Balakars Taten gleich alle Maruuk als Feinde betrachten.', '', '', '', '', '', '', 47187),
(66327, 'deDE', 'Windjger', 'Hrt Euch den Bericht von Spherin Tomul an.', 'Wir sollten einen Moment innehalten und unsere Strategie berdenken.\n\nWir brauchen Ohn\'ahras Segen, um das Horn von Drusahl zu blasen und die grnen Drachen zu beschwren. Ohne ihre Hilfe knnen wir diesen Krieg nicht gewinnen. Die Nokhud sind den anderen Klans bereits zahlenmig berlegen und nun haben sie Verstrkung von den Primalisten. Auerdem hat Koroleth jetzt auch noch unsere Windmutter gefangen genommen! Wir mssen daher Ohn\'ahra finden, bevor die Nokhud ihren finalen Angriff starten und Maruukai einkreisen.\n\nIch werde unverzglich all unsere Spher entsenden. Ich hoffe nur, dass wir es schaffen, sie rechtzeitig zu finden.', '', '', '', '', '', '', 47187),
(66326, 'deDE', 'Handwerkszeuge', 'Sammelt $4oa |4Przisionsschuppenhammer:Przisionsschuppenhmmer;, $3oa |4Obsidianamboss:Obsidianambosse;, $2oa |4Schwarzstahlzange:Schwarzstahlzangen; und $1oa Drachenklauenstempel.', 'Eine derart mchtige Schmiede bentigt besondere Werkzeuge, die ihrer berwltigenden Hitze standhalten knnen.\n\nAber die Djaradin haben diesen Ort geplndert und viele der Werkzeuge gestohlen, die wir fr diese Arbeit bentigen.\n\nErgattert die Werkzeuge von ihnen zurck, wenn Ihr knnt, damit wir unsere Verbndeten wieder bewaffnen knnen.', '', '', '', '', '', '', 47187),
(66324, 'deDE', 'Niemals vergessen', 'Bergt Gegenstnde und berlebende aus dem Untersttzungshort.', 'Das Gegengift ist fertig. Benutzt es, um im Untersttzungshort nach berlebenden zu suchen. Beeilt Euch... Der Effekt wird nicht lange anhalten, also msst Ihr es eventuell wiederholt anwenden.\n\nFalls einige meiner Leute noch atmen, dann rettet sie.\n\nUnd falls dem nicht mehr so ist, dann sammelt ihre Hornsignets, damit ihren Namen Ehre erwiesen werden kann.\n\nWhrend Ihr dort drin seid, knnt Ihr vielleicht Beweise finden, wie es zu dieser Ansteckung kommen konnte.', '', '', '', '', '', '', 47187),
(66320, 'deDE', 'Der Strom der Zeit', 'Reist in die Wandernden Sande und sprecht mit Chromie.', 'Die Fden der Zeit flieen wie ein Fluss mit vielen Armen und Biegungen. Manchmal kann sich der Fluss ndern. Doch eine Anomalie, die ungelst bleibt, kann unser Schicksal zu einer falschen Zeitlinie verdammen.\n\nWir bewegen uns gerade schnell auf eine solche Anomalie zu. Ich habe Chronormu zu den Wandernden Sanden geschickt, um die Sache zu untersuchen, den Fluss zu korrigieren und uns auf die richtige Zeitlinie zurckzufhren.\n\nIch kann vorhersehen, dass Eure Hilfe von unschtzbarem Wert sein wird.\n\nBitte helft uns und trefft Euch mit Chronormu.', '', '', '', '', '', '', 47187),
(66308, 'deDE', 'Das Feuer schren', 'Sammelt $1oa Stcke Aschenscherbenkohle.', 'Die Erschaffung neuer Waffen und Rstungen in der Schmiede des Erdwchters wird uns den letztendlichen Sieg ber die Djaradin sichern.\n\nDie Flammen der Schmiede mssen allerdings kontinuierlich geschrt werden. Aschenscherbenkohle spendet die strkste Hitze, und die ist ntig, um Waffen zu schmieden.\n\nIhr findet Aschenscherbenkohle in Ablagerungen und Elementaren in der Aschenscherbenspalte.', '', '', '', '', '', '', 47187),
(66299, 'deDE', 'Geplante Ei-plosion', 'Ttet die Matriarchin des Kreischerschwarms.', 'Unser Prototyp hat funktioniert! Exzellent!\n\nJetzt wird es Zeit fr das Hauptgericht. Dieses Mal seid IHR $gder Koch:die Kchin;.\n\nNach ein paar notwendigen Korrekturen werdet Ihr erneut in Eure Verkleidung schlpfen. Nehmt im Anschluss unser Meisterwerk der EI-plosion, schmeit es in diesen stinkenden Eintopf, begebt Euch zur Hhle der Matriarchin, serviert ihn ihr und gleitet dann zurck nach unten, whrend hinter Euch alles in die Luft fliegt.\n\nWenn alles nach Plan geht, wird das ihr letztes Abendmahl sein. Wegen der Explosion. Weil sie nicht mehr besonders hungrig sein wird, wenn sie tot ist.', '', 'Die zurckgezogen lebende Matriarchin der Kreischerschwarm-\nharpyien! Wollt Ihr ihren Hunger mit einer hohnzirperschen Sprengladung oder Eurem eigenen Fleisch stillen?', 'Matriarchin Avethyra, Anfhrerin der Kreischerschwarmharpyien', '', '', '', 47187),
(66279, 'deDE', 'Reisewecker', 'Bringt die Taschenuhr zu Orizmu in den Grten.', 'Ah ja, diese Taschenuhr gehrt einem der Verwalter, der mir bei der Pflege der Grten hilft.\n\nEr gehrt zu Nozdormu. Orizmu, wenn ich mich recht entsinne. Bei all den Kindern kommt man schnell mal durcheinander. An den meisten Tagen steht er neben dem Stundenglas in der Nhe von Alexstraszas Baum, ohne sich zu bewegen. Oder zu blinzeln.\n\nNozdormus Leute waren schon immer merkwrdig, wenn Ihr mich fragt. Aber er wird Euch sicher dankbar sein, wenn Ihr sie ihm zurckbringt.', '', '', '', '', '', 'Bringt die Taschenuhr zu Orizmu in den Grten.', 47187),
(66278, 'deDE', 'Der Plunder eines Drakoniden', 'Bringt die Taschenuhr zu Gryrmpech in den Grten.', '<Eine funkelnde Taschenuhr liegt zwischen den Mllhaufen. Vielleicht wei Gryrmpech, was es damit auf sich hat.>', '', '', '', '', '', 'Bringt die Taschenuhr zu Gryrmpech in den Grten.', 47187),
(66277, 'deDE', '[DNT] Making Quest', 'Ttet $1oa Banditen.', 'Willkommen, $gAbenteurer:Abenteurerin; zu Eurem ersten Auftrag! Heute werden wir niedertrchtige Banditen tten. Los, geht sie tten!', '', '', '', '', '', '', 47187),
(66270, 'deDE', 'Hau-den-Gnoll', 'Besiegt die Mchtegernkriegsherren.', 'Oh, Licht... mehr sind unterwegs! Wie konnte das geschehen?\n\nAll meine sorgfltige Planung! All die Tage, die ich in diesem widerlichen See verbracht habe! Die Meucheleien!\n\nAll das htte sie ins Chaos strzen und ihre Siedlung zusammenbrechen lassen sollen, aber wir haben sie kaum verlangsamt!\n\nVielleicht... vielleicht habt Ihr recht, $n. Ich lag die ganze Zeit falsch...\n\nNein! Unmglich! Wir stecken sowieso zu tief drin.\n\nGeht... kmmert Euch um diese Neuankmmlinge. Ich brauche Zeit, um mich zu sammeln.', '', '', '', '', '', '', 47187),
(66269, 'deDE', 'Nur, um sicher zu gehen', 'Ttet $1oa Elementaristen von Sturmfang.', 'Ttet... einfach alle, die aussehen, als wren sie magisch begabt. Oder als htten sie organisatorische Fhigkeiten. Oder die besonders ehrgeizig aussehen.\n\nTut, was auch immer Ihr in diesem Fall fr richtig haltet.\n\nWas Ihr \"fr richtig haltet\" ist, nicht mehr mit mir zu sprechen? Also wirklich, $C! Die... haben eindeutig etwas Bsartiges vor!', '', '', '', '', '', '', 47187),
(66268, 'deDE', 'Aller guten Dinge sind drei', 'Ttet Blutklaue.', 'Was? Ein anderer hat das Kommando bernommen? Was ist aus dem lhmenden Machtvakuum geworden? Oder wenigstens aus der angemessenen Trauerzeit, um den Schein zu wahren?\n\nHaben sie den gar keinen Anstand? Keinen Sinn von Schicklichkeit? Keinen Respekt fr einen fein suberlich geschmiedeten Plan? Ich habe Tabellen angefertigt!\n\nKmmert Euch um diesen Blutklaue. Ich brauche einen Moment.\n\nUnd ich kann Eure lstigen Kommentare nicht brauchen, vielen Dank!', '', 'Wer ist gestorben und wer hat ihn zum Kriegsfhrer ernannt?', 'Blutklaue', '', '', '', 47187),
(66267, 'deDE', 'M.E.T.A.', 'Befreit $1oa missbrauchte Tiere.', 'Diese Unholde! Plnderung und Mord sind eine Sache, aber Tierqulerei? Das kann ich nicht zulassen.\n\nDie Gnolle haben Fallen aufgestellt, um Tiere zu fangen, mit denen sie ihre sabbernden Hynenkter ernhren. Findet einen Weg, ihre flauschigen Gefangenen zu befreien, und zeigt diesen Grobianen, wie ein Magier ethisch korrekt mit Tieren umgeht!\n\nNatrlich macht das ethisch Sinn, wenn man meine krzlichen Handlungen bedenkt. Was genau wollt Ihr da andeuten?', '', '', '', '', '', '', 47187),
(66266, 'deDE', 'Dreckige Bastarde', 'Erschlagt $1oa Hynenmatriarchinnen und $2oa Hynenkter.', 'Diese flohgebissenen Hynenkter der Gnolle mssen verschwinden! Nicht nur, dass sie keine Manieren haben... Ihr glaubt nicht, an welchen Orten sie sich erleichtern... aber mglicherweise knnen sie mich trotz meiner beispiellosen Illusionen wittern.\n\nTut der wohlgesitteten Welt einen Gefallen und beseitigt sie.', '', '', '', '', '', '', 47187),
(66265, 'deDE', 'Wer ist der Nchste?', 'Ttet Knackzahn.', 'Aha! Nun, wie es scheint, hat ein anderer Gnoll das Kommando bernommen. Wie ich erwartet habe. Ja.\n\nEs ergibt natrlich Sinn, einen vertrauten Vize-Kriegsfrsten zu haben, um die Weiterfhrung der Regierung zu sichern, nicht wahr? Wir mssen sie einfach nur etwas hrter treffen, wenn wir ihre Brokratie zu Fall bringen wollen, hm?\n\nWas? Ob ich diesen Moment nutze, um darber nachzudenken, ob ich diese Gnolle vorschnell verurteile? Lcherlich! Das sind Gnolle!\n\nSchnell jetzt! Ttet Knackzahn, bevor das Eisen kalt wird oder sie eine Wahl organisieren!', '', 'Wie viele Hynen kann ein Gnoll eigentlich haben?', 'Knackzahn', '', '', '', 47187);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(66264, 'deDE', 'Entwaffnet und sanftmtig', 'Sammelt $1oa Knochennagerwaffen.', 'Um ehrlich zu sein, wedeln sie dort oben mit einer beunruhigenden Menge an Waffen herum. Es sollte die Dinge beruhigen, wenn wir sie um einige davon erleichtern. Oder zumindest beruhigt es meine Nerven.\n\nWas wollen sie ohne Waffen schon gro anstellen? Euch mit bloen Hnden angreifen? Ha!', '', '', '', '', '', '', 47187),
(66263, 'deDE', 'Eine przise Annherung', 'Ttet Gerbfaust.', 'Gnolle sind furchtbare Kreaturen. Sie stinken. Sie kratzen sich. Sie lachen einen immer aus. Und es sind schon viele hier, und mehr kommen stndig an. Wir, und dabei meine ich Ihr, knnten sie tagelang niedermhen wie Weizen auf einem Feld und nicht wirklich etwas erreichen. Sie drfen nicht hierbleiben.\n\nStattdessen mssen wir der Schlange den Kopf abschlagen! Erleichtert sie um ihre Fhrung, und sie werden vor Ratlosigkeit und Verzweiflung erstarren.\n\nWas soll das heien, warum tun wir das? Ist es nicht offensichtlich? Es sind Gnolle! Das sollte Grund genug sein.', '', 'Welche Chance haben sie ohne ihren geliebten Anfhrer?', 'Gerbfaust', '', '', '', 47187),
(66262, 'deDE', 'Abwasserklrung', 'Subert $1oa verrottende Haufen am See.', 'Fangen wir vorne an: Ich brauche meine Operationsbasis zurck! Aber mit den Amok laufenden Elementaren ist es nicht gerade leicht, auch nur Zeh zu fassen.\n\nUnd natrlich ist das die Schuld dieser elenden Gnolle.\n\nDie Gnolle haben so viel Mll, Innereien und wei das Licht was noch in den See geworfen, dass die ansssigen Elementare angefangen haben, durchzudrehen.\n\nSeid so gut und sammelt ein paar der ekelhafteren Schweinereien auf, bevor die Lage sich weiter zuspitzt. Und viel wichtiger: bevor sie meine Robe besudelt!', '', '', '', '', '', '', 47187),
(66261, 'deDE', 'Ein kleiner Rckschlag', 'Trefft Detry.', 'Ah, Ihr seid genau das schwer gerstete Individuum, das ich gehofft habe zu treffen.\n\nIch bin wegen sehr wichtiger Geschfte der Kirin Tor hergekommen, seht Ihr, aber als ich mein Lager aufschlug, verjagte mich eine Horde dreckiger, verfilzter Gnolle.\n\nTatschlich hat sich in der Nhe eine besorgniserregende Anzahl Gnolle versammelt, genug, um mich glauben zu lassen, dass sie eine Bedrohung fr das ganze Gebirge darzustellen.\n\nAber keine Sorge, ich habe einen Plan! Trefft mich auf der anderen Seite des Sees, und ich erklre Euch alles.', '', '', '', '', '', '', 47187),
(66259, 'deDE', 'Ein Sturm an schlechten Neuigkeiten', 'bergebt Euren Bericht der Khanam Matra in Maruukai.', '$n, wir mssen der Khanam Matra erzhlen, was alles passiert ist, inklusive der Gefangenschaft von Ohn\'ahra.\n\nIhr msst so schnell wie mglich nach Maruukai. Ihr werdet jedoch ohne mich gehen mssen. Ich wurde beim Sturz verletzt und wrde Euch nur aufhalten.\n\nSorgt Euch nicht um mich. Ich komme spter nach. Geht!', '', '', '', '', '', '', 47187),
(66258, 'deDE', 'Oh nein, Ohn\'ahra!', 'Besiegt Feinde, whrend Boku versucht, Ohn\'ahra zu befreien.', 'Diese Primalistin schafft es gerade so, Ohn\'ahra festzuhalten. Sie scheint uns nicht zu bemerken.\n\nTigari Khan wrde sagen, dass selbst die leichteste Brise, einen wankenden Stein umwerfen kann. Wenn ich ihren Zauber unterbrechen kann, selbst wenn es nur kurz ist, kann sich Ohn\'ahra vielleicht losreien.\n\nHaltet Ihr die Wachen beschftigt. Ich habe eine Idee.', '', '', '', '', '', '', 47187),
(66257, 'deDE', 'Vogelzauber', 'Verwendet Bokus Windtotems, um die Wagen der Nokhud zu zerstren.', 'Es heit, dass Ohn\'ahra den Speer unseres Vorfahren Maruuk mit ihrer Macht erfllt hat. Balakar Khan muss den Primalisten von dieser Legende erzhlt haben.\n\nSie haben Magie von den Kindern von Ohn\'ahra gestohlen. Sie haben sie mit Sturmhexerei beschmutzt und Ballistenbolzen damit erfllt. Wofr brauchen die Nokhud solche Waffen?\n\nWir sollten nicht darauf warten, es herauszufinden. Nehmt meine Totems und platziert eins auf jedem Wagen, dem Ihr begegnet. Meine Windmagie wird die Bolzen in Stcke zerschlagen.', '', '', '', '', '', '', 47187),
(66256, 'deDE', 'Adlermacher', 'Befreit $1oa Kinder von Ohn\'ahra und eliminiert $2oa Primalisten bei der Windspielanhhe.', 'Wir haben herausgefunden, warum die Nokhud Mystikertotems wollen: Damit lassen sich die Kinder von Ohn\'ahra einfangen. Obwohl die Nokhud die Totems gestohlen haben, stecken eigentlich die Primalisten hinter dieser Lsterung.\n\nDie Kinder von Ohn\'ahra sind heilige Ohuna, gesegnet von der Windmutter hchstselbst. Bitte, $n, befreit jegliche Ohuna, denen Ihr begegnet! Und wenn Ihr irgendwelchen Primalisten ber den Weg lauft...\n\n<Bokus Blick schweift ab, aber er bleibt von finsterer Entschlossenheit gezeichnet.>', '', '', '', '', '', '', 47187),
(66254, 'deDE', 'Ein pessimistischer Mystiker', 'Stellt die Totems der Ermchtigung um Boku herum auf.', 'Krieg? Drachen? Ich soll Ohn\'ahra fr Euch kontaktieren?\n\nKann ich nicht! Ich kann Ohn\'ahra nicht hren, kein bisschen. Ich bin lediglich ein Initiand. Und es scheint, als htte mir Ohn\'ahra ihren Segen entzogen. Vielleicht bin ich einfach nicht gut genug...\n\n<Boku beginnt, in einer Tasche herumzuwhlen.>\n\nAls meine Mentorin mich diesem Klan zuwies, schenkte sie mir diese Totems. Sie sagte, sie wrden mir Kraft geben, wenn ich jemals an mir selbst zweifeln sollte.\n\nHelft Ihr mir, sie zu platzieren? Ich werde noch einmal versuchen, Ohn\'ahra anzurufen.', '', '', '', '', '', '', 47187),
(66252, 'deDE', 'Bericht erstatten', 'Kehrt nach Valdrakken zurck und berichtet Hauptmann Drine.', 'Die Primalisten hier sind zurckgedrngt, $n. Unsere Verstrkungen aus Valdrakken sollten bald eintreffen und die restlichen Primalisten beseitigen.\n\nIhr solltet zur Stadt zurckkehren und Hauptmann Drine Bescheid geben. Ich bin mir sicher, dass sie wissen wollen wird, was hier mit Kommandant Eranog vorgefallen ist.\n\nDanke noch mal fr alles, $n.', '', '', '', '', '', '', 47187),
(66251, 'deDE', 'Feuerwehr', 'Ttet Magmakralle.', 'Kommandant Eranog hat uns hintergangen und dieser Bestie das Kommando berlassen.\n\nIhr habt bereits so viel fr mich getan, doch ich kann es in meinem gegenwrtigen Zustand nicht mit diesem Monster aufnehmen.\n\nIch bitte Euch, tut mir diesen letzten Gefallen und helft sicherzustellen, dass das Tor der Sdfeste nicht gegen diese Primalisten fllt.\n\nWir mssen ihren Anfhrer tten!\n\nHelft mir, $n!', '', 'Der Anfhrer der Primalisten, die das Tor der Sdfeste angreifen.', 'Magmakralle', '', '', '', 47187),
(66250, 'deDE', 'Wo ist der Huptling?', 'Begleitet Wchter Velomir und untersucht den Wachturm am Tor der Sdfeste.', 'Das ist der einzige Teil der Festung, den wir noch nicht durchsucht haben, $n. Wenn sich Kommandant Eranog irgendwo befindet, dann muss es hier sein.\n\n<Velomir blickt zum nahe gelegenen Eingang.>\n\nSchauen wir mal, was wir herausfinden knnen.', '', '', '', '', '', '', 47187),
(66249, 'deDE', 'Befreit den Himmel', 'Bedient einen Belagerungsskorpion und verwendet ihn, um die Lfte von den magmagebundenen Wahrgeborenen zu befreien.', 'Ihr habt beim Sammeln der Speere und der Seile gute Arbeit geleistet. Damit knnen wir sicherstellen, dass diese eingebildeten Primalisten nicht lnger die Herrscher der Lfte sind!\n\nWenn Ihr die Treppe hochgeht, findet Ihr eine Plattform mit mehreren Belagerungsskorpionen. Mit dem Seil knnt Ihr die Wurfarme bespannen und die Speere dienen als Munition. Damit solltet Ihr in der Lage sein, die magmagebundenen Drachen aus der Luft zu holen!\n\nWenn Ihr sie beseitigen knnt, sollte der Weg zur Spitze frei sein, um unsere Suche nach Kommandant Eranog fortzusetzen.', '', '', '', '', '', 'Trefft Euch mit Wchter Velomir auf dem Wachturm am Tor der Sdfeste.', 47187),
(66248, 'deDE', 'Perfekte Verbindung', 'Sammelt $1oa Rollen mit schwerem Seil.', 'Diese Rolle mit schwerem Seil ist in gutem Zustand.\n\nWchter Velomir hat gesagt, dass Ihr ein Auge nach ntzlichen Materialien offen halten sollt. Vielleicht kann er etwas damit anfangen, wenn Ihr noch mehr Rollen findet.', '', '', '', '', '', '', 47187),
(66247, 'deDE', 'Kaum benutzte Waffen', 'Sammelt $1oa magmagebundene Speere.', 'Dieser Speer scheint in gutem Zustand zu sein, wenn man bedenkt, in welchem Zustand sich sein ehemaliger Besitzer befindet.\n\nWchter Velomir hat erwhnt, dass Ihr nach ntzlichen Materialien Ausschau halten sollt. Vielleicht knnen noch mehr dieser Speere von den Magmagebundenen erbeutet werden.', '', '', '', '', '', '', 47187),
(66246, 'deDE', 'Der Schlachtennebel', 'Sucht nach den Mitgliedern von Wchter Velomirs Einheit am Tor der Sdfeste.', 'Der Angriff der Primalisten kam pltzlich und ohne Vorwarnung. Meine Einheit hat versucht, unseren Anfhrer zu finden, Kommandant Eranog. Aber bevor wir auf die andere Seite der Garnison gelangen konnten, wurden wir abgeschnitten.\n\nWhrend der Schlacht hat der Anfhrer meiner Einheit, Unteroffizier Tagrik, drei Primalisten alleine aufgehalten, whrend Kaora, Mikor und ich an seiner Seite kmpften.\n\nIhre Schreie sind das Letzte, an das ich mich erinnern kann, bevor ich fiel.\n\nIch bitte Euch, $R, wenn Ihr irgendwelche Anzeichen von meiner Einheit findet, dann lasst mich wissen, was mit ihnen passiert ist.', '', '', '', '', '', '', 47187),
(66245, 'deDE', 'Gedenkt den Gefallenen', 'Sammelt $1oa Signets der Sdfestengarnison.', 'So viele meiner Kameraden sind gefallen.\n\nBitte... sammelt ihre Erkennungssignets, auf dass ihre Namen nie vergessen werden.', '', '', '', '', '', '', 47187),
(66244, 'deDE', 'Nach Valdrakken', 'Reist nach Valdrakken und trefft Euch mit Alexstrasza der Lebensbinderin.', 'Dank Euch konnten wir einer absoluten Katastrophe knapp entgehen.\n\nDennoch sollten wir uns mit den anderen Aspekten treffen und von dem berichten, was sich hier ereignet hat.\n\nBitte trefft mich beim Sitz der Aspekte in Valdrakken. Ich bin sicher, dass die anderen Informationen zu den Plnen von Raszageth und ihren Primalisten haben.\n\nNrdlich von hier, ein wenig nach Osten, gibt es einen bergang nach Thaldraszus. Die Flugstrecke ist malerisch, aber lasst Euch nicht zu lange Zeit.', '', '', '', '', '', '', 47187),
(66242, 'deDE', 'Wetterkontrolle', 'Ttet $1oa sturmgebundene Essenzen und $2oa Sturmruferinitianden.', 'Dieser unnatrliche Sturm ist mit Magie aufgeladen. Die Nokhud scheinen zu lernen, die heilige Essenz der Windspielanhhe zu manipulieren, um Sturmelementare zu erschaffen. Manche haben mehr Erfolg als andere...\n\n<Boku deutet auf einen unglcklichen Initianden der Nokhud in der Nhe, der immer noch von Blitzen verbrannt raucht.>\n\n$n, wir drfen nicht zulassen, dass sie weitermachen.', '', '', '', '', '', '', 47187),
(66241, 'deDE', 'Rennen von Thaldraszus', '', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66239, 'deDE', 'Ausbreitender Verfall', 'Trefft Euch mit Brena am Handelsauenposten.', '<Brena wendet Kargtatzes Totem immer wieder in ihren groen Pranken hin und her.>\n\nKargtatze ist nur eine Schachfigur. Er ist nicht die Quelle dieser Fulnis. Wir mssen sie finden, bevor sie sich noch weiter ausbreitet.\n\nDie nchste Tuskarrsiedlung von hier ist ein Handelsauenposten, gleich am anderen Ende der Brcke nach Iskaara.\n\nWir sollten nach ihnen sehen... und zwar schnell.', '', '', '', '', '', '', 47187),
(66237, 'deDE', 'Spirituelle Verbndete', 'Sprecht mit den Behrden.', 'Unsere Ankunft wird nicht unbemerkt bleiben.\n\nGestattet mir, mit ihnen zu sprechen, bevor wir eintreten. Ich habe so etwas wie eine gemeinsame Geschichte mit dem Rat.\n\nWir haben spter noch genug Zeit, alle vorzustellen.', '', '', '', '', '', '', 47187),
(66236, 'deDE', 'Ein gefangener Wind', 'Trefft Boku bei der Windspielanhhe.', 'Die Nokhud sammeln Totems. Die Primalisten fangen Ohuna. Und Ohn\'ahra schweigt.\n\nWas auch immer die Nokhud vorhaben, wir mssen sie daran hindern. Ihr msst zusammen mit Boku zur Windspielanhhe reisen. Vermutlich warten unsere Feinde dort bereits.\n\nSucht dort nach Ohn\'ahra. Wenn ihre Kinder in Gefahr sind, wird sie sich zweifelsohne zu ihnen begeben... und wir mssen ihr helfen. Die Windmutter ist mchtig, doch ich frchte, zu was diese Primalisten imstande sind.', '', '', '', '', '', 'Trefft Boku bei der Windspielanhhe.', 47187),
(66232, 'deDE', 'Salziger Affront', 'Sammelt $1oa Kristallflocken an der Gorlockste.', 'Wir wrden Euch und Eure Freunde gerne als unsere Gste wissen, nicht, dass jemand gefragt htte. Aber wrt Ihr so $gein guter Nachbar:eine gute Nachbarin; und wrdet mir einige Kristallflocken mitbringen, wenn Ihr an den Quellen vorbeikommt? Wir nutzen sie, um alle mglichen Dinge zu konservieren. Und wenn es um die Lagerung von Essen geht, ist das hier unerlsslich.\n\nDie greren Gorlocs sind ber und ber mit dem Zeug bedeckt. Vielleicht knnt Ihr ja von denen ein paar Flocken ergattern.', '', '', '', '', '', '', 47187),
(66230, 'deDE', 'Bilderbuchauftrag', 'Findet Alvis \"Register\" und bringt es zu Wegbehterin Alvi.', 'Die Tarasek haben alles mitgenommen, was sie in ihre Klauen bekommen konnten, inklusive meines Registers.\n\nDiese bergroen Eidechsen horten Schmuckstcke und Trophen zuhauf. Ich bin sicher, dass sie mein Register auch irgendwo verstaut haben. Knntet Ihr ein Auge danach offen halten, whrend Ihr auf dem Weg ber den Pass seid?\n\nOh, und, $n, wenn es Euch gelingt, es zu finden, seht nicht hinein. Der Inhalt ist gewissermaen... privat.', '', '', '', '', '', '', 47187),
(66228, 'deDE', 'Lager Antonidas', 'Trefft Euch mit Noriko der Allerinnernden im Lager Antonidas.', 'Die Kirin Tor haben unser Hauptlager sdlich von hier aufgeschlagen: Lager Antonidas.\n\nIch glaube, Noriko und Khadgar sind gerade dort und rekrutieren Abenteurer, um Kalecgos bei der Rckeroberung des Azurschwursteins zu helfen.\n\nWenn Ihr unsere Sache untersttzen wollt, geht dorthin.', '', '', '', '', '', 'Trefft Euch mit Noriko der Allerinnernden im Lager Antonidas.', 47187),
(66227, 'deDE', 'Gutes Angeln', 'Fangt $3oa Blauflossenelritzen an Khuris Angelplatz.', 'Ein neues Paar Hnde! Ich knnte etwas Hilfe brauchen, um genug Fisch fr ein feines Essen zu fangen.\n\nDiese Kirin Tor scheinen ber etwas in dieser Gegend beunruhigt zu sein, was sie magische Anomalien nennen, was immer das sein mag.\n\nEs sind alle willkommen, hierzubleiben, solange sie mit anpacken und mithelfen.\n\nNehmt Euch eine Angel und fangt an, zu fischen. Je mehr Hnde, umso leichter die Arbeit!', '', '', '', '', '', '', 47187),
(66226, 'deDE', 'Begleiter fr seelischen Beistand', 'Rettet die unschuldigen Kreaturen vor den Nokhud bei der Gratwasserzuflucht.', 'Bitte tut mir nicht weh...\n\nWas? Ihr seid hier, um zu helfen? Ihr msst die Tiere retten!\n\nDie Nokhud haben ohne Vorwarnung angegriffen. Wir alle sind um unsere Leben gerannt! Ich konnte dem Tod gerade noch entkommen, indem ich in den See gesprungen bin.\n\nDie Tiere! Wir haben sie zurckgelassen. Bitte, ich flehe Euch an, rettet sie. Wer wei, welche Grausamkeiten die Nokhud fr sie geplant haben.', '', '', '', '', '', '', 47187),
(66225, 'deDE', 'Totale Totems', 'Sammelt $1oa Totembndel von den Nokhud bei der Gratwasserzuflucht.', 'Boku hat gefragt, warum ich eine Nachricht entsandt habe, die alle Mystiker zur Gratwasserzuflucht ruft.\n\nIch habe keine solche Nachricht entsendet. Balakar hat meine Mystiker vorstzlich in eine Falle gefhrt, um Klan Ohn\'ir zu schwchen.\n\nDoch vielleicht gibt es noch einen weiteren Grund. Die Nokhud sammeln mystische Totems, so viele sie finden knnen. Diese Totems sind von Ohn\'ahra gesegnet.\n\nEs nicht klar, was die Nokhud damit vorhaben, doch wir drfen nicht zulassen, dass sie sich an Ohn\'ahras Geschenken bedienen. Bringt so viele Totems zurck, wie Ihr knnt.', '', '', '', '', '', '', 47187),
(66224, 'deDE', 'Mystisches Mysterium', 'Trefft Euch mit Boku und reist zur Gratwasserzuflucht.', 'Es tut mir leid, ich habe es nicht geschafft, mit Ohn\'ahra Zwiesprache zu halten. Ihr werdet jemand anderen finden mssen, der die Bitte der Khanam Matra erfllt.\n\nVor einigen Tagen wurden die anderen Mystiker im Zuge einer dringenden Bitte von Tigari Khan zur Gratwasserzuflucht gerufen. Sie sollten noch dort sein.\n\nTrefft mich auerhalb der Stadt. Das Mindeste, das ich tun kann, ist, Euch den Weg dorthin zu zeigen.', '', '', '', '', '', '', 47187),
(66223, 'deDE', 'Knnen wir das behalten?', 'Bringt Neelo $1oa Eiswasserfische. Kauft sie entweder in Iskaara oder angelt sie in einem beliebigen Ozean der Dracheninseln.', 'Er versucht nur, uns zu essen, weil er so hungrig ist!\n\nFisch! Niemand kann so leckeren, eiskalten, rohen Fisch abschlagen!\n\nEiswasserfische sind das Beste berhaupt! Ihr knnt sie berall im Ozean angeln! Aber falls Ihr selbst nicht angeln knnt, wird Euch Jinkutuk in Iskaara bestimmt welche verkaufen.\n\nBringt mir so viele, bis er nicht mehr hungrig ist!', '', '', '', '', '', '', 47187),
(66222, 'deDE', 'Die Ruhe vor dem Sturm', 'Kommuniziert Jebotais Befehle an die Bewohner von Teerakai.', 'Die Nokhud sind mchtig und haben viele Verbndete. Es wird uns alles abverlangen, ihnen standzuhalten.\n\n$n, Ihr habt das Vertrauen der Khanam Matra. Ihre Befehle waren, unser Volk vorzubereiten und unsere Freunde zu versammeln.\n\nIch brauche Eure Hilfe. Sucht Hojin auf, um den Rest der Khanswache zu mobilisieren. Macht Spherin Khenyug auf mgliche Orte aufmerksam, an denen die Nokhud eindringen knnten. Informiert Agura, dass mit Verwundeten zu rechnen ist, und sagt Gensai, dass er unsere Verpflegung vorbereiten soll.\n\nBezglich der Mystiker... Ich glaube, dass sie vor Kurzem aufgebrochen sind. Ich werde prfen, ob sich in Teerakai noch jemand von ihnen befindet.', '', '', '', '', '', '', 47187),
(66221, 'deDE', 'Es geht voran', 'Sprecht mit Alexstrasza beim Sitz der Aspekte in Valdrakken.', 'Mit der Wiederherstellung des Bronzeschwursteins kann Alexstrasza mit ihrem Plan fortfahren.\n\nReist nach Valdrakken, $n. Sie wird von Eurem Erfolg hren wollen.', '', '', '', '', '', '', 47187),
(66218, 'deDE', 'Strende Strolche', 'Findet Neelo und Nau.', 'Hallo noch mal.\n\nKnntet Ihr Norukk und mir einen Gefallen tun? Unsere Kinder Neelo und Nau sind zum Spielen rausgegangen. Sie wissen, dass sie lngst zurck sein sollten.\n\nIch bin beschftigt, also bitte geht sie suchen. Ich bezweifle, dass sie in Gefahr sind, meine Kinder wissen sich zu helfen.', '', '', '', '', '', '', 47187),
(66217, 'deDE', 'GESUCHT: Krojek der Kstenstreifer', 'Ttet Krojek den Kstenstreifer.', 'Wir haben den groen Hai beobachtet, der seit vielen Jahren als Krojek bekannt ist, und warten auf die beste Gelegenheit, ihn zu erlegen.\n\nSeine Jagdgrnde haben sich immer nher an die Kste verschoben. Das bedeutet, dass es an der Zeit ist. Versammelt Euren Jagdtrupp und streckt ihn nieder!', '', 'Der Kstenstreifer, eine ehemalige Gre des hiesigen kosystems, hat seine Jagdgrnde zu nah an Iskaara verlegt.', 'Krojek der Kstenstreifer', '', '', '', 47187),
(66213, 'deDE', 'Das Weben einer Geschichte', 'Erzhlt der ltesten Poa eine Geschichte ber Fisch.', 'Meine liebe Frau, Poa, ist eine groartige Geschichtenerzhlerin.\n\nAber dreiig Jahre sind vergangen, und sie erzhlt manche immer und immer wieder! Bitte, $C, sprecht mit Poa und erzhlt ihr eine neue Geschichte.\n\nWas sagt Ihr? Ihr wollt ihr von Euren Abenteuern erzhlen? Macht Euch nicht lcherlich, davon will ich nichts hren. Die besten Geschichten handeln immer von Fisch. Erzhlt ihr eine Geschichte ber Fisch, und wenn Ihr Euch eine ausdenken msst!', '', '', '', '', '', '', 47187),
(66212, 'deDE', 'Angeln: Querflossen-Flgelrossfisch', 'Zieht $1oa Querflossen-Flgelrossfische aus dem Meer um die Dracheninseln.', 'Wei denn NIEMAND mehr, wie man RICHTIG angelt?\n\n<Lukoturukk zuckt wtend mit seinem Schnauzbart.>\n\nIhr da mit dem komischen Gesicht, bringt mir ein paar Fische. Und zwar FEINE Fische. Keine Grungeln!', '', '', '', '', '', '', 47187),
(66211, 'deDE', 'Brackenfellhhle: Zur Quelle', 'Betretet die Brackenfellhhle und stellt Faultriarchin Zornauge.', 'Wir knnen Euch fr Eure Hilfe, die Brackenfellgnolle zurckzuschlagen, nicht genug danken.\n\nAber sie sammeln sich weiter und beziehen ihre Verfallmagie aus irgendeiner Quelle tief im Inneren der Brackenfellhhle. Schlimmer noch, wir haben seit Wochen nichts mehr von den Tuskarr aus der Gegend gehrt.\n\nIch frchte, dort knnte etwas Furchtbares vorgefallen sein. Wir mssen unsere Heimat schtzen. Bitte, sammelt Eure Streitmacht, findet unsere Leute und seht, was Ihr gegen diesen Verfall unternehmen knnt!', '', '', '', '', '', '', 47187),
(66210, 'deDE', 'Die Familie zusammenrufen', 'Sammelt $1oa Bestattungsgaben in der Gegend von Iskaara und legt sie dann in das Bestattungsboot.', 'Euer Freund Kalecgos mchte ber Leylinien sprechen, aber es mssen Vorbereitungen fr die Bestattung getroffen werden.\n\nKnntet Ihr die letzten Opfergaben aus der Umgebung von Iskaara einsammeln und sie im Bestattungsboot neben den guten alten Ponoliak legen, whrend ich mich mit ihm treffe?\n\nIch hoffe, Ihr nehmt Euch die Zeit, um auch die Stadt zu genieen! Mein Volk wird Euch herzlich willkommen heien, insbesondere nach Eurer Hilfe in Brackenfell.', '', '', '', '', '', '', 47187),
(66206, 'deDE', 'Nozdormu, ich komme, um zu verhandeln', '', '', '', '', '', '', '', '', 47187),
(66201, 'deDE', 'Hufe des Krieges', 'Bringt die Nachricht der Khanam Matra zu Khanswache Jebotai in Teerakai.', 'Balakar wird seine Streitkrfte fr den Krieg aufstellen. Ich werde es ihm gleichtun, doch wir sind zahlenmig unterlegen.\n\nDie Drachen haben um unsere Hilfe gebeten... und jetzt knnen wir ihre Hilfe brauchen, uns eine faire Chance zu geben. Um ihrem Ruf nach einem Bndnis zu antworten, muss ich das Horn von Drusahl blasen, doch ich brauche Ohn\'ahras Segen. Werdet Ihr mir helfen?\n\nGeht nach Teerakai und bergebt meine Kriegserklrung an meinen Leutnant, Jebotai. Er wird meine Streitkrfte zusammentrommeln und Euch den Weg zu den Mystikern zeigen, die Ohn\'ahra finden knnen.', '', '', '', '', '', 'Bringt die Nachricht der Khanam Matra zu Khanswache Jebotai in Teerakai.', 47187),
(66196, 'deDE', 'Ein Hilfequaken', 'Bringt das Entchen in der Blase zurck ins kologenlager.', '<Das Entchen schlgt in der Blase wild um sich und quakt verngstigt.>\n\n<Vielleicht wissen die kologen, wie man ihm helfen kann?>', '', '', '', '', '', 'Bringt das Entchen in der Blase zurck ins kologenlager.', 47187),
(66187, 'deDE', 'Der verrckte Mordigan und der Kristallknig', 'Dekristallisiert Mordigan Eisenkiefer an der Gorlockste.', 'Ich habe die Umgebung durchsucht. Wenn Mordigan irgendwo hier ist, muss er in dieser Hhle sein.\n\n<Dumpfe Flche und Beleidigungen hallen aus dem Hhleneingang.>\n\nEr ist definitiv in dieser Hhle.\n\nLOU-C hat gesagt, diese Kristalle haben gefhrliche dehydrierende Eigenschaften. Versucht, ihn von seinen... geologischen Funden zu trennen. Aber tut ihm nicht allzu sehr weh.\n\nEr ist in seinem Fachbereich ziemlich angesehen.', '', '', '', '', '', 'Sprecht mit Aelnara.', 47187),
(66177, 'deDE', 'Kein Zwerg bleibt zurck', 'Folgt der Spur von Mordigan Eisenkiefer entlang der Gorlockste.', 'Das Salzniveau hier sprengt die Skala! Wir mssen Mordigan finden und ihn hier rausholen. Er muss inzwischen lebensgefhrlich dehydriert sein.\n\nEr ist erst seit einigen Stunden fort. Versucht herauszufinden, welchen Weg der grimmige, alte Zwerg genommen hat!', '', '', '', '', '', 'Findet Aelnara an der Gorlockste.', 47187),
(66176, 'deDE', 'Elementare Experimente', 'Fhrt $1oa Elementarexperimente an der Gorlockste durch.', 'Geht und fhrt Experimente an den Wasserelementaren durch, die die Gorlocs belstigen!', '', '', '', '', '', 'Gut gemacht!', 47187),
(66175, 'deDE', 'Feldexperiment', 'Helft LOU-C dabei, ihre Tests in Walfngerwinkel durchzufhren.', 'Dank Euch arbeitet unsere geologische Untersuchung mit beinahe 96%iger Effizienz! \n\n<LOU-C zieht die Augenbrauen zusammen.>\n\nDas sind Anfngerzahlen.\n\nHelft mir, Eure gesammelten Proben mit dem Geoscanner 289-07 zu prfen. Es sollte uns eine Grundvorstellung davon geben, was genau auf dem Plateau vor sich geht.', '', '', '', '', '', 'Sprecht mit LOU-C Fitzkog in Walfngerwinkel.', 47187),
(66169, 'deDE', 'Rache, hei serviert', 'Ttet $1oa magmagebundene Primalisten am Tor der Sdfeste.', 'Die Primalisten haben uns komplett berrumpelt.\n\n<Velomir spuckt angewidert aus.>\n\nMeine Wchterkameraden wurden von diesen Monstern zerfleischt. Ich htte mich ihnen im Tod angeschlossen, wrt Ihr nicht aufgetaucht.\n\nIn der Ferne kann ich immer noch den Lrm der Schlacht vernehmen. Vielleicht gibt es noch mehr berlebende. Vielleicht lebt sogar Kommandant Eranog noch.\n\nHelft mir und lenkt sie ab, damit ich mich nher ranschleichen kann.\n\nEs wre perfekt, wenn Ihr ein paar dieser sogenannten \"Magmagebundenen\" tten knntet.', '', '', '', '', '', '', 47187),
(66167, 'deDE', 'Entblter Sden', 'Reist zur Sdfestengarnison.', 'Basierend auf Euren Entdeckungen vermute ich, dass die Primalisten die Garnison von Kommandant Eranog an der Sdfeste angreifen. Doch meine Eidschuppen knnen die Stadt nicht verlassen, denn das wrde den Primalisten nur in die Hnde spielen.\n\nIch brauche erneut Eure Hilfe, $n.\n\nReist zur Sdfeste und seht, was fr Streitkrfte uns dort erwarten. Und wenn mglich, tretet mit den Garnisonswchtern dort in Kontakt.', '', '', '', '', '', '', 47187),
(66166, 'deDE', 'Augen und Ohren', 'Findet Hinweise in Valdrakken.', 'Die Primalisten haben ihre Propaganda unter den Einwohnern von Valdrakken verbreitet.\n\nUnsere Feinde sind zu gerissen, um sich in Anwesenheit meiner Eidschuppen zu verplappern, aber vielleicht knnt Ihr Euch nah genug heranschleichen, um ihre Unterhaltungen zu belauschen und herauszufinden, ob Ihr dadurch etwas in Erfahrung bringen knnt.\n\nIch habe Orte auf Eurer Karte fr weitere Untersuchungen markiert.\n\nNehmt diesen verzauberten Stein mit. Solange Ihr ihn in Hnden haltet, knnen wir miteinander kommunizieren.\n\nSeid Ihr bereit?', '', '', '', '', '', '', 47187),
(66164, 'deDE', 'Fischfinger', 'Findet $1oa gestohlene Teile an der Gorlockste.', 'Jetzt, da Mordigan Steine lutscht, knnen wir uns um das Hauptproblem kmmern...\n\nDiese perfiden Fischleute haben meine Teile geklaut!\n\nWir waren noch keine Stunde in diesem schbigen kleinen Kaff, und ZACK! Haben Gorlocs uns von berall berschwemmt! Rowe hat geschrien, Aelnara hat geheult und ich meinen Schraubenschlssel wie eine wahnsinnige Gnomin geschwungen!\n\nKnnt Ihr die Situation retten und mir einige meiner Teile zurckbringen?', '', '', '', '', '', '', 47187),
(66163, 'deDE', 'Kein Versteck', 'Ttet $2oa Eindringlinge der Primalisten in Valdrakken.', 'Willkommen in Valdrakken, $R.\nDas Klima in der Stadt war in letzter Zeit etwas erhitzt, und damit meine ich nicht das Wetter.\n\nDie Primalisten schleichen durch die Gassen und schren Uneinigkeit unter den Brgern unserer Stadt.\n\nUnsere Feinde verkleiden sich nun als gewhnliche Brger der Stadt, um sich vor den Eidschuppen zu verstecken. Sie wissen, wie sie meinen Wachen aus dem Weg gehen, aber vor einem Fremdling werden sie sich nicht in Acht nehmen.\n\nNehmt dieses Drachenaugenjuwel, damit werdet Ihr ihre Tarnung durchschauen knnen.\n\nGeht! Identifiziert diese Eindringlinge und ttet sie!', '', '', '', '', '', '', 47187),
(66159, 'deDE', 'Eine schlimme Nachricht', 'Sprecht mit Alexstrasza beim Sitz der Aspekte in Valdrakken.', 'Kalecgos wollte nicht darber sprechen, was im Azurblauen Gebirge passiert ist, bis Ihr eintrefft.\n\nAber was immer es auch ist... Ich empfinde eine unheilvolle Vorahnung, $n.', '', '', '', '', '', '', 47187),
(66156, 'deDE', 'Angesehen bei der Drachenschuppenexpedition', 'Sprecht mit Katalogisiererin Jakes im Drachenschuppenbasislager.', 'Eure Taten sind nicht unbemerkt geblieben. Ihr stellt immer wieder unter Beweis, dass Ihr $gein berhmter Forscher:eine berhmte Forscherin; seid!\n\nKehrt ins Drachenschuppenbasislager zurck. Ich habe einige Vorrte vorbereitet, die Euch in Euren Anstrengungen untersttzen sollen.', '', '', '', '', '', '', 47187),
(66155, 'deDE', 'Ruriqs Stromschnellenritt', 'Fahrt mit der Fallschreiter den Fluss hinunter.', 'Ich habe nicht mit der Zustimmung meines Bruders gerechnet... Aber sie ist willkommen.\n\nDie Zeit ist gekommen! Lasst uns sehen, ob unsere harte Arbeit sich ausgezahlt hat!\n\nTrefft mich auf der Fallschreiter, $n, dann legen wir flussabwrts ab und fangen unterwegs Fisch fr Iskaara!', '', '', '', '', '', '', 47187),
(66154, 'deDE', 'Speichelproben', 'Sammelt $1oa Speichelproben an der Gorlockste.', '<Der magere Untote greift sich an die Stirn und seufzt tief.>\n\nDas wird mich gar nicht gut dastehen lassen. An nur einem Tag haben wir es geschafft, die ansssigen Gorlocs aufzuscheuchen, die Hlfte unserer Ausrstung zu verlieren und jetzt sind wir auch noch um einen Zwerg rmer.\n\nIn dieser Situation schreibt das Protokoll vor, dass wir so effizient wie mglich arbeiten. Geht und dnnt unsere gezahnten Antagonisten aus und bringt mir ihren Speichel zur Untersuchung, wenn Ihr schon dabei seid.\n\nNur das gute Zeug, wohl gemerkt.', '', '', '', '', '', '', 47187),
(66152, 'deDE', 'Kein Entrinnen', 'Trefft Garz beim Lager im Nirgendwo.', 'Wir knnen nicht hierbleiben.\n\nIch wei nicht, was wir tun knnen... oder wohin gehen...\n\nWir werden zum Lager im Nirgendwo zurckkehren. Die Tuskarr sollten wissen, was hier bei den Rostkiefern passiert ist.\n\nWenn wir unsere Geschichte weitererzhlen und bewahren, wird sie sich vielleicht nicht wiederholen...', '', '', '', '', '', '', 47187),
(66151, 'deDE', 'Sein steinernes Herz', 'Ttet Steinherz.', 'Wir jaulen in Trauer um unseren Huptling, auch wenn er noch lebt.\n\nWas von Steinherz brig ist, befindet sich in der Hhle weiter vorn. Viele haben versucht, ihn zur Vernunft zu bringen.\n\nEr hat sie gettet, beinahe auch Narn.\n\nEr ist ein Monster! Das ist das wahre Ziel der Primalisten. Sie wollen uns in Stein und Feuer verwandeln, damit wir ihnen dienen.\n\nIn ihm ist kein bisschen Rostkiefer mehr brig. Er muss vernichtet werden, bevor andere dasselbe Schicksal erleiden.', '', 'Das Geschenk der Primalisten hat den Krper des Rostkieferhuptlings zu Stein erstarren lassen.', 'Steinherz', '', '', '', 47187),
(66150, 'deDE', 'Radzas Rettung', 'Rettet Radza Donnerklaue.', 'Radza Donnerklaue ist unsere Geisthterin. Sie bewahrt unsere Traditionen und unsere Geschichte.\n\nDie berzeugungen der Primalisten stehen entgegengesetzt zu allem, an das unser Klan glaubt. Ich wusste, sie wrde sich Steinherz widersetzen!\n\nSteinherz wird alles dafr tun, sie zu unterwerfen. Ohne Radzas Segen kann niemand Huptling sein!\n\nNarn sagt, dass Khargall Fnfzahn, die Wache des Huptlings, versucht, sie zu brechen. Wenn Radza stirbt, stirbt unser Klan mit ihr.\n\nHelft ihr, $n, und seid darauf gefasst, dass er sie nicht ohne einen Kampf gehen lassen wird.', '', '', '', '', '', 'Trefft Euch mit Radza Donnerklaue im Rostkieferbau.', 47187),
(66149, 'deDE', 'Elementarer Einfluss', 'Zerstrt $1oa Primalistentotems der Erdbindung und trefft Euch anschlieend mit Narn tiefer im Rostkieferbau.', 'Narn sagt, dass nicht alle Rostkiefern Steinherz oder den Primalisten gefolgt sind.\n\nEinige Widerstndler werden gegen ihren Willen gefangen gehalten. Von Totems, die Fels und Schlamm versprhen... Von ihnen werden sie unterworfen.\n\nZerschmettert die Totems und befreit sie!', '', '', '', '', '', 'Trefft Euch mit Narn im Rostkieferbau.', 47187),
(66148, 'deDE', 'Frhere Furbolgfamilie', 'Ttet $1oa Rostkieferfurbolgs und Elementare und trefft Euch anschlieend mit Narn tiefer im Rostkieferbau.', 'Primalisten sind gekommen. Sie haben uns neue Kraft versprochen: die Macht ber die Elemente.\n\nIch htte nicht gedacht, dass Steinherz ihre Geschenke annehmen wrde. Unser Klan brauchte keine Macht. Er hat nicht ber die Folgen nachgedacht.\n\nSeine furchtbare Entscheidung kann nicht ungeschehen gemacht werden. Die Magie hat meinen Klan verdorben wie eine Krankheit, die eine Wurzel verfaulen lsst.\n\nEs bricht mir das Herz, aber das Einzige, was uns bleibt, ist, die Verderbten auszumerzen.', '', '', '', '', '', 'Trefft Euch mit Narn im Rostkieferbau.', 47187),
(66147, 'deDE', 'Kristalle im Wasser', 'Sammelt $1oa Kristallproben an der Gorlockste.', 'Im Moment mag es nicht danach aussehen, aber wir sind Profis. Die Expedition hat uns damit beauftragt, eine Ansammlung seltener Kristalle in der Gegend aufzuspren. Eine geologische Untersuchung, wenn man so will.\n\nIch bin immer noch erschttert von dem Gorlocangriff. Wrt Ihr so freundlich, fr mich nach diesen Kristallen zu suchen? Bringt Proben mit, wenn Ihr knnt.', '', '', '', '', '', '', 47187),
(66141, 'deDE', 'Gebrochene Traditionen, gebrochene Krper', 'Trefft Garz und Narn auf dem Weg zum Rostkieferbau.', 'Meine Furbolgfreunde sind nicht mehr sie selbst. Sie haben... schlimme Dinge getan. Jetzt sind sie zu etwas Schlimmerem geworden.\n\nFurbolgs haben sich noch nie gegen Furbolgs gewandt!\n\nMein Bruder und ich sind ihnen entkommen. Ich bin hergekommen, um Hilfe zu suchen, whrend er bei unserem Klanbau geblieben ist.\n\nHelft uns, bevor das das Ende unseres Klans ist!', '', '', '', '', '', '', 47187),
(66139, 'deDE', 'Endlich Feuer', 'Nutzt die konzentrierte Essenz des Wassers, um das lodernde Inferno in den Grten zu bezwingen.', 'Na gut, junges Wesen. Ich habe all die Wasserelementaressenzen fr Euch in diesem Krug verstaut.\n\nWenn Ihr ihn einfach auf den Groen werft, sollte das gengen. Ich meine, wann hat Wasser jemals nicht gegen Feuer gewirkt? Das ist eine idiotensichere Sache.\n\nDie Hitze, hm, ist nicht gut fr meine Gelenke, ich bleibe also einfach hier. Ihr knnt das sicher selbst erledigen.\n\nViel Glck, junges Wesen!', '', '', '', '', '', '', 47187),
(66138, 'deDE', 'Wie Sand im Stundenglas', 'Sammelt $1oa Haufen aus windgepeitschtem Zeitsand in den Grten.', 'Wie auch der Rest der Grten musste Nozdormus Stundenglas den Unruhen der Elementare standhalten. Turbulente Windelementare sind vorbeigezogen und haben den magischen Sand aus dem Inneren des Stundenglases verstreut.\n\nOhne diesen Sand ist Nozdormus Einfluss hier stark geschwcht.\n\nAls Verwalter in Ausbildung wurde ich damit beauftragt, das Stundenglas jederzeit zu berwachen. Wenn Ihr den Sand an meiner Stelle einsammeln knntet, wre ich Euch auf ewig dankbar.', '', '', '', '', '', '', 47187),
(66137, 'deDE', 'Die Peitsche schwingen', 'Ttet $1oa invasive Todesblten und Peitscherunkrautlinge in den Grten.', 'Ich bin sicher, dass die Schotlinge nicht die einzigen Wildtiere sind, die sich wie die Axt im Wald benehmen.\n\nAlexstraszas Baum war mir schon immer ein Dorn im Auge. Ihre Lebensmagie zieht allerhand Flora und Fauna an, Gut und Bse gleichermaen. Und ratet mal, wer sich um die Bsen kmmern muss? Der alte Gryrmpech natrlich!\n\nBei den Aspekten, ich werde zu alt fr so etwas.\n\nDiese Verwalter sind nicht im Kmpfen ausgebildet, es liegt also an Euch, das Unkrautproblem der Lebensbindern zu lsen.', '', '', '', '', '', '', 47187),
(66136, 'deDE', 'Elementarextrakt', 'Sammelt $1a wssrige Essenzen in den Grten.', 'Vor ein paar Tagen hat ein riesiger Feuerelementar den See verwstet. Ich glaube, dass er hinter all diesem Chaos steckt, aber er ist zu gro, als dass wir ihn bekmpfen knnten. Irgendwie mssen wir ihn zuerst schwchen.\n\nSchreibt den alten Gryrmpech aber noch nicht zu frh ab, denn ich habe einen Plan!\n\nWasserelementare haben beschlossen, es sich im Pavillon des blauen Drachenschwarms gemtlich zu machen. Wenn Ihr gengend Essenz von ihnen sammelt, knnten wir sie gegen den Feuerelementar einsetzen.\n\nMan soll Feuer mit Feuer bekmpfen! Oder in diesem Fall eben mit Wasser, schtze ich.\n\nJedenfalls solltet Ihr Euch jetzt auf den Weg machen.', '', '', '', '', '', '', 47187),
(66135, 'deDE', 'Lehrling des Grtners', 'Sucht nach Frst Blattington in der Gartenhtte, indem Ihr Mllhaufen beseitigt.', 'Blattington! Frst Blattington, wo bist du?\n\nMein Vorstandsassistent und Lehrling Frst Blattington ist verschwunden! Er liebt das Erkunden, aber er ist noch schlechter als ich, wenn es darum geht, sich zu verteidigen. Ich bin ein Grtner, kein Krieger!\n\nKnntet Ihr diesen Faulenzer bitte fr mich finden? Ich brauche ihn hier, damit ich nachdenken kann. Er hlt sich normalerweise im Schuppen auf und whlt sich durch Mllhaufen.\n\nAber seid vorsichtig, er kann manchmal leicht reizbar sein.', '', '', '', '', '', '', 47187),
(66134, 'deDE', 'Schdlingsbekmpfung in Azeroth', 'Ttet $1oa aufgebrachte Setzlinge in den Grten.', 'Ihr da! Schlpfling!\n\nGeht mir zur Hand, ja? Diese Schotlinge zerfetzen meine ganzen Pflanzen!\n\nAlle mglichen Elementare sind in die Grten eingedrungen und sie scheinen... die Tiere zu beeinflussen. Als ob ihre Energie die Schotlinge verrckt machen wrde! Verrckter als sonst!\n\nIch habe mit diesen drei schon alle Hnde voll zu tun. Bitte! Helft mir, bevor sie all meine Blumenbeete verwsten.', '', '', '', '', '', '', 47187),
(66133, 'deDE', 'Schlssel der Loyalitt', 'Sammelt $1oa groe Obsidianschlssel.', '', '', '', '', '', '', 'Liefert den zusammengesetzten Schlssel in der Obsidianzitadelle ab.', 47187),
(66131, 'deDE', 'Offenbarung unserer Vergangenheit', 'Findet $1oa zusammengesetzten Schlssel.', 'Bringt mir einen zusammengesetzten Schlssel.', '', '', '', '', '', 'Liefert den zusammengesetzten Schlssel bei einer beliebigen Fraktion innerhalb der Schwarzdrachenzitadelle ab.', 47187),
