(66126, 'deDE', 'Offenbarung unserer Vergangenheit', 'Findet $1oa zusammengesetzten Schlssel.', 'Bringt mir einen zusammengesetzten Schlssel.', '', '', '', '', '', 'Liefert den zusammengesetzten Schlssel bei einer beliebigen Fraktion innerhalb der Obsidianzitadelle ab.', 47187),
(66124, 'deDE', 'Triumphaler Abgang', 'Entkommt mit Majordomus Selistra aus der Blitzfrostenklave.', 'Soweit ich sehen konnte, hat die Knigin sich in die Wilde Brutsttte zurckgezogen. Sie dient als Auenposten, um die Protodrachen in der Gegend zu berwachen... Ich hoffe nur, dass ihre Verteidigung ausreicht.\n\nWir mssen sofort dorthin!', '', '', '', '', '', '', 47187),
(66123, 'deDE', 'Ab mit dem Kopf', 'Besiegt Jadzigeth in der Blitzfrostenklave.', 'Jadzigeth, einer von Raszageths niedertrchtigen Leutnants, fhrt die Primalisten hier an.\n\nZeigen wir ihnen, was passiert, wenn sie sich gegen uns stellen.', '', 'Raszageths Leutnant wird so lange rger machen, bis jemand sie stoppt.', 'Jadzigeth', '', '', '', 47187),
(66122, 'deDE', 'Protokampf', 'Besiegt $2oa Protodrachen in der Blitzfrostenklave.', 'Diese Protodrachen verabscheuen uns. Sie glauben, wir sind eine verdorbene Drachenart, die von den Titanen manipuliert und geknechtet wird. Sie verstehen es nicht.\n\nDarum fhlen sie sich sogar noch sicher, whrend sie ihre Streitkrfte an unsere Mauern branden lassen.\n\nDoch sie irren sich.\n\nNehmt diesen Speer, $p. Ttet unsere Feinde.', '', '', '', '', '', 'Trefft Euch mit Majordomus Selistra bei der Blitzfrostenklave.', 47187),
(66121, 'deDE', 'Eivakuierung', 'Rettet 4 Eier aus der Blitzfrostenklave.', 'Die Primalisten haben unsere Eier fr deren verdorbene Rituale gestohlen! Sie mssen aufgehalten werden.\n\nHelft uns, die Eier zu retten, bevor es zu spt ist. Markiert jedes Ei, das Ihr findet, $p. Ich werde dafr sorgen, dass sie sicher aus dem Gebiet geborgen werden.', '', '', '', '', '', 'Trefft Euch mit Majordomus Selistra bei der Blitzfrostenklave.', 47187),
(66119, 'deDE', 'Rubinlebensbecken: Invasion der Primalisten', 'Betretet die Rubinlebensbecken und haltet den Angriff der Primalisten auf.', 'Die Primalisten haben sich einen Weg in unser Zuhause gebahnt. Wir waren auf einen so intensiven Angriff nicht vorbereitet... Mehrere von ihnen konnten durchbrechen.\n\nEiner unserer Drakoniden ist ebenfalls durch, um ihnen zu folgen, doch er hat sich noch nicht zurckgemeldet. Ich frchte das Schlimmste.\n\nIch stehe Wache. Solange ich lebe, wird kein weiterer von ihnen unsere Mauern durchbrechen, doch Ihr msst Euch um die kmmern, die es hineingeschafft haben.\n\nLos!', '', '', '', '', '', '', 47187),
(66118, 'deDE', 'Basaltangriff', 'Zerstrt $1oa zornige Klippen beim Blitzfrostangriff.', 'Raszageth und ihre Primalisten haben gigantische Erdelementare herbeigerufen, um unsere Mauern zu durchbrechen. Sie mssen aufgehalten werden!', '', '', '', '', '', '', 47187),
(66117, 'deDE', 'Subert das Schlachtfeld', '', '', '', '', '', '', '', '', 47187),
(66116, 'deDE', 'Die grte Bedrohung', 'Findet Kommandant Lethanak beim Blitzfrostangriff.', 'Wir haben einfach zu viele verwundbare Eier, die wir schtzen mssen. Wenn der Feind durchbricht, ist alles verloren!\n\nIch bin sicher, unsere Wachen marschieren auf dem Feld auf, um den Gegner zurckzudrngen. Sprecht mit Kommandant Lethanak. Er wird Eure Strke dort einsetzen, wo sie am dringendsten gebraucht wird.', '', '', '', '', '', '', 47187),
(66115, 'deDE', 'Das Mandat der Roten', 'Sprecht mit den Pflegern beim Rubinlebensschrein.', 'Hingabe und Mitgefhl sind unsere Berufung. Wir helfen den anderen Schwrmen nicht nur ihretwegen, sondern zum Wohle der gesamten Drachenheit.\n\nVielleicht versteht Ihr uns besser, wenn Ihr mit der Drachenbrut hier beim Rubinlebensschrein sprecht.', '', '', '', '', '', '', 47187),
(66114, 'deDE', 'Fr die Knigin', 'Reitet mit Majordomus Selistra zum Rubinlebensschrein.', 'Wir beschtzen unsere kostbaren Eier, um die Zukunft aller Drachenschwrme zu sichern. Mit ihrem Handeln werden uns die Primalisten nicht nur seelische Pein zufgen.\n\nSie bedrohen unsere Existenz.\n\nIch muss die Knigin sofort darber informieren.', '', '', '', '', '', '', 47187),
(66113, 'deDE', 'Eine unscheinbare Fuhre', 'Repariert den ausgeliehenen Wagen.', '[DNT] Our foes watch the skies. I will risk no harm to the future of my flight, so we must travel by less traditional mean.\n\nI ordered a more... down to earth means of transport be acquired, but it seems to have suffered some damage during the exchange. You are undoubtedly more familiar with such things than I, $r, so your assistance in repairing the wagon would be most appreciated.', '', '', '', '', '', '', 47187),
(66112, 'deDE', 'Immer zur Hand', 'Sammelt einen urzeitlichen irdenen Kern und einen urzeitlichen geschmolzenen Kern.', 'Habt Ihr je so machtvolle Elementare gesehen?!\n\n<Grun grt.>\n\nHab die Wachen grummeln gehrt, weil sie die ganze Zeit gegen sie kmpfen mssen, aber sie sehen nicht das groe Ganze... grere Elementare heit grere Handwerksmaterialien!\n\nWhrend Ihr drauen seid, um fr unsere Sicherheit Elementare zu beseitigen oder was auch immer ihr macht, nehmt ein paar Stcke der grten mit, dann kann ich mal versuchen, ob ich da was draus machen kann!', '', '', '', '', '', '', 47187),
(66111, 'deDE', 'Eindringende Elementare', 'Ttet $1oa Urelementare in der Botschaft von Schwingenrast.', 'Die Handwerker und Forscher der Drachenschuppenexpedition sind ungeeignet fr die Hrte der Schlacht.\n\nAber wir beide nicht, $p.\n\nLasst uns hier auf den Dracheninseln diese Strke nutzen, um jene zu schtzen, die sich nicht selbst schtzen knnen.\n\nBeseitigt die Elementare, die vom Norden eindringen, sodass die Expedition sich auf ihre hheren Ziele konzentrieren kann.', '', '', '', '', '', '', 47187),
(66110, 'deDE', 'Dem Frieden eine Chance', 'Stellt Euch den Vertretern der Allianz vor.', 'Aka\'Magosh, $p.\n\nDiese Expedition steht unter dem Schutz der Horde wie der Allianz. Unsere Anweisungen sind klar: die Mitglieder der Drachenschuppenexpedition untersttzen, ganz gleich, wem sie sonst die Treue geschworen haben.\n\nDie Vertreter der Allianz, Kapitnin Garrick und ihr Sohn Henry, stehen auf der anderen Seite des Lagers Wache.\n\nIch habe mit Kapitnin Garrick gegen die Geiel gekmpft. Sie ist eine ehrbare Streiterin und wird der Expedition sehr dienlich sein.\n\nBietet ihr Eure Untersttzung an. Beweist ihr, dass die Horde ihre Vereinbarungen ehrt.', '', '', '', '', '', 'Sprecht mit Kapitnin Garrick in der Botschaft von Schwingenrast.', 47187),
(66108, 'deDE', 'Lsung mit dem Vorschlaghammer', 'Ttet Sogglmoggl, den Knig der Triefschlnde, und Wirblgirgl, den Knig der Windflossen.', 'Nun, ich bin froh, dass Tharu meine Sichtweise jetzt nachvollziehen kann. Und ich bin dankbar, dass Ihr Lebewesen retten konntet, whrend ich hier herumgetrdelt habe.\n\nDie Situation ist ernster als gedacht. Er hatte recht, dass wir sofort handeln mssen. Nach allem, was ich bisher in Erfahrung bringen konnte, wird dieses elementare Bombardement nicht aufhren, bis wir uns um die Gorlocs gekmmert haben.\n\nAn Tharus Stelle und praktisch gedacht wrde ich mich direkt ihren Anfhrern zuwenden. Wenn sie niemanden mehr haben, um den sie sich versammeln knnen, sollten sie sich verziehen und das Sumpfland nicht mehr bedrohen.', '', '', '', '', '', '', 47187),
(66107, 'deDE', 'Wildtierrettung', 'Rettet die Lebewesen des Rastlosen Sumpflands.', 'Man muss kein kologe sein, um zu erkennen, dass das Sumpfland in echten Schwierigkeiten steckt.\n\nAber Iskha lsst uns hier in aller Ruhe tote Kreaturen untersuchen, whrend wir lieber verhindern sollten, dass sie berhaupt sterben! Der rote Drachenschwarm ist schlielich dafr da, das Leben zu schtzen, nicht zu zerteilen!\n\nIch liebe Iskha, und er hat wirklich Ahnung, aber wenn wir warten, bis er fertig ist, gibt es kein Sumpfland mehr, das wir noch retten knnten.\n\nIch kmmere mich um seine ewige Nachdenkerei. Geht Ihr inzwischen raus, macht Euch Eure Stiefel schmutzig und rettet einige Lebewesen.', '', '', '', '', '', '', 47187),
(66106, 'deDE', 'Muscheln kuscheln', 'Sammelt $1oa wassererfllte Muscheln und $1oa winderfllte Muscheln von Triefschlund- und Windflossengorlocs.', 'Ich war ein Narr, Iskha nicht zu glauben, als er darauf beharrte, dass mehr dahintersteckte. Er wre nicht mein Freund, wenn er mir nicht immer zwei Schritte voraus wre.\n\nAber wir knnen es ihm gegenber wiedergutmachen, indem wir etwas unternehmen. Wenn tatschlich Muscheln fr dieses elementare Chaos verantwortlich sind, geht doch in ihr Lager und entreit die Muscheln ihren glitschigen Hnden.\n\nBringt haufenweise Wind- und Wassermuscheln her, damit Iskha genug hat, um nach Herzenslust zu forschen.', '', '', '', '', '', '', 47187),
(66105, 'deDE', 'Lsung mit dem Skalpell', 'Ttet $1oa |4Tobendes:Tobende; Wasser und $1oa |4Tobenden Wind:Tobende Winde;.', 'Ich glaube, wir knnen von hier aus sicher genug Daten sammeln, aber...\n\nTharu ist ein herausragender kologe und er ist ein Mann der Tat. Dennoch ist das kosystem fragil, und wir knnten es beschdigen, wenn wir nicht vorsichtig sind. Ich gebe allerdings zu, dass wir nicht mehr viel Zeit haben.\n\nEs knnte sich vielleicht lohnen, ihn etwas zu verwhnen.\n\nDie wtenden Elementare zu erledigen, sollte uns etwas Zeit verschaffen, ohne dass es unsere Forschung behindert. Aber achtet darauf, sie in gleichen Zahlen zu erledigen... Wir wollen das Gleichgewicht ja nicht noch weiter stren.', '', '', '', '', '', '', 47187),
(66104, 'deDE', 'Forensische kologie', 'Seziert die Gorlocleichen.', 'Ich wei nicht mehr weiter, $n. Tharu und ich haben uns durch fast alle Leichen gewhlt, nur um am Ende zu stolpern, weil wir uns nicht auf einen Ansatz einigen knnen. Wenn er mir blo zuhren wrde!\n\n<kologe Iskha seufzt.>\n\nDer Stress durch die Situation setzt uns beiden zu. Ich habe bislang nicht einmal eine belastbare Hypothese.\n\nIhr seht aus, als wrde Euch so schnell nichts auf den Magen schlagen. Knntet Ihr vielleicht die letzten beiden Gorlocs bernehmen? Ihr knnt Euch mein Skalpell borgen.', '', '', '', '', '', '', 47187),
(66103, 'deDE', 'Bemht, jeden Wunsch zu erfllen', 'Stellt das Knnen von $1oa Schwarzkrallenassassinen und -rchern am Obsidianbollwerk auf die Probe.', 'Wir mssen mehr Truppen aussenden, um die Obsidianzitadelle zu verteidigen. Jetzt, da wir Fu gefasst haben, ist es wichtig, die Versorgung an frischen Rekruten nicht abreien zu lassen.\n\nWir verfgen ber zustzliche Reservetruppen am Obsidianbollwerk. Die knnten uns den Rcken strken.\n\nIm Prinzip sind sie gut ausgebildet, aber sie knnten davon profitieren, wenn jemand mit Eurer Erfahrung und Eurem Talent ihre Kampfknste auf die Probe stellen wrde. So stellen wir fest, ob sie wirklich bereit sind.', '', '', '', '', '', 'Trefft Euch mit Fao dem Unerbittlichen beim Obsidianbollwerk.', 47187),
(66101, 'deDE', 'Vom Himmel hoch', 'Nutzt die Scheibe des Feldmessers, um in den Himmel zu springen und die Umgebung auszusphen.', 'Toddy und Naleidea haben einen sofortigen Untersuchungsbericht ber die Umgebung angefordert.\n\nZum Glck habe ich ein verzaubertes Teleskop und eine Feldmesserscheibe, die uns helfen werden, nahegelegene Gebiete aus der Sicherheit der Wolken heraus auszusphen.\n\nLeider habe ich tdliche Hhenangst und kann mich nicht berwinden, das Gert zu betreten.\n\nIhr habt keine Hhenangst, oder?', '', '', '', '', '', '', 47187),
(66100, 'deDE', 'Gewichtiger Nachschub', 'Sammelt $1oa Scke an Vorrten der Wegbehterin.', 'Diesmal hab ich es echt vermasselt. Ich wollte mir nur kurz die Beine vertreten und kam gerade noch rechtzeitig zum Lager zurck, um mitanzusehen, wie sich die Tarasek alles unter den Nagel rissen, was nicht festgetackert war.\n\nDiese Vorrte waren teuer und ich kann nicht einfach um Hilfe bitten, um neue zu besorgen! Meine Schwester Nori hlt mich jetzt schon fr eine Versagerin.\n\nWenn Ihr sowieso das Tal passiert, knntet Ihr vielleicht die Augen nach verlorenen Scken mit Vorrten offenhalten?', '', '', '', '', '', '', 47187),
(66087, 'deDE', 'Sperrstunde', 'Untersttzt die Zeitwanderer und vernichtet zeitverlorene Gegner, strkt bronzene Verbndete, holt verlorene Artefakte zurck und schliet Zeitrisse in den Wandernden Sanden.', 'Diese Vorste strapazieren diese Zeitlinie, bis sie zerbricht. Wenn wir nur die Reihe unserer Zeitwanderer vollstndig wre!\n\nObwohl Ihr neu am Stab seid, sagt man mir, dass Ihr uns sehr geholfen habt. Mit zustzlichem Ansporn knntet Ihr unserer Sache vielleicht noch mehr helfen.\n\nNormalerweise wrde ich Euch grndlich ausbilden, aber es sind... ungewhnliche Zeiten. Nehmt diese Rolle des fortgeschrittenen Wissens und nutzt sie, um die Eindringlinge zurckzudrngen! Aber beeilt Euch, die Effekte sind vorbergehender Natur.', '', '', '', '', '', '', 47187),
(66085, 'deDE', 'Knnten wir die Zeit zurckdrehen', 'Schliet die Zeitrisse mit Siaszerathel in den Wandernden Sanden.', 'Ein anstndiger Zeitwanderer lsst keine Krise halb geklrt. Warum warten und lernen, wenn wir die Werkzeuge, die wir brauchen, bereits besitzen?\n\nDa Ihr nach wie vor meinen Stab habt, habe ich mir Ersatz besorgt. Den vermisst bestimmt niemand. Mein Plan lautet wie folgt: Wir schlieen uns bei diesen Rissen zusammen und retten gemeinsam den Tag! Alle Tage, genaugenommen. Entschuldigung, dieser Zeitkram ist noch verwirrend fr mich.\n\nWas sagt Ihr? Das sollte doch leicht genug sein, nicht wahr?', '', '', '', '', '', '', 47187),
(66084, 'deDE', 'Zeiten wie diese', 'Sammelt $1oa Temporalrckstnde von zeitverlorenen Gegnern in den Wandernden Sanden.', 'Trotz des kleinen Malheurs bei der Ausbildung glaube ich, dass Ihr bereit seid, um uns hier zu helfen.\n\nDie Verzerrungen im Tal erlauben verschiedenen Zeitperioden, in unsere berzuflieen. Uns ist noch ein Rtsel, warum diese Zeitlinien miteinander verbunden sind, und das ist beunruhigend. Wir brauchen mehr Informationen.\n\nBitte seht, ob Ihr etwas ber die Kreaturen Erfahrung bringen knnt, die aus den verschiedenen Zeitlinien hierherkommen. Sicherlich hinterlassen sie bei der Passage irgendwelche Rckstnde. Wenn wir sie untersuchen, finden wir hoffentlich einen Weg, diese Krise zu meistern.', '', '', '', '', '', '', 47187),
(66083, 'deDE', 'Fhlt sich an, wie beim ersten Mal', 'Sprecht mit Andantenormu und nehmt an der Zeitwandererausbildung teil.', 'Die Zeitwege zu behten, ist eine gefhrliche Aufgabe.\n\nAuch wenn Ihr $gkein Zeitwanderer:keine Zeitwanderin; seid, glaubt Botschafterin Chronormu, dass Ihr eine groe Hilfe sein werdet. Aber damit Eure Sicherheit gewhrleistet ist, mssen wir Euch ordentlich ausbilden.\n\nLeider sind unsere Ausbilder immer noch vermisst. Ich werde mein Bestes geben. Schauen wir mal, wie wir uns anstellen. Ich wei, dass die Botschafterin sich auf uns beide verlsst.', '', '', '', '', '', '', 47187),
(66082, 'deDE', 'Zeit in der Flasche', 'Sammelt Zeitenergie von erlegten zeitgeladenen Wildtieren im Wallenden Wald von Thaldraszus.', 'Toll! Der Zeitwandererstab ist intakt! Aber er ist leer.\n\nIch wei! Ihr knnt ihn mit der Temporalenergie wieder aufladen, die sich hier in der Natur ansammelt. Das bedeutet leider auch, dass Ihr die betroffenen Waldlebewesen besiegen msst. Die Energien machen sie gefhrlich und instabil und wir htten die Population ohnehin dezimieren mssen...\n\nManchmal muss man fr das grere Wohl Opfer bringen. Knnt Ihr helfen? Ich brauche noch einen Augenblick.', '', '', '', '', '', '', 47187),
(66081, 'deDE', 'Die Zeit luft ab', 'Sammelt $1oa Temporalsammler im Wallenden Wald von Thaldraszus.', 'Wegen des Angriffs auf den Bronzetempel luft berall Temporalenergie aus.\n\nDie Zeitwanderer haben berall im Wald Sammelgefe aufgestellt, um die Magie aufzufangen. Alles, was gesammelt wird, kann als zustzliche Macht verwendet werden! Das ist gut, denn diese Krise frisst Ressourcen.\n\nIch sollte die Gefe einsammeln, aber ich muss erst noch Luft schnappen.\n\nKnntet Ihr sie fr mich holen?', '', '', '', '', '', '', 47187),
(66080, 'deDE', 'Zeitprobleme', 'Findet die vermisste Rekrutin im Wallenden Wald in Thaldraszus.', 'Hallo, $C. Ihr kommt genau zur rechten Zeit!\n\nAm Tempel geht etwas vor sich und sorgt dafr, dass sich die Zeitwege destabilisieren und ins Tal berlaufen. Nicht nur das, wir vermissen auch einige Zeitwanderer!\n\nDeshalb haben wir zustzliche Hilfe angefordert, doch eines unserer neusten Mitglieder ist noch nicht angekommen.\n\nKnntet Ihr sie suchen gehen? Da sich die Zeit im Bereich um das Tal herum im Wandel befindet, wissen wir nicht, welche Gefahren dort lauern!', '', '', '', '', '', '', 47187),
(66079, 'deDE', 'Furorion wartet', 'Trefft Euch mit Furorion am Obsidianbollwerk.', 'Diese Eier reprsentieren eine neue Generation der Drachenheit. Sie mssen beschtzt und gehegt werden. Und doch... ist mein Herz voller Schmerz und ich sorge mich um Furorion. Ich frchte, seine sture Entschlossenheit macht ihn geradezu tollkhn.\n\nIm Laufe der Jahre habe ich Eure treue Freundschaft zu schtzen gelernt, $n. Vielleicht knnt Ihr an meiner statt gehen und ihm helfen.\n\nIhr findet ihn am Obsidianbollwerk. Und bitte, gebt auf ihn acht. Von seinem Schwarm sind nur noch so wenige brig.', '', '', '', '', '', 'Trefft Euch mit Furorion beim Obsidianbollwerk.', 47187),
(66078, 'deDE', 'Scharfes Training', 'Stellt das Knnen von $1oa Schwarzkrallenassassinen und -rchern auf die Probe.', 'Ich habe die Schwarzkrallen seit Jahren gehegt, ausgebildet und ermutigt, nach den gleichen Hhen zu streben, die Ihr erreicht habt.\n\nSie mgen nicht die gleichen hehren Ziele erreicht haben wie Ihr, doch sie zeichnen sich auf ihre Weise aus. Sie machen mich stolz.\n\nEs wre uns allen eine Ehre, wenn Ihr ihr Knnen auf die Probe stelltet. Ich glaube, Ihr werdet in ihnen ein Stck von Euch selbst wiedererkennen.', '', '', '', '', '', '', 47187),
(66076, 'deDE', 'Uralter Flunker', '', '', '', '', '', '', '', '', 47187),
(66074, 'deDE', 'Urscythidenknigin', '', '', '', '', '', '', '', '', 47187),
(66071, 'deDE', 'Fliegende Rocs', 'Untersttzt $1oa verletzte Blaufederrocs.', 'Mein Name ist Professorin Harleen Hohnzirper, berhmte Ornithologin der Extraklasse! Ich bin hergekommen, um die mythischen Blaufederrocs der Dracheninseln zu studieren, aber ich schtze, wir haben jetzt grere Hhnchen zu rupfen.\n\nIch nehme mal an, dass diese Harpyien aus Kalimdor kamen, als die Inseln sich ffneten. Sie sind hoch invasiv und veranstalten ein Festmahl, wie man es sonst nur bei Ogern am Buffet des Bilgewasserkasinos sieht.\n\nGeben wir den einheimischen Rocs hier die Chance, sich zu wehren. Nehmt dieses Medizinset und verwendet es, um die Verletzten wieder auf die Beine zu bringen.', '', '', '', '', '', '', 47187),
(66057, 'deDE', 'Wiederherstellen der Zuversicht', 'Repariert den Obsidianschwurstein.', 'Die zerbrochenen Fragmente wurden wieder zusammengefgt. Wir sind bereit, den Schwurstein zu reparieren.\n\nNun geht und helft Furorion, die Reparatur fertigzustellen.', '', '', '', '', '', 'Trefft Furorion am Obsidianthron', 47187),
(66056, 'deDE', 'Eine neue Zukunft schmieden', 'Bereitet die Schmiede des Erdwchters vor.', 'Die Schmiede des Erdwchters ist die mchtigste aller Drachenschmieden. Unsere Vorfahren schmiedeten darin die strksten Waffen und Rstungen, um Azeroth zu verteidigen.\n\nDas Feuer der Schmiede weist die ntige Kraft auf, um die zerbrochenen Fragmente des Schwursteins neu zusammenzufgen.\n\nLasst uns gehen und die Schmiede fr die bevorstehende Arbeit vorbereiten.', '', '', '', '', '', 'Bringt die Aschenscherbenkohle zu Schmiedemeister Bazentus.', 47187),
(66055, 'deDE', 'Eine zerrttete Vergangenheit', 'Findet $2oa Schwursteinfragmente.', 'Der Schwurstein ist beschdigt, es fehlen Teile.\n\nTut, was Ihr knnt, um die Fragmente zu beschaffen! Vielleicht kann man den Stein irgendwie reparieren!', '', '', '', '', '', '', 47187),
(66049, 'deDE', 'Obsidianschwurstein', 'Findet den Obsidianschwurstein.', 'Als Neltharion zum Erdwchter wurde, leistete er einen Schwur, die Welt zu behten, $n. Dass er die tiefsten Orte der Erde schtzen und mit seinem Schwarm als Azeroths Verteidiger dienen wrde. Der Obsidianschwurstein reprsentiert dieses Versprechen.\n\nWir mssen den Stein aktivieren und die Dracheninseln wissen lassen, dass der schwarze Drachenschwarm zurckgekehrt ist!\n\nFolgt mir, $n.', '', '', '', '', '', '', 47187),
(66048, 'deDE', 'Beste Plne und Absichten', 'Besprecht die Plne mit verschiedenen Mitgliedern von Furorions Streitkrften.', 'Die Djaradin anzugreifen, die die Obsidianzitadelle kontrollieren, wird keine leichte Aufgabe. Selbst mit Furorion und seinen Schwarzkrallenstreitkrften mssen wir uns auf einen harten Kampf gefasst machen. Furorion mag sich seiner Sache sicher sein, aber... ich bin nicht so siegesgewiss.\n\nVielleicht knnen wir mit den Assistenten sprechen, die bei der Strategieplanung helfen, um Verbesserungen vorzuschlagen.', '', '', '', '', '', 'Berichtet Furorion am Obsidianbollwerk von Euren Entdeckungen.', 47187),
(66044, 'deDE', 'Erstrmung der Mauern', 'Schaltet die drei Belagerungsarmbrste und den Champion Choruk aus.', 'Sabellian und die anderen Drachen halten die Djaradin frs Erste zurck. Wir mssen schnell sein und die hohen Trme sichern, um unseren Sieg sicherzustellen.\n\nWir beide schalten die Belagerungsarmbrste aus, die uns von oben bedrohen.\n\nLasst mich wissen, sobald Ihr bereit seid.', '', '', '', '', '', 'Trefft Euch mit Furorion.', 47187),
(66040, 'deDE', 'Zurck in die Zukunft', 'Verteidigt Eure Verbndeten gegen das Schwarze Imperium, bis das Temporalportal errichtet wurde.', 'Wir werden nicht mehr durch die Zeiten fallen, aber wir sind weit in die Vergangenheit gereist. Seeehr weit. \"Die-Titanen-waren-noch-nicht-auf-Azeroth\"-weit. Wieder nach Hause zu kommen, wird... keine leichte Aufgabe.\n\nAber wir Drachen knnen es schaffen!\n\nHaltet Ihr uns bitte diese Schergen des Schwarzen Imperiums vom Leib. Es sollte nicht allzu lang dauern!\n\nSchtze ich.\n\nVermutlich.\n\nMacht Euch keine Gedanken! Haltet einfach nur diese grsslichen Biester fern und wir kmmern uns um den Rest! Ganz einfach!', '', '', '', '', '', '', 47187),
(66039, 'deDE', 'Chromiezeit', 'Findet Chromie und schliet das Temporalstabilisierungsritual ab.', 'Das... das ist das Schwarze Imperium. Wir sind tatschlich sehr weit in die Vergangenheit gereist.\n\nSeht! Dort sind Botschafterin Chronormu und Eternus! Wir mssen uns beeilen und das Ritual zu Ende bringen.\n\nSelbst meine Neugier ist nicht gro genug, als dass ich herausfinden wollte, wo sie beim nchsten Mal landen.', '', '', '', '', '', '', 47187),
(66038, 'deDE', 'Rennt durch die Zeit!', 'Rast durch die Zeit und folgt dem Pfad von Chromie und Eternus.', '$n, wir mssen rasch handeln, um Botschafterin Chronormu einzuholen, und das meine ich ganz wrtlich.\n\nZera und ich tun, was wir knnen, damit wir schneller Fortschritte machen. Wir mssen jedoch so gut es geht vermeiden, uns zu sehr in dieser Zeitperiode zu verfangen. Andernfalls werden wir noch langsamer und erwischen die Botschafterin womglich nicht, bevor sie an Nozdormus Magie verloren ist.\n\nWir haben keine Sekunde zu verschwenden!\n\n|cFF0000FF(Wenn Ihr diese Quest akzeptiert, beginnt ein Timer.)|r', '', '', '', '', '', '', 47187),
(66037, 'deDE', 'Zurck in die Realitt', 'Kehrt zu Nozdormu in die Gegenwart zurck.', 'Wir konnten Botschafterin Chronormus Verbindung zu unserer Zeit verstrken. Ich bin mir sicher, wenn wir sie wiederfinden, knnen wir das Ritual beenden.\n\nLasst uns frs Erste wieder in unsere Gegenwart zurckkehren, in eine Welt mit... deutlich weniger Murlocs.', '', '', '', '', '', '', 47187),
(66036, 'deDE', 'Mugurlglrlgl!', 'Murglgulglrrlglgul!', 'Mrglgulglrrlglgul! Grurguglullgurl!\n\nGruglrlgllrugl rrgulgrulgrgl grugll gurgull gur. Murgllgllrugl gurgllglrl Murgul gruggullgl. Murguglegurgllgur gurgll gurgulgul guruulgurllgr guuglrllgl.\n\nMgrgulllglll gurl gugll.\n\n<Ihr seid Euch nicht sicher, was genau er Euch sagen will, aber er gestikuliert wild, als wrde er auf jemanden oder etwas einstechen. Dieser Murloc will wohl, dass Ihr etwas ttet.>', '', '', '', '', '', '', 47187),
(66035, 'deDE', 'Murlocpartikel', 'Laugt $1oa Temporalpartikel aus.', 'Eine alternative Zeitlinie, die aus Murlocs entsprungen ist?!\n\nVerzeiht meine egoistische Bitte, aber wrdet Ihr einige Partikel Temporalenergie einsammeln, whrend Ihr nach Botschafterin Chronormu sucht?\n\nLauft einfach in die Partikel hinein und Euer Stab sollte den Rest erledigen. Ich werde die Daten spter analysieren... wenn wir nicht gerade auf Reisen durch die Risse in Azeroths verschiedenen Realitten sind.', '', '', '', '', '', '', 47187),
(66033, 'deDE', 'In die... Vergangenheit?', 'Nehmt das Portal und trefft Euch mit Andantenormu in Azmerloth.', 'Es ist bedauerlich, dass wir Chronormu nicht stabilisieren konnten. Aber es gibt einen weiteren Ort, an dem wir sie eventuell erwischen und ihren Sturz durch die Zeit stoppen knnen.\n\n<Nozdormu runzelt die Stirn.>\n\nDie Einblicke in die Vergangenheit dieser Zeitlinie sind... seltsam. Selbst verglichen mit einigen der Visionen, die ich im Laufe meines Lebens beobachtet habe.\n\nSeid vorsichtig, $n. Ich bin nicht sicher, was Euch erwartet, aber es ist mchtig und es... kommt mir irgendwie bekannt vor.', '', '', '', '', '', 'Nehmt das Portal und trefft Euch mit Andantenormu in Azmerloth.', 47187),
(66032, 'deDE', 'Rckkehr in die Gegenwart', 'Kehrt zu Nozdormu in die Gegenwart zurck.', 'Diese Zeitlinie ist dster und chaotisch. Die Strung hier war schwerwiegend. Ich werde eine Weile in dieser Zeitlinie bleiben und mich um die verbleibenden Wellen kmmern, die erscheinen knnten.\n\nKehrt zu Nozdormu zurck. Er wird von Eurem Erfolg erfahren wollen, auch wenn er weniger umfassend war, als wir es uns gewnscht hatten.', '', '', '', '', '', '', 47187),
(66031, 'deDE', 'Zeit verschaffen', 'Sammelt Elementaressenz fr das berlebendenlager.', 'Ich schtze, es sollte mich nicht berraschen, hier zu sein.\n\nDas ist nicht das Azeroth, das ich wollte, aber es ist das, was ich bekommen habe. Wir kmpfen dafr, das zu erhalten, was noch brig ist, und dafr, unsere Welt zurckzubekommen... Aber Eure Ankunft hat fr etwas rger gesorgt.\n\nWir nutzen die Essenz dieser Elementare da drauen fr unseren Schutz. Seht Ihr diesen Schild? Das ist das Einzige, das uns davor bewahrt, entdeckt und vernichtet zu werden, und Ihr habt uns unserer Ressourcen beraubt. Bringt uns etwas von dieser Essenz zurck, dann berleben wir womglich einen weiteren Tag.', '', '', '', '', '', '', 47187),
(66030, 'deDE', 'Widerstand ist nicht zwecklos', 'Heilt Widerstandskmpfer in der Zukunft der Primalisten.', 'Die temporalen Wellen haben den Leuten hier Probleme bereitet. Feinde tauchen auf, wo sie zuvor nicht waren, oder sind viel mchtiger, als sie sein sollten. Diese Vernderungen sind recht klein, aber verheerend.\n\nIch bitte Euch, den Widerstandskmpfern hier zu helfen. Heilt ihre Wunden, damit sie weiterkmpfen knnen. Setzt ihre Zeitlinien auf die richtigen Pfade zurck, so als htten sie nie mit unserer interagiert. Es ist nicht viel, aber es ist alles, was wir fr sie tun knnen.', '', '', '', '', '', '', 47187),
(66029, 'deDE', 'Temporalabstimmung', 'Wendet den Chronokristall in der Zukunft der Primalisten auf Eternus und Chromie an, um zu verhindern, dass sie weiter durch die Zeit fallen.', 'Chronormu und Eternus fallen durch die Zeit, aber ich spre, dass sie hin und wieder anhalten. Diese kurzen Momente sind unsere Gelegenheit, sie zu finden.\n\n<Nozdormu beschwrt einen kleinen Chronokristall herbei.>\n\nIch habe diesen Kristall mit meiner Macht sowie meiner eigenen Zeitresonanz erfllt. Sie sind in eine... beunruhigende potenzielle Zukunft geraten. Findet sie und nutzt ihn. Hoffentlich knnt Ihr damit ihre temporale Position fixieren, bevor sie uns wieder entgleiten.', '', '', '', '', '', 'Kehrt zu Nozdormu in die Gegenwart zurck.', 47187),
(66028, 'deDE', 'In die Zukunft!', 'Reist in die Zukunft der Primalisten.', 'Ich habe Chronormus und Eternus\' Spur in eine potenzielle Zukunft verfolgt. Ich wei nicht, was Ihr dort finden werdet, nur, dass sie dunkel und chaotisch ist.\n\nSoridormi hat einige unserer Zeitwanderer vorweg in diese Zukunft gebracht, um unsere Verbindung zu dieser Zeit aufrechtzuerhalten. Ihre betrchtliche Macht wird bentigt, um das Portal offen zu halten, sie wird sich also auf Eure Hilfe verlassen mssen.\n\nSoridormi kann Euch weitere Anweisungen geben, wenn Ihr sie aufsucht.\n\nBeeilt Euch, $n. Findet Chronormu.', '', '', '', '', '', 'Sprecht mit Soridormi in der Zukunft der Primalisten.', 47187),
(66027, 'deDE', 'Ruf an die blauen Drachen', 'Seht zu, wie Kalecgos den blauen Drachenschwarm zusammenruft.', 'Ich kann mich nicht lnger davor frchten, die blauen Drachen zu vereinen, $n. Es ist besser fr uns, eine Familie zu sein, als... nur ein Schatten unseres einstigen Selbst.\n\nSelbst wenn ich den Schwurstein nicht wieder beanspruchen kann, werde ich seine Macht dennoch nutzen knnen, um eine Nachricht an alle blauen Drachen zu senden.\n\nEs ist Zeit, dass sie... von ihrem Aspekt zu hren bekommen.', '', '', '', '', '', '', 47187),
(66026, 'deDE', 'Schnelles Handeln ist geboten', 'Trefft Brena bei Brackenfell.', 'Der Grund fr diese Angriffe muss in den Brackenfellgnollen selbst zu finden sein.\n\nWir kmpfen seit Generationen gegen sie, aber normalerweise sind sie nicht mehr als lstige Fliegen.\n\nUns bleibt keine andere Wahl, als direkt zu handeln. Diese Fulnis wird sonst das Gleichgewicht im Azurblauen Gebirge zerstren, inklusive dessen, was Ihr sucht.\n\nTrefft uns auerhalb von Brackenfell. Wir werden jede Hilfe brauchen knnen, die wir bekommen.', '', '', '', '', '', '', 47187),
(66025, 'deDE', 'Bedrohung der Nokhud', 'Besprecht die nchsten Schritte.', 'Klan Nokhuds Armee nimmt Maruukai ein.\n\nLasst uns unsere nchsten Schritte in den Kammern des Khans besprechen. Wir mssen fr die Sicherheit der Maruuk sorgen.', '', '', '', '', '', '', 47187),
(66024, 'deDE', 'Den Rcken freihalten', 'Ttet Wache Bahir.', 'Die Nokhud sind vernarrt in die uralten Kriegsgeschichten unseres Volkes. Eigentlich sind sie schwache, herumalbernde Kinder. Und blitzartig haben sie ihre Verbindung zu Ohn\'ahra durchtrennt.\n\nNun! Wenn sie den Weg der Verderbnis einschlagen, um Krieg zu beginnen, so werden wir ihnen entgegenkommen.\n\nNatrlich behielt Bahir das Kommando, um seine Flucht zu decken. Ihr Blut wird schon bald den Boden trnken.', '', 'Bahir, dem Balakar diese Verantwortung anvertraut hat, musste lange auf diesen Moment warten.', 'Wache Bahir', '', '', 'Kehrt zur Khanam Matra Sarest zurck.', 47187),
(66023, 'deDE', 'Waffenstillstand gebrochen', 'Ttet $1oa Streitkrfte der Nokhud.', 'Balakar bringt Schande ber seinen Klan. Er fhrt sie in einen Sturm, geblendet durch seine Gier nach Macht.\n\nIhr Betrug enthllt ihre Schwche. Macht sie nieder.', '', '', '', '', '', '', 47187),
(66022, 'deDE', 'Die Khanam Matra', 'Berichtet Khanswache Akoto, um an Gemisaths Audienz mit der Khanam Matra teilzunehmen.', 'Ich kann nicht in den Gebieten der Zentauren bleiben, ich muss so schnell wie mglich in die Grten zurckkehren.\n\nDie Khanam Matra hat zugestimmt, unser Hilfegesuch anzuhren. Sie erwartet meine Ankunft oben auf dem Krutal, dem zentralen Gebude von Maruukai.\n\nAuch wenn ich zunchst mit ihr alleine sprechen muss, seid Ihr herzlich eingeladen, Euch uns anzuschlieen.', '', '', '', '', '', '', 47187),
(66021, 'deDE', 'Unwillkommener Fremdling', 'Besiegt $1oa Zentauren der Nokhud.', 'Hah! Seht Euch an. Schwach. So wie diese mickrigen Jger, die Euch hergebracht haben.\n\nIhr mchtet die Nokhud kennenlernen? Unsere Sprache ist der Kampf.\n\n\"Der Tabarr\", so nennt sich unser Kampfritual. Wir trainieren. Wir ben. Dadurch werden wir hart. Nun gibt es keine Schwche in unserem Klan.\n\nSchon zu viele Worte. Geht, bt.', '', '', '', '', '', 'Kehrt zu Spherin Tomul zurck.', 47187),
(66020, 'deDE', 'Omen und Rucherwerk', 'Sammelt $1oa Snuckelblten, mahlt sie zu Snuckelrucherwerk und helft dann Ohn Seshteng beim Ritual.', 'Ich erzhlte Tigari Khan vom Omen, das wir erhalten hatten, bevor wir Maruukai betraten. Sie uerte ihre Bedenken, da sich der Wind auch fr sie kalt anfhlte.\n\nWir kultivieren hier bestimmte Blumen. Wir nehmen ihre Blten und zerkleinern und verbrennen sie, um eine trancehnliche Wirkung zu erzeugen. So vertiefen wir unsere Verbindung zu den Omen.\n\nIch bitte Euch, solche Blumen zu sammeln, damit wir mit ihnen ein Rucherwerk machen knnen. Vielleicht erfahren wir mithilfe meiner Khan mehr ber Ohn\'ahras Not.', '', '', '', '', '', '', 47187),
(66019, 'deDE', 'Unsere Ahnen ehren', 'Helft Qariin Dotur dabei, ein Mahl fr die Ahnen vorzubereiten.', 'Unsere Ahnen schreiten an unserer Seite auf den Winden von Ohn\'ahra, sie fhren und beschtzen uns. Alle Maruuk, tote und lebendige, versammeln sich unter einem Waffenstillstand am Khural.\n\nDer Geruch dieses Mahls ruft unsere Vorfahren zu unserem Feuer. Wenn sie kommen, beginnt der Khural.', '', '', '', '', '', '', 47187),
(66018, 'deDE', 'Klan Nokhud', 'Begleitet Tomul zu Wache Bahir.', '<Whrend Sansok Khan in Gebrden spricht, formuliert Okir die Worte.>\n\nKlan Nokhud ist als neuester an die Macht gekommen. Ihr verstorbener Khan, Jhakan, hat eine mchtige Armee aufgestellt, um sich Gebiete von ihren Vorgngern anzueignen. Das ist der Brauch unseres Volkes.\n\nWhrend Jhakan sich Respekt verdient hat, trifft das nicht auf seinen Sohn zu. Balakar hat seinen Vater gettet und die Kontrolle ber den Klan ergriffen. Seitdem sind sie noch engstirniger geworden. Aber um die Maruuk zu verstehen, msst Ihr sie verstehen.', '', '', '', '', '', 'Trefft Spherin Tomul in der Nhe des Lagers der Nokhud.', 47187),
(66017, 'deDE', 'Klan Ohn\'ir', 'Trefft Ohn Seshteng bei den Mystikerbecken.', '<Whrend Sansok Khan in Gebrden spricht, formuliert Okir die Worte.>\n\nDie Mystiker unserer Lnder, so wie Ohn Seshteng, gehren zum Klan Ohn\'ir. Der Klan besteht nicht aus Familien, sondern eher aus Zentauren aus allen Teilen der Ebenen mit einer angeborenen Verbindung zu Ohn\'ahra. Sie verbringen ihr Leben damit, diese Verbindung zu pflegen und ihre Fhigkeiten zu perfektionieren. Letztendlich erhalten sie Anweisungen, um unterschiedliche Klans zu beraten und unsere Lnder zu beschtzen.\n\nOhn Seshteng ging, um mit ihrem Khan ber das Omen zu sprechen, das sie erhalten hat. Schliet Euch ihr an, um mehr ber die Ohn\'ir zu erfahren.', '', '', '', '', '', 'Trefft Ohn Seshteng bei den Mystikerbecken.', 47187),
(66016, 'deDE', 'Klan Teerai', 'Meldet Euch bei Qariin Dotur.', '<Whrend Sansok Khan in Gebrden spricht, formuliert Okir die Worte.>\n\nKlan Teerai ist der Klan unserer Khanam Matra, unsere direkte Verbindung zu den Vorfahren der Maruuk. Sie bewahren unsere Traditionen und erzhlen unsere Geschichten.\n\nUm die Maruuk zu verstehen, msst Ihr den Klan Teerai verstehen. Eine der Tchter der Khanam Matra, Qariin Dotur, bereitet ein Mahl fr unsere Ahnen vor. Helft ihr. Sie wird Euch ber unser Volk lehren.', '', '', '', '', '', 'Meldet Euch bei Qariin Dotur.', 47187),
(66015, 'deDE', 'Der Schwurstein der blauen Drachen', 'Begleitet Kalecgos, um den Schwurstein der blauen Drachen zu beanspruchen.', 'Das Azurblaue Gebirge hat sich frs Erste stabilisiert, und immer mehr blaue Drachen sind aufgetaucht... genau im rechten Moment.\n\nEs ist Zeit, in die Azurarchive zurckzukehren und den Schwurstein wieder zu beanspruchen.\n\nIch mchte, dass Ihr auch anwesend seid, $n. Ihr wart whrend dieser Tortur eine groe Bereicherung.', '', '', '', '', '', '', 47187),
(66011, 'deDE', 'In Gedenken an Ysera', 'Findet Theramus erneut.', 'Oh nein! Ich glaube, ich verstehe ihn jetzt. Theramus... er vermisst Ysera und sie kann nicht zurckkehren.\n\nKommt! Ich kann mir vorstellen, wohin er gegangen ist. Wir werden ihn nicht weiter belstigen, aber es wre gut, ihm zu sagen, dass es uns leidtut und dass wir ihm den Abstand geben, den er braucht.\n\nWir sind freinander da, inmitten der Natur, die uns umgibt.', '', '', '', '', '', '', 47187),
(66009, 'deDE', 'Zur Verteidigung Vakthros\'', 'Besiegt Korthrox den Zerstrer.', 'Es ist Zeit, $n. Die Streitkrfte der Primalisten in der Luft schwinden, jetzt, wo Ihr die Situation am Boden unter Kontrolle gebracht habt.\n\nRazageth hat nach einem ihrer Leutnants gerufen, um die Truppen der Primalisten zu verstrken, dank Eurer Anstrengungen.\n\nIhr msst Euch um dieses Monster kmmern, whrend ich weiter gegen Razageth vordringe und Khadgar helfe.\n\nHaltet die Augen nach meiner Magie offen, whrend Ihr kmpft. Ich werde tun, was ich kann, um Euch zu helfen.\n\nEs ist Zeit, dass Razageth den Zorn des Aspekts der Magie zu spren bekommt!', '', 'Einer von Raszageths Leutnants, der die blauen Drachen zerstren will.', 'Korthrox der Zerstrer', '', '', 'Sprecht mit Khadgar weiter oben in Vakthros.', 47187),
(66007, 'deDE', 'Die Luft ist rein', 'Zerstrt $1oa Lavaleuchtfeuer.', 'Die Primalisten halten Kalecgos mithilfe dieser massiven Kugeln fern.\n\nWenn das so weitergeht, wird Kalecgos noch verletzt. Sollte er scheitern, kann er Raszageth nicht mehr bekmpfen.\n\nMithilfe Eures ermchtigten Edelsteins msstet Ihr Euch als Elementar tarnen knnen, um vorzuschleichen.\n\nVernichtet die Kugeln mit ihm. Dann msste Kalecgos seine Macht entfesseln knnen.\n\nIch werde mich darauf konzentrieren, den Turm vor Raszageth zu beschtzen.', '', '', '', '', '', 'Trefft Kalecgos in einer Hhle im Vakthrosgipfel.', 47187),
(66006, 'deDE', 'Rckkehr zu Roscha', 'Bringt die Vorrte zu Hufschmiedin Roscha zurck.', 'Baba konnte sich ausruhen und Roschas Vorrte sind wieder da. Wir knnen zurckkehren, ohne sie zustzlich aufzuregen.\n\nNehmt einige Kisten mit, wenn Ihr geht. Den Rest werde ich von unseren Kriegern abholen lassen.', '', '', '', '', '', '', 47187),
(66005, 'deDE', 'Medaillon einer gefallenen Freundin', 'Bringt das Medaillon einer gefallenen Freundin zu Khasar zurck.', '<Dieser zerkaute Metallbrocken war einst ein wunderschnes und bedeutendes Ornament der Zentauren der Shikaar.\n\nKhasar knnte mehr ber seinen Besitzer wissen.>', '', '', '', '', '', 'Bringt das Medaillon einer gefallenen Freundin zu Khasar zurck.', 47187),
(66004, 'deDE', 'Galgresh', '', '', '', '', '', '', '', '', 47187),
(66003, 'deDE', 'Ringe, sie zu binden', 'Sammelt $1oa geschmolzene Fesselringe.', 'Die Djaradin hier sind wagemutig geworden. Sie haben Flammenelementare gebunden und lassen sie durch die Gegend wten. Die Wildtiere sind geflohen, und die Elementare sind unseren Lagern gefhrlich nahe.\n\nZum Glck konnte ich eine kleine steinerne Bastion errichten, um diese feurige Flut, die die Djaradin entfesselt haben, standzuhalten... Und wir werden nicht scheitern!\n\nSammelt die magischen Ringe ein, die diese Flammenelementare binden. Wir werden die Ringe verwenden, um unsere Verteidigung gegen sie zu verstrken.', '', '', '', '', '', '', 47187),
(66001, 'deDE', 'Eine letzte Hoffnung', 'Rettet das letzte energieerfllte Drachenei.', 'Eine ganze Brut an Welplingen ist verloren...\n\n<Sendrax richtet sich auf und schiebt ihr Kinn vor.>\n\nEs gibt einen Ort, an dem wir noch nicht nachgesehen haben. Die groe Ritualsttte, an der dieser Protodrache die Eier abgelegt hat.\n\nStellen wir uns gemeinsam ihrer grausamen Verteidigung entgegen, $p. Retten wir, so viele wir knnen.', '', '', '', '', '', '', 47187),
(66000, 'deDE', 'Bibliothek von Alexstrasza', 'Rettet $1oa Werke von kultureller Bedeutung.', '<Die Seiten dieses Buchs sind vllig verkohlt.\n\nDie Primalisten verbrennen offenbar gezielt die uralten Folianten und bedrohen damit die Geschichte der Drachenschwrme selbst. Es ist, als wollten die Primalisten die Drachenschwrme geradezu aus der Geschichte tilgen.\n\nRettet, was Ihr knnt.>', '', '', '', '', '', '', 47187),
(65999, 'deDE', 'Blutrnstig', 'Ttet $1oa Eindringlinge der Primalisten.', 'Kommandant Lethanak warnte uns Rekruten, dass die Sturmfresserin Raszageth Berichten zufolge aus ihrem Gefngnis entkommen sein soll. Wie es scheint, sind ihre Untergebenen ihr gefolgt und bedrohen jetzt alles, was uns lieb und teuer ist.\n\nSie kommen schnell voran. Bei der letzten Patrouille wurden diese Ruinen noch als verlassen gemeldet.\n\nWir mssen die Primalisten hier aufhalten.\n\nFr die Lebensbinderin, und fr alle Drachenschwrme!', '', '', '', '', '', '', 47187),
(65998, 'deDE', 'Zukunft der Schwrme', 'Rettet die Rubindracheneier.', 'Einem Drakoniden kann nach dem Abschluss keine hhere Aufgabe bertragen werden, als jedes einzelne Drachenei mit dem eigenen Leben zu verteidigen.\n\nDafr werden wir ausgebildet. Dafr existieren wir.\n\nIch kann mich nicht lnger verstecken und tatenlos zusehen, $p. Die Primalisten gefhrden die gesamte Zukunft der Drachenschwrme, indem sie diese Eier stehlen und mit Energie erfllen!\n\nWir sind deutlich in der Unterzahl, aber werdet Ihr dennoch an meiner Seite stehen? Werdet Ihr kmpfen, um die Drachenschwrme zu retten?', '', '', '', '', '', '', 47187),
(65997, 'deDE', 'Sendrax auf der Spur', 'Findet Sendrax in den Ruinen des Konservatoriums der Lebensbinderin.', 'Kadettin Sendrax kam hier vor nicht allzu langer Zeit vorbei.\n\nSie hatte den Befehl von Kommandant Lethanak fr alle Drakoniden, sich bei den Lebensbecken zu sammeln. Unser gesamtes Verteidigungsregiment ist kurz darauf in diese Richtung aufgebrochen.\n\nUnsere Spher waren zu der Zeit jedoch noch auf Patrouille in den alten Ruinen, also ist sie ihnen hinterher, um auch ihnen die Befehle zu bermitteln.', '', '', '', '', '', 'Trefft Sendrax im Konservatorium der Lebensbinderin.', 47187),
(65996, 'deDE', 'Veteranen zur Hilfe', 'Helft den verletzten Wachen und findet Sendrax.', 'Kommandant Lethanak war wie gewohnt verstndnisvoll. Wir werden die Hilfe unserer erfahrensten Wachen bentigen, um die Bedrohung abwenden zu knnen. Sie zu versammeln, war der perfekte Auftrag fr eine junge Kadettin wie Sendrax, doch vielleicht knnte sie etwas Untersttzung brauchen.\n\nSendrax\' Pfad fhrt sie nach Westen, der mglicherweise von dieser aufkommenden Bedrohung berwltigt wurde. Sie werden ebenfalls Untersttzung brauchen. Nehmt dieses Gebru und untersttzt sie.', '', '', '', '', '', 'Trefft Sendrax im Auenposten des Konservatoriums.', 47187),
(65995, 'deDE', 'Die Obsidianzitadelle', 'Bringt die Plne der Qalashi zu Furorion.', '<Auf den ersten Blick scheint es sich dabei um interne Kommunikation zwischen den Djaradinlagern zu handeln.\n\nDie Worte \"Obsidianzitadelle\" springen Euch ins Auge.\n\nMglicherweise wre Furorion hieran interessiert.>', '', '', '', '', '', '', 47187),
(65994, 'deDE', 'Djaradingerechtigkeit', '', '', '', '', '', '', '', '', 47187),
(65993, 'deDE', 'Stimmungskiller', 'Ttet Fleischwlfin Sotok in der Schuppenknackerfeste.', 'Ah, ja.\n\nKurz nach meiner Ankunft habe ich gesehen, wie die Anfhrerin dieser Riesen von ihrem Raubzug zurckkehrte. Irgendwo im Lager feiert sie ihren Sieg.\n\nEs wre eine Schande, wenn jemand ihre Feierlichkeiten stren wrde, meint Ihr nicht auch?', '', 'Die Drahtzieherin des Angriffs auf den Drachenherzauenposten.', 'Fleischwlfin Sotok', '', '', 'Trefft Furorion in der Schuppenknackerfeste.', 47187),
(65992, 'deDE', 'Schwarzkralleninformationen', 'Sprecht mit Furorions Spionen, die sich in der Schuppenknackerfeste versteckt halten.', 'Whrend Selistra und ich ihre Blicke nach oben lenken konnten, sind Schatten durch ihre Verteidigung geschlpft.\n\nMeine Agenten, die Schwarzkrallen, halten in ihrer Festung Augen und Ohren offen. Trefft sie und lasst sie wissen, dass Ihr auf unserer Seite steht. Sie werden Euch wertvolle Informationen ber unsere Feinde bermitteln.', '', '', '', '', '', 'Trefft Furorion in der Schuppenknackerfeste.', 47187),
(65991, 'deDE', 'Zeit fr eine Abrechnung', 'Trefft Furorion und Majordomus Selistra bei der Schuppenknackerfeste.', 'Kadettin Sendrax hat mich ber die Plne von Majordomus Selistra informiert. Der Lebensbinderin sei Dank fr diese Hilfe. Das Einschreiten gibt uns genug Zeit, unsere Verwundeten zur Behandlung zurck zu den Lebensbecken zu bringen.\n\nIch wnschte, ich knnte Selistra Verstrkung senden, doch ich brauche meine Wachen in der Nhe der Verwundeten. Begebt Euch zur feindlichen Festung und trefft sie dort.\n\nIch wnschte, es gbe einen anderen Weg, die Djaradin unter Kontrolle zu bekommen. Aber es geht nicht anders...\n\nIhr msst tun, was Ihr tun msst.', '', '', '', '', '', '', 47187),
(65990, 'deDE', 'Welpenerlsung', 'Rettet $1oa wimmernde Welplinge aus dem Drachenherzauenposten.', 'Sie fielen ber uns her, bevor wir berhaupt reagieren konnten. Meine Wachen hielten so lange dagegen, wie sie nur konnten, whrend wir die Kleinen und Hilflosen in Sicherheit brachten. Ich befrchte aber, dass im Auenposten noch mehr von ihnen sind.\n\nberquert diese Brcke und sucht nach berlebenden.', '', '', '', '', '', '', 47187),
(65989, 'deDE', 'Djaradin auf dem Vormarsch', 'Ttet $1oa Djaradin im Drachenherzauenposten.', 'Wir verfgen vielleicht nicht ber die Streitkrfte, unseren Auenposten zurckzuerobern, aber wir mssen uns auch nicht kampflos ergeben.\n\nZeigt ihnen, dass wir immer noch Biss haben.', '', '', '', '', '', '', 47187),
(65977, 'deDE', 'Erholung der Kirin Tor', 'Rettet $1oa sterbende Magier.', 'Als die Primalisten unsere Expedition angegriffen haben, habe ich befrchtet, dass wir etliche Magier verloren htten.\n\nAber es scheint, als htten die Primalisten sie entfhrt und wrden sie in diesem Moment foltern!\n\nBitte, Ihr msst die berlebenden Magier retten. Sie mgen uns in diesem Kampf nicht untersttzen knnen, aber deshalb drfen wir sie nicht im Stich lassen!', '', '', '', '', '', 'Trefft Khadgars Projektion noch tiefer in der Bergkette von Vakthros.', 47187),
(65962, 'deDE', 'Der nie endende Countdown', 'Sprecht mit Chromie, wenn Ihr bereit seid.', 'Ich htte nie gedacht, dass ich unseren Tempel einmal retten wrde, indem ich jene Sicherheitsmechanismen zerstre, die ihn schtzen sollen. Aber sei\'s drum!\n\nNachdem wir die Zeitelementare nun vernichtet haben, unsere Zeitwanderer befreit sind und unsere Wchter bereitstehen, wird es endlich Zeit, die letzte Stasisblase zu zerstren und uns um Eternus zu kmmern.\n\nLasst mich wissen, wenn Ihr bereit seid. Ich wei, dass mit Euch an meiner Seite nichts schiefgehen kann.', '', '', '', '', '', '', 47187),
(65958, 'deDE', 'Urgewalt', 'Nutzt den Elementarfokus, um Elementarenergie aus getteten Primalisten und Elementaren zu extrahieren.', 'Ich befrchte, es wird schwerer fr mich, die Abbilder aufrechtzuerhalten. Die Primalisten konzentrieren sich zunehmend darauf, mich aus dem Himmel zu holen.\n\nAber keine Sorge... Ich habe einen Plan.\n\nIhr msst die Kugel, die Ihr an Euch genommen habt, nutzen, um Elementarmagie getteter Primalisten einzusammeln.\n\nDiese elementare Energie brauchen wir, um die Aufmerksamkeit ihrer Streitkrfte von mir abzulenken.', '', '', '', '', '', 'Trefft Khadgars Projektion noch tiefer in der Bergkette von Vakthros.', 47187),
(65957, 'deDE', 'Keine Zeit fr Helden', 'Ttet Modak Flammenspeier, Durchbohrerin Gigra und Olphis den Geschmolzenen.', 'Unseren Beobachtungen nach zu urteilen, basiert die Gesellschaft der Djaradin auf Strke. Die Strksten unter ihnen dienen den anderen als Vorbild und motivieren sie zum Kmpfen.\n\nUnter den Streitkrften unter uns befinden sich einige Vertreter der mchtigsten Djaradin... Eure Ziele.\n\nIhr, $n, werdet sie persnlich ausschalten. Das sollte ihrer Moral einen entscheidenden Dmpfer verpassen.', '', '', '', '', '', '', 47187),
(65956, 'deDE', 'Krallenschlag', 'Strt die Djaradinverteidigung.', 'Mit Eurer Hilfe werden meine Schwarzkrallenassassinen die Djaradin beseitigen, die die ueren Gebiete verteidigen. Markiert potenzielle Ziele mit kleinen Betubungsbomben und meine Assassinen erledigen den Rest.\n\nSputet Euch und eliminiert alles, das unser Vordringen behindern knnte.', '', '', '', '', '', '', 47187),
(65955, 'deDE', 'Der beste Freund eines Zentauren', 'Befreit Khasar und trefft ihn in der Hhle.', 'Hier drauen sind wir nicht sicher, $p.\n\nDie Gorlocs haben meinen Jagdbegleiter Baba in eine Hhle im Osten gedrngt.\n\nBefreit mich, dann werden wir Baba retten. Wir treffen uns in der Hhle, sobald der Weg frei ist.', '', '', '', '', '', '', 47187),
(65954, 'deDE', 'Die Hunde loslassen', 'Befreit die Bakar der Shikaar.', 'Ich habe das Heulen und Bellen der Bakar gehrt, die aus dem Lager verschwunden sind.\n\nUnsere geliebten Hunde werden in Kfigen gefangen gehalten und warten darauf, von diesen... Dingern in Stcke gerissen zu werden.\n\nWir sind unseren Begleitern gegenber verpflichtet zu helfen. Befreit sie und werdet $gZeuge:Zeugin; der wahren Macht der Bakar der Shikaar!', '', '', '', '', '', '', 47187),
(65953, 'deDE', 'Das Ora-Keulen', 'Sammelt $1oa Totems von Gorlocschamanen.', 'Unter all dem Wahnsinn, der sich in diesem Gorlocdorf abspielt, habe ich nichts Bedenklicheres entdeckt als die Gorlocschamanen.\n\nSie sind besonders bsartig und spielen leichtsinnig mit Sturmmagie, ohne die Konsequenzen zu bedenken.\n\nDas muss ein Ende haben. Ttet sie und bringt mir ihre Totems. Unsere Mystiker werden an ihnen sehr interessiert sein.', '', '', '', '', '', '', 47187),
(65952, 'deDE', 'Legendrer Huptling', 'Ttet Huptling Grrlgllmesch.', 'Die Gorlocs dieses Sumpfes waren einst simple Kreaturen. Lstig, sicher, aber niemals Plnderer, Diebe oder Hundefresser.\n\nEs ist ihr Huptling Grrlgllmesch, der sie dazu gebracht hat, sich von ihrer wahren Natur abzuwenden.\n\nSetzt ihm ein Ende, damit die Gorlocs keine Bedrohung mehr fr uns darstellen.', '', 'Der mchtigste aller Gorlocs, Grrlgllmesch, hat alles bezwungen, auer seiner eigenen Verzweiflung.', 'Huptling Grrlgllmesch', '', '', '', 47187),
(65951, 'deDE', 'Sohlenlieferant', 'Sucht den Wald nach Khasar ab.', 'Die arme Roscha! Sie hat sich so fr die Karawane abgerackert, und dann stehlen diese widerlichen Gorlocs all ihre Vorrte.\n\nSie hat schon so viel verloren... Ich gebe mein Bestes, um ihr zu helfen.\n\nKhasar hat sich wahrscheinlich allein auf die Suche nach ihren Vorrten gemacht und niemandem davon erzhlt. So ist er einfach. Aber er ist schon viel zu lange weg. Viele Hunde sind auch verschwunden.\n\nWrdet Ihr bitte nach Khasar und den Hunden sehen, $p?', '', '', '', '', '', 'Sprecht mit Khasar in Schlickflossendorf.', 47187),
(65950, 'deDE', 'Diebische Gorlocs', 'Bringt die gestohlenen Vorrte aus dem Schlickflossendorf zurck.', 'Ist Hufschmiedin Roscha zur Karawane eingeladen? Nein! Aber wer muss Hufeisen fr die Karawane anfertigen? Hufschmiedin Roscha. Und wen bestehlen die Schlickflossen? Natrlich Hufschmiedin Roscha. Pah.\n\nIch wrde ja Khasar losschicken, aber wer wei, wo der sich gerade wieder rumtreibt?\n\nFindet meine Vorrte. Zeigt diesen Kreaturen, dass man nicht von Hufschmiedin Roscha stiehlt.\n\nLos!', '', '', '', '', '', 'Sprecht mit Khasar in Schlickflossendorf.', 47187),
(65949, 'deDE', 'Einsame Eisen', 'Bringt das Medaillon zu Hufschmiedin Roscha zurck.', 'Wenn wir uns Ohn\'ahra im Wind anschlieen, hinterlassen wir diese Medaillons.\n\nObwohl ich geholfen habe, dieses Medaillon herzustellen, bin ich nicht sein rechtmiger Besitzer.\n\nEs sollte zu Roscha zurckgebracht werden. Es ist die letzte Erinnerung an ihre Verlobte.\n\nBringt es zu ihr, damit sie trauern und ihren Frieden finden kann.', '', '', '', '', '', '', 47187),
(65948, 'deDE', 'Risse in der Zeit', 'Nutzt die stlichen und westlichen Kristalle, um Euren Zeitwandererstab weiter zu verstrken.', 'Als der Tempel verschlossen wurde, sind die Wchter ebenfalls eingeschlossen worden. Wenn wir sie rausholen wollen, mssen wir die Stasisblase platzen lassen! Dafr braucht Ihr leider einen vollstndig ermchtigten Zeitwandererstab...\n\nOh, ich wei! Ihr knnt Energie aus den Kristallen hier auf der Plattform ziehen. Das sollte Eurem Stab genug Wumms verleihen.\n\nDie Kristalle haben selbst Stasisfelder, also reit sie einfach heraus und absorbiert ihre Energie mit Eurem Stab.\n\nUnd keine Sorge, falls sie zerbrechen: Die Kraft wohnt ihnen weiter inne, selbst wenn sie in Stcken sind!', '', '', '', '', '', '', 47187),
(65947, 'deDE', 'Zeitfixierte Zeitwanderer', 'Befreit $1oa Zeitwanderer aus Zeitblasen.', 'Ich bin so froh, dass Ihr hier seid! Ihr msst die Lage hier auf den Plattformen fr mich stabilisieren, whrend Dante und Zera mir helfen, unsere ewige Drachenfreundin festzuhalten.\n\nDie Sicherheitsvorkehrungen des Tempels haben Eternus in eine Stasisblase gesperrt, als sie versuchte, die Kontrolle ber unseren Schwurstein zu erlangen. Unglcklicherweise wurden einige der anderen Zeitwanderer ebenfalls von diesen Sicherheitsvorkehrungen getroffen.\n\nMit Eurem Zeitwandererstab solltet Ihr sie problemlos befreien knnen... Kmmert Euch nur um die wtenden Zeitlinge, die dabei auftauchen!', '', '', '', '', '', '', 47187),
(65944, 'deDE', 'Lavaeruption', 'Zerstrt $1oa Lavakugeln.', 'Die Primalisten haben den Berg entzweigerissen, um ihre Streitkrfte nach Vakthros hineinstrmen zu lassen!\n\nIch habe einige Lavakugeln im vorderen Korridor erspht, die sie nutzen, um ihr elementares Chaos weiter zu verbreiten.\n\nVernichtet sie, um ihr Vorrcken zu verlangsamen. Ich werde von hier oben aus tun, was ich kann, um Kalecgos zu helfen.', '', '', '', '', '', 'Trefft Khadgars Projektion tiefer in der Bergkette von Vakthros.', 47187),
(65943, 'deDE', 'Uroffensive', 'Besiegt $1oa Primalisten in Vakthros.', 'Khadgar und ich tun unser Bestes, um die Primalisten im Himmel abzuwehren, aber wir kommen nicht nher an den Turm heran.\n\nIhr msst ihre Truppen am Boden dezimieren, damit wir uns Raszageth nhern und sie aufhalten knnen, bevor es zu spt ist.\n\nKmpft Euch zu den Primalisten voraus durch. Wenn ich meine Konzentration aufrechterhalten kann, wird dort ein weiteres Abbild auf Euch warten.', '', '', '', '', '', 'Trefft Kalecgos\' Abbild tiefer in der Bergkette von Vakthros.', 47187),
(65940, 'deDE', 'Auf zerstrten Wegen', 'Reist zusammen mit der Shikaarkarawane zum Flussbergang.', 'Ich hoffe, dass Ihr nichts gegen nasse Fe habt. Der nchste Teil unserer Reise fhrt uns ber zwei Flsse.\n\nOhn Seshteng mchte Euch eine Geschichte ber unsere gesegnete Wchterin Ohn\'ahra erzhlen. Ich lasse Euch mit Freuden in ihrer Obhut.', '', '', '', '', '', '', 47187),
(65939, 'deDE', 'Der Mut der berzeugung', 'Erlangt die Kontrolle ber die Obsidianzitadelle.', 'Eine heftige Schlacht steht uns bevor, aber unser Mut und unsere Entschlossenheit werden uns ihre zahlenmige berlegenheit berwinden lassen.\n\nIch verlasse mich darauf, dass Ihr unsere Truppen mit Euren hervorragenden Fhigkeiten zum Sieg fhren werdet.\n\nWir werden den Angriff beginnen, wenn Ihr bereit seid.', '', '', '', '', '', '', 47187),
(65938, 'deDE', 'Das einstige und zuknftige Team', 'Nutzt Euren Zeitwandererstab, um die Stasisblase an der Tempeltr zum Platzen zu bringen.', 'Alles klar! Zerstren wir die Stasisblase um die Tempeltren herum und befreien wir unsere Wchter! Seid Ihr bereit fr ein gewaltiges Tauziehen gegen die Zeit selbst?\n\nZieht an der Blase an der Tr wie zuvor an den Kristallen. Aber nehmt Euch in Acht: Die freigesetzte Zeitenergie wird sich gewiss sammeln und Euch angreifen. Ich wei nicht genau, was Euch erwartet, aber immerhin werden die befreiten Wchter an Eurer Seite kmpfen, was auch geschieht.\n\nViel Glck, $n!', '', '', '', '', '', '', 47187),
(65937, 'deDE', 'Ein Beweis der Nachlssigkeit', 'Findet Beweise fr die Schden im Fliederstreifen und zeigt sie Theramus.', 'Wir drfen nicht aufgeben. Er muss begreifen, was hier drauen geschieht! Wenn er die Hhle nicht verlassen will, mssen wir es ihm eben direkt zeigen.\n\nDazu knnte sicher alles Mgliche dienen. Es luft so vieles schief, von der verderbten Flora bis hin zur leidenden Fauna!', '', '', '', '', '', '', 47187),
(65935, 'deDE', 'Chromie einholen', 'Trefft Chromie auf den Plattformen des temporalen Konflux.', 'Ihr habt uns geholfen, die Kontrolle ber die Sande wiederzuerlangen, doch oben auf den Tempelplattformen spre ich noch etwas Greres. Lasst uns in die Lfte steigen und uns dort oben mit Botschafterin Chronormu treffen.\n\nWie immer ist Eile geboten.', '', '', '', '', '', '', 47187),
(65930, 'deDE', 'Ringen von Wind und Wasser', 'Stellt Euch Kraunot, dem Geist der Luft, in der Nhe des Kauriqweilers.', 'Jetzt sollten wir uns den Geistern entgegenstellen knnen.\n\nHat Ruriq das nicht erwhnt? Die Traditionen unseres Stamms schreiben es vor, dass wir uns den Geistern im Kampf stellen mssen, bevor wir ihren Segen erbitten. Wie stark er ausfllt, hngt davon ab, wie sehr man sie beeindruckt hat.\n\nVielleicht hat die Leuchtfischerin deshalb darauf bestanden, dass wir alle zusammenarbeiten.\n\nKmmert Ihr Euch um Kraunot, den Geist der Luft, dann bernehmen Ruriq und ich Otu\'rorq, den Geist des Wassers.\n\nSie leben in der Hhle hinter dem Wasserfall gleich in der Nhe. Wir sehen uns dort, $gAbenteurer:Abenteurerin;.', '', 'Der Geist der launischen Winde in der Gegend um den Kauriqweiler. Es ist bekannt, dass er sich gerne von jungen Tuskarr herausfordern lsst, die sich beweisen wollen.', 'Kraunot', '', '', '', 47187),
(65929, 'deDE', 'Eisbrecher', 'Befreit gefrierendes Wasser aus dem Eis in der Nhe des Kauriqweilers.', 'Ich wusste, dass die Ahnen ihren Segen geben wrden!\n\nWobei ich nicht viel ber Geister wei, Kauj ist der Schamane. Aber wir mssen die groen Geister der Luft und des Wassers beschwichtigen, bevor sie sich uns zeigen.\n\nJeder kann sehen, wie die Wasserelementare oben auf dem Berg langsam einfrieren. Das ist kein natrlicher Frost. In letzter Zeit strmt wesentlich mehr Klte vom Berg herunter als sonst. Wenn niemand etwas dagegen unternimmt, knnte unser gesamter Fluss vereisen.\n\nBefreit sie aus ihren frostigen Gefngnissen!', '', '', '', '', '', '', 47187),
(65928, 'deDE', 'Unberechenbare Winde', 'Sammelt $1oa ruhelose Windpartikel von den ruhelosen Winden in der Nhe des Kauriqweilers.', 'Pah! Zusammenarbeiten will sie?\n\nAber... wenn die Leuchtfischerin denkt, dass wir damit den anderen Stmmen vielleicht helfen knnen... mssen wir es versuchen.\n\nDamit der Windgeist Kraunot von uns Notiz nimmt, mssen wir uns zuerst um sein Element kmmern. Die Windelementare in der Nhe sind aufgewhlt, seit das Land erwacht ist.\n\nWhrend ich das Boot inspiziere, das Ihr zwei gebaut habt, knnt Ihr sie bekmpfen und mir ihre ruhelosen Partikel bringen. Das sollte die Ruhe in der Gegend wiederherstellen.', '', '', '', '', '', '', 47187),
(65926, 'deDE', 'Die Wasserflle bezwingen', 'Helft Ruriq dabei, die Fallschreiter zu bauen.', 'Kennt Ihr die Geschichte der Leuchtfischerin? Sie hat ein Boot gebaut, stark genug, um Wasserflle hinunterzufahren!\n\nDie lteste Nava liebt es, diese Geschichte zu erzhlen.\n\nIch denke, den ehrwrdigen Geistern der On\'tuq-Mammuts wrde es groe Ehre erweisen, wenn wir das Material aus ihren Krpern nutzen wrden, um erneut ein solches Boot anzufertigen.\n\nMein Bruder ist dagegen, aber wenn es uns gelingt, knnten wir dabei helfen, Fische zu unseren Schwesterstmmen zu bringen, die es gerade sehr schwer haben.\n\nIhr habt Eure Fhigkeiten und Eure Leidenschaft bereits bewiesen! Gemeinsam knnen wir sicherlich etwas Groes erschaffen.', '', '', '', '', '', '', 47187),
(65925, 'deDE', 'Die Schlchter schlachten', 'Ttet Eiskriecher und Eisbohrer in der Nhe des Kauriqweilers.', 'Diese Wyrms gehren nicht hierher. Ich wei nicht, was sie aus ihren unterirdischen Hhlen getrieben hat, aber jetzt knnen wir ihnen nicht mehr helfen.\n\nWir drfen nicht zulassen, dass sie die einheimische Fauna zerstren.\n\nTtet die Wyrms, $n. Behaltet ihre Einzelteile, wenn ntig, und sucht mich im Weiler auf, sobald Ihr fertig seid.', '', '', '', '', '', 'Trefft Ruriq bei Kauriqweiler.', 47187),
(65921, 'deDE', 'Vergeltung der Refti', 'Ttet Primalisten und rettet Refti im Tyrholdreservoir.', 'Ich bekomme es einfach nicht aus meinem Kopf, $p. So viele meiner Schwestern wurden abgeschlachtet! Weggeworfene Leben... Ihre Opfer werden nicht ohne Folgen bleiben!\n\nMeine Soldaten haben die Primalisten aufgesprt und entdeckt, dass einige unserer Schwestern noch am Leben sind.\n\nWir mssen sie retten und sicherstellen, dass jeder dieser Primalisten meinen Zorn zu spren bekommt!', '', '', '', '', '', '', 47187),
(65920, 'deDE', 'Fr den Schutz!', 'Nutzt die fehlenden Schlsselsteine, um die Reservoirschutze zu reparieren, und aktiviert dann die Konsole.', 'Wir knnen die Schutze endlich reparieren. Trotz unserer schweren Verluste muss unsere Arbeit vollendet werden.\n\n$p, wir bentigen erneut Eure Hilfe. Bringt jeden Schlsselstein an seinen angestammten Platz, um die Schutze wiederherzustellen.\n\nKommt zurck, sobald Ihr das erledigt habt, damit wir die Konsole aktivieren und die Ordnung im Reservoir wiederherstellen knnen .', '', '', '', '', '', '', 47187),
(65918, 'deDE', 'Vorbeugende Manahme', 'Ttet $1oa entfesselte Elementare im Tyrholdreservoir.', 'Die Urelementare vermehren sich vllig unkontrolliert. Normalerweise wrden meine Schwestern und ich uns darum kmmern, aber wir sind nicht in der Lage, gegen sie zu kmpfen. Wir haben einfach zu viele Soldaten verloren.\n\nAuerdem mssen die wenigen von uns, die hier verblieben sind, sich um dringendere Angelegenheiten kmmern.\n\n<Zuttiki zuckt schmerzerfllt zusammen.>\n\nUnd hier kommt Ihr ins Spiel, $p. Wrdet Ihr Euch um diese Elementare kmmern?', '', '', '', '', '', '', 47187),
(65916, 'deDE', 'Wir verhandeln nicht mit Primalisten', 'Ttet Primalistenanfhrer Ko\'jo und erlangt die fehlenden Schlsselsteine im Tyrholdreservoir zurck.', 'Die Primalisten glaubten, sie knnten die Macht von Tyr bertreffen. Da lagen sie falsch.\n\nMeine Refti konnten sie in einer Hhle nicht weit von hier aufspren. Wie ich dachte, befinden sie sich im Besitz der verschwundenen Schlsselsteine.\n\nChampion, wenn wir dem Reservoir zu alter Pracht verhelfen wollen, mssen wir diese Steine zurckerlangen.\n\nAuerdem muss ihr Anfhrer sterben, damit sie keinen erneuten Angriff starten knnen.', '', '', '', '', '', '', 47187),
(65914, 'deDE', 'Mammuts im Mittelpunkt', 'Sammelt On\'tuq-Hautfetzen und On\'tuq-Stozhne von gefallenen Mammuts der On\'tuq in der Nhe des Kauriqweilers.', 'Unser Stamm hat sich damit gerhmt, die On\'tuq-Mammutherde seit Generationen heranzuziehen. Jetzt sind sie... verloren.\n\nNach diesem Massaker werden ihre Seelen sicher in Rage gefangen sein. Wir mssen ihnen die letzte Ehre erweisen, indem wir ihre berreste sinnvoll verwerten.\n\nEs sind zu viele, wir knnen sie nicht alleine einsammeln. Bitte sammelt so viele Materialien von den Jungen und den Matriarchinnen ein, wie Ihr knnt, und trefft mich im Kauriqweiler.', '', '', '', '', '', 'Trefft Ruriq bei Kauriqweiler.', 47187),
(65913, 'deDE', 'Alles gter, Hter?', 'Rettet Hterin Mara vor den Primalisten im Tyrholdreservoir.', 'Den Titanen sei Dank! $C, wir brauchen Eure Hilfe!\n\nGerade eben erst wurden wir von Primalisten angegriffen. Meine Schwestern und ich konnten sie abwehren, aber nur unter schweren Verlusten...\n\nWir haben Zeit zum Trauern, sobald meine Hterin in Sicherheit ist! Eine Gruppe Primalisten hat sich whrend der Kmpfe abgesetzt... Ich schwre, wenn sie unserer Hterin Leid zufgen...\n\nIhr msst ihr helfen, bevor es zu spt ist!', '', '', '', '', '', '', 47187),
(65911, 'deDE', 'Azurblaue Ausrichtung', 'Kehrt zu Kalecgos in den Azurarchiven zurck.', 'Die Bande dieser Gemeinschaft... Freunde, Familie... die Vertrautheit, die sie miteinander teilen.\n\nIch... hatte so etwas nie. Der blaue Drachenschwarm hatte so etwas nie. Und vielleicht liegt es daran, dass wir nie die Gelegenheit dazu hatten.\n\nJetzt haben wir sie. Ich muss meinesgleichen versammeln.\n\nSucht mich in den Azurarchiven auf. Es gibt viel zu tun.', '', '', '', '', '', 'Kehrt zu Kalecgos in den Azurarchiven zurck.', 47187),
(65907, 'deDE', 'Lieblingsobst', 'Sammelt wilde Strauchfrchte aus den Geysiren von Ohn\'iri und fttert damit $1oa faulenzende Schlammstampfer.', 'Die Mystikerausbildung ist so langweilig. Die Hlfte der Zeit beobachte ich Wasser dabei, wie es nass ist. Meine Brder sind schon drauen in der Wildnis unterwegs, verndern die Welt und jagen Drachen und Primalisten.\n\nEgal. Ich habe versprochen, Euch etwas Groartiges zu zeigen! Wusstet Ihr, dass Schlammstampfer Strauchfrucht lieben? Sie wchst in der Nhe bei den Geysiren. Sammelt ein paar davon, dann knnen wir sie gemeinsam fttern.', '', '', '', '', '', '', 47187),
(65906, 'deDE', 'Eine aufgebrachte Initiandin', 'Sprecht mit Initiandin Radiya bei den Quellen von Ohn\'iri auf den Ebenen von Ohn\'ahra.', 'Ich habe einen interessanten Brief von den Quellen von Ohn\'iri erhalten.\n\nWas den Inhalt des Briefes angeht, so beschreibt er, ich zitiere, furchtbare Gefangenschaft, kontrollwtige Mentoren und extreme Langeweile. Er ist formell unterzeichnet, Initiandin Radiya. Schaut, da ist auch eine Zeichnung von einem Adler... er tritt eine Zentaurin namens Meluun von einer Klippe.\n\nNun. Ich vermute, es handelt sich hier um einen Hilferuf, falls Ihr es Euch selbst ansehen mchtet. Um ehrlich zu sein, ich glaube, Radiya ist in Ordnung. Sie schickt mir hufig solche Briefe.', '', '', '', '', '', 'Sprecht mit Initiandin Radiya bei den Quellen von Ohn\'iri auf den Ebenen von Ohn\'ahra.', 47187),
(65905, 'deDE', 'Mehr als Unkraut', 'Beseitigt berwucherungen und Monster im Fliederstreifen.', 'Vielleicht sollten wir Theramus etwas Freiraum lassen.\n\nAber wir drfen deshalb nicht unttig sein. Der Hain zerstrt sich mit zunehmender Geschwindigkeit selbst. Bitte helft uns!', '', '', '', '', '', '', 47187),
(65904, 'deDE', 'Genug ist genug', 'Bringt die Beweise fr die Schden im Fliederstreifen zu Theramus.', 'Griesgrmig oder nicht, Theramus hat eine Aufgabe zu erledigen. Solange er sich drinnen versteckt, kann er die Folgen seiner Abwesenheit nicht abschtzen.\n\nLasst uns zusammen gehen. Wir werden ihm die Beweise prsentieren.', '', '', '', '', '', '', 47187),
(65903, 'deDE', 'Flausch ist unschlagbar', 'Fangt $1oa Wiesenspringer.', 'Armer Theramus. Ich habe eine Idee, wie man ihn wieder aufmuntern kann!\n\nNehmt dieses Netz und fangt ein paar der einheimischen Springer. Sie sind zwar friedlich, aber schnell. Sie haben sich an der Kste gut eingelebt.\n\nWir werden sie zu Theramus bringen. Er wird buchstblich von flauschigen Freuden berschwemmt werden!', '', '', '', '', '', '', 47187),
(65902, 'deDE', 'Futter oder Flausch', 'Bringt das gewrzte Schildkrtenfleisch und die Wiesenspringer zu Theramus.', 'Sieh sich einer dieses saftige und kstlich gewrzte Schildkrtenfleisch an! Das ist natrlich nur eine rein objektive Betrachtung. Ich bin Vegetarierin.\n\nNa los! Er hat den vermutlich den ganzen Tag ber noch kein Fleisch gegessen.', '', '', '', '', '', '', 47187),
(65901, 'deDE', 'Rausschleichen', 'Platziert die Lufttotems in Quellen von Ohn\'iri und informiert danach Radiya.', 'Ich habe Hausarrest fr unbestimmte Zeit! Wei meine Ohn nicht, dass ich nchstes Frhjahr sechzehn werde? Ich sollte weggehen drfen, wann immer ich will.\n\nIhr seht aus, als knntet Ihr mir helfen. Ich habe einen Fluchtplan: Indem ich diese Totems kanalisiere, kann ich die Luft konzentrieren und einen ordentlichen Wirbel erzeugen. Aber ich kann nicht herumlaufen und sie platzieren, ich stehe nmlich unter maximaler Windaufsicht. Sogar Togo wird mir nicht helfen.\n\nAber mit Eurer Hilfe... bitte! Ich verspreche Euch, ich werde Euch etwas Groartiges zeigen.', '', '', '', '', '', 'Trefft Euch mit Radiya beim Spiegel des Himmels.', 47187),
(65900, 'deDE', 'Verdchtig gewrztes Steak', 'Sammelt $1oa Stcke wunderbar zartes Schildkrtenfleisch, $2oa Reptilieneierschalen und $3oa Sauerblten.', 'Die Idee meiner Schwester ist bezaubernd, aber Theramus braucht einen echten Muntermacher.\n\nEine grozgige Portion Sauerblte ist genau das Richtige. Wir knnen daraus eine Paste herstellen, die ich auf sein Lieblingsessen streichen kann: Schildkrtenfleisch!\n\nHelft Ihr mir, die Zutaten zu beschaffen?', '', '', '', '', '', '', 47187),
(65899, 'deDE', 'Findet Theramus', 'Durchsucht die nahe gelegenen Hhlen und findet Theramus.', '$R! Seid Ihr hier, um den wunderschnen Fliederstreifen zu besichtigen? Tut mir leid, dass er sich gerade in solch einem Zustand befindet. Ich schwre, dass er normalerweise nicht so ungepflegt aussieht!\n\nTheramus, der Hter des Gartens, wollte sich heute eigentlich mit uns treffen, damit wir die Probleme angehen knnen. In letzter Zeit ist er mit der Pflege etwas berfordert, also helfen Felina und ich aus. Aber wir knnen nicht alles erledigen.\n\nWrdet Ihr fr uns nach ihm suchen? Vielleicht hat er es vergessen.', '', '', '', '', '', 'Kehrt zu Celina Knisterblatt zurck.', 47187),
(65898, 'deDE', 'Protoprobleme', 'Beschafft den Locus und besiegt den Protodrachen, der ihn bewacht.', 'Ich mag die Splitterflammen zwar nicht, aber nicht einmal ich kann einfach tatenlos zuschauen, wie sie sich so zerfleischen. Das kommt mir nur allzu bekannt vor.\n\nWas auch immer dieser Locus ist, er ist in unseren Hnden besser aufgehoben als in ihren. Folgt der Spur aus Leichen, dann finden wir ihn bestimmt.\n\nAber seid vorsichtig, $p. Ich befrchte, das Nest ist nicht ganz so verlassen, wie es den Anschein hat.', '', '', '', '', '', '', 47187),
(65896, 'deDE', 'Alte Wunden', 'Helft den Bewohnern von Sturmwind, die Wunden der Vergangenheit zu heilen.', 'Dachtet Ihr wirklich, Ihr knntet Euch unbemerkt in diese Stadt stehlen? Nein, mir entgeht nichts!\n\nIch hatte schon einmal recht, was Eure Art betrifft, und ich will verdammt sein, wenn ich die Drachen meine Heimat erneut zerstren lasse.\n\nDies war einst ein Park voller Frieden und Gelchter. Doch dann kam Euer Ahne, Todesschwinge. Oh ja, ich wei alles ber ihn.\n\nSeht Euch doch das Vermchtnis der Zerstrung an, das er hinterlassen hat. Der Schmerz hallt bis heute in den Straen wider.', '', '', '', '', '', '', 47187),
(65895, 'deDE', 'Konkurrenz belebt das Geschft', 'Sammelt Informationen ber die Splitterflammen.', 'Pah! Durch das Abschlachten von Arbeitern werden wir auch nicht schlauer.\n\nSucht ihre Anfhrer. Einer davon wird wissen, was wir bentigen.\n\nAch, und noch etwas, $n. Belauscht sie dieses Mal, bevor Ihr sie umbringt. So erfahrt Ihr vielleicht etwas Ntzliches.', '', '', '', '', '', 'Trefft Adenedal nahe der Spitze der Ruinen.', 47187),
(65893, 'deDE', 'Die Reliktsuche', 'Sammelt $1oa Artefaktfragmente von Nelthazan.', 'Die Splitterflammen sind hier. Wrdet Ihr irgendwelchen Splittern kostbare Artefakte anvertrauen?\n\nIch glaube kaum. Aber wir mssen herausfinden, was sie hier wollen, wenn wir weiterkommen mchten. Nehmt ihnen so viele wie mglich ab und zeigt sie mir dann.\n\nDieses Rtsel besteht aus mehr Teilen, als wir in der Erde finden werden.', '', '', '', '', '', '', 47187),
(65892, 'deDE', 'Zersplitterte Splitterflammen', '', '', '', '', '', '', '', '', 47187),
(65891, 'deDE', 'Ein Mittel zum Zweck', 'Verwendet die verzauberten Werkzeuge in der Nhe von $1oa Gerllhaufen.', 'Gut. Ich habe mir gerade berlegt, dass ich $geinen Abenteurer:eine Abenteurerin; wie Euch brauchen knnte. Stark. Robust. Willens, fr ein kleines Handgeld zu arbeiten.\n\nEs ist, als wret Ihr meinem Wunsch entsprungen. Das habe ich gut gemacht. Diese Ruinen haben die Aufmerksamkeit anderer erregt. Aber sie machen bei den Ausgrabungen bestimmt etwas falsch. Sie werden die Proben verderben!\n\nNehmt dies hier. Platziert es bei interessanten Artefakten in den Ruinen. Es ist so verzaubert, dass es alles Ntige erledigt.', '', '', '', '', '', '', 47187),
(65890, 'deDE', 'Die Ruinen von Nelthazan', 'Trefft den Himmelsschreiber Adenedal bei den Ruinen von Nelthazan.', 'Die Drachenschuppenexpedition bentigt Eure Untersttzung.\n\nEin Himmelsschreiber wurde zum Sammeln von Informationen in die Ruinen geschickt. Sie sollten unbewohnt sein, aber ich kann ihn bis hier schreien hren.\n\nEr muss in einer brenzligen Situation sein, wenn er bis hierher zu hren ist.\n\nAuf dieser Expedition kmmern wir uns um einander. Sogar um die Unertrglichen. Sucht nach ihm und schtzt ihn vor was auch immer er dort gefunden hat.', '', '', '', '', '', '', 47187),
(65887, 'deDE', 'Zu den Bergen', 'Trefft Khadgars und Kalecgos\' Abbilder am Fu der Bergkette von Vakthros.', 'Was fr ein Anblick da oben, wie Khadgar und Kalecgos die Primalisten am Himmel bekmpfen!\n\nSie haben mehrere Abbilder von sich beschworen, um Euch durch das gigantische Loch zu helfen, das die Primalisten erschaffen haben.\n\nZwei davon befinden sich gerade am Fu der Berge.\n\nWenn die Dinge sich zum Schlechten wenden... nun, dann werde ich den Rest von uns im Azurblauen Gebirge informieren.', '', '', '', '', '', 'Trefft Khadgars und Kalecgos\' Abbilder am Fu der Bergkette von Vakthros.', 47187),
(65886, 'deDE', 'Zu Rhonins Schild', 'Trefft Euch mit Drok Schriftstecher im Turmausguck.', 'Raszageth und die Primalisten starten einen Groangriff auf Vakthros. Wir drfen nicht zulassen, dass sie Erfolg haben!\n\nKhadgar und ich werden vorgehen und die Situation aus dem Himmel unter Kontrolle bringen.\n\nIn der Zwischenzeit msst Ihr Euch zu Rhonins Schild aufmachen, einem der letzten Lager der Kirin Tor in dieser Gegend.\n\nIhr seid schneller, wenn Ihr von der Spitze des Archivs mit Eurem Drachen losfliegt.\n\nStellt sicher, dass es den Kirin Tor gut geht und begebt Euch dann nach Vakthros.\n\nWir zhlen auf Eure Bodenuntersttzung.', '', '', '', '', '', 'Trefft Euch mit Drok Schriftstecher in Rhonins Schild.', 47187),
(65875, 'deDE', 'Ein Drache macht blau', 'Findet die Getrnke fr Vazallia.', 'Ein ganzes Leben in der Scherbenwelt... stndige Kmpfe. So wenig Zeit zum Entspannen.\n\nHin und wieder braucht ein Drache einen Tag am Meer, mit einem richtig kalten Getrnk in seinen Klauen.\n\nHey, vielleicht knnt Ihr mir dabei helfen, mich zu entspannen! Tut mir einen Gefallen und schaut, ob Ihr einige dieser Getrnke findet, um unseren Vorrat aufzustocken.', '', '', '', '', '', '', 47187),
(65874, 'deDE', 'Eine verdorbene Offenbarung', 'Sprecht mit Hanu, der ltesten Poa und Norukk.', 'Hm...\n\n<Brel starrt das seltsame Totem unverwandt an und dreht und wendet es in ihren wuchtigen Hnden.>\n\nWir mssen die Barthaare zusammenstecken und herausfinden, was es damit auf sich hat.', '', '', '', '', '', '', 47187),
(65873, 'deDE', 'Anfhrer der Schattenpfotenbande', 'Ttet Kargtatze und nehmt sein Totem an Euch.', 'Kargtatze ist der wahre Anfhrer der Gnolle in diesem Teil des Waldes. Wir hatten in der Vergangenheit bereits... unangenehme Begegnungen mit ihm.\n\nAber diesmal war etwas anders. Er hatte ein seltsames Totem bei sich, das seine gesamte Essenz zu verzerren.\n\nWir mssen Kargtatze aufhalten und dieses Totem in unseren Besitz bringen. Ich befrchte, die Gnolle spielen mit etwas, das dunkler ist, als wir es uns vorstellen knnen.', '', 'Kargtatze war zwar schon immer boshaft, aber seit er ein verderbtes Totem trgt, ist er noch aggressiver geworden.', 'Kargtatze der Miefende', '', '', '', 47187),
(65872, 'deDE', 'Bse Gnolle mit bsen Absichten', 'Ttet $1oa Schattenpfotengnolle in Kargtatzes Hhle.', 'Ich wittere etwas Seltsames in der Luft. Hier stimmt etwas nicht...\n\nHanu hat die Gnolle in dieser Hhle als eigenartig beschrieben... und krank. Wir sollten mehr ber den Ursprung von alldem herausfinden.\n\nAber werdet nicht bermtig. So krnklich sie auch aussehen, sie drften hochgradig hinterhltig und gefhrlich sein.', '', '', '', '', '', '', 47187),
(65871, 'deDE', 'Kein Weg an den Gnollen vorbei', 'Rettet Norukk und $1oa weitere gefangene Tuskarr.', 'Ich bin der Fhrte der gefangenen Tuskarr gefolgt. Sie und mein Mann Norukk sind in dieser Hhle.\n\nNorukk gibt oft nicht gengend auf sich selbst acht, deshalb tue ich das normalerweise fr ihn. Aber ein wenig Hilfe werde ich nicht ablehnen.\n\nBitte rettet sie!', '', '', '', '', '', '', 47187),
(65870, 'deDE', 'Vorrte!', 'Bergt die Behlter mit Jagdausrstung.', 'In den Riesenbaumhgeln war keine Spur von unserer gestohlenen Jagdausrstung. Sie muss in dieser Hhle sein.\n\nHaltet die Augen nach Ausrstungsbehltern offen und seid auf alles gefasst.\n\nIch wrde nicht davon ausgehen, dass die Gnolle die Behlter unbewacht zurckgelassen haben.', '', '', '', '', '', '', 47187),
(65869, 'deDE', 'Noch ein Hinterhalt', 'Sprecht mit Akiun und untersucht $2oa Leichen in der Nhe.', 'Eine Tragdie. Und mglicherweise nur die erste von vielen.\n\nFindet heraus, was Akiun wei, und untersucht dann alle, die bei dem Angriff ums Leben gekommen sind.\n\nIch habe da so meine Vermutungen, was hier geschehen ist. Finden wir heraus, ob die Spuren meine Theorie besttigen.\n\nIch werde versuchen, meinen aufgewhlten Freund zu beruhigen.', '', '', '', '', '', '', 47187),
(65868, 'deDE', 'Nichts zum Knabbern', 'Holt $1oa Bestattungsgaben zurck.', 'Ich habe eine von Ponoliaks Bestattungsgaben gefunden, von diesen Schattenpfotengnollen verschandelt und dann weggeworfen... Sie war voller Bissspuren.\n\nDiese Gabe, zusammen mit anderen, wird fr die Beerdigungszeremonie unseres jngst verstorbenen Huptlings von Iskaara bentigt.\n\nEs ist eine Schande, etwas so Heiliges als Kauspielzeug zu verwenden. Bitte haltet die Augen nach weiteren Bestattungsgaben offen.', '', '', '', '', '', 'Trefft Hanu am Eingang von Kargtatzes Hhle in den Riesenbaumhgeln.', 47187),
(65867, 'deDE', 'Heulen in den Riesenbaumhgeln', 'Ttet Durgun, Kerwal und Bakra.', 'Die Gnolle, die unsere Karawane angegriffen haben, wurden von drei Leutnants angefhrt.\n\nDurgun wurde von einem Dutzend Hynen begleitet.\n\nKerwal lachte jedes Mal wie wahnsinnig, wenn wir ihn verfolgen wollten und in eine seiner Stahlfallen getappt sind.\n\nBakra hat uns erbarmungslos verspottet.\n\nWenn wir auch nur darauf hoffen wollen, das wiederzuerlangen, was gestohlen wurde, mssen sie sterben.', '', '', '', '', '', 'Trefft Hanu am Eingang von Kargtatzes Hhle in den Riesenbaumhgeln.', 47187),
(65866, 'deDE', 'Fallen auslsen', 'Lst $1oa Klingenkieferfallen aus.', 'Die Hgel vor uns sind mit Klingenkieferfallen gespickt.\n\nAber wenn Ihr aufmerksam seid, solltet Ihr sie aufspren knnen. Lst sie mit diesem alten Trick der Tuskarr vorsichtig aus: Nehmt einem langen Stock. Natrlich knntet Ihr das auch tun, indem Ihr in sie hineintretet, aber das wrde ich nicht empfehlen.\n\nSucht Hanu auf, sobald Ihr gengend von ihnen entfernt habt. Die lteste Poa und ich werden nachkommen, sobald wir knnen.', '', '', '', '', '', 'Trefft Hanu am Eingang von Kargtatzes Hhle in den Riesenbaumhgeln.', 47187),
(65865, 'deDE', 'Sie haben uns festgesetzt!', 'Ttet Gnollscharfschtzen.', 'Diese Scharfschtzen der Gnolle sind gnadenlos... und berraschend zielsicher.\n\nSolange sie ihre Waffen auf uns gerichtet haben, knnen wir nicht einmal daran denken, in die Riesenbaumhgel aufzubrechen.\n\nDnnt ihre Reihen aus und zeigt ihnen, dass wir keine lebenden Zielscheiben sind!', '', '', '', '', '', 'Trefft Hanu am Eingang von Kargtatzes Hhle in den Riesenbaumhgeln.', 47187),
(65864, 'deDE', 'Die Karawane erwischen', 'Holt Brena in der Nhe der Riesenbaumhgel ein.', 'Ihr solltet Brena hinterher. Ihre Karawane ist gerade einmal vor ein paar Stunden hier durchgekommen.\n\nSie haben die wertvollsten Besitztmer unseres verstorbenen Huptlings fr ein Begrbnis zu seinen Ehren gesammelt.\n\nDa die Karawane schwer beladen war, drfte sie noch nicht weit gekommen sein.', '', '', '', '', '', '', 47187),
(65855, 'deDE', 'Hilfe fr das Azurblaue Gebirge', 'Kehrt zu Noriko der Allerinnernden im Lager Antonidas zurck.', 'Die Energie des Schwursteins kann nicht wieder beansprucht werden, bis die Leylinien innerhalb des Azurblauen Gebirges repariert wurden.\n\nEinige von ihnen knnen womglich nur mithilfe von Kalecgos\' Fhigkeiten erreicht werden... aber Ihr knnt dennoch helfen.\n\nFindet heraus, ob die Tuskarr berlebt haben, und sucht sie in dem Fall auf. Sie haben zu meiner Zeit hier gelebt und besitzen umfangreiches Wissen ber diese Gegend.\n\nSprecht mit einem unserer arkanen Helfer, um zu Euren Verbndeten zurckzukehren.', '', '', '', '', '', 'Sprecht mit Noriko der Allerinnernden im Lager Antonidas.', 47187),
(65854, 'deDE', 'Erneute Beanspruchung des Schwursteins', 'Seht zu, wie Kalecgos den Azurschwurstein neu beansprucht.', 'Hervorragende Arbeit. Offenbar ist es uns gelungen, die Leylinien in den Azurarchiven zu reparieren.\n\nFrher, als der blaue Drachenschwarm vereint war, htte ich meinen Brdern und Schwestern gesagt, nie an der Strke der Sterblichen zu zweifeln.\n\nTrefft mich am Schwurstein sdlich von hier. Ich werde ihn beanspruchen und mich dann auf den Weg nach Thaldraszus begeben.', '', '', '', '', '', 'Sprecht mit Sindragosa.', 47187),
(65852, 'deDE', 'Direkt zur Spitze', 'Sucht im Beutel ntzlicher Waren nach dem arkanen Trittstein und nutzt ihn an einem arkanen Fokuspunkt, um die Spitze der Azurarchive zu erreichen.', 'Anscheinend entzieht etwas an der Spitze des Turms die arkanen Energien.\n\nNun, da Ihr die Energien hier unten stabilisiert habt, solltet Ihr in der Lage sein, die arkanen Magien der Gegend zu \"reiten\".\n\nSucht in Eurer Tasche nach etwas, das sich \"Arkaner Trittstein\" nennt. Setzt ihn ein, damit wir uns oben treffen knnen.', '', '', '', '', '', 'Trefft Kalecgos an der Spitze der Azurarchive.', 47187),
(65850, 'deDE', 'Der Kreislauf des Meeres', 'Sprecht mit Brena, um an der Beerdigungszeremonie teilzunehmen.', 'Danke, $n. Ich habe von unseren neuen Freunden alles Ntige erfahren.\n\nDie Bestattungszeremonie fr ihren ehemaligen Huptling beginnt bald. Angesichts ihrer Gte und Gastfreundschaft uns gegenber wre es nur angemessen, daran teilzunehmen, bevor wir in die Archive zurckkehren.\n\nRedet mit Brena und lasst sie wissen, dass wir jederzeit bereit sind.', '', '', '', '', '', '', 47187),
(65849, 'deDE', 'Nach Iskaara', 'Trefft Brena in Iskaara.', 'Ich danke Euch, $n. Dank Euch ist meine Familie in Sicherheit.\n\nJetzt knnen wir endlich nach Iskaara zurckkehren und den alten Ponoliak der See bergeben. Er war mein Mentor und ein guter Huptling.\n\nBitte, schliet Euch uns an! Jeder kann sich an der Feier des Kreislaufs des Meeres beteiligen.', '', '', '', '', '', 'Trefft Brena in Iskaara.', 47187),
(65848, 'deDE', 'Auf zum Folianten', 'Sprecht mit Kalecgos, damit er das Portal ffnet, und nutzt, was er beschwrt, um die Verderber von Brackenfell auszuschalten und schlielich das kranke Urtum zu vernichten.', 'Wir mssen diesen Baum aufhalten! Dank der Leykristalle kann ich endlich mithelfen.\n\nSprecht mich an, wenn Ihr bereit seid. Ich werde ein Portal zu den Azurarchiven ffnen und versuchen, etwas Ntzliches hervorzubringen.\n\nHaltet Abstand, es knnte ziemlich instabil sein.', '', '', '', '', '', 'Sprecht mit Kalecgos in der Leykristallhhle.', 47187),
(65847, 'deDE', 'Neuausrichtung', 'Konzentriert Euch auf den Leykristall und zerstrt dann 3 Verfallansteckungen.', 'Nun zu dieser Leylinie. Meine Befrchtungen scheinen sich zu besttigen... der Verfall hat sich in der Linie ausgebreitet.\n\nWir mssen den Verfall entfernen und den Heilungsprozess beschleunigen, aber ich kann mit meinem Spiegelbild alleine nicht genug Energie hineinkanalisieren.\n\nKonzentriert Euch auf diesen Leykristall hier. Meine Verbindung zu Euch wird mir dabei helfen, mich physikalisch hierherzuteleportieren. Dann werde ich stark genug sein.', '', '', '', '', '', 'Sucht Kalecgos auerhalb von Brackenfell auf.', 47187),
(65846, 'deDE', 'Liegengelassenes Ley', 'Sammelt $1oa Leykristalle in den Brackenfellrandgebieten.', 'Die Leylinie muss hier sein. Ich spre sie!\n\nAber zunchst mssen wir die Gnolle aufhalten. Dieses Urtum ist vermutlich ihre mchtigste Waffe.\n\nEs befinden sich einige Leykristalle hier, die die Gnolle gesammelt haben. Zum Glck scheinen sie die Macht, die den Kristallen innewohnt, nicht zu verstehen.\n\nBringt mir so viele, wie Ihr knnt. Sie werden mein Spiegelbild strken und mir helfen, etwas Ntzliches aus den Archiven zu beschwren, um das Monster auszuschalten.', '', '', '', '', '', '', 47187),
(65845, 'deDE', 'Echos der Gefallenen', 'Platziert Brenas Totem in der Nhe von $1oa Leichen der Tuskarr, um Kontakt zu ihren Geistern aufzunehmen.', 'Hier liegen Tuskarr! Die Leichen meiner Freunde, meines Volkes... meiner Familie. Sie sind vor nicht einer Woche erst zur Jagd aufgebrochen.\n\nSie sind schon zu verwest, um sie zu bergen.\n\nIhre Geister sind noch hier. Ihr Zorn, ihre Reue fesselt sie an diesen Ort. Kaqiata, Litokk, Tuyuki...\n\nIch bitte Euch, $n, nehmt mein Totem und stellt es in der Nhe ihrer Leichen auf. Ich werde ihre Geister anrufen... auf dass sie endlich Frieden finden.', '', '', '', '', '', '', 47187),
(65844, 'deDE', 'Die Fulnis herausschneiden', 'Ttet $1oa verfaulende Treants und $2oa Fulniswerfer von Brackenfell.', 'Dieser Verfall muss die Gehirne der Gnolle wie ihre Krper zerfressen haben!\n\nWie zerstrerisch sie auch sein mgen: Gnolle sind in diesem Land heimisch... genau wie wir.\n\nWir beobachteten jedoch bereits, wie sie den Verfall bis zu den Riesenbaumhgeln ausbreiteten. Wenn das so weitergeht, werden sie noch das Gebirge infizieren und sich selbst vernichten.\n\nDas drfen wir nicht zulassen. Es ist bedauerlich, aber... wir mssen ihnen ein Ende setzen.', '', '', '', '', '', '', 47187),
(65842, 'deDE', 'Entwaffnendes Verhalten', 'Schaltet Waffenmeisterin Vordak aus und sammelt $1oa Weltenbrecherwaffen.', 'Ich habe wenig fr die Weltenbrecherdrachkin brig. Sie hngen einem fehlgeleiteten Glauben an, dass Todesschwinge zurckkehren wird, und helfen uns nicht mit dem Obsidianthron.\n\nWaffenmeisterin Vordak, die dem Schwarzen Prinzen einst die Treue schwor, hat etliche hier in der Zitadelle hergestellten Waffen gestohlen und den Weltenbrechern bergeben. Diesen Diebstahl werde ich nicht dulden. Diesen Verrat auch nicht.\n\nGeht zur Schwelenden Spitze und holt die Waffen zurck... wenn ntig mit Gewalt.', '', '', 'Waffenmeisterin Vordak', '', '', '', 47187),
(65841, 'deDE', 'Die Ausbreitung verhindern', '', '', '', '', '', '', '', '', 47187),
(65838, 'deDE', 'Die Brackenfelle brechen', 'Untersucht die Brackenfellrandgebiete.', 'Wenn die Gnolle Verfallmagie entdeckt haben, sind die Leylinien und das Land selbst in groer Gefahr.\n\nMeine Spiegelbilder sind zu ausgednnt, um elementaren Strungen dieses Ausmaes zu widerstehen. Bitte betretet den Wald und untersucht den Verfall.\n\nIch werde mit unseren neuen Freunden von den Tuskarr zusammenarbeiten und einen Ort suchen, an dem ich mein Spiegelbild aufrechterhalten kann. Ich treffe Euch anschlieend tiefer im Wald.\n\nWir mssen dem ein Ende setzen!', '', '', '', '', '', 'Sprecht mit Kalecgos im Brackenfellgestrpp.', 47187),
(65837, 'deDE', 'Probleme im Nadelholz', 'Sprecht mit Wchter Olekk im Nadelholzposten auf den Ebenen von Ohn\'ahra.', 'Die Primalisten haben im Shikaarhochland angegriffen.\n\nSolltet Ihr Informationen besitzen oder helfen knnen, begebt Euch zum Nadelholzposten und sucht nach Olekk. Sagt ihm, ich habe Euch geschickt. <Tirren kichert.> Ich hoffe, der eingestaubte Huffu erinnert sich an mich.\n\nBleibt auf der Strae, $p. Die Ebenen sind nicht mehr so friedlich wie frher.', '', '', '', '', '', 'Sprecht mit Wchter Olekk im Nadelholzposten auf den Ebenen von Ohn\'ahra.', 47187),
(65836, 'deDE', 'Eine strmische Demonstration', 'Formiert Euch mit Watu im Weisenkronenpinienwald neu.', '<Watu steht ohne Probleme auf, als ob seine Verletzung verschwunden wre.>\n\nI-i-ich... habe mir den Splitter reingerammt. Nichts schmerzt mehr. Ich fhle mich gut. Blendend. Gewaltig.\n\nOlekk ist immer noch nicht zurck. Etwas stimmt nicht. Er htte niemals ohne mich gehen sollen!', '', '', '', '', '', '', 47187),
(65834, 'deDE', 'Ttet die Knigin', 'Ttet die Schaudernetzknigin.', 'Und fertig ist der Lack! Mit ein bisschen Wissen, gesundem Raten und ein paar neugemeielten Runen haben wir jetzt einen magischen... Enterfller? Entfller? Ausfller?\n\nEgal! Bin ziemlich sicher, dass er irgendwas Unschnes mit der Knigin anstellen wird. Und um die Bedrohung loszuwerden, mssen wir sie loswerden. Die Kleinen zu zerquetschen, verzgert alles nur, wir mssen dies im Keim ersticken.', '', 'Es darf niemals eine Spinnenknigin geben.', 'Schaudernetzknigin', '', '', '', 47187),
(65833, 'deDE', 'Einmischung der Primalisten', 'Erbeutet die drei Frostruferrunensteine.', 'Die Primalisten erfllen die Spinnen mit Elementareis, um sie als Kanonenfutter gegen die Verteidigung der Drachen im Gebirge einzusetzen und sie zu berrennen. Das drfen wir nicht zulassen.\n\nDie drei Frostbeulen haben das Kommando. Schaltet sie aus und bringt mir ihre Runensteine, mit denen sie die Urmagie fokussieren. Damit sollten wir den Magiestrom unterbrechen knnen.', '', '', '', '', '', '', 47187),
(65832, 'deDE', 'Zwergenfrostschutz', 'Findet $1oa Flschchen Zwergenfrostschutz.', 'Ich stecke ein bisschen in der Klemme, $uJunge:Mdel;. Diese Frostlutscher von Primalisten haben mich in diesen zu gro geratenen Eiswrfel gepackt und der einzige Grund, warum ich nicht vllig einfriere, ist mein geheimer Vorrat an Stffchen... und er geht zur Neige!\n\nDummerweise haben diese Dreckskerle meinen weniger geheimen Vorrat geklaut.\n\nWrt Ihr so gut, mir meine Flschchen zurckzubringen, bevor mein verdammtes Blut einfriert?\n\nOh, und $uJunge:Mdel;... Wenn Ihr sie aus dem Hintern einer Spinne ziehen msst, erzhlt mir lieber nichts davon. Will ich gar nicht wissen.', '', '', '', '', '', '', 47187),
(65806, 'deDE', 'Maruukai', 'Reist nach Maruukai.', '<Whrend Sansok Khan in Gebrden spricht, formuliert Okir die Worte.>\n\nMaruukai liegt an einem Berghang in der Nhe dieses Waldes. Unsere Reise ist fast zu Ende.\n\nDer Khural ist eine Zeit des Friedens bei den Maruuk, aber Ohn Seshtengs Omen ist beunruhigend. Wir mssen auf der Hut sein.', '', '', '', '', '', '', 47187),
(65805, 'deDE', 'Verbindung zu Ohn\'ahra', 'Sammelt $1oa Teile Flussschilf, $2oa Vogelschwanzfedern und ein Salamantherherz am Flussufer.', 'Der Wind zeigt sich hier ruhelos, $n. Ohn\'ahra ruft. Und ich muss ihrem Ruf folgen.\n\nIch brauche Reagenzien fr mein Ritual: Schilf vom Flussufer, Federn von den Schwnzen der Stockenten und das Herz eines Salamanthers. Sammelt diese Materialien am Fluss, damit ich ihrer Stimme folgen kann.', '', '', '', '', '', '', 47187),
(65804, 'deDE', 'Fr Speisen und Rivalitt', 'Erbeutet $1oa Teile frisches Wildfleisch von den Tieren in der Steppe des Wanderers.', 'Die Maruuk reisen aus allen Teilen der Ebenen an, um am Khural teilzunehmen. Die Zusammenkunft erstreckt sich ber mehrere Tage.\n\nSo viele Zentauren satt zu bekommen, ist kein leichtes Unterfangen. Die Jger der Shikaar liefern das Fleisch fr alle gemeinsamen Mahlzeiten. Nach unserer Tradition jagen wir auf dem Weg nach Maruukai.\n\nAuch Ihr msst Euren Beitrag leisten.', '', '', '', '', '', '', 47187),
(65803, 'deDE', 'Zur Stadt', 'Reist mit der Shikaarkarawane zur Steppe des Wanderers.', 'Der Khural ist eine Zeit, wo die Klans sich besprechen und Geschichten austauschen. Es gibt viele Zentaurenklans auf den Ebenen, aber wir alle sind Maruuk.\n\nDie Karawane ist reisefertig. Da Maruukai etwas weiter weg ist, werden wir Halt machen mssen.\n\nWenn Ihr bereit zum Aufbruch seid, findet Ihr mich am Wagen. Lasst uns nicht warten.', '', '', '', '', '', '', 47187),
(65802, 'deDE', 'Vorrte fr die Reise', 'Sammelt $1oa Lagervorrte in der Gegend des Baumschrittauenpostens und $2oa Wildbltenkapseln im nahen Wald.', '<Whrend Sansok Khan in Gebrden spricht, bersetzt Okir fr sie.>\n\nWhrend Ihr mit uns reist, msst Ihr Euren Soll erbringen. Wilde Gorlocs haben krzlich unsere medizinischen Vorrte geplndert, und wir bentigen dringend Nachschub. Sammelt die orangen Blten, die Ihr im Umkreis des Auenpostens findet, damit wir mehr Heilumschlge herstellen knnen.\n\nUm den Auenposten herum liegen auch Vorrte, die zur Karawane gebracht werden mssen. Sammelt sie bitte mit auf.\n\nWenn Ihr alles beisammen habt, bringt es zu Tomul.', '', '', '', '', '', 'Meldet Euch bei Spherin Tomul.', 47187),
(65801, 'deDE', 'Vorstellungsrunde', 'Stellt Euch den Mitgliedern von Klan Shikaar vor.', '<Whrend Sansok Khan in Gebrden spricht, bersetzt Okir fr sie.>\n\nEs ist Generationen her, seit ein Fremdling wie Ihr Fu auf unser Land setzte. Angesichts der Primalisten, die unser Land heimsuchen und ihre verbotene Magie ausben, ist mein Volk verstndlicherweise misstrauisch.\n\nWenn Ihr mit uns reisen wollt, msst Ihr Euch mit meinem Klan bekanntmachen. Stellt Euch den Mitgliedern vor.', '', '', '', '', '', 'Meldet Euch bei Spherin Tomul.', 47187),
(65798, 'deDE', 'Eine opportunistische Herangehensweise', 'Sammelt Waffen und erschlagt Nokhud-Kmpfer beim Vorsto der Nokhud.', 'Die Shikaar haben gegen die Nokhud im Norden eine Angriffslinie gebildet. Es gefllt mir eigentlich nicht, uns zum Plndern herabzulassen, doch es ist leider ein notwendiges bel, um unsere Vorrte aufzufllen. Trotzt dem Schlachtfeld und kehrt mit Waffen zurck. Ich werde Eure Mhen entlohnen.\n\nWenn Ihr ebenjene Mhen auf die Seite der Nokhud konzentriert, werden die Ahnen mich hoffentlich nicht ganz so sehr verurteilen.', '', '', '', '', '', '', 47187),
(65796, 'deDE', 'Die beste Verteidigung...', 'Ttet Sirena die Zahnbrecherin.', 'Unser nchster Pfad fhrt uns durch das Territorium der Nokhud. In der Vergangenheit herrschte ein vorlufiger Frieden zwischen unseren Klans, aber die Zeiten haben sich gendert.\n\nWenn wir nicht zuerst handeln, machen wir uns angreifbar. Meine Spher haben berichtet, dass eine ihrer Kriegsanfhrerinnen nahe Drachentreff gesichtet wurde. Greift sie zuerst an, lasst ihr keine Zeit, ihre Truppen zu sammeln, um uns unterwegs berfallen.', '', '', '', '', '', '', 47187),
(65795, 'deDE', 'Auf in die Steppe', 'Trefft Botschafter Taurasza im Auenposten der Rubinschuppen.', 'Der grne Drachenschwarm braucht jetzt Eure Hilfe. Die Tochter meiner Schwester und ihr Schwarm sind in den Smaragdgrnen Traum eingedrungen, um ihren eigenen Schwurstein zu strken. Aber wir haben nichts mehr von ihnen gehrt, seit ihr Schlummer begann.\n\nSucht die Zentauren auf, die ber die Ebenen von Ohn\'ahra herrschen. Ihr knntet ihre Verbindung zum Land und seinen Geistern gut brauchen, wenn ihr die Grnen wecken wollt.\n\nSie sind ein stolzes und sehr territoriales Volk, das sehr empfindlich auf vermeintliche Beleidigungen reagiert. Sprecht mit unserem Botschafter. Er wird Euch vorbereiten.', '', '', '', '', '', 'Trefft Botschafter Taurasza im Auenposten der Rubinschuppen.', 47187),
(65794, 'deDE', 'Die Pflicht der Pflege', 'Seht zu, wie die Schwarzdracheneier erneut in den Lebensbecken ihren Platz finden.', 'Ich danke Euch, $C. Und mein Beileid dafr, dass Ihr so lange mit den beiden zu tun hattet.\n\nDer rote Drachenschwarm hat die Aufgabe, alle Drachen zu beschtzen und zu pflegen, auch jene, derer wir vielleicht manchmal berdrssig sind.\n\nMit der Rckkehr der Eier des schwarzen Drachenschwarms ist die Drachengemeinschaft so geeint wie seit tausenden von Jahren nicht mehr. Ich glaube, das ist es, was unseren Rubinschwurstein wiederherstellen wird.\n\nSprecht mich an, wenn Ihr bereit seid, die Eier zum Obsidianlebensbecken zu bringen.', '', '', '', '', '', '', 47187),
(65793, 'deDE', 'Eieskorte', 'Eskortiert die Eier zu den Lebensbecken.', 'Nachdem der Schwurstein wieder ermchtigt wurde, mssen wir nun die Zukunft unserer Art zu den Lebensbecken bringen. Es ist das Recht eines jeden wahren Drachenschwarms, seine Eier in seinen eigenen Gewssern pflegen zu lassen.\n\nLeider werden unsere Feinde den Himmel beobachten, nachdem wir uns offenbart haben. Wir werden die letzte Etappe der Reise zu Fu zurcklegen, um ihren Blicken zu entgehen.\n\nTrefft mich in der Nhe des Obsidianbollwerks, $C. Als Champion der Lebensbinderin mchte ich Euch einladen, mich zu begleiten.', '', '', '', '', '', 'Sprecht mit Sabellian beim Rubinlebensschrein.', 47187);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(65792, 'deDE', 'Zhne um Zahn', 'Ttet $1oa Felszhne mit Toluijin.', 'Toliqui hat behauptet, neulich einen Felszahn ohne Hilfe erlegt zu haben. Da unsere Seelen miteinander verbunden sind, mchte ich ihr nicht vorwerfen, gelogen zu haben. Stattdessen...\n\nIch will ihr und allen anderen beweisen, dass ich die bessere Hlfte unserer Seele bin! Die nchste Felszahnaufgabe wartet im Nordosten auf uns. Trefft mich dort!', '', '', '', '', '', '', 47187),
(65791, 'deDE', 'Lebensbinderin im Einsatz', 'Trefft Alexstrasza beim Rubinschwurstein.', 'Bald werden die Lebensbecken wieder gefllt sein.\n\nDanke fr Eure Hilfe dabei, $n. Es bedeutet mehr, als ich je in Worte fassen knnte.\n\nGeht und sucht die Lebensbinderin beim Schwurstein auf. Sagt ihr, dass wir bereit fr die Eier sind.', '', '', '', '', '', 'Trefft Alexstrasza beim Rubinschwurstein.', 47187),
(65789, 'deDE', 'Wo Flsse schlafen', 'Sammelt Reagenzien im Sumpfholzmoor.', 'Im Sumpfholzmoor lassen sich wichtige Reagenzien finden, die oft zur Kommunikation mit den Ahnen verwendet werden. Unglcklicherweise durchstreift der Schlickflossenstamm diese Gegend und hindert uns daran, sie einzusammeln.\n\nIch wrde es sehr zu schtzen wissen, wenn Ihr ein paar der Gewchse im Moor und einige Ressourcen der Schlickflossen auftreiben knntet.', '', '', '', '', '', '', 47187),
(65783, 'deDE', 'Willkommen an unserem Feuer', 'Trefft Spherin Tomul am Baumschrittauenposten.', 'Ihr habt Seite an Seite mit unseren Jgern gekmpft und Euch einen Platz an unserem Feuer verdient.\n\nUnsere Khan ist beim Jagdposten im Sumpf und bereitet unsere nchste Karawane vor. Ich werde sie ber Eure Ankunft und Euer Anliegen benachrichtigen.\n\nDen Weg findet Ihr gewiss selbst.', '', '', '', '', '', 'Trefft Spherin Tomul am Baumschrittauenposten.', 47187),
(65782, 'deDE', 'Hinter Schloss und Riegel', 'Beschafft den Weltenbrecherzellenschlssel und befreit Ayasanth.', 'Als wir Gerchte eines Todesschwingenkults gehrt haben, befahl Majordomus Selistra mir, diese ehemaligen Schuppengeborenen wieder bei uns aufzunehmen. Wir hatten gehofft, dass es sich einfach nur um ein Missverstndnis handelte.\n\nOffensichtlich lagen wir falsch.\n\nWir mssen uns um ihren Anfhrer kmmern, aber zuerst muss ich aus diesem Kfig entkommen. Findet den Schlssel und bringt ihn mir.', '', '', '', '', '', '', 47187),
(65780, 'deDE', 'Bewhrungsprobe', 'Ttet den lodernden Protodrachen.', 'Ein Geschenk der Drachen mag einige Zentauren beeindrucken, aber Klan Shikaar muss sehen, wie gut Ihr jagt.\n\nEiner unserer Jagdtrupps brachte gerade einen Protodrachen zu Boden, dem die Kraft der Flamme innewohnt. Beweist uns Euren Wert und helft dem Trupp, ihn zu tten.', '', 'Wenn ein junger Zentaur volljhrig wird, nimmt er den Erwartungen gem oft an seiner ersten Protodrachenjagd teil.', 'Lodernder Protodrache', '', '', '', 47187),
(65779, 'deDE', 'Zu den Ebenen', 'Trefft die Spherin der Shikaar auf den Ebenen von Ohn\'ahra.', 'Der grne Drachenschwarm ist in ihre Grten in den nahen Ebenen zurckgekehrt. Knigin Alexstrasza wnscht, dass Ihr Euch mit Merithra des Traums in Verbindung setzt.\n\nDie Zentauren dieser Ebenen sind stolze Jger. Um in die Smaragdgrten zu gelangen, msst Ihr mit ihnen zuerst diplomatische Beziehungen eingehen.\n\nZeigt Respekt, aber keine Schwche.', '', '', '', '', '', 'Trefft die Spherin der Shikaar auf den Ebenen von Ohn\'ahra.', 47187),
(65778, 'deDE', 'Ein Mitbringsel fr den Kreischerschwarm', 'Tragt Eure Verkleidung und verwendet das \"Prototypei\" gegen die Chefkchin der Matriarchin.', 'Seid Ihr bereit, Eure schauspielerischen Talente unter Beweis zu stellen, $n?\n\nWas? Keine solchen Talente? Dann ist es ja gut, dass ich Euch aus den Materialien, die Ihr gesammelt habt, eine federfhrende Kreischerschwarmverkleidung gefertigt habe!\n\nSegallia und ich brauchen noch Zeit, um das letzte \"Ei\" zu bauen, das die Matriarchin ausschalten wird. Ich habe allerdings eine kleinere Version als Prototyp gebaut, die Ihr an der Kchin ausprobieren knnt.\n\nUnd keine Bange! Unter all den Federn seid Ihr 12% besser vor diesen Explosionen geschtzt!', '', '', '', '', '', '', 47187),
(65777, 'deDE', 'Schlammbedeckte Halskette', 'Macht jemanden ausfindet, der sich mit der Ebenenjagd und handgefertigten Artefakten auskennt.', '<Die uralten Muster auf der Halskette sind schwer zu entziffern, aber sie scheint aus Tierhaut und geschnitzten Knochenfragmenten zu bestehen.\n\nVielleicht kann Euch ein erfahrener Jger mehr ber den Wert dieses Objekte erzhlen.>', '', '', '', '', '', '', 47187),
(65770, 'deDE', 'Ein Versprechen ist ein Versprechen', 'Versprecht Initiandin Radiya, ihr Geheimnis zu bewahren.', 'Die Tiere scheinen sich in Eurer Nhe wohlzufhlen. Das ist ein gutes Zeichen fr Euren Geist.\n\nNun... knnt Ihr ein Geheimnis fr Euch behalten? Ich mchte Euch einer Freundin vorstellen. Niemand wei von ihr.\n\nIhr msst mir zuerst versprechen, dass das zwischen uns bleibt. Meine Ohn wrde mich von den Ebenen verbannen, wenn sie es herausfnde.', '', '', '', '', '', 'Sprecht mit Godoloto der Ohuna.', 47187),
(65769, 'deDE', 'Eisige Spinnweben', 'Befreit $1oa eingesponnene berlebende im Schaudernetztal.', 'Viele meiner Freunde und Kollegen wurden gefangen genommen, als die Arachniden und ihre Primalistenmeister angriffen.\n\nIch habe gesehen, wie sie mit gefrorenen Spinnweben gefesselt und verschleppt wurden. Ihnen droht ein Schicksal, das ich mir gar nicht ausmalen mag.\n\nBitte befreit so viele von ihnen wie mglich!', '', '', '', '', '', '', 47187),
(65761, 'deDE', 'Mehr Abenteuer als erwartet', 'Nutzt Godoloto, um Radiya zu finden und zu retten.', '<Godolotos Blick ist starr und vorwurfsvoll. Sie hustet.>\n\n<Vielleicht kann Euch die Ohuna helfen, Radiya zu finden und zu retten.>', '', '', '', '', '', '', 47187),
(65760, 'deDE', 'Zum Dienst melden', 'Folgen Sendrax zum Drachenherzauenposten.', 'Ich habe bisher nur in Bchern ber die Djaradin gelesen.\n\nUralte Rivalen der Drachen, mchtige Riesen und Herrscher ber Erde und Lava... vollkommen darauf verschworen, die Drachen bis zur Auslschung zu jagen.\n\n<Sendrax runzelt die Stirn beim Anblick des fernen Vulkans.>\n\nMein Ausbilder sagte, sie wren nicht mehr gesehen worden, seit die Drachen verschwunden sind, da sie tief in der Erde schlafen.\n\nSollten sie erwacht sein, ist jeder Welpling auf diesen Inseln in Gefahr!\n\nFolgt mir, ich bringe uns zu Kommandant Lethanak beim Drachenherzauenposten.', '', '', '', '', '', 'Sprecht mit Kommandant Lethanak beim Drachenherzauenposten.', 47187),
(65758, 'deDE', 'Grungir der Entdecker', 'Findet Grungir Eisenschnauze.', '$N! Mein Kollege aus der Forscherliga, Grungir Eisenschnauze, war nicht unter jenen, die Ihr gerettet habt. Zunchst hatte er sich den Weg freigekmpft, aber als er sah, wie wenige von uns es rausgeschafft hatten, kehrte er um und ging direkt wieder rein! Alleine!\n\nDieser Trottel ist ebenso mutig wie impulsiv. So ein Schicksal hat er nicht verdient.\n\nBitte findet ihn.', '', '', '', '', '', '', 47187),
(65752, 'deDE', 'Arkane Strenfriede', 'Ttet $1oa schlemmende Wyrms.', 'Eine groe Anzahl Manawyrms absorbiert die wilde arkane Magie, die den Archiven entstrmt.\n\nDie Rate, mit der sie das tun, strt das Gleichgewicht der Leylinien... was verhindert, dass der Azurschwurstein wiedererlangt werden kann.\n\nIch werde etwas von dem instabilen Arkana nutzen, das Ihr eingesammelt habt, um eine Art Haken zu bilden.\n\nNutzt ihn, um einige Wyrms zu erledigen. Die kurze Verzgerung wird genug fr mich sein, um die Energien unten anzupassen.', '', '', '', '', '', '', 47187),
(65751, 'deDE', 'Plattformanpassungen', 'Bannt $1oa Einheiten instabiler Arkanenergie an der Spitze der Azurarchive.', 'Die letzte arkane Strung scheint hier oben zu sein.\n\nIch werde die Leyenergien weiter angleichen. Benutzt etwas von dem Arkana, das Ihr zuvor geborgen habt, um die Unterbrechungen hier auszugleichen.', '', '', '', '', '', '', 47187),
(65750, 'deDE', 'Achtbeinige Plage', 'Ttet $1oa Schaudernetzschleicher oder Schaudernetzkriecher und $2oa Pfleger der Primalisten im Schaudernetztal.', '$C!\n\nIch brauche Eure Hilfe, wenn Ihr bereit seid...\n\nDiese gemeinsame Expedition sollte die einzigartigen Arachniden in dieser Gegend studieren, aber wie Ihr sehen knnt, ist unser Plan gescheitert.\n\nWas wir ursprnglich fr eine evolutionre Anpassung hielten, ist stattdessen eine Perversion der natrlichen Ordnung durch die Primalisten!\n\nIch nehme meine Verantwortung als Naturschtzerin ernst, aber die Zeit des Studiums lebender Exemplare ist vorbei. Wir knnen nicht zulassen, dass sich ihre Perversion ausbreitet. Stattdessen knnen wir ihre Leichen erforschen.\n\nWerdet Ihr uns dabei helfen?', '', '', '', '', '', '', 47187),
(65711, 'deDE', 'Den Donner rauben', 'Ttet die Sturmextraktoren und befreit Lizi das Donnerrckgrat aus dem Lager der Kaighan.', 'Ihr seid das! Ohn\'ahra sei Dank. Ich habe so getan, als wre ich verletzt, um den nchsten Grobian in die Irre zu fhren, der sich hierher traut. Uff... die Huflecker haben mich mit einem Bindungszauber belegt. Den werde ich noch brechen.\n\nSie halten Lizi in der Hhle gefangen. Bitte befreit sie. Ich komme hier schon allein klar.\n\nTut, was Ihr tun msst.', '', '', '', '', '', '', 47187),
(65709, 'deDE', 'Arkanes Stutzen', 'Sucht im Beutel ntzlicher Waren nach dem Leyszepter und nutzt es, um zwei Plattformen zu reparieren.', 'Wir knnen den Schwurstein in den Azurarchiven nicht aktivieren, bis wir das Problem mit der auer Kontrolle geratenen Leyenergie hier behoben haben.\n\nZwei der drei drakonischen Runen, die sie kontrollieren sollen, werden von instabilem Arkana unterdrckt.\n\nIch entschuldige mich, dass dies aufgrund von Khadgars Verantwortungen und dem Nichterscheinen meiner Leute nun Euch zufllt.\n\nIn dem Beutel ntzlicher Waren, den Ihr habt, sollte ein Leyszepter sein.\n\nBenutzt es, um die Runen in der Nhe zu reparieren.', '', '', '', '', '', '', 47187),
(65702, 'deDE', 'In den Wahnsinn getrieben', 'Bergt $1oa Portionen instabiler Arkanenergie.', 'Die Azurarchive waren einst der Ort, wo die blauen Drachen sich versammelten, um ber Magie zu diskutieren.\n\nNun bin ich hier der einzige meiner Art.\n\nVon hier aus werden die gewaltigen Leylinien unter dem Azurblauen Gebirge beaufsichtigt, aber dieser Ort und seine Diener sind auer Kontrolle geraten.\n\nIch glaube, wenn wir wieder Ordnung in diesen Ort bringen, kann ich den Azurschwurstein neu beanspruchen.\n\nDie verschiedenen Konstrukte und Elemente sind voller instabiler arkaner Energie, die umgeleitet werden muss.\n\nZerstrt sie und sammelt ein, was Ihr knnt.', '', '', '', '', '', '', 47187),
(65701, 'deDE', 'Bewahrung oder Verheerung', 'Whlt eine Spezialisierung.', 'Falls es stimmt, was diese Drachen sagen, dann erwartet uns eine groe Schlacht. Wir brauchen Eure Konzentration und Eure Strke, $gRufer:Ruferin;.\n\nEs ist an der Zeit, dass Ihr Eure Kampfspezialisierung whlt. Werdet Ihr Eure Verbndeten bewahren oder Eure Feinde verheeren?\n\nUm Eure Kampffertigkeiten bis auf das Schrfste zu schleifen, whlt Verheerung.\n\nUm Euer Heilpotenzial zu maximieren, whlt den Weg der Bewahrung.\n\nJede Spezialisierung wird Euch gut dienen. Und vergesst nicht, Ihr knnt sie spter noch ndern oder anpassen.', '', '', '', '', '', '', 47187),
(65691, 'deDE', 'Der Schatten seiner Schwingen', 'Stellt Cygenoth, Stimme von Neltharion, zur Rede.', 'Die Stimme von Neltharion hlt sich weiter unten auf und verbreitet Lgen unter ihren Anhngern.\n\nEr scheint wie ich der Drachenbrut anzugehren, aber er spricht gebrochenes Drakonisch, als wre er ein Ungeschuppter.\n\nIch vermute ein falsches Spiel, womglich eine Illusion. Wenn wir ihn unterwerfen knnen, wird die Wahrheit sicherlich ans Licht kommen.', '', 'Selbsternannte Stimme von Neltharion und Anfhrer der Weltenbrecher.', 'Cygenoth', '', '', '', 47187),
(65690, 'deDE', 'Befrchtungen eines Kultisten', 'Findet Ayasanth im Schwelenden Horst.', 'Eine weitere Auenseiterin kam gestern hier an. Sie nannte sich \"Abgesandte\" des roten Drachenschwarms und bat um eine Audienz bei unserem Anfhrer, der Stimme Neltharions.\n\nDoch die Stimme wurde furchtbar wtend. Er sagte, dass der Erdwchter uns auf die Probe stellt, und dass wir sie hinrichten mssen!\n\nIch wei, dass wir Fremden nicht trauen sollen, aber deshalb mssen wir sie ja nicht gleich tten! Bitte helft mir, sie zu retten.', '', '', '', '', '', 'Sprecht mit Ayasanth im Schwelenden Horst.', 47187),
(65689, 'deDE', 'Die vielen Abbilder von Kalecgos', 'Nutzt den Kristallpylon, um zu den Azurarchiven zu gelangen.', 'Schn, Euch offiziell kennenzulernen, $n. Mein Name ist Kalecgos, Erzmagier der Kirin Tor und Aspekt des blauen Drachenschwarms.\n\nIch habe Schwierigkeiten bei der Wiederherstellung der Azurarchive, um den Azurschwurstein erneut zu beanspruchen. Ich knnte ein zustzliches Paar physischer Hnde gut brauchen.\n\nIch bin gerade oben in den Archiven selbst. Es ist mir gelungen, den Pylon drauen zu reaktivieren, das sollte Euch erlauben, hier heraufzukommen.', '', '', '', '', '', 'Sprecht mit Kalecgos in den Azurarchiven.', 47187),
(65688, 'deDE', 'Treffen mit Kalecgos', 'Holt den Beutel ntzlicher Waren und trefft Kalecgos am Fue der Azurarchive.', 'Ich frchte, wir werden unsere Aufmerksamkeit teilen mssen. Die Primalistenbedrohung im Osten muss unter Kontrolle gebracht werden.\n\nIch muss Euch darum bitten, an meiner statt zu den Azurarchiven zu reisen und Kalecgos dabei zu untersttzen, den Azurschwurstein neu zu beanspruchen.\n\nIhr werdet einige Vorrte einpacken mssen, die Euch dabei helfen werden, mit den ganzen Geschehnissen dort fertig zu werden.\n\nSprecht mit unserem Portalrstmeister. Dort solltet Ihr etwas bekommen knnen, das Euch auf Eurem Wege hilft.\n\nViel Glck, $n. Kalecgos wird die Hilfe zu schtzen wissen.', '', '', '', '', '', 'Trefft Kalecgos am Fu der Azurarchive.', 47187),
(65687, 'deDE', 'Schlagfertige Argumente', 'Ttet $1oa Weltenbrecherdrachkin.', 'Einige der anderen Schler sind... ziemlich fies.\n\n<Barren reibt ber eine frische Wunde auf seiner Schnauze.>\n\nFrher war das nicht so. Aber dann kam Cygenoth und sagte: \"Wir sollten Strke ber alles andere stellen.\" Jetzt kmpfen alle die ganze Zeit.\n\nIch will mich ja wehren! Aber ihre Blge sind zu dick... und ich bin zu klein.\n\nAber Ihr nicht! Ihr kmpft bestimmt andauernd gegen Fieslinge. Vielleicht knnt Ihr ja helfen?', '', '', '', '', '', '', 47187),
(65686, 'deDE', 'In das Azurblaue Gebirge', 'Trefft Euch mit Glania von den Gesegneten im Azurblauen Gebirge.', 'Seid gegrt, $n! \n\nPakina und ich sind hier im Auftrag der Kirin Tor und suchen Hilfe.\n\nDie Kirin Tor sind damit beschftigt, die wilde arkane Magie, die sich berall im Azurblauen Gebirge findet, zu schtzen.\n\nKalecgos, der Aspekt des blauen Drachenschwarms und einer unserer Anfhrer, bentigt Hilfe dabei, den Azurschwurstein erneut zu beanspruchen.\n\nWenn Ihr helfen knnt, reist die Strae weiter, um Glania von den Gesegneten aufzusuchen.\n\nSie kann Euch sagen, wo Eure Hilfe am meisten bentigt wird.', '', '', '', '', '', 'Trefft Euch mit Glania von den Gesegneten im Azurblauen Gebirge.', 47187),
(65615, 'deDE', 'Arkanes Eindringen', 'Untersucht den Arkanstrahl.', 'Das Leuchtfeuer vor uns... Ich bin mir sicher, es war noch nicht da, als wir eingesperrt wurden.\n\nZauberei ist nicht meine Strke, aber ich erkenne arkane Magie, wenn ich sie sehe. Dieselbe Magie hat der blaue Drache in dem Hort angewandt.\n\nEr sagte einen Namen... Malygos. Er hrt sich so vertraut an, aber die Lehren des Erdwchters scheinen wie in weiter Ferne. Bruchstckhaft.\n\nFalls uns dieser Malygos in Stasis versetzt hat, wurde vielleicht auch dieses arkane Leuchtfeuer auf seinen Befehl hin platziert.\n\nUntersucht den Bereich und meldet Euch wieder. Vergewissert Euch, dass mit dem Leuchtfeuer keine gegnerischen Verstrkungen herbeigerufen werden knnen.', '', '', '', '', '', '', 47187),
(65613, 'deDE', 'Ein ikonischer wie drakonischer Anblick', 'Nehmt ein Antlitz an.', 'Ich bin sicher, Eure Ankunft in Orgrimmar hat fr ziemlichen Aufruhr bei den Einwohnern gesorgt. Zweifelsohne fhlten sich einige in Eurer Gegenwart wohler als andere.\n\nAls ich ein junger Drache war, nahm ich das Antlitz eines Sterblichen an, das Ihr nun seht. So konnte ich als Verbndeter unter den Tauren von Hochberg leben.\n\nAuch wenn sich Eure Pfade von meinen unterscheiden, fliet die Essenz der Drachenheit auch durch Eure Adern, $p. Vielleicht erlaubt sie Euch ebenfalls, ein Antlitz anzunehmen.\n\nLasst uns ein Stck gehen.', '', '', '', '', '', '', 47187),
(65606, 'deDE', 'Angesehen bei den Maruuk', 'Sprecht mir Agari in Maruukai.', 'Eure Bemhungen zur Frderung der Interessen des Klans sind nicht unbemerkt geblieben.\n\nKehrt nach Maruukai zurck. Ich habe einige Vorrte vorbereitet, um Euch bei Eurer Zusammenarbeit mit uns weiter zu untersttzen.', '', '', '', '', '', '', 47187),
(65595, 'deDE', 'Ein fauler Apfel', 'Ttet die Wurzel des Verfalls.', 'Verrottung lsst Gnolle hungern.\n\nVerrottung verletzt Freunde.\n\nWir jetzt Verrottung tten. Ist Aufgabe von Mohn-Archs.', '', 'Der widerwrtige Treant hat die Gnolle Verfallmagie gelehrt. Und miese Hygiene.', 'Wurzel des Verfalls', '', '', '', 47187),
(65594, 'deDE', 'Aus einem Gnoll einen Elefanten machen', 'Zerstrt $2oa Totems des Verfalls.', 'Blder Verfall denken, ist Boss. Aber ich Boss. Wir jetzt tten. Hab Schleim in Freunde verwandelt.', '', '', '', '', '', '', 47187),
(65490, 'deDE', 'Explosive Exkremente', 'Fllt Professorin Hohnzirpers Autoexkrementsammler.', 'Die Harpyien sind ja eine erfreuliche berraschung und so, aber ich bin nur aus einem einzigen Grund in diese Berge gekommen: EXKREMENTE!\n\nGenauer gesagt, wegen der Exkremente von Blaufederrocs, die von Wanzen gefressen und verdaut wurden. Die Magensfte der Skaraben erhhen den explosiven Stickstoffgehalt um das Zehnfache! Mindestens!\n\nHier nehmt Hohnzirpers Autoexkrementsammler. Tretet auf die Skaraben auf dem Hhlenboden ein und benutzt den Sammler, um die Belohnungen zu ernten.\n\nBringt ihn vollstndig gefllt zurck, damit wir mit dem richtigen Spa anfangen knnen: EXPLOSIONEN!', '', '', '', '', '', '', 47187),
(65486, 'deDE', 'Ein perfektes Bild', 'Nehmt das Katalogisiererflo mit Fren und macht Bilder von der heimischen Tierwelt.', 'Entschuldigt, ich verlier mich manchmal sehr im Teleskop.\n\nFindet Ihr nicht auch, dass die Welt sich aus der Ferne viel leichter versteh\'n lsst? Keine Strungen von auen, nur die Natur, die ihren Weg ohne uns geht...\n\n<Akunda die Katalogisiererin seufzt.>\n\nWie ich sehe, hat Coralie Euch eine Kamera gegeben. Gut.\n\nFahrt mit Fren den Fluss entlang und macht ein paar Fotografien von den Wildtieren in ihrem natrlichen Lebensraum, damit ich sie studier\'n kann.', '', '', '', '', '', 'Kehrt zu Akunda der Katalogisiererin in ihrem Lager zurck.', 47187),
(65475, 'deDE', 'Kreischende Botschaft', 'Bringt die Schriftrolle des Kreischerschwarms zu Harleen Hohnzirper an den Blaufederklippen.', '<Ihr zieht einen Fetzen Pergament aus dem mit Blut getrnkten, besudelten Ranzen von Rocfresser. Alles, was Ihr erkennt, ist das Bild einer Harpyie, die groe Eier verschlingt.\n\nIhr seid Euch sicher, dass die dicken, unverstndlichen Kratzspuren Eurer Lieblingsornithologin, Harleen Hohnzirper, einiges verraten werden.>', '', '', '', '', '', 'Bringt die Schriftrolle des Kreischerschwarms zu Harleen Hohnzirper an den Blaufederklippen.', 47187),
(65453, 'deDE', 'Urgeziefer', 'Ttet $1oa Urprotodrachen an der Wilden Kste.', '<Glutdresch wirft einen misstrauischen Blick auf die Protodrachen, die hinter ihr auf dem Gebirgskamm lauern.>\n\nIch knnte schwren, dass diese Protodrachen jedes Mal, wenn ich ihnen den Rcken zuwende, nher an das Lager herankommen...\n\nDas sind nicht die Drachen, die Ebyssian uns hier vorstellen wollte.\n\nDie Protodrachen sind skrupellose Raubtiere, mit denen man nicht verhandeln kann. Wir mssen ebenso skrupellos sein.\n\nDezimiert ihre Zahl, um ihre Khnheit zu migen, sonst ist diese Expedition zu Ende, bevor sie richtig begonnen hat.', '', '', '', '', '', 'Trefft Schuppenkommandantin Glutdresch in der Botschaft von Schwingenrast.', 47187),
(65452, 'deDE', 'Forscher in Not', 'Rettet 3 Mitglieder der Drachenschuppenexpedition an der Wilden Kste.', 'Missversteht das wissenschaftliche Vorgehen der Expedition nicht als Zaghaftigkeit, $p.\n\nWir sind keine Einsiedler, die in weit entfernten Trmen ihre Bcher studieren.\n\nWir sind Abenteurer, die in jedem Winkel Azeroths nach Wissen aus erster Hand suchen!\n\nDiese Leidenschaft fr Abenteuer bringt uns oftmals in Gefahr, und einige Expeditionsmitglieder haben sich ein bisschen mehr vorgenommen, als sie bewltigen konnten...', '', '', '', '', '', 'Trefft Naleidea in der Botschaft von Schwingenrast.', 47187),
(65451, 'deDE', 'bungsmaterialien', 'Sammelt $1oa Urprotowelpenschuppen.', 'So etwas wie diese Protodrachen habe ich noch nie auf Azeroth gesehen.\n\nIhre Schuppen scheinen von Natur aus feuerfest zu sein, strker als Stahl, und sie ben dabei nicht an Flexibilitt ein. Unglaublich.\n\nMeine Kunsthandwerker... und zwar alle... wollen unbedingt ein paar dieser Schuppen in die Hnde bekommen, um damit zu arbeiten.\n\nBeginnt mit den Welpen. Ihre kleineren Schuppen sollten biegsamer sein und uns dabei helfen, unsere Techniken zu verbessern.', '', '', '', '', '', 'Trefft Boss Magor in der Botschaft von Schwingenrast.', 47187),
(65444, 'deDE', 'Zu den Dracheninseln!', 'Nehmt die Draufgngerische Drachenschuppe vom Zeppelinturm auerhalb von Orgrimmar zu den Dracheninseln.', 'Unsere Expeditionsvorhut ist auf den Dracheninseln gelandet.\n\nDank den Bemhungen der mutigen Mitglieder der Drachenschuppenexpedition haben wir einen geschtzten Landeplatz auf den Dracheninseln eingerichtet und Kontakt mit der Botschaft des Drachenschwarms aufgenommen.\n\nWollt Ihr uns auf unserer nchsten Reise zu den Dracheninseln begleiten?', '', '', '', '', '', 'Trefft Naleidea Flussglanz an der Kste der Dracheninseln.', 47187),
(65443, 'deDE', 'Expeditionskoordination', 'Rekrutiert Forscher, Handwerker und Gelehrte in ganz Orgrimmar fr die Expedition zu den Dracheninseln.', 'Erfreut, Euch kennenzulernen, ich bin Naleidea Flussglanz!\n\nDie Einladung, die Dracheninseln aufzusuchen, ist eine beraus aufregende Aussicht! Meint Ihr nicht auch?\n\nDie Archologische Akademie hat ihre Ressourcen mit den entsprechenden Mitgliedern unserer Expedition zusammengelegt, um uns bei der Koordination unserer Anstrengungen zu untersttzen. Als Mitglied der Drachenschuppenexpedition ist es mir eine Ehre, Euch willkommen zu heien!\n\nZunchst mssen wir jedoch weitere Mitglieder fr unsere Reise finden. Wollen wir beginnen?', '', '', '', '', '', 'Trefft Naleidea am Zeppelinturm auerhalb von Orgrimmar.', 47187),
(65439, 'deDE', 'Flstern in den Winden', 'Sprecht mit Erzmagier Khadgar auerhalb von Orgrimmar.', 'Hallo, $p. Es ist lange her und ich wnschte, wir htten mehr Zeit zum Plaudern.\n\nAber ich hatte gerade eine recht erhellende... nein, eher unheilvolle... ja, eine unheilvolle Unterhaltung mit einem alten Freund.\n\nManchmal kann eine Enthllung immerhin beides sein.\n\nIch muss Euch berichten, was ich erfahren habe.', '', '', '', '', '', '', 47187),
(65438, 'deDE', 'Krasser Questbeginn', '', 'Der Beginn des Azurblauen Gebirges.', '', '', '', '', '', '', 47187),
(65437, 'deDE', 'Einladung der Aspekte', 'Sprecht mit Ebyssian.', 'Ihr kommt genau zur rechten Zeit, $p.\n\nIch habe gerade beim Rat der Horde vorgesprochen und er hat beschlossen, die Einladung der Aspekte auf die Dracheninseln anzunehmen.\n\nDie Einladung gilt genauso fr Euch.\n\nVielleicht sind Euch auch hier in Orgrimmar einige ungewohnte Gesichter aufgefallen. Die Dracthyr sind gerade erst angekommen, aber Ihr werdet auf unserem gemeinsamen Abenteuer noch viel ber sie erfahren.\n\nLasst uns weiter reden.', '', '', '', '', '', '', 47187),
(65436, 'deDE', 'Die Dracheninseln warten', 'Trefft Euch mit Furorion in Sturmwind.', 'Wundervolle Neuigkeiten, meine lieben Freunde! Die Dracheninseln erwachen!\n\nNach der Zerschlagung lie mein Volk die Dracheninseln in einem tiefen Schlummer zurck. Doch nun endlich spren wir den Ruf nach Hause.\n\nDie Inseln bergen viele Wunder, doch sie sind nicht ohne Gefahren. Um unser rechtmiges Erbe zurckzuerobern, sind wir auf die Hilfe unserer sterblichen Verbndeten angewiesen.\n\nTrefft mich in Sturmwind. Ich muss der Allianz die Einladung der Aspekte vorlegen.', '', '', '', '', '', '', 47187),
(65435, 'deDE', 'Die Dracheninseln warten', 'Trefft Euch mit Ebyssian in Orgrimmar.', 'Helden der Horde, ich bringe Neuigkeiten. Die Dracheninseln erwachen!\n\nNach der Zerschlagung fielen die Inseln in einen tiefen Schlummer. Doch nun endlich haben sie meinesgleichen und mich nach Hause berufen.\n\nDie Inseln bergen viele Wunder, doch auch nicht minder Gefahren. Um unser rechtmiges Erbe zurckzuerobern, sind wir auf die Hilfe unserer sterblichen Verbndeten angewiesen.\n\nIch werde dem Rat der Horde in Orgrimmar gleich die Einladung der Aspekte prsentieren. Trefft mich dort und wir werden sehen, was der Rat dazu sagt.', '', '', '', '', '', '', 47187),
(65422, 'deDE', 'Die Jagd nach Schtzen ist nicht leicht', 'Schnappt Euch die Kletterausrstung, sucht Euch dann einen Haltegriff und klettert auf den Gipfel des Berges, ohne den Halt zu verlieren!', 'Ich kann es in Euren Augen sehen: Ihr wollt unbedingt den Gipfel dieses Berges erklimmen und herausfinden, was dort oben ist!\n\nWir Kletterer erkennen uns immer gegenseitig. Wir lassen uns von keinem Berg klein machen, nicht wahr?\n\nNur gut, dass ich eine Menge Kletterausrstung dabei habe. Schnappt Euch einen Rucksack und findet einen Weg nach oben!', '', '', '', '', '', 'Sprecht mit Twitti Leuchtritzel auf der Spitze des Berges.', 47187),
(65421, 'deDE', 'Auf jeden Berg', 'Schnappt Euch die Kletterausrstung, sucht Euch einen Haltegriff und klettert die Klippe hoch, um Pfadfinderin Yips zu befreien!', 'Hoffentlich lernt Ihr schnell, $C. Ich hab nmlich keine Zeit fr eine Lehrstunde!\n\nSchnappt Euch einen Rucksack und findet einen Weg zur Spitze.\n\nWenn Ihr oben seid, werft unserer Yips diesen Fallschirm zu. Die arme Kleine hat sich in ein paar Ranken verfangen, als die Luftelementare unser Flugzeug zum Absturz gebracht haben!\n\nBeeilt Euch, damit wir schleunigst hier rauskommen!', '', '', '', '', '', '', 47187),
(65417, 'deDE', 'Verbindungen finden', '', '', '', '', '', '', '', '', 47187),
(65374, 'deDE', 'Zeit zum Rupfen', 'Rupft $1oa Kkenfedern aus.', 'Harleen hat mir erzhlt, dass sie eine Verkleidung fr Euch anfertigt! Wie aufregend! Aber sie braucht noch ein paar Federn von Rockken, um das Kostm zu vervollstndigen.\n\nGlcklicherweise habe ich gerade die Reparatur des Federrupfers 3300 abgeschlossen!\n\nDer Kreischerschwarm fngt auf den unteren Klippen Rockken ein, um sie aufzuziehen und fr sich selbst zu zchten. Benutzt den Rupfer, um die Kken aus der Gefahr zu befreien. Er rupft auch automatisch einige ihrer Federn fr Euch!\n\nZwei Fliegen mit einem Rupfer, wrde ich sagen!', '', '', '', '', '', '', 47187),
(65373, 'deDE', 'Auseinandergerupft', 'Bergt 4 Teile des Federrupfers 3300.', 'Oh, nein... Ich habe einen gewaltigen Fehler gemacht.\n\nHarleen hat mir den berhmten Federrupfer 3300 anvertraut, eine phnomenale Erfindung von ihr persnlich!\n\nIch wollte in der Hhle sdlich von hier Rocfedern fr ihre Forschungsarbeit rupfen, aber die Harpyien haben mir aufgelauert und er zerbrach in mehrere Teile, als ich hinauslief.\n\nBitte sammelt die Teile ein! Sie liegen wahrscheinlich wie abgeworfene Schuppen berall auf dem Hhlenboden verstreut.\n\nIch kann ihn bestimmt wieder zusammensetzen. Kein Zweifel. Nun, wahrscheinlich.', '', '', '', '', '', '', 47187),
(65371, 'deDE', 'Ein eigenes Nest', 'Sammelt $1oa Kreischerschwarmkrallen, $2oa Kreischerschwarmstbe und $3oa Flussbrutkerne.', 'Die Schriftrolle, die Ihr gefunden habt, ist ein Befehl, alle Blaufedereier zur Harpyienkchin Fritt-Erie zu bringen. Offenbar isst die Matriarchin des Kreischerschwarms nichts, was nicht ordentlich zubereitet und gewrzt wurde.\n\nAlso werden wir ihr ein besonderes Ei kredenzen. Eines, das EXPLOSIV lecker ist... und explodiert, wenn sie es isst... versteht sich.\n\nUnd wie werdet Ihr es ihr berbringen? In Verkleidung!\n\nTtet die Biester auf den unteren Klippen, sammelt die Teile auf dieser Liste ein, und ich fertige Euch ein Kostm mit Federn und allem Drum und Dran.', '', '', '', '', '', '', 47187),
(65313, 'deDE', 'Appetit auf Geflgel', 'Ttet Hawthia Rocfresser.', 'Tharzera scheint in Ordnung zu sein, sie kann gut mit Gerten umgehen, aber sie gert leicht in Panik.\n\nEin Beispiel: Als ich sie in die Hhlen direkt sdlich von hier geschickt habe, wurde sie prompt von einer ungewhnlich groen Harpyie dort herausgejagt. Anscheinend hat sie auch den anderen Befehle gegeben.\n\nKnnte sie die Matriarchin dieser Brut sein? Vielleicht eine Art Kommandantin? Geht rein und findet es heraus, $n.\n\nUnd scheut Euch nicht, ein paar Federn zu rupfen, wenn Ihr wisst, was ich meine.', '', 'Eine auergewhnlich groe Harpyie des Kreischerschwarms mit einem unstillbaren Appetit auf Blaufederknochen.', 'Hawthia Rocfresser', '', '', '', 47187),
(65307, 'deDE', 'Gnade zuerst', 'Heilt verletzte Dracthyr und Drakoniden.', 'Das Gift im Hort hat uns fast alle dahingerafft. Whrend das Gegengift zubereitet wird, msst Ihr die Verwundeten suchen und sie heilen.\n\nJa, sogar die blauen Drakoniden. Die Heilschwingen stehen nicht unttig herum, whrend andere leiden.', '', '', '', '', '', '', 47187),
(65306, 'deDE', 'Fulnisfarmer', 'Sammelt $1oa Portionen mffelnden Schleim von verrottenden Wurzeln.', 'Verfall. Eklig, stinkt und tut weh. Hab Idee, aber brauche Schleim. IHR SCHLEIM HOLEN!', '', '', '', '', '', '', 47187),
(65302, 'deDE', 'Schlssel zum Knigreich', 'Beschafft den Schlssel und ffnet damit das Waffendepot.', 'Brauche Waffen fr Plan. Hab gute Waffen, sind aber eingeschlossen. Gnolle Schlssel in Lager gelassen haben, in beschtztem Waffendepot.\n\nHolt spitzigste Stcke. Gibt meiste Blutflecken.', '', '', '', '', '', '', 47187),
(65287, 'deDE', 'Das Eigelb trennen', 'Sammelt $1oa Blaufedereier ein.', 'Ich habe die Schriftrolle entziffert und, berraschung, es sind schlechte Nachrichten!\n\nDer Kreischerschwarm frisst die Blaufedern nicht nur, um sich zu ernhren. Vielmehr hat sich herausgestellt, dass sie einen oder zwei Zauber gefunden haben, die die angeborene Strke der Rocs durch Verzehr auf sie bertragen. Das gilt insbesondere fr die Eier!\n\nRettet unten an den Klippen so viele Roceier wie mglich. Das wird die Harpyien lange genug aufhalten, damit ich meinen Plan in die Tat umsetzen kann.\n\nUnd nehmt Euch vor umherwandernden Elementaren in Acht. Die Zauberei der Fluchweiber hat sie aufgescheucht!', '', '', '', '', '', '', 47187),
(65286, 'deDE', 'Drakonische Verbindungen', 'Betretet Sturmwind.', 'Normalerweise wrde ein solcher Flug wesentlich lnger dauern. Aber wenn der bronzene Aspekt selbst Eure Reise beschleunigt, ist es mglich, die Strecke in Rekord...\n\n<hm>...zeit zurckzulegen.\n\nOh, die Soldaten mit den spitzen Waffen? Kein Grund zur Sorge. Lediglich eine Formalitt.\n\nIch werde Euch eine Audienz beim Lordkommandanten verschaffen, whrend Ihr und Azurathel Euch an die Arbeit macht.\n\nGlcklicherweise verfge ich ber beachtlichen Einfluss in dieser Stadt.', '', '', '', '', '', 'Sprecht mit Azurathel.', 47187),
(65279, 'deDE', 'Ein kniglicher Erlass', 'Ttet $1oa Krieger von Brackenfell und $2oa Schamanen von Brackenfell im Bachzahnbau.', 'Bekloppte Gnolle Krone nicht verstehen, nur Gewalt. Macht sie fertig oder ich Euch fressen.', '', '', '', '', '', '', 47187),
(65274, 'deDE', 'Navigation Playtest: Level Up', '', 'This is a single quest. It will guide you though the high points of the level up story for Thaldraszus', '', '', '', '', '', '', 47187),
(65267, 'deDE', 'Rupft ihnen die Federn', 'Ttet $1oa Siecherinnen des Kreischerschwarms und $2oa Bannklauen des Kreischerschwarms.', 'Diese seltsamen geflgelten Wesen haben mich neugierig gemacht und ich wollte mich ihnen mal vorstellen. Ich wre gefressen worden, wenn nicht Professorin Hohnzirper und ihr groes mechanisches Federvieh gewesen wren!\n\nKnntet Ihr uns helfen, diesen \"Kreischerschwarm\" loszuwerden? Die einheimischen Blaufederrocs haben Probleme, ihre Nester vor ihnen zu verteidigen.\n\nUnd ich mchte nicht, dass weitere Bekanntschaften mit ihnen so verlaufen wie meine...', '', '', '', '', '', '', 47187),
(65220, 'deDE', 'Navigation Playtest: Level Up (PART 2)', '', 'Das Ende des Azurblauen Gebirges.', '', '', '', '', '', '', 47187),
(65218, 'deDE', 'Navigation Playtest: Level Up (PART 1)', '', 'Der Beginn des Azurblauen Gebirges.', '', '', '', '', '', '', 47187),
(65133, 'deDE', 'Schwung mit dem Drachen nutzen', 'Taucht durch die Ringe und landet im Zielgebiet.', 'Und was, wenn sich Hindernisse im Weg befinden?\n\nWenn Ihr das Fliegen beherrscht, knnt Ihr Euren Schwung beibehalten und nach einem Sturzflug etwas Hhe gewinnen.\n\nWenn Ihr Euch dieses Mal in den Sturzflug begebt, fhrt Euch die Flugroute unterhalb des Landebereichs vorbei. Mit dem aufgenommenen Schwung knnt Ihr die verlorene Hhe am Ende des Kurses wiedergutmachen, um im Zielbereich zu landen.\n\nWenn Ihr irgendwo festhngt, benutzt die bronzene Taschenuhr. Celormu wird dann Eure Position zurcksetzen.', '', '', '', '', '', '', 47187),
(65120, 'deDE', 'Drachensturzflug leicht gemacht', 'Fhrt einen Sturzflug aus, gleitet dann durch die Ringe und landet im Zielgebiet.', 'Gleitend erreicht Ihr das gewnschte Ziel. Aber was, wenn Ihr schneller ankommen wollt?\n\nDurch den Sturzflug von einem hohen Punkt erhaltet Ihr einen Geschwindigkeitsschub.\n\nFliegt durch die Ringe zum Zielort.\n\nWenn Ihr irgendwo festhngt, benutzt die bronzene Taschenuhr und Celormu wird Eure Position zurcksetzen.', '', '', '', '', '', '', 47187),
(65118, 'deDE', 'Drachenflug leicht gemacht', 'Gleitet durch die Ringe und landet im Zielgebiet.', 'Fangen wir mit den Grundlagen an.\n\nWenn Ihr geradeaus fliegt, werdet Ihr sehr schnell erschpft sein. Nutzt die Schwerkraft und zielt leicht nach unten, um eine lange Strecke zu fliegen. Die Ringe zeigen Euch den allgemeinen Winkel an, den Ihr fr den einfachen Gleitflug verwenden solltet.\n\nZuerst, ruft Euren Drachen herbei.\n\nDann fliegt durch die Ringe und landet am Zielort.\n\nWenn Ihr irgendwo festhngt, benutzt die bronzene Taschenuhr und Celormu wird Eure Position zurcksetzen.', '', '', '', '', '', '', 47187),
(65101, 'deDE', 'Ein ikonischer wie drakonischer Anblick', 'Nehmt Euer sterbliches Antlitz an.', 'Ihr habt mit Eurer Ankunft fr jede Menge Aufsehen in Sturmwind gesorgt, $p. Zweifellos haben Euch manche Brger... offener empfangen als andere.\n\nUm mit anderen Vlkern besser kommunizieren zu knnen, nehmen wir Drachen ein sterbliches Antlitz an, so wie jenes, das Ihr vor Euch seht. Das beruhigt nicht nur Verbndete, sondern erleichtert es auch ungemein, durch Tren zu gehen.\n\nDie Dracthyr durchfliet offensichtlich die Essenz der Drachenheit. Ich vermute, auch Ihr besitzt unsere Fhigkeit, ein Antlitz anzunehmen.\n\nBegleitet mich.', '', '', '', '', '', 'Zeigt Furorion Euer Antlitz.', 47187),
(65100, 'deDE', 'Letzte Befehle', 'Organisiert die Evakuierung der Verbotenen Insel.', 'Der Sturm, den Raszageth entfesselt hat, ist zu mchtig. Wir mssen die einzige Heimat evakuieren, die wir je gekannt haben.\n\nEs gibt keinen Erdwchter mehr, der uns befehligen knnte. Zum ersten Mal steht es uns frei, unsere eigenen Entscheidungen zu treffen. Unser eigenes Schicksal zu bestimmen.\n\nWo immer Ihr auch hingeht in diesem neuen Zeitalter, ich hoffe, dass Ihr wrdige Verbndete findet. Erzhlt ihnen unsere Geschichte.\n\nWas mich betrifft, ich werde hierbleiben und nach berlebenden suchen. Vielleicht stoe ich dabei ja noch auf Antworten zu unserer Vergangenheit.\n\nDas Glck sei mit uns allen, $p.', '', '', '', '', '', 'Erstattet Eurem Schuppenkommandanten Bericht.', 47187),
(65098, 'deDE', 'Konsequenzen des Mutes', 'Findet Ebyssian.', 'Danke, dass Ihr mich geheilt habt, $n. Ich hoffe, dass wir unser gegenseitiges Vertrauen aufbauen knnen.\n\n<Furorion schaudert.>\n\nDie Sturmfresserin. Ich bin noch nie einem Drachen mit solch einer rohen Elementarenergie gegenbergestanden. Ob es noch mehr wie sie gibt?\n\nWartet... Wo ist Ebyssian? Hat er berlebt? Ihr msst ihn finden!', '', '', '', '', '', 'Sprecht mit Glutthal.', 47187),
(65097, 'deDE', 'Lauft!', 'Rckzug!', 'Strme werden uns berrollen! Wir mssen evakuieren!\n\nRettet so viele, wie Ihr knnt. Und findet mir diese schwarzen Drachen!', '', '', '', '', '', 'Sprecht mit Furorion.', 47187),
(65087, 'deDE', 'Die Beute im Inneren', 'Verteidigt das Gewlbe.', 'Die Primalisten wollen also, was im Gewlbe ist?\n\n<Sarkareth kneift die Augen zusammen.>\n\nLasst sie nur kommen.\n\nWir werden ihnen zeigen, wozu die Dracthyr geboren wurden!', '', '', '', '', '', '', 47187),
(65084, 'deDE', 'Das Froststeingewlbe', 'Versammelt Euch beim Froststeingewlbe.', 'Seht dort, auf der Insel! Primalistentruppen ziehen sich am Froststeingewlbe zusammen.\n\nDer Sturm, den sie entfesseln mchten, muss dort drinnen eingeschlossen sein.\n\n<Glutthal zuckt zusammen und ringt mit ihren zerrtteten Erinnerungen.>\n\nWir haben diesen Gegner schon einmal bekmpft... und wir haben gewonnen. Neltharion ordnete an, dass das Gewlbe geschtzt werden soll, aber ich... wei nicht mehr, warum...\n\nEs bleibt keine Zeit, um sich in Erinnerungen zu verlieren. Versammelt Euch mit Sarkareth und den Schwarzschuppen am Gewlbe. Sorgt dafr, dass der Feind nicht durchbricht!', '', '', '', '', '', 'Erstattet Schuppenkommandant Sarkareth im Froststeingewlbe Bericht.', 47187),
(65075, 'deDE', 'Die Heilschwingen', 'Sprecht mit Glutthal.', '$gRufer:Ruferin;, Ihr habt meinen Dank dafr, dass Ihr meinem Weyrn in seiner Stunde grter Not geholfen habt.\n\nNachdem wir unsere Strke wiedererlangt haben, werden sich die Heilschwingen mit dem Rest unserer Truppen treffen.\n\nGlutdresch sagt mir, dass Glutthal ihren gesamten Weyrn verloren hat. Ich frchte, ich verfge nicht ber die Magie, eine solche Wunde zu heilen.\n\nSie mag stoisch wirken, aber Glutthal schmerzt der Verlust zutiefst, $n. Sagt ihr, dass ich unterwegs bin.', '', '', '', '', '', 'Sprecht mit Glutthal.', 47187),
(65074, 'deDE', 'Leichte Beute', 'Ttet $1oa Scythiden.', 'Die Wildnis rund um den Hort beheimatet Scythiden. Sie sind gefrige Insektoide, oft territorial und aggressiv.\n\nAll die Verwundeten wrden fr diese Bestien leichte Beute abgeben. Ich will nicht, dass sie unsere Heiler angreifen, whrend sie sich erholen.\n\nTtet so viele von ihnen wie mglich, whrend ich mich nach Viridia umsehe.\n\nSie ist... sehr tapfer.', '', '', '', '', '', '', 47187),
(65073, 'deDE', 'Ein giftiges Problem', 'Sammelt $1oa Giftdrsen.', 'Ihr erholt Euch schnell, $n. Gut.\n\nDiejenigen, die meinem Hort entflohen sind, heilen, aber es sind noch mehr im Inneren gefangen. Wenn Ihr hineinstrmt, um sie zu retten, werde ich Euch nur wieder herausziehen mssen.\n\nRund um die Kaldera liegen Kfernester verteilt. Ihre Giftdrsen knnten ein Mittel sein, um die Wirkung dieses Gifts zu neutralisieren.\n\nIch bin nicht dazu in der Lage, sie selbst einzusammeln. Ich muss auf Eure Fertigkeiten vertrauen, $gRufer:Ruferin;.', '', '', '', '', '', '', 47187),
(65071, 'deDE', 'Halpa!', 'Rettet Klein Ko.', 'Ich brauch Halpa!\n\nIch bin To\'no und war auf Erkundung, da bin ich gut drin, aber ich habe nicht bemerkt, dass meine Schwester Ko mir gefolgt ist. Ich brauch Eure Halpa, sie zu finden, weil sie in Schwierigkeiten ist, also hab ich Eure Halpa, bitte?\n\nSie ist in diese Hhle gegangen, aber sie ist im Verstecken nicht so gut wie ich und unsere Eltern sind zu weit weg.\n\nKnnt Ihr sie finden, bevor es die Monster tun?', '', '', '', '', '', 'Bringt die Kinder zu ihren Eltern.', 47187),
(65063, 'deDE', 'In den Bau', 'Folgt Glutdresch, um Viridia zu finden.', 'Was auch immer das fr ein Gift ist, dass sich in diesem Hort ausgebreitet hat, es ist stark genug, selbst unsere besten Heiler auszuschalten.\n\nDas verheit nichts Gutes, weder fr mich noch fr Euch, $n.\n\nAber das spielt keine Rolle. Dort sitzen Dracthyr in der Falle. Wir gehen rein, egal wie riskant.\n\nAtmet tief durch und folgt mir!', '', '', '', '', '', 'Sprecht mit Viridia.', 47187),
(65060, 'deDE', 'Kaldera der Heiler', 'Trefft Glutdresch in der Kaldera der Heiler.', 'Eure Vision vom arkanen Leuchtfeuer hat offenbart, dass Dracthyr in ihren Horten eingesperrt sind. Wir knnen es uns nicht erlauben, noch mehr unserer Leute zu verlieren.\n\n<Glutthal hlt mit gerunzelter Stirn inne.>\n\nDie Heilschwingen sind die besten Heiler in unseren Rngen. Ihr Hort liegt innerhalb der Kaldera der Heiler. Glutdresch kennt den Weg.\n\nLasst niemanden zurck, $gRufer:Ruferin;.', '', '', '', '', '', 'Sprecht mit Glutdresch bei der Kaldera der Heiler.', 47187),
(65057, 'deDE', 'Auf zu Glutthal', 'Erstattet Glutthal Bericht.', 'Nun, da der Kampf vorber ist, erwartet Ihr, dass ich Glutthal Bericht erstatte. Erwartet Azurathel, dass ich ihren Befehlen folge?\n\nIch denke nicht.\n\nDie Schwarzschuppen sind einzig dem Erdwchter unterstellt. Und bis jetzt habe ich keine Befehle von Neltharion erhalten.\n\n<Sarkareths Blick verfinstert sich.>\n\nDennoch bin ich nicht blind gegenber der Bedrohung, welche diese Primalisten darstellen. Ich bin mir sicher, dass ich ihre Art zuvor schon bekmpft habe und dennoch...\n\nWir werden am Boden vorstoen, wenn meine Leute wieder einsatzbereit sind. Wegtreten, $gRufer:Ruferin;.', '', '', '', '', '', '', 47187),
(65052, 'deDE', 'Die Schwarzschuppen', 'Gelangt zu Schuppenkommandant Sarkareth.', 'Wir haben es hinter den Primalisteneinfall geschafft. Nun mssen wir den Hort erreichen.\n\nSchuppenkommandant Sarkareth ist hart im Nehmen und sein Weyrn hlt stand. Aber ein Drache hat die Schwarzschuppen festgenagelt.\n\nEs ist an der Zeit, dem Kampf beizutreten!\n\nGeht voran. Gebt das Signal, wenn wir in Reichweite des Drachen sind. Dann schlagen wir mit smtlichen uns zur Verfgung stehenden Krften zu.\n\nNehmt Euch vor Hinterhalten in Acht. Ich habe kein gutes Gefhl dabei.', '', 'Eine uralte Bestie, die die Schwarzschuppen gefangen hlt.', 'Ekrazathal', '', '', 'Sprecht mit Schuppenkommandant Sarkareth.', 47187),
(65050, 'deDE', 'Eine herbeigezauberte Armee', 'Ttet $1oa beschworene Elementare.', 'Die Primalisten beschwren eine Elementararmee. Wir mssen annehmen, dass sie vorhaben, sie gegen unsere Truppen einzusetzen.\n\nNun, nicht solange wir Wache halten.\n\nLasst Feuer auf sie niedergehen, $gRufer:Ruferin;! Brennt diese Elementare von der Insel und schaltet ihre Beschwrer aus, bevor sie weitere herbeirufen.', '', '', '', '', '', 'Trefft Azurathel im Sturmrisskrater.', 47187),
(65049, 'deDE', 'Mischt die Tarasek auf', 'Ttet $1oa Tarasek.', 'Die Tarasek sind unberechenbar und wild. Wie urzeitliche Drakoniden sozusagen.\n\nNeltharion hat sie nie als viel mehr als Futter betrachtet. bungsziele. Aber sie sind gerissene Jger und tdlich, wenn sie in Rudeln vorgehen.\n\nSollten sie von den Primalisten elementare Macht erhalten, wrden sie wesentlich gefhrlicher werden.\n\nDas knnen wir nicht zulassen, $n. Dnnt ihre Reihen aus.', '', '', '', '', '', 'Trefft Azurathel im Sturmrisskrater.', 47187),
(65046, 'deDE', 'Die Primalisten', 'Findet Hinweise ber die Ursprnge und Absichten der Primalisten.', 'Meine Erinnerungen sind noch immer benebelt von der Stasis, aber ich bin mir sicher, dass wir diesen Primalisten zuvor schon begegnet sind.\n\n<Derwischian beit die Fangzhne zusammen.>\n\nEs hat keinen Zweck! Es fhlt sich an, als wrde ich Fragmenten eines Traumes hinterherjagen, wenn ich versuche, mich zu erinnern.\n\nVielleicht schlagt Ihr Euch besser. Sucht nach Hinweisen, was... oder wer... diese Eindringlinge antreibt.', '', '', '', '', '', 'Trefft Derwischian im Sturmrisskrater.', 47187),
(65045, 'deDE', 'Sturmrisskrater', 'Trefft Azurathel im Sturmrisskrater.', 'Derwischians Bericht ist beunruhigend. Eine feindliche Streitmacht, die sich selbst als Primalisten bezeichnet, ist in den Sturmrisskrater eingefallen und hat die Schwarzschuppen am Belagerungshort festgenagelt.\n\nDie Eindringlinge beschwren gewaltsame Elementare und rekrutieren die grausamen Tarasek fr ihre Sache.\n\nAzurathel wird am Krater Eure Hilfe brauchen. Durch Flgel oder Kralle, rettet unsere Leute.\n\nSobald die Schwarzschuppen in Sicherheit sind, veranlasst ein Treffen zwischen ihrem Kommandanten und mir. Seid gewarnt. Sarkareth kann... reizbar sein.', '', '', '', '', '', 'Sprecht mit Azurathel im Sturmrisskrater.', 47187),
(65036, 'deDE', 'Trainieren wie wir kmpfen', 'bt \'Segeln\'.', 'Durch Ringe zu fliegen, hilft, die Grundlagen zu erlernen, aber wir trainieren so unerbittlich, wie wir kmpfen.\n\nVersucht nun, ein wenig in der Umgebung zu \'Segeln\', bis Ihr den Bogen heraushabt. Natrlich msst Ihr auf die Wildtiere achten und Eure Augen nach mglichen Gefahren offenhalten, aber deswegen trainieren wir ja.\n\nMeldet Euch bei Glutthal zurck, sobald Ihr bereit seid. Viel Glck!', '', '', '', '', '', 'Sprecht mit Schuppenkommandantin Glutthal, wenn Ihr bereit seid, fortzufahren.', 47187),
(64877, 'deDE', 'Navigation Playtest: Level Up (PART 2)', '', 'Geniet das Ende des Tieflands!', '', '', '', '', '', '', 47187),
(64873, 'deDE', 'Die Flgel ausbreiten', 'bt \'Segeln\'.', 'Es ermutigt mich zu sehen, dass so viele dem Kriegshort entkommen sind. Mein eigener Weyrn... hatte nicht so viel Glck.\n\n<Glutthal steht einen Moment schweigend da.>\n\nEs gibt noch weitere Horte berall auf der Insel, voller Dracthyr in Gefahr. Es wird strkere Flgel brauchen, um sie zu erreichen.\n\nKonzentriert Euch. Erinnert Euch an das, was Ihr gelernt habt. Bekommt wieder ein Gefhl fr den Wind. Ihr msst Eure Strke wiedererlangen und zu den anderen Horten fliegen.\n\nDie Zeit fr Ruhe ist vorber.', '', '', '', '', '', '', 47187),
(64872, 'deDE', 'Das innere Feuer', 'Erlernt \'Feueratem\' und bt ermchtigte Angriffe.', 'Ihr seid $gein Rufer:eine Ruferin;, $n, und gehrt zu den Besten der Besten. Elitesoldaten wie Ihr haben die Fertigkeiten aller unserer Weyrns gemeistert.\n\nIch erwarte einiges von Euch.\n\nAuch wenn Eure Erinnerungen ausgelscht wurden, fliet die Macht der Drachen durch Eure Venen. Nutzt sie.\n\nEine Eurer mchtigsten Waffen ist der Atemangriff. Das innere Feuer wird strker, je lnger Ihr einatmet.\n\nDie Insektenschwrme ber unserem bungsfeld sollten passende Ziele abgeben.', '', '', '', '', '', '', 47187),
(64871, 'deDE', 'Der Drache auf der Schwelle', 'Besiegt Lapisagos und flieht aus dem Kriegshort.', 'Dieser blaue Drache wird den Hort zum Einsturz bringen und uns hier einsperren!\n\nEr behauptet, auf Malygos\' Befehl hin zu handeln. Dieser Name ist mir vertraut, doch... warum sollte ein Drache uns zu Gefangenen machen wollen?\n\nHrt mir gut zu, $p. Wir wurden ausgebildet, um an der Seite der Drachen zu kmpfen, nicht gegen sie. Doch uns bleibt keine Wahl.\n\nTun wir, was wir tun mssen, $gRufer:Ruferin;.', '', 'Er steht unserer Flucht im Weg.', 'Lapisagos', '', '', '', 47187),
(64866, 'deDE', 'In den Kessel', 'Bereitet Euch darauf vor, den Hort zu verlassen.', 'Eure Fertigkeiten werden gebraucht, $gRufer:Ruferin;.\n\nDer Hort zerfllt und wir sind knapp an Vorrten. Wir mssen den Durchgang nach drauen erreichen, aber zuerst mssen wir diese arkane Barriere berwinden.\n\nIn der Kammer dahinter befinden sich Dracthyr, welche Hilfe bentigen. Versorgt ihre Wunden. Vernichtet jegliche Gegner, die sich Euch in den Weg stellen.\n\nEs ist vielleicht das letzte Mal, dass wir gemeinsam durch diese Hallen gehen, $n. Macht etwas daraus.', '', '', '', '', '', '', 47187),
(64865, 'deDE', 'Aufrsten', 'Beschafft Waffen, Rstungen und Vorrte.', 'Gegner sind eingedrungen, unsere Leute werden in einer magischen Stasis gehalten und unser Hort scheint zusammenzubrechen.\n\nDeshalb trainieren wir, $n. Im Zweifelsfall greift auf das zurck, was Ihr wisst.\n\nAber das Wichtigste zuerst. Waffen, Rstungen, Vorrte. Sammelt, was Ihr finden knnt, und rstet Euch aus, whrend ich unsere Streitkrfte zusammenrufe.\n\nDann werden wir den Erdwchter ausfindig machen. Neltharion kann uns sicherlich die Antworten auf unsere Fragen geben.', '', '', '', '', '', '', 47187),
(64864, 'deDE', 'Erwacht, Dracthyr', 'Weckt die anderen Dracthyr.', '<Ihr seht nur Erinnerungsfetzen vor Euch, whrend Ihr aus Eurem schier endlosen Schlaf erwacht.\n\nDer Dracthyr vor Euch reagiert nicht, so als wre er durch eine unbekannte Macht festgefroren. Ihr sprt, dass Ihr die Macht besitzt, Euren Verbndeten zu befreien.\n\nMglicherweise gibt es noch andere im Hort, die in solch einer Stasis gefangen sind.\n\nEs obliegt Euch, sie zu erwecken.>', '', '', '', '', '', 'Sprecht mit Schuppenkommandant Azurathel.', 47187),
(64863, 'deDE', 'Arkanwchter', 'Besiegt $1oa Wchter oder Konstrukte.', 'Die Konstrukte, welche durch den Hort patrouillieren, werden nicht durch die Magie des Erdwchters animiert.\n\n<Derwischians Blick verdstert sich.>\n\nWir knnen keine Feinde in unseren Reihen dulden.\n\nVernichtet sie und rumt uns den Weg nach vorne frei.', '', '', '', '', '', '', 47187),
(64856, 'deDE', '[DNT] A Little Pruning', 'Ttet %1oa fleischfressende Peitscher.', 'Seid gegrt, $gSterblicher:Sterbliche;. Ich bentige Eure Hilfe.\n\nDie Grten sind whrend der langen Abwesenheit der Drachenschwrme verwahrlost. Viele der Pflanzen sind... renitent geworden.\n\nIch muss mich um die Setzlinge kmmern und bin daher sehr beschftigt. Bitte beseitigt diese feindliche Vegetation. Ihr werdet entsprechend belohnt.', '', '', '', '', '', '', 47187),
(64163, 'deDE', 'Rache an den Abtrnnigen', 'Findet und besiegt die Krieger der Zentaurenrebellen in den behelfsmigen Lagern auf der anderen Seite des Flusses.', 'Rebellenklans haben Anspruch auf einige unserer Lager auf der anderen Seite des Flusses erhoben.\n\nSolch aufrhrerischen Umtriebe mssen unterbunden werden.\n\nDarf ich darauf vertrauen, dass Ihr in der Lage seid, diesen Rebellen in meinem Namen eine Lektion zu erteilen?\n\nIn den Lagern herrscht zudem ein heilloses Chaos, aber ignoriert das vorerst. Wir knnen das spter klren, wenn die Ordnung wiederhergestellt ist.', '', '', '', '', '', '', 47187),
(64162, 'deDE', 'Rituelle Rivalen', 'Findet und besiegt den Khan der Rebellen in den behelfsmigen Lagern auf der anderen Seite des Flusses.', 'Ein weiterer rivalisierender Khan hat sich aus den Rebellenstmmen erhoben.\n\nIch wrde mich selbst darum kmmern, aber ich muss die Dinge hier im Auge behalten.\n\nKann ich darauf vertrauen, dass Ihr ihnen eine Lektion erteilt?', '', '', '', '', '', '', 47187),
(64159, 'deDE', 'Seltene Vorrte zurckerobern', 'Holt Vorrte aus den behelfsmigen Lagern auf der anderen Seite des Flusses zurck.', 'Die Rebellen haben Vorrte aus den umliegenden Lagern gestohlen.\n\nIhr habt bewiesen, dass Ihr solche Situationen lsen knnt. Ich vertraue darauf, dass Ihr uns auch helfen knnt, diese Situation zu lsen.', '', '', '', '', '', '', 47187),
(42820, 'deDE', 'GEFAHR: Aegir Wellenschmetterer', '', '', '', '', '', '', '', '', 47187),
(37484, 'deDE', 'Hauptmannspfeife', 'Bringt Anne Dunworthy 100 Artefaktfragmente fr eine Hauptmannspfeife.', '', '', '', '', '', '', '', 47187),
(3632, 'deDE', 'Gnomeningenieurskunst', 'Wenn Ihr etwas ber die Gnomeningenieurskunst erlernen wollt, dann bringt die Anleitung der Ingenieurskunstdisziplinen zu Tftlermeister Oberfunks nach Eisenschmiede.', 'Ingenieurskunst auf Expertenniveau gliedert sich in zwei Disziplinen auf: Gnom und Goblin. Gnomeningenieurskunst ist die weit berlegenere der beiden! Es geht um die Konstruktion von wunderbaren Apparaten und Gerten, die das Leben schner machen.$B$B$n, lest diese Anleitung. Wenn Ihr mehr ber Gnomeningenieurskunst lernen wollt, dann bringt sie zu Tftlermeister Oberfunks hier in Eisenschmiede. Denkt daran - das ist eine dauerhafte Mitgliedschaft und es ist nicht mglich, in die andere Disziplin einzutreten, also solltet Ihr Euch absolut sicher sein, dass Ihr Euch sicher seid, bevor Ihr seine Aufgabe ausfhrt.', '', '', '', '', '', '', 47187);
